INSERT INTO `inv_types` VALUES (0,0,'#System','',1,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(2,2,'Corporation','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(3,3,'Region','',0,1,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(4,4,'Constellation','',0,1,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(5,5,'Solar System','',0,1,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(6,6,'Sun G5 (Yellow)','A main-sequence stellar body of a class that is often yellow or yellow-orange in hue, generating and emitting energy from the vast hydrogen fusion process within the heart of the star.\r\n\r\nVarious numbers of planets of the terrestrial and gas giant types are found around these stars and the habitable zones often contain one or more planets.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20099,21457),(7,6,'Sun K7 (Orange)','Yellow-orange and orange stars of this type are rather stable and believed to take tens of billions of years to burn through their core hydrogen reserves in a process of thermonuclear fusion. \r\n\r\nThis stability and long life, combined with the common presence of planetary systems marks these as viable candidates for colonization and exploration efforts.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20095,21459),(8,6,'Sun K5 (Red Giant)','This large red star has exhausted its core hydrogen fuel and is slowly expanding into a red giant, consuming all remaining hydrogen in the stellar shell. \r\n\r\nWhile the process of expansion into a full red giant will take hundreds of millions of years, eventually the star will engulf any planetary system orbiting close to it.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20097,21462),(9,6,'Sun B0 (Blue)','This luminous blue star belongs to a class known for powerful stellar winds and rapid rotation. These stars generate most of their energy at the center of their mass in a thermonuclear fusion process involving a carbon-nitrogen-oxygen (CNO) catalytic cycle.\r\n\r\nStars of this type generally show strong non-ionized helium lines and some have a chemistry that results in very strong lines, leading to the designation \'helium-strong\'.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20094,21464),(10,6,'Sun F0 (White)','A main-sequence star in a class of stellar bodies that are typically white or yellow-white in hue. Hydrogen fusion drives the energy generation of these stars and they are often hot and bright.\r\n\r\nStars of this type can be found with companion stars, are often accompanied by mature planetary systems and tend to emit an ultraviolet radiation flux providing for habitable zones conducive to human occupation.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20098,21466),(11,7,'Planet (Temperate)','Life-bearing worlds are often referred to as \"temperate\", as their mild temperatures are one of their defining features. Planets with existing, stable ecosystems are prime targets for colonization efforts as they are generally easier to make fully habitable; as a result, the majority of highly populated worlds are of this type. Indeed, it is not altogether uncommon for detailed surveys to reveal signs of previous settlements from various stages of New Eden\'s history.',1e35,1,0,1,NULL,NULL,0,NULL,10136,20092,3832),(12,7,'Planet (Ice)','The majority of icy planets went through a period of being barren terrestrials, before being surfaced with ice over the course of many millennia. The exact process for this varies from case to case, but the end result is both common and visually uniform - a bright, reflective planet scored by countless fractures and crevasses. A few icy planets are hypothesized to have been warmer, liquid-bearing planets in the past that have subsequently frozen, as a result of either stellar cooling or failed terraforming projects.',1e35,1,0,1,NULL,NULL,0,NULL,10137,20087,3834),(13,7,'Planet (Gas)','Gas planets are characterized by a deep, opaque upper atmosphere, usually composed primarily of light elements such as hydrogen or helium. Simple chemicals can add a range of hues and shades in the visual spectrum, and the interaction between upwellings and rapidly circulating pressure bands result in a huge variety of visible surface structures. A similar level of diversity can be found beneath the cloud-tops: the inner composition of a given gas planet might belong to any one of a dozen broad groups, with no two planets entirely alike in this regard.',1e35,1,0,1,NULL,NULL,0,NULL,10139,20086,3833),(14,8,'Moon','',1e35,1,0,1,NULL,NULL,0,NULL,10141,NULL,10),(15,9,'Asteroid Belt','',1e35,1,0,1,NULL,NULL,0,NULL,15,9,0),(16,10,'Stargate (Caldari System)','',100000000000,10000000,0,1,1,NULL,0,NULL,NULL,32,235),(17,10,'Stargate (Amarr Constellation)','',100000000000,100000000,0,1,4,NULL,0,NULL,NULL,32,236),(18,458,'Plagioclase','Plagioclase is not amongst the most valuable ore types around, but it contains a large amount of pyerite and is thus always in constant demand. It also yields some tritanium and mexallon.\r\n\r\nAvailable in <color=\'0xFF4DFFCC\'>0.9</color> security status solar systems or lower.',1e35,0.35,0,100,NULL,12800.0000,1,516,230,NULL,0),(19,461,'Spodumain','Spodumain is amongst the most desirable ore types around, as it contains high volumes of the four most heavily demanded minerals. Huge volumes of tritanium and pyerite, as well as moderate amounts of mexallon and isogen can be obtained by refining these rocks.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,1149400.0000,1,517,1274,NULL,0),(20,457,'Kernite','Kernite is a fairly common ore type that yields a large amount of mexallon. Besides mexallon the kernite also has a bit of tritanium and isogen.\r\n\r\nAvailable in <color=\'0xFF00FF00\'>0.7</color> security status solar systems or lower.',1e35,1.2,0,100,NULL,74916.0000,1,523,1270,NULL,0),(21,454,'Hedbergite','Hedbergite is sought after for its high concentration of nocxium and isogen. However hedbergite also yields some pyerite and zydrine.\n\nAvailable primarily in <color=\'0xFFFF4D00\'>0.2</color> security status solar systems or lower.',1e35,3,0,100,4,337408.0000,1,527,1269,NULL,0),(22,450,'Arkonor','The rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some mexallon and tritanium.\r\n\r\nAvailable primarily in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,16,0,100,4,3068504.0000,1,512,1277,NULL,0),(23,12,'Cargo Container','This cargo container is flimsily constructed and may not survive the rigors of space for more than an hour or so.',10000,27500,27500,1,NULL,NULL,0,NULL,16,NULL,1176),(24,13,'Ring','',1e35,1,0,1,NULL,NULL,0,NULL,0,NULL,0),(25,14,'Corpse Male','',80,2,0,1,NULL,NULL,1,NULL,398,NULL,20373),(26,16,'Office Folder','',0,1,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(27,16,'Office','',0,1,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(28,16,'Factory Folder','',0,1,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(29,17,'Credits','',0,0,0,57344,NULL,NULL,0,NULL,21,NULL,0),(30,19,'Faction','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(34,18,'Tritanium','The main building block in space structures. A very hard, yet bendable metal. Cannot be used in human habitats due to its instability at atmospheric temperatures. Very common throughout the universe.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:22>Arkonor</a>, <a href=showinfo:17425>Crimson Arkonor</a>, <a href=showinfo:17426>Prime Arkonor</a>\r\n<a href=showinfo:1225>Crokite</a>, <a href=showinfo:17432>Sharp Crokite</a>, <a href=showinfo:17433>Crystalline Crokite</a>\r\n<a href=showinfo:1232>Dark Ochre</a>, <a href=showinfo:17436>Onyx Ochre</a>, <a href=showinfo:17437>Obsidian Ochre</a>\r\n<a href=showinfo:19>Spodumain</a>, <a href=showinfo:17466>Bright Spodumain</a>, <a href=showinfo:17467>Gleaming Spodumain</a>\r\n\r\n<color=\'0xFFFF4D00\'>0.2</color> security status solar system or lower:\r\n<a href=showinfo:1231>Hemorphite</a>, <a href=showinfo:17444>Vivid Hemorphite</a>, <a href=showinfo:17445>Radiant Hemorphite</a>\r\n\r\n<color=\'0xFF00FF00\'>0.7</color> security status solar system or lower:\r\n<a href=showinfo:20>Kernite</a>, <a href=showinfo:17452>Luminous Kernite</a>, <a href=showinfo:17453>Fiery Kernite</a>\r\n<a href=showinfo:1227>Omber</a>, <a href=showinfo:17867>Silvery Omber</a>, <a href=showinfo:17868>Golden Omber</a>\r\n\r\n<color=\'0xFF4DFFCC\'>0.9</color> security status solar system or lower:\r\n<a href=showinfo:18>Plagioclase</a>, <a href=showinfo:17455>Azure Plagioclase</a>, <a href=showinfo:17456>Rich Plagioclase</a>\r\n<a href=showinfo:1224>Pyroxeres</a>, <a href=showinfo:17459>Solid Pyroxeres</a>, <a href=showinfo:17460>Viscous Pyroxeres</a>\r\n\r\n<color=\'0xFF33FFFF\'>1.0</color> security status solar system or lower:\r\n<a href=showinfo:1228>Scordite</a>, <a href=showinfo:17463>Condensed Scordite</a>, <a href=showinfo:17464>Massive Scordite</a>\r\n<a href=showinfo:1230>Veldspar</a>, <a href=showinfo:17470>Concentrated Veldspar</a>, <a href=showinfo:17471>Dense Veldspar</a>',0,0.01,0,1,NULL,2.0000,1,1857,22,NULL,0),(35,18,'Pyerite','A soft crystal-like mineral with a very distinguishing orange glow as if on fire. Used as conduit and in the bio-chemical industry. Commonly found in many asteroid-ore types.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:1223>Bistot</a>, <a href=showinfo:17429>Monoclinic Bistot</a>, <a href=showinfo:17428>Triclinic Bistot</a>\r\n<a href=showinfo:1229>Gneiss</a>, <a href=showinfo:17865>Iridescent Gneiss</a>, <a href=showinfo:17866>Prismatic Gneiss</a>\r\n<a href=showinfo:19>Spodumain</a>, <a href=showinfo:17466>Bright Spodumain</a>, <a href=showinfo:17467>Gleaming Spodumain</a>\r\n\r\n<color=\'0xFFFF4D00\'>0.2</color> security status solar system or lower:\r\n<a href=showinfo:21>Hedbergite</a>, <a href=showinfo:17440>Vitric Hedbergite</a>, <a href=showinfo:17441>Glazed Hedbergite</a>\r\n\r\n<color=\'0xFF00FF00\'>0.7</color> security status solar system or lower:\r\n<a href=showinfo:1227>Omber</a>, <a href=showinfo:17867>Silvery Omber</a>, <a href=showinfo:17868>Golden Omber</a>\r\n\r\n<color=\'0xFF4DFFCC\'>0.9</color> security status solar system or lower:\r\n<a href=showinfo:18>Plagioclase</a>, <a href=showinfo:17455>Azure Plagioclase</a>, <a href=showinfo:17456>Rich Plagioclase</a>\r\n<a href=showinfo:1224>Pyroxeres</a>, <a href=showinfo:17459>Solid Pyroxeres</a>, <a href=showinfo:17460>Viscous Pyroxeres</a>\r\n\r\n<color=\'0xFF33FFFF\'>1.0</color> security status solar system or lower:\r\n<a href=showinfo:1228>Scordite</a>, <a href=showinfo:17463>Condensed Scordite</a>, <a href=showinfo:17464>Massive Scordite</a>',0,0.01,0,1,NULL,8.0000,1,1857,400,NULL,0),(36,18,'Mexallon','Very flexible metallic mineral, dull to bright silvery green in color. Can be mixed with tritanium to make extremely hard alloys or it can be used by itself for various purposes. Fairly common in most regions.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:1229>Gneiss</a>, <a href=showinfo:17865>Iridescent Gneiss</a>, <a href=showinfo:17866>Prismatic Gneiss</a>\r\n<a href=showinfo:19>Spodumain</a>, <a href=showinfo:17466>Bright Spodumain</a>, <a href=showinfo:17467>Gleaming Spodumain</a>\r\n\r\n<color=\'0xFFE58000\'>0.4</color> security status solar system or lower:\r\n<a href=showinfo:1226>Jaspet</a>, <a href=showinfo:17448>Pure Jaspet</a>, <a href=showinfo:17449>Pristine Jaspet</a>\r\n\r\n<color=\'0xFF00FF00\'>0.7</color> security status solar system or lower:\r\n<a href=showinfo:20>Kernite</a>, <a href=showinfo:17452>Luminous Kernite</a>, <a href=showinfo:17453>Fiery Kernite</a>\r\n\r\n<color=\'0xFF4DFFCC\'>0.9</color> security status solar system or lower:\r\n<a href=showinfo:18>Plagioclase</a>, <a href=showinfo:17455>Azure Plagioclase</a>, <a href=showinfo:17456>Rich Plagioclase</a>\r\n<a href=showinfo:1224>Pyroxeres</a>, <a href=showinfo:17459>Solid Pyroxeres</a>, <a href=showinfo:17460>Viscous Pyroxeres</a>',0,0.01,0,1,NULL,32.0000,1,1857,401,NULL,0),(37,18,'Isogen','Light-bluish crystal, formed by intense pressure deep within large asteroids and moons. Used in electronic and weapon manufacturing. Only found in abundance in a few areas.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:1232>Dark Ochre</a>, <a href=showinfo:17436>Onyx Ochre</a>, <a href=showinfo:17437>Obsidian Ochre</a>\r\n<a href=showinfo:1229>Gneiss</a>, <a href=showinfo:17865>Iridescent Gneiss</a>, <a href=showinfo:17866>Prismatic Gneiss</a>\r\n<a href=showinfo:19>Spodumain</a>, <a href=showinfo:17466>Bright Spodumain</a>, <a href=showinfo:17467>Gleaming Spodumain</a>\r\n\r\n<color=\'0xFFFF4D00\'>0.2</color> security status solar system or lower:\r\n<a href=showinfo:21>Hedbergite</a>, <a href=showinfo:17440>Vitric Hedbergite</a>, <a href=showinfo:17441>Glazed Hedbergite</a>\r\n<a href=showinfo:1231>Hemorphite</a>, <a href=showinfo:17444>Vivid Hemorphite</a>, <a href=showinfo:17445>Radiant Hemorphite</a>\r\n\r\n<color=\'0xFF00FF00\'>0.7</color> security status solar system or lower:\r\n<a href=showinfo:20>Kernite</a>, <a href=showinfo:17452>Luminous Kernite</a>, <a href=showinfo:17453>Fiery Kernite</a>\r\n<a href=showinfo:1227>Omber</a>, <a href=showinfo:17867>Silvery Omber</a>, <a href=showinfo:17868>Golden Omber</a>',0,0.01,0,1,NULL,128.0000,1,1857,402,NULL,0),(38,18,'Nocxium','A highly volatile mineral only formed during supernovas, thus severely limiting the extent of its distribution. Vital ingredient in capsule production, making it very coveted.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:1225>Crokite</a>, <a href=showinfo:17432>Sharp Crokite</a>, <a href=showinfo:17433>Crystalline Crokite</a>\r\n<a href=showinfo:1232>Dark Ochre</a>, <a href=showinfo:17436>Onyx Ochre</a>, <a href=showinfo:17437>Obsidian Ochre</a>\r\n\r\n<color=\'0xFFFF4D00\'>0.2</color> security status solar system or lower:\r\n<a href=showinfo:21>Hedbergite</a>, <a href=showinfo:17440>Vitric Hedbergite</a>, <a href=showinfo:17441>Glazed Hedbergite</a>\r\n<a href=showinfo:1231>Hemorphite</a>, <a href=showinfo:17444>Vivid Hemorphite</a>, <a href=showinfo:17445>Radiant Hemorphite</a>\r\n\r\n<color=\'0xFFE58000\'>0.4</color> security status solar system or lower:\r\n<a href=showinfo:1226>Jaspet</a>, <a href=showinfo:17448>Pure Jaspet</a>, <a href=showinfo:17449>Pristine Jaspet</a>\r\n\r\n<color=\'0xFF4DFFCC\'>0.9</color> security status solar system or lower:\r\n<a href=showinfo:1224>Pyroxeres</a>, <a href=showinfo:17459>Solid Pyroxeres</a>, <a href=showinfo:17460>Viscous Pyroxeres</a>',0,0.01,0,1,NULL,512.0000,1,1857,1201,NULL,0),(39,18,'Zydrine','Only found in huge geodes; rocks on the outside with crystal-like quartz on the inside. The rarest and most precious of these geodes are those that contain the dark green zydrine within. Very rare and very expensive.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:1223>Bistot</a>, <a href=showinfo:17429>Monoclinic Bistot</a>, <a href=showinfo:17428>Triclinic Bistot</a>\r\n<a href=showinfo:1225>Crokite</a>, <a href=showinfo:17432>Sharp Crokite</a>, <a href=showinfo:17433>Crystalline Crokite</a>\r\n\r\n<color=\'0xFFFF4D00\'>0.2</color> security status solar system or lower:\r\n<a href=showinfo:21>Hedbergite</a>, <a href=showinfo:17440>Vitric Hedbergite</a>, <a href=showinfo:17441>Glazed Hedbergite</a>\r\n<a href=showinfo:1231>Hemorphite</a>, <a href=showinfo:17444>Vivid Hemorphite</a>, <a href=showinfo:17445>Radiant Hemorphite</a>\r\n\r\n<color=\'0xFFE58000\'>0.4</color> security status solar system or lower:\r\n<a href=showinfo:1226>Jaspet</a>, <a href=showinfo:17448>Pure Jaspet</a>, <a href=showinfo:17449>Pristine Jaspet</a>',0,0.01,0,1,NULL,2048.0000,1,1857,404,NULL,0),(40,18,'Megacyte','An extremely rare mineral found in comets and very occasionally in asteroids that have traveled through gas clouds. Has unique explosive traits that make it very valuable in the armaments industry.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:22>Arkonor</a>, <a href=showinfo:17425>Crimson Arkonor</a>, <a href=showinfo:17426>Prime Arkonor</a>\r\n<a href=showinfo:1223>Bistot</a>, <a href=showinfo:17429>Monoclinic Bistot</a>, <a href=showinfo:17428>Triclinic Bistot</a>',0,0.01,0,1,NULL,8192.0000,1,1857,405,NULL,0),(41,280,'Garbage','Production waste can mean garbage to some but valuable resource material to others.',2500,0.25,0,1,NULL,20.0000,1,20,1179,NULL,0),(42,280,'Spiced Wine','Luxury goods are always solid commodities for inter-stellar trading. Spiced wine is not the rarest of luxury goods, but it can still be sold at small outposts and bases that don\'t manufacture any themselves.',500,0.5,0,1,NULL,1500.0000,1,492,27,NULL,0),(43,280,'Antibiotics','Antibiotics are in constant demand everywhere and new, more potent versions, are always made available to counter the increased immunity of bacteria against antibiotics.',5,0.2,0,1,NULL,325.0000,1,492,28,NULL,0),(44,1034,'Enriched Uranium','Enriched Uranium is used in many kinds of manufacturing and as a fuel, making it a steady trade commodity. Enriched Uranium is generally manufactured by combining standard semiconductor PVD methods with ionic separation by means of mass spectrometry.',0,1.5,0,1,NULL,5000.0000,1,1335,29,NULL,0),(45,281,'Frozen Plant Seeds','Frozen plant seeds are in high demand in many regions, especially on stations orbiting a non-habitable planet.',400,0.5,0,1,NULL,75.0000,1,492,1200,NULL,0),(49,24,'Player Kill','Kill confirmation',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(50,24,'Company Shares','Shares of a corporation.',0,0,0,1,NULL,NULL,0,NULL,2243,NULL,0),(51,24,'Bookmark','',0,0,0,1,NULL,NULL,0,NULL,1700,NULL,0),(52,94,'Trading','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(53,95,'Trade Session','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(54,15,'Caldari Logistics Station','',0,1,0,1,1,600000.0000,0,NULL,NULL,20162,237),(56,15,'Gallente Military Station','',0,1,0,1,8,600000.0000,0,NULL,NULL,20164,2307),(57,15,'Gallente Station Hub ','',0,1,0,1,8,600000.0000,0,NULL,NULL,20164,2306),(58,15,'C-O-1','Caldari Outpost 1',0,1,0,1,1,600000.0000,0,NULL,NULL,NULL,0),(59,15,'C-O-2','Caldari Outpost 2',0,1,0,1,1,600000.0000,0,NULL,NULL,NULL,0),(60,1319,'Asset Safety Wrap','',1,1,1,1,NULL,NULL,0,NULL,16,NULL,1174),(164,23,'Clone Grade Alpha','',0,1,0,1,NULL,NULL,0,NULL,34,NULL,0),(165,23,'Clone Grade Beta','',0,1,0,1,NULL,28000.0000,0,NULL,34,NULL,0),(166,23,'Clone Grade Gamma','',0,1,0,1,NULL,45500.0000,0,NULL,34,NULL,0),(178,83,'Carbonized Lead S','Small Projectile Ammo. This ammo uses a simple lead slug encased in a hard shell of crystalline carbon. It is fairly cheap and works very well against most armors. Shields, however, are a problem. \r\n\r\n60% increased optimal range.\r\n5% increased tracking speed.',0.01,0.0025,0,100,NULL,200.0000,1,113,1004,NULL,1308),(179,83,'Nuclear S','Small Projectile Ammo. Nuclear weapons are considered by most races to be crude and primitive. However, the Minmatar still favor them over more sophisticated weapons due to the abundance of materials for plutonium production in Minmatar space.\r\n\r\n60% increased optimal range.\r\n5% increased tracking speed.',0.01,0.0025,0,100,NULL,300.0000,1,113,1288,NULL,1288),(180,83,'Proton S','Small Projectile Ammo. Emits a focused, high intensity proton burst upon impact. Fairly effective vs. both shields and armor.\r\n\r\n60% increased optimal range.\r\n5% increased tracking speed.',0.01,0.0025,0,100,NULL,400.0000,1,113,1290,NULL,1290),(181,83,'Depleted Uranium S','Small projectile Ammo. Very commonly used by Minmatar pilots, this ammo is incendiary and also has great penetration. Just be careful handling it unless you want to wake up with an extra toe on your forehead. \r\n\r\n20% tracking speed bonus.',0.01,0.0025,0,100,NULL,500.0000,1,113,1285,NULL,1285),(182,83,'Titanium Sabot S','Small Projectile Ammo. This is among the most feared ammunition around. It has excellent penetration. Once the ship\'s outer layer is penetrated, the core explodes, spraying the interior with a cloud of fragmentation fletchets that cause considerable damage to the vulnerable interior structure.\r\n\r\n20% increased tracking speed.',0.01,0.0025,0,100,NULL,600.0000,1,113,1291,NULL,1291),(183,83,'Fusion S','Small Projectile Ammo. The destructive power of a fusion warhead is superior to most other projectile warheads available, although it has problems penetrating heavy shield systems.\r\n\r\n50% reduced optimal range.',0.01,0.0025,0,100,NULL,700.0000,1,113,1287,NULL,1287),(184,83,'Phased Plasma S','Small Projectile Ammo. This ammo uses a similar plasma containment core as hybrid charges except that it is mounted in a standard cannon shell.\r\n\r\n50% reduced optimal range.',0.01,0.0025,0,100,NULL,800.0000,1,113,1289,NULL,1289),(185,83,'EMP S','Small projectile Ammo. A new technology, this highly advanced ammunition emits a focused EM pulse. Very potent against shields.\r\n\r\n50% reduced optimal range.',0.01,0.0025,0,100,NULL,1000.0000,1,113,1286,NULL,1286),(186,83,'Carbonized Lead M','Medium Projectile Ammo. This ammo uses a simple lead slug encased in a hard shell of crystalline carbon. It is fairly cheap and works very well against most armors. Shields, however, are a problem.\r\n\r\n60% increased optimal range.\r\n5% increased tracking spe