 Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',500,5,0.2,1,NULL,12000.0000,1,561,376,NULL,11129),(565,74,'150mm Railgun I','This is a standard long-range railgun designed for frigates. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',500,5,0.1,1,NULL,15000.0000,1,564,349,NULL,11139),(566,74,'Heavy Electron Blaster I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,10,2.5,1,NULL,60000.0000,1,562,371,NULL,11124),(567,74,'Dual 150mm Railgun I','This cruiser-sized weapon is a double-barreled version of the frigate class 150mm railgun. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',1000,10,2,1,NULL,20000.0000,1,565,370,NULL,11135),(568,74,'Heavy Neutron Blaster I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',1000,25,1,1,NULL,120000.0000,1,562,371,NULL,11126),(569,74,'Heavy Ion Blaster I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',1000,10,1.5,1,NULL,90000.0000,1,562,371,NULL,11125),(570,74,'250mm Railgun I','Cruiser-sized large barrel turret. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',1000,25,0.5,1,NULL,150000.0000,1,565,370,NULL,11137),(571,74,'Electron Blaster Cannon I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,50,5,1,NULL,600000.0000,1,563,365,NULL,11121),(572,74,'Dual 250mm Railgun I','This battleship-sized weapon is a double-barreled version of the cruiser class 250mm railgun. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,20,4,1,NULL,200000.0000,1,566,366,NULL,11132),(573,74,'Neutron Blaster Cannon I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,50,2,1,NULL,1200000.0000,1,563,365,NULL,11123),(574,74,'425mm Railgun I','This large battleship-sized weapon packs quite a punch. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,50,1,1,NULL,1500000.0000,1,566,366,NULL,11134),(575,74,'Ion Blaster Cannon I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,50,3,1,NULL,900000.0000,1,563,365,NULL,11122),(577,76,'Medium Capacitor Booster I','Provides a quick injection of power into the capacitor.',0,10,32,1,NULL,28124.0000,1,700,1031,NULL,0),(578,77,'Adaptive Invulnerability Field I','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,20,0,1,NULL,75000.0000,1,1696,81,NULL,0),(580,80,'Burst Jammer I','Emits random electronic bursts which have a chance of momentarily disrupting target locks on ships within range.\r\n\r\nGiven the unstable nature of the bursts and the amount of internal shielding needed to ensure they do not affect their own point of origin, this module requires large amounts of capacitor energy to operate.\r\n\r\nNote: Only one module of this type can be activated at the same time.',5000,5,0,1,NULL,NULL,1,678,109,NULL,0),(581,82,'Passive Targeter I','Uses advanced gravitational and visual targeting to identify threats. Allows target lock without alerting the ship to a possible threat.',2000,25,0,1,NULL,NULL,1,672,104,NULL,0),(582,25,'Bantam','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Caldari State, this led to the redesign and redeployment of the Bantam.\r\n\r\nThe Bantam, a strong and sturdy craft, was originally an extremely effective mining frigate. After its redesign, the Bantam\'s large structure had to give way for logistics systems that ate up some of its interior room but allowed it to focus extensively on shield support for fellow vessels.',1480000,20000,270,1,1,NULL,1,61,NULL,20070,38),(583,25,'Condor','The Condor is fast and agile. It has limited cargo space so it\'s not very suitable for trading or mining. It is best used as an assault vessel in a hit-and-run type of operations.',1100000,18000,130,1,1,NULL,1,61,NULL,20070,39),(584,25,'Griffin','The Griffin is much used by the Caldari Navy as a support vessel in combat squadrons, using its impressive array of electronic gadgetry to disrupt the operation of target ships, making them easy prey for traditional combat vessels.',1056000,19400,260,1,1,NULL,1,61,NULL,20070,40),(585,25,'Slasher','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers.',1075000,17400,120,1,2,NULL,1,64,NULL,20078,44),(586,25,'Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on drone assistance if engaged in combat.',1123000,19500,400,1,2,NULL,1,64,NULL,20078,45),(587,25,'Rifter','The Rifter is a very powerful combat frigate and can easily tackle the best frigates out there. It has gone through many radical design phases since its inauguration during the Minmatar Rebellion. The Rifter has a wide variety of offensive capabilities, making it an unpredictable and deadly adversary.',1067000,27289,140,1,2,NULL,1,64,NULL,20078,46),(588,237,'Reaper','The Reaper-class corvette is one of the smallest of the Minmatar vessels, just barely reaching rookie ship status instead of a manned fighter. The Reaper is very cheap and is used en masse in daring hit-and-run operations by Minmatars either side of the law.',1157000,15800,120,1,2,NULL,1,1819,NULL,20078,53),(589,25,'Executioner','The Executioner is another newly commissioned ship of the Amarr Imperial Navy. The Executioner was designed specially to counter the small, fast raider frigates of the Minmatar Republic; thus it is different from most Amarr ships in favoring speed over defenses. With the Executioner, the Amarrians have expanded their tactical capabilities on the battlefield.',1090000,28100,115,1,4,NULL,1,72,NULL,20063,54),(590,25,'Inquisitor','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Amarr Empire, this led to the redesign and redeployment of the Inquisitor.\r\n\r\nThe Inquisitor was originally an example of how the Amarr Imperial Navy modeled their design to counter specific tactics employed by the other empires. After its redesign, it was exclusively devoted to the role of a support frigate, and its formerly renowned missile capabilities gave way to a focus on remote armor repair.\r\n',1630000,28700,250,1,4,NULL,1,72,NULL,20063,55),(591,25,'Tormentor','The Tormentor has been in service for many decades. For most of that time it saw service as a mining ship, its size barring it from making any kind of impact on the battlefield. As with most Amarr ships, however, its strong defenses always made it a tough opponent to crack, and with recent advances in turret capacitor use and damage output, its lasers have now stopped digging into dead ore and are instead focused on boring through the hulls of hapless vessels in combat.',1080000,24398,130,1,4,NULL,1,72,NULL,20063,56),(592,25,'Navitas','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Gallente Federation, this led to the redesign and redeployment of the Navitas.\r\n\r\nThe Navitas had been a solid mining vessel that had seen wide use by independent excavators, along with being one of the best ships available for budding traders and even for much-maligned scavengers. After its redesign, its long-range scanners and sturdy outer shell gave way entirely for remote repairing capabilities, moving the Navitas away from the calming buzz of mining lasers and into the roar of battle.',1450000,10000,280,1,8,NULL,1,77,NULL,20074,59),(593,25,'Tristan','Often nicknamed The Fat Man this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.',956000,26500,140,1,8,NULL,1,77,NULL,20074,60),(594,25,'Incursus','The Incursus may be found both spearheading and bulwarking Gallente military operations. Its speed makes it excellent for skirmishing duties, while its resilience helps it outlast its opponents on the battlefield. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance. ',1028000,29500,165,1,8,NULL,1,77,NULL,20074,61),(595,25,'Gallente Police Ship','The standard police vessel of the Gallente Federation. Renowned for its high quality equipment and loadout.',2040000,20400,200,1,8,NULL,0,NULL,NULL,20074,66),(596,237,'Impairor','The Impairor-class corvette has been mass-produced by the Amarr Empire for decades. It is the most common space vessel sighted within the Amarrian boundaries, and is used both as a basic trade vessel and as a small-scale slave transport. ',1148000,28100,115,1,4,NULL,1,1816,NULL,20063,299),(597,25,'Punisher','The Punisher is considered by many to be one of the best Amarr frigates in existence. As evidenced by its heavy armaments, the Punisher is mainly intended for large-scale military operations, acting in coordination with larger military vessels. With its damage output, however, it is also perfectly capable of punching its way right through unwary opponents.',1190000,28600,135,1,4,NULL,1,72,NULL,20063,300),(598,25,'Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.',1087000,20000,175,1,2,NULL,1,64,NULL,20078,305),(599,25,'Burst','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Minmatar Republic, this led to the redesign and redeployment of the Burst.\r\n\r\nThe Burst had been a small and fast cargo vessel. This all changed after the redesign, when the Burst found its small-time mining capabilities curtailed in lieu of logistics systems that moved its focus to shield support for friendly vessels.',1420000,17100,260,1,2,NULL,1,64,NULL,20078,306),(600,25,'Minmatar Peacekeeper Ship','Minmatar Police 1',1200000,12000,80,1,2,NULL,0,NULL,NULL,20078,307),(601,237,'Ibis','The Caldari Ibis corvette is a small but stout vessel that fits admirably well as a cargo hauler or small-scale miner. Its reliability makes it a good choice for novice ship captains.',1163000,15000,125,1,1,NULL,1,1817,NULL,20070,312),(602,25,'Kestrel','The Kestrel is a heavy missile boat with one of the most sophisticated sensor arrays around. Interestingly enough, it has been used by both the Caldari Navy and several wealthy trade corporations as a cargo-hauling vessel. It is one of few trading vessels with good punching power, making it ideal for solo trade-runs in dangerous areas. The Kestrel was designed so that it could take up to four missile launchers but as a result it can not be equipped with turret weapons nor with mining lasers.',1113000,19700,160,1,1,NULL,1,61,NULL,20070,313),(603,25,'Merlin','The Merlin is the most powerful combat frigate of the Caldari. Its role has evolved through the years, and while its defenses have always remained exceptionally strong for a Caldari vessel, its offensive capabilities have evolved from versatile, jack-of-all-trades attack patterns into focused and deadly gunfire tactics. The Merlin\'s primary aim is to have its turrets punch holes in opponents\' hulls.',997000,16500,150,1,1,NULL,1,61,NULL,20070,314),(605,25,'Heron','The Heron has good computer and electronic systems, giving it the option of participating in electronic warfare. But it has relatively poor defenses and limited weaponry, so it\'s more commonly used for scouting and exploration.',1150000,18900,400,1,1,NULL,1,61,NULL,20070,316),(606,237,'Velator','The Velator class corvette is one of the older vessel types in the Gallente fleet. It was first deployed on the market as a fast passenger craft but the extra passenger quarters were later modified into weapon hardpoints as the newer models came to be used for small-scale security and military duties. The Velator is still a very solid mining and trading vessel.',1148000,24500,135,1,8,NULL,1,1818,NULL,20074,321),(607,25,'Imicus','The Imicus is a slow but hard-shelled frigate, ideal for any type of scouting activity. Used by merchant, miner and combat groups, the Imicus is usually relied upon as the operation\'s eyes and ears when traversing low security sectors.',997000,21500,400,1,8,NULL,1,77,NULL,20074,322),(608,25,'Atron','The Atron is a hard nugget with an advanced power conduit system, but little space for cargo. Although it is a good harvester when it comes to mining, its main ability is as a combat vessel.',1050000,22500,145,1,8,NULL,1,77,NULL,20074,323),(609,25,'Maulus','The Maulus is a high-tech vessel, specialized for electronic warfare. It is particularly valued in fleet warfare due to its optimization for sensor dampening technology.',1063000,23000,275,1,8,NULL,1,77,NULL,20074,324),(613,25,'Devourer','Pirate Frigate 2',1200000,19100,110,1,2,NULL,0,NULL,NULL,20078,339),(614,25,'Fury','The Fury is a fast and versatile frigate. Its primary role is as a tackler, getting in close and holding down the enemies of the Angel Cartel. It backs up this with decent armaments and is rarely alone.',1200000,26000,180,1,2,NULL,0,NULL,NULL,20078,340),(615,237,'Immolator','The Immolator is a small ship, designed by the upper (read: unslaved) echelon of Sansha\'s Nation to serve as a good entry for those pilots new to the glory of Nation. It excels in picking off smaller targets and hitting them hard with energy beams.',1148000,17400,115,1,4,NULL,1,1619,NULL,20078,341),(616,25,'Medusa','The Medusa is the Angel Cartels premier Frigate class Electronic Warfare platform. It\'s fast and agile, allowing it to keep the distance needed to avoid enemy fire while providing a range of electronic warfare support.',1200000,17500,30,1,2,NULL,0,NULL,NULL,20078,342),(617,237,'Echo','The Echo is a small vessel, designed by the Angel Cartel to be easily missed in the heat of battle, while posing a viable threat in combat. As such, it is intended to rush in with guns blazing and subsequently escape without being eaten up by larger ships.',1157000,17660,120,1,2,NULL,1,1619,NULL,20078,343),(618,25,'Lynx','Little is known about the Lynx. The Angel Cartel uses it for a variety of roles including close range electronic warfare support, as well as dishing out significant damage from its projectile weapon systems.',1200000,22500,200,1,2,NULL,0,NULL,NULL,20078,344),(619,25,'Swordspine','The Swordspine is a logistics frigate operated by the Angel Cartel. It\'s remote shield boosters have saved many an Angel pilot, and lead to the downfall of countless capsuleers.',1047000,21120,220,1,2,NULL,0,NULL,NULL,20078,345),(620,26,'Osprey','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Caldari State the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Osprey.\r\n\r\nThe Osprey originally offered excellent versatility and power for what was considered a comparably low price. After its redesign, its inbuilt mining technology - now a little creaky and long in the tooth - was gutted from the Osprey and replaced in its entirety with tech of a different type, capable of high energy and shield transfers.',11100000,107000,485,1,1,NULL,1,75,NULL,20070,41),(621,26,'Caracal','The Caracal is a powerful vessel that specializes in missile deployment. It has excellent shield defenses, but poor armor plating. Its missile arsenal, when fully stocked, is capable of making mincemeat of almost anyone.',11910000,92000,450,1,1,NULL,1,75,NULL,20070,42),(622,26,'Stabber','The Stabber is the mainstay of the Minmatar fleet. It is light and extremely fast, yet surprisingly powerful, with a wide variety of weapons. It is one of few Minmatar vessels that have reached popularity outside Minmatar space.',11400000,80000,420,1,2,NULL,1,73,NULL,20078,47),(623,26,'Moa','The Moa was designed as an all-out combat ship, and its heavy armament allows the Moa to tackle almost anything that floats in space. In contrast to its nemesis the Thorax, the Moa is most effective at long range where its railguns can rain death upon foes.',12000000,101000,450,1,1,NULL,1,75,NULL,20070,49),(624,26,'Maller','Quite possibly the toughest cruiser in the galaxy, the Maller is a common sight in Amarrian Imperial Navy operations. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches.',13150000,118000,480,1,4,NULL,1,74,NULL,20063,57),(625,26,'Augoror','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Amarr Empire the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Augoror.\r\n\r\nThe Augoror-class cruiser is one of the old warhorses of the Amarr Empire, having seen action in both the Jovian War and the Minmatar Rebellion. Like most Amarr vessels, the Augoror depended first and foremost on its resilience and heavy armor to escape unscathed from unfriendly encounters. After its overhaul, it had some of the armor stripped off to make room for equipment allowing it to focus on the armor of other vessels, along with energy transfers.',12870000,115000,465,1,4,NULL,1,74,NULL,20063,58),(626,26,'Vexor','The Vexor is a strong combat ship that is also geared to operate in a variety of other roles. The Vexor is especially useful for surveying in potentially hostile sectors as it can stay on duty for a very long time before having to return to base. Furthermore, it is well capable of defending itself against even concentrated attacks.',11100000,115000,480,1,8,NULL,1,76,NULL,20074,62),(627,26,'Thorax','The Thorax-class cruiser is the latest combat ship commissioned by the Federation. While the Thorax is a very effective ship at any range, typical of modern Gallente design philosophy it is most effective when working at extreme close range where its blasters and hordes of combat drones tear through even the toughest of enemies.',11280000,112000,465,1,8,NULL,1,76,NULL,20074,63),(628,26,'Arbitrator','The Arbitrator is unusual for Amarr ships in that it\'s primarily a drone carrier. While it is not the best carrier around, it has superior armor that gives it greater durability than most ships in its class.',11200000,120000,345,1,4,NULL,1,74,NULL,20063,298),(629,26,'Rupture','The Rupture is slow for a Minmatar ship, but it more than makes up for it in power. The Rupture has superior firepower and is used by the Minmatar Republic both to defend space stations and other stationary objects and as part of massive attack formations.',12200000,96000,450,1,2,NULL,1,73,NULL,20077,302),(630,26,'Bellicose','Being a highly versatile class of Minmatar ships, the Bellicose has been used as a combat juggernaut as well as a support ship for wings of frigates. While not quite in the league of newer navy cruisers, the Bellicose is still a very solid ship for most purposes, especially in terms of long range combat.',11550000,85000,315,1,2,NULL,1,73,NULL,20078,303),(631,26,'Scythe','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Minmatar Republic the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Scythe.\n\nThe Scythe-class cruiser remains the oldest Minmatar ship still in use. It has seen many battles and is an integrated part in Minmatar tales and heritage. With its redesign, past firmware upgrades for mining output were tossed out entirely in favor of two new separate systems that focused on shield transporting and logistics drones respectively.',11110000,89000,475,1,2,NULL,1,73,NULL,20078,304),(632,26,'Blackbird','The Blackbird is a small high-tech cruiser newly employed by the Caldari Navy. Commonly seen in fleet battles or acting as wingman, it is not intended for head-on slugfests, but rather delicate tactical situations. ',13190000,96000,305,1,1,NULL,1,75,NULL,20070,311),(633,26,'Celestis','The Celestis cruiser is a versatile ship which can be employed in a myriad of roles, making it handy for small corporations with a limited number of ships. True to Gallente style the Celestis is especially deadly in close quarters combat due to its advanced targeting systems.',12070000,116000,320,1,8,NULL,1,76,NULL,20074,319),(634,26,'Exequror','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Gallente Federation the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Exequoror.\r\n\r\nThe Exequror was a heavy cargo cruiser originally strong enough to defend itself against raiding frigates, though it lacked prowess in heavier combat situations. After its redesign, it had some of that bulk - and, necessarily, some of that strength - yanked out and replaced with the capability to help others in heavy combat situations, in particular those who needed armor repairs.',11020000,113000,495,1,8,NULL,1,76,NULL,20074,320),(635,26,'Opux Luxury Yacht','The Opux Luxury Yachts are normally used by the entertainment industry for pleasure tours for wealthy Gallente citizens. These Opux Luxury Yacht cruisers are rarely seen outside of Gallente controlled space, but are extremely popular within the Federation.',13075000,115000,1750,1,8,NULL,1,1699,NULL,20074,330),(638,27,'Raven','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty.',99300000,486000,665,1,1,108750000.0000,1,80,NULL,20068,43),(639,27,'Tempest','The Tempest is one of the Republic Fleet\'s key vessels; a versatile gunship proficient at long-range bombardment and capable of dishing out specialized types of damage with great effectiveness. A well-rounded squadron of Tempests has been proven time and time again to be an invaluable wild card in a fleet battle, one which opponents should ignore at their own peril.',99500000,450000,600,1,2,103750000.0000,1,78,NULL,20076,48),(640,27,'Scorpion','The first Scorpion-class battleship was launched only a couple of years ago, and those that have been built are considered to be prototypes. Little is known of its capabilities, but what has been garnered suggests that the Scorpion is crammed to the brink with sophisticated hi-tech equipment that few can match.',103600000,468000,550,1,1,71250000.0000,1,80,NULL,20068,50),(641,27,'Megathron','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.',98400000,486000,675,1,8,105000000.0000,1,81,NULL,20072,64),(642,27,'Apocalypse','In days past, only those in high favor with the Emperor could hope to earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. In latter years, even though now in full market circulation, these golden, metallic monstrosities are still feared and respected as enduring symbols of Amarrian might.',97100000,495000,675,1,4,112500000.0000,1,79,NULL,20061,296),(643,27,'Armageddon','The mighty Armageddon class is one of the enduring warhorses of the Amarr Empire. Once a juggernaut that steamrolled its way into battle, it has now taken on a more stately and calculated approach, sending out a web of drones in its place while it drains the enemy from a distance.',105200000,486000,600,1,4,66250000.0000,1,79,NULL,20061,297),(644,27,'Typhoon','Much praised by its proponents and much maligned by its detractors, the Typhoon-class battleship has always been one of the most hotly debated spacefaring vessels around. Its distinguishing aspect - and the source of most of the controversy - is its sheer versatility, variously seen as either a lack of design focus or a deliberate freedom for pilot modification. ',100600000,414000,625,1,2,75000000.0000,1,78,NULL,20076,301),(645,27,'Dominix','The Dominix is one of the old warhorses dating back to the Gallente-Caldari War. While no longer regarded as the king of the hill, it is by no means obsolete. Its formidable hulk and powerful drone arsenal means that anyone not in the largest and latest battleships will regret ever locking horns with it.',100250000,454500,600,1,8,62500000.0000,1,81,NULL,20072,318),(648,28,'Badger','The Badger-class industrial is the main cargo-carrier for the Caldari State, particularly in long, arduous trade-runs. Its huge size and comfortable armament makes it perfectly equipped for those tasks, although the Caldari seldom let it roam alone.\n',10650000,250000,3900,1,1,NULL,1,84,NULL,20070,51),(649,28,'Tayra','The Tayra, an evolution of the now-defunct Badger Mark II, focuses entirely on reaching the highest potential capacity that Caldari engineers can manage.',13000000,270000,7300,1,1,NULL,1,84,NULL,20070,52),(650,28,'Nereus','Originally set to sail under the guise of \"Iteron\", this new iteration of an old stalwart is fast and reliable. It is equally popular among civilians and militaries due to its low price and ability to be fitted in myriad different ways. Despite its speed and resilience, however, it may need to be guarded while in particularly unfriendly territories, which is why it has also been outfitted with a drone bay for extra protection.',11250000,240000,2700,1,8,NULL,1,83,NULL,20074,65),(651,28,'Hoarder','Aside from being endowed with the usual hauling capabilities of Industrials, the Hoarder possesses an extra cargo bay. That bay is a static-free, blast-proof chamber, and as such is meant to be dedicated solely to ferrying consumable charges of all kinds, including ammunition, missiles, capacitor charges, nanite paste and bombs. ',10625000,400000,500,1,2,NULL,1,82,NULL,20078,308),(652,28,'Mammoth','The Mammoth is the largest industrial ship of the Minmatar Republic. It was designed with aid from the Gallente Federation, making the Mammoth both large and powerful yet also nimble and technologically advanced. A very good buy.',11500000,255000,5500,1,2,NULL,1,82,NULL,20078,309),(653,28,'Wreathe','The Wreathe is an old ship of the Minmatar Republic and one of the oldest ships still in usage. The design of the Wreathe is very plain, which is the main reason for its longevity, but it also makes the ship incapable of handling anything but the most mundane tasks.',10000000,225000,2900,1,2,NULL,1,82,NULL,20078,310),(654,28,'Kryos','Aside from being endowed with the usual hauling capabilities of Industrials, the Kryos possesses an extra cargo bay. That bay is equipped with precise temperature and pressure controls, and is dedicated solely to ferrying minerals. The Kryos was originally designed as a variant of the Iteron, but eventually evolved to perform an entirely separate role.',12625000,245000,550,1,8,NULL,1,83,NULL,20074,325),(655,28,'Epithal','Aside from being endowed with the usual hauling capabilities of Industrials, the Epithal possesses an extra cargo bay. That bay is equipped with sealed sub-chambers capable of maintaining hospitable environments for practically any kind of organism or entity, from biocells to viral agents, and is meant solely for ferrying planetary commodities. The Epithal was originally designed as a variant of the Iteron, but eventually evolved to perform an entirely separate role.',12800000,250000,550,1,8,NULL,1,83,NULL,20074,326),(656,28,'Miasmos','Aside from being endowed with the usual hauling capabilities of Industrials, the Miasmos possesses an extra cargo bay. That bay is equipped with sealed, temperature-controlled vats, and is meant solely for ferrying all types of interstellar ore: ice, gasses and asteroids. The Miasmos was originally designed as a variant of the Iteron, but eventually evolved to perform an entirely separate role.',12975000,265000,550,1,8,NULL,1,83,NULL,20074,327),(657,28,'Iteron Mark V','This lumbering giant is the latest and last iteration in a chain of haulers. It is the only one to retain the original \"Iteron\"-class callsign, but while all the others eventually evolved into specialized versions, the Iteron Mk. V still does what haulers do best: Transporting enormous amounts of goods and commodities between the stars.',13500000,275000,5800,1,8,NULL,1,83,NULL,20074,328),(670,29,'Capsule','Standard capsule.',32000,1000,0,1,16,NULL,0,NULL,73,20080,73),(671,30,'Erebus','From the formless void\'s gaping maw, there springs an entity. Not an entity such as any you can conceive of, nor I; an entity more primordial than the elements themselves, yet constantly coming into existence even as it is destroyed. It is the Child of Chaos, the Pathway to the Next.\r\n\r\nThe darkness shall swallow the land, and in its wake there will follow a storm, as the appetite of nothing expands over the world.\r\n\r\nFrom the formless void\'s gaping maw, there springs an entity.\r\n\r\n<i>-Dr. Damella Macaper,\r\nThe Seven Events of the Apocalypse</i>',2100000000,145500000,16250,1,8,50699805800.0000,1,815,NULL,20075,2942),(672,31,'Caldari Shuttle','Caldari Shuttle',1600000,5000,10,1,1,7500.0000,1,396,NULL,20080,317),(681,104,'Clone Grade Beta Blueprint','',0,0.01,0,1,NULL,9999999.0000,0,NULL,34,NULL,0),(682,104,'Clone Grade Gamma Blueprint','',0,0.01,0,1,NULL,9999999.0000,0,NULL,34,NULL,0),(683,105,'Bantam Blueprint','',0,0.01,0,1,NULL,2550000.0000,1,261,NULL,NULL,38),(684,105,'Condor Blueprint','',0,0.01,0,1,NULL,2150000.0000,1,261,NULL,NULL,39),(685,105,'Griffin Blueprint','',0,0.01,0,1,NULL,2350000.0000,1,261,NULL,NULL,40),(686,106,'Osprey Blueprin