hree groups: solar magmatics, which orbit sufficiently close to their star that the surface never cools enough to solidify; gravitational magmatics, which experience gravitational shifts sufficiently strong to regularly and significantly fracture cooling crusts; and magmatoids, which are for largely-unexplained reasons simply incapable of cooling and forming a persistent crust. All three types generally exhibit the same external phenomena - huge red-orange lava fields being a defining feature - but the latter two types are sometimes capable of briefly solidifying for a period measured in years or perhaps decades.',1e35,1,0,1,NULL,NULL,0,NULL,10133,20088,3836),(2016,7,'Planet (Barren)','Barren planets are archetypical \"dead terrestrials\": dry, rocky worlds with a minimal atmosphere and an unremarkable composition. They are commonly etched with flood channels, which are often broad enough to be visible from orbit; most such worlds have accumulated significant quantities of ice over their lifetimes, but cannot retain it on their surface. Generally surface liquid evaporates rapidly, contributing to the thin atmosphere, but occasionally it will seep back into the ground and refreeze, ready for another breakout in future when the local temperature rises.',1e35,1,0,1,NULL,NULL,0,NULL,10135,20085,3837),(2017,7,'Planet (Storm)','Storm worlds are usually considered terrestrial planets, although to a casual eye they may appear more similar to gas planets, given their opaque, high-pressure atmospheres. Geomorphically, however, the distinctions are clear: compared to a gas world, the atmosphere of a storm world is usually considerably shallower, and generally composed primarily of more complex chemicals, while the majority of the planet\'s mass is a rocky terrestrial ball. Their name is derived from the continent-scale electrical storms that invariably flash through their upper atmospheres.',1e35,1,0,1,NULL,NULL,0,NULL,10134,20091,3935),(2018,61,'Medium Cap Battery I','Increas