the often hyper-specialized industry of neural augmentations. It provides a dual function; tapping into both the occipital lobe for a perception boost, and also the neocortex, for improving the brain\'s handling of a ship\'s energy and capacitor needs. Like the infamous pirate implant sets found on capsuleer markets, each implant is also designed to work at higher levels when integrated into a neural implant network.<br><br>Though many in the augmentation industry initially questioned the agenda behind Genolution\'s entry into the implantation field, fears eventually subsided as the implant was shown to be one of the safest on record. Genolution went one step further to assuage fears however and vowed never to release the implant to open markets, providing only a single-run issue to capsuleers as a demonstration of the technology.',0,1,0,1,NULL,800000.0000,1,618,2053,NULL,0),(2083,481,'Prototype Iris Probe Launcher','The Iris system is a prototype launcher designed to work exclusively with the Zephyr exploration platform.\r\n\r\nIts tight integration allows it to work effectively with the minimal power and CPU capacity the Zephyr can provide, but the non-standard interfaces needed for this optimization make it entirely unusable on other ship types.',5,5,0.8,1,NULL,6000.0000,1,NULL,2677,NULL,0),(2093,283,'Kidnapped Citizens','These poor people have been through enough already; all they want is to go home.',5,1,0,1,8,NULL,1,NULL,2539,NULL,0),(2096,226,'Caldari Supercarrier Wreckage','This hollowed out husk is all that remains of one of New Eden\'s most impressive capital ships.\r\n\r\nWhat was once a battlefield juggernaut has been reduced to nothing but a silent, slowly deteriorating tomb.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3103),(2097,226,'Amarr Supercarrier Wreckage','This hollowed out husk is all that remains of one of New Eden\'s most impressive capital ships.\r\n\r\nWhat was once a battlefield juggernaut has been reduced to nothing but a silent, slowly deterior