00,'Hammerhead II','Medium Scout Drone',5000,10,0,1,8,95536.0000,1,838,NULL,NULL,1095),(2186,176,'Hammerhead II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,NULL,NULL,1095),(2187,952,'Orca Container','The Orca was developed as a joint venture between Outer Ring Excavations and Deep Core Mining Inc as a vessel to help meet the demands of New Eden\'s industry and provide a flexible platform from which mining operations can be more easily managed. The Orca uses much of the technology developed by ORE for the Rorqual and integrated with the latest advancements from Deep Core Mining research division has developed a vessel which offers a diverse role to all sizes of operations and needs.',0,0,500,1,NULL,NULL,0,NULL,NULL,NULL,3466),(2188,1019,'Guristas Mjolnir XL Cruise Missile','XL Cruise Missiles are designed for long range bombardment of capital ships and installations. They are a specialized design usable only by capital ships.\n\nNothing more than a baby nuclear warhead, this guided missile wreaks havoc with the delicate electronic systems aboard a starship. Specifically designed to damage shield systems, it is able to ravage heavily shielded targets in no time.',1500,0.3,0,100,NULL,350000.0000,1,1317,182,NULL,20045),(2189,952,'Drone Infested Dominix','',105000000,1010000,600,1,8,NULL,0,NULL,NULL,NULL,1718),(2190,1053,'Renyn Meten','<font color=yellow>Subject:</font>  Prototype Nation Vessel (ID: Renyn Meten)<br>\r\n<font color=yellow>Military Specifications:</font>  Frigate-class vessel. Primary anti-support damage dealer amongst frigate-class prototypes. Significant microwarp velocity. Short range laser systems.<br>\r\n<font color=yellow>Additional Intelligence:</font>  There were no reported civilian abductions from the Renyn VI invasion. The Renyn identifier suggests a small number of captives may have been initially unaccounted for, as with the Eystur Rhomben variant. The Meten identifier suggests an oversight role amongst the other frigate-class prototypes, or alternatively, that it was created during the first phase of development.<br>\r\n<i>Synopsis from ISHAEKA-0043. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>\r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1237),(2191,1054,'Antem Neo','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Antem Neo)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Primary role is long-range sniping support. Moderate microwarp velocity. Vessel will attempt to establish orbit ranges in excess of 100km.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 900,000 civilian abductions from Antem IV. The Neo identifier suggests this variant was designed recently, or alternatively, is an improvement upon other, pre-existing designs. Possible links to the Mara Paleo variant.<br>\r\n<i>Synopsis from ISHAEKA-0059. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2192,1052,'The Kundalini Manifest','True power lies within all of us. Coiled beneath our fears and insecurities like a resting serpent, it has waited with infinite patience for those last few layers of our imperfection to be stripped away. It waits, as we strive, for a freedom only this part of ourselves truly deserves.<br>\r\nFor as long as human history records, we have ignored what we truly are, and worse, we have ignored everything we could yet become. We must learn, now, to let go. Not everything we have taken with us so far on this journey should remain.<br>\r\nOur flaws and faults, these near-indelible errors pervading throughout human history, they can all be removed. Together, as one, we can overcome the enemy within.<br>\r\n<i>- Sansha Kuvakei</i>\r\n',1546875000,62000000,1337,1,4,NULL,0,NULL,NULL,10002,10038),(2193,100,'Praetor I','Heavy Attack Drone',10000,25,0,1,4,60000.0000,1,839,NULL,NULL,1119),(2194,176,'Praetor I Blueprint','',0,0.01,0,1,NULL,6000000.0000,1,359,NULL,NULL,0),(2195,100,'Praetor II','Heavy Attack Drone',10000,25,0,1,4,251072.0000,1,839,NULL,NULL,1120),(2196,176,'Praetor II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,NULL,NULL,0),(2197,314,'Environmentally-friendly Mining Equipment','The latest generation of environmentally-friendly mining drills reduces airborne pollutants by 75% when compared to the most popular drills on the market. This is accomplished through a revolutionary dust recapture system that essentially vacuums the air around the drill head. The collected dust is captured in large, on-site filtration systems which then compacts the dust into blocks. These blocks can either be refined along with the extracted ores, or simply placed back into the mine as backfill once drilling operations are complete. While more than five times as expensive as normal drills, the efficiency of these new models provides an entirely new level of environmental protection. ',70,32,0,1,NULL,NULL,1,NULL,2852,NULL,0),(2198,314,'Crate of Environmentally-friendly Mining Equipment','The latest generation of environmentally-friendly mining drills reduces airborne pollutants by 75% when compared to the most popular drills on the market. This is accomplished through a revolutionary dust recapture system that essentially vacuums the air around the drill head. The collected dust is captured in large, on-site filtration systems which then compacts the dust into blocks. These blocks can either be refined along with the extracted ores, or simply placed back into the mine as backfill once drilling operations are complete. While more than five times as expensive as normal drills, the efficiency of these new models provides an entirely new level of environmental protection. ',210,450,0,1,NULL,NULL,1,NULL,2852,NULL,0),(2199,314,'Prototype Body Armor Fabric ','This energy and force-absorbing fabric could represent a generational advancement in light body armor technology. What makes this remarkable fabric unique is that it contains microscopically thin layers of an advanced polymer containing nanites programmed for self-repair. In short, when a suit of body armor made form this material is impacted by any significant force, the nanites instantly begin to repair any damage done, which protects the wearer from further harm. Most importantly, during the manufacturing phase, if the fabric is properly pre-stressed, the nanites are forced to bond thus creating stronger and stronger material, without any increase in weight or decrease in flexibility. For these reasons, this prototype body armor fabric will undoubtedly become the most sought-after material for those groups able to afford its exorbitant price. ',50,20,0,1,NULL,NULL,1,NULL,1189,NULL,0),(2200,314,'Crate of Prototype Body Armor Fabric ','This energy and force-absorbing fabric could represent a generational advancement in light body armor technology. What makes this remarkable fabric unique is that it contains microscopically thin layers of an advanced polymer containing nanites programmed for self-repair. In short, when a suit of body armor made form this material is impacted by any significant force, the nanites instantly begin to repair any damage done, which protects the wearer from further harm. Most importantly, during the manufacturing phase, if the fabric is properly pre-stressed, the nanites are forced to bond thus creating stronger and stronger material, without any increase in weight or decrease in flexibility. For these reasons, this prototype body armor fabric will undoubtedly become the most sought-after material for those groups able to afford its exorbitant price. ',5000,2000,0,1,NULL,NULL,1,NULL,1189,NULL,0),(2201,314,'Riot Interdiction Team','Riot Interdiction Teams, or RITs, are the primary Amarrian response forces for incidents involving slave riots and uprisings. These forces are equipped with the latest generations of body armor, stun sticks, flash-bang grenades, and other less-lethal technologies. In those cases where less-lethal force is insufficient, the teams are fully trained and equipped to use lethal force to resolve any such threat. For example, the RITs are often called in to resolve hostage situations in which one or more of the captives has been killed, thus eliminating the need for a phased operation and then transitioning to lethal force contingency operations (i.e., shoot to kill). Therefore, it is of little surprise that they are among the most highly trained Amarr ground forces in hostage rescue operations, and are sometimes called on to act in situations unrelated to slave-based scenarios.',30,30,0,1,NULL,NULL,1,NULL,2549,NULL,0),(2202,314,'Riot Interdiction Teams','Riot Interdiction Teams, or RITs, are the primary Amarrian response forces for incidents involving slave riots and uprisings. These forces are equipped with the latest generations of body armor, stun sticks, flash-bang grenades, and other less-lethal technologies. In those cases where less-lethal force is insufficient, the teams are fully trained and equipped to use lethal force to resolve any such threat. For example, the RITs are often called in to resolve hostage situations in which one or more of the captives has been killed, thus eliminating the need for a phased operation and then transitioning to lethal force contingency operations (i.e., shoot to kill). Therefore, it is of little surprise that they are among the most highly trained Amarr ground forces in hostage rescue operations, and are sometimes called on to act in situations unrelated to slave-based scenarios.',500,300,0,1,NULL,NULL,1,NULL,2549,NULL,0),(2203,100,'Acolyte I','Light Scout Drone',3000,5,0,1,4,2000.0000,1,837,1084,NULL,1084),(2204,176,'Acolyte I Blueprint','',0,0.01,0,1,NULL,200000.0000,1,1531,1084,NULL,0),(2205,100,'Acolyte II','Light Scout Drone',3000,5,0,1,4,36768.0000,1,837,NULL,NULL,2764),(2206,176,'Acolyte II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,NULL,NULL,0),(2207,1054,'Vylade Dien','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Vylade Dien)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Primary roles are damage dealing and squad enhancement. Low microwarp velocity.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 100,000 civilian abductions from Vylade II. The Dien identifier suggests an oversight role amongst other cruiser-class prototypes, or alternatively, that it was created during the first phase of development. The nature of Nation\'s squad boosting technology is still not fully understood, although current intelligence from recovered wrecks indicates that the designs deviates from standard warfare links in the same way as Tech III Warfare Processors.<br>\r\n<i>Synopsis from ISHAEKA-0047. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2208,1054,'Uitra Telen','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Uitra Telen)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Moderate microwarp velocity. Limited weapons systems.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 210,000 civilian abductions from VII. The Telen identifier suggests an oversight role amongst other Cruiser-class variants, or that other, more advanced prototypes may have originated from this design.<br>\r\n<i>Synopsis from ISHAEKA-0055. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i> \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2209,1054,'Arnon Epithalamus','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Arnon Epithalmus)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Primary role is extreme range ECM support. Low microwarp velocity. Long range missile support.<br>\r\n<font color=yellow>Additional Intelligence:</font> There were no reported civilian abductions from the invasion of Arnon III, IX and XI. The Arnon identifier suggests a number of captives may have been initially unaccounted for, as with the Eystur Rhomben and Renyn Meten variants. This supports previous conjecture that Nation\'s synchronized attacks on multiple planets were at least partly designed to aid in covert abduction. The Epithalmus identifier suggests a unifying role between the cruiser-class prototypes and other hull classes, and perhaps an additional regulatory role in crew emotional response, similar to the suspected behavior of the Tama Cerebellum variant.<br>\r\n<i>Synopsis from ISHAEKA-0049. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2210,89,'Banshee Torpedo','An ultra-heavy piercing missile. Slow and dumb but its sheer damage potential is simply staggering.',1500,0.05,0,100,NULL,30000.0000,0,NULL,1346,NULL,20016),(2211,166,'Sansha Juggernaut Torpedo Blueprint','',1,0.01,0,1,NULL,9000000.0000,1,NULL,1346,NULL,0),(2212,385,'Ghost Heavy Missile','The Scourge is an old relic from the Caldari-Gallente War that is still in widespread use because of its low price and versatility.',1000,0.03,0,100,4,2500.0000,0,NULL,189,NULL,20050),(2213,166,'Ghost Heavy Missile Blueprint','',1,0.01,0,1,NULL,750000.0000,1,NULL,189,NULL,0),(2214,952,'Guard Post','This inconspicuous guard post is awaiting security clearance before taking any action.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,1991),(2215,314,'Amarr TIL-1A Nexus Chips ','The Amarr TIL-1A Nexus Chip was once used to store the key elements of a ship\'s artificial intelligence system, as well as for controlling some of the vessel\'s autonomous functions. In addition, the TIL-1A series chip had been modified by top Viziam scientists for the Imperial Navy, making it far more resilient to damage and harsh environmental conditions than standard chips of its kind. The TIL-1A chip, specifically, was designed for front-line Amarr battleship-class vessels where it saw widespread use for almost a decade before being replaced by newer technologies. As a result, very few examples of this remain outside Amarr military historical archives, where they are often highly valued for the data they contain on early naval operations. ',1,12,0,1,NULL,NULL,1,NULL,2038,NULL,0),(2216,314,'Crate of Amarr TIL-1A Nexus Chips','The Amarr TIL-1A Nexus Chip was once used to store the key elements of a ship\'s artificial intelligence system, as well as for controlling some of the vessel\'s autonomous functions. In addition, the TIL-1A series chip had been modified by top Viziam scientists for the Imperial Navy, making it far more resilient to damage and harsh environmental conditions than standard chips of its kind. The TIL-1A chip, specifically, was designed for front-line Amarr battleship-class vessels where it saw widespread use for almost a decade before being replaced by newer technologies. As a result, very few examples of this remain outside Amarr military historical archives, where they are often highly valued for the data they contain on early naval operations. ',10,120,0,1,NULL,NULL,1,NULL,2038,NULL,0),(2217,283,'Preacher','Tolmak\'s preachers serve as his proxies, and are the primary way he spreads his controversial message.',65,1,0,1,NULL,NULL,1,NULL,3036,NULL,0),(2218,306,'Locced\'s Bribe','This cargo container is filled with all the extra supplies the pirates brought along with them.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(2219,314,'Large Group of Civilian Workers and Dependents','Civilian workers and their dependents, including men, women, and children.',110,125,0,1,NULL,NULL,1,NULL,2539,NULL,0),(2220,314,'Civilian Workers and Dependents','Civilian workers and their dependents, including men, women, and children.',11,12,0,1,NULL,NULL,1,NULL,2539,NULL,0),(2221,314,'Manportable Electromagnetic Pulse Weapons ','These EM beam weapons have been custom fitted to detect and eradicate specific nanotechnologies. Normally, these EMP devices are used by special operations personnel during covert operations. They are placed in proximity to the enemy\'s defense grid and used to short out any nearby electronics, thus creating a hole in the defense grid such that conventional forces can then move through unimpeded by sentry grids, security bots, and other lethal defensive systems. The devices themselves are approximately the size of a large rucksack and can be both emplaced and operated by a single trained individual. ',25,25,0,1,NULL,NULL,1,NULL,1362,NULL,0),(2222,673,'Scions of the Superior Gene','The Scions of the Superior Gene are a minor extremist cult. They believe that the Jovians are gods, and their technology is sacred  too pure to be used by the lowly empires. They have a small fleet of well-armed ships used exclusively to \"purify\" those who they feel have offended the Jovians.\r\n\r\n',10100000,101000,235,1,1,NULL,0,NULL,NULL,NULL,42),(2223,306,'Preacher\'s Quarters','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',100000,100000000,8850,1,NULL,NULL,0,NULL,NULL,NULL,2515),(2224,1006,'Tolmak\'s Zealots','Tolmak has managed to convert a number of people to his religious message. Some of them are so fanatical they\'re willing to fight for him. These zealots form a motley fleet of whatever small ships they have been able to buy with donations from their planetside brethren.',11500000,115000,465,1,4,NULL,0,NULL,NULL,NULL,1730),(2226,283,'Sisters of EVE Negotiator','An emissary sent by the Sisters of EVE to oversee peace talks.',85,1,0,1,NULL,NULL,1,NULL,2538,NULL,0),(2232,306,'Life pod','A life pod from a long since destroyed ship.',10000,1200,1400,1,NULL,NULL,0,NULL,73,NULL,73),(2233,1025,'Customs Office','Orbital Customs Offices are the primary points of contact between planetary and interplanetary economies. These facilities, resembling massive hangars in space, provide high-volume, high-frequency cargo transport services between a planet\'s surface and orbit.\r\n\r\n<i>Excerpt from the Amarr Prime Customs Agency regulations, section 17, subsection 4, paragraph 8:\r\n\r\nThe following items may only be imported or exported with the express prior approval of the Imperial Underscrivener for Commercial Affairs:\r\n\r\nNarcotic substances; handheld firearms; slaver hounds (except as personal property); Mindflood; live insects; ungulates; Class 1 refrigerants and aerosols; forced laborers/personal slaves (or other sapient livestock); animal germ-plasm; biomass of human origin; xenobiotics; walnuts.</i>',5000000000,100000000,35000,1,NULL,NULL,0,NULL,NULL,10029,4579),(2234,226,'Sansha\'s Battletower','This gigantic war station is one of the military installations of Sansha\'s slumbering nation.  It is known to be able to hold a massive number of Sansha vessels, but strange whispers hint at darker things than mere warfare going on underneath its jagged exterior.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,20199,2364),(2239,283,'Oura Madusaari','A half-mad young female Caldari salvager, she was among the few survivors of <i>The Paryi</i>\'s salvaging crew.',85,1,0,1,NULL,NULL,1,NULL,2537,NULL,0),(2240,283,'Harroken Ikero','A half-mad young male Caldari salvager, he was among the few survivors of <i>The Paryi</i>\'s salvaging crew.',85,3,0,1,NULL,NULL,1,NULL,2536,NULL,0),(2244,283,'Fajah Ateshi','A serious middle-aged female Amarr scientist, Dr. Ateshi remained eerily calm while the crew all around her lost their minds. She attributes her survival to God being on her side.',85,1,0,1,NULL,NULL,1,NULL,2891,NULL,0),(2250,314,'Neurowave Pattern Scanner','This scanner will track the brainwaves of any living creatures within a ship.',1,0.1,0,1,NULL,NULL,1,NULL,2037,NULL,0),(2252,226,'Roden Station','This facility bears the red color scheme particular to Roden Shipyards.',0,1,0,1,8,600000.0000,0,NULL,NULL,14,3798),(2254,1027,'Temperate Command Center','The modular design of this administrative structure allows it to be deployed piecemeal from orbit, then manually assembled on the surface by MTACs and engineering personnel. Supported by self-regulating pylons that follow the contours of indigenous terrain, the facility can accommodate almost any severity of incline or other non-critical geological hazard. Once active, it serves as both a central command post to coordinate the activity of all other nodes and a basic transportation site for getting commodities off world using standard, vertically launched rockets.',5000,1000,500,1,NULL,90000.0000,1,1322,NULL,NULL,4566),(2256,1030,'Temperate Launchpad','The temperate launchpad is able to send and receive payloads from orbit. Because of the relatively calm atmospheric conditions of most temperate planets, the primary focus of this facility is on interfacing effectively with adjacent facilities, allowing for passengers and commodities to be easily organized, scanned, and transported to the appropriate areas. The obvious importance of a centralized spaceport often leads to its becoming a focal point of local culture, including trade, entertainment, and even illegal activities.',0,0,10000,1,NULL,900000.0000,1,NULL,NULL,NULL,4559),(2257,1029,'Ice Storage Facility','\"At some point, it all comes down to more metal.\" The designers of this storage site believed this adage above all else. The outer walls of each container are comprised of almost a meter of titanium alloy around a flexible, lightweight tritanium frame, all sealed with a few layers of active nanite coating to prevent microfractures and thermal warping. This combination allows the building to withstand nearly any environmental challenge. To prevent the tritanium supports from decaying, the interior is kept in a constant vacuum, and workers must wear fully sealed atmosphere suits at all times.',0,0,12000,1,NULL,250000.0000,1,NULL,NULL,NULL,4572),(2258,202,'ECCM - Omni II','A secondary electronic array that provides a significant boost to sensor strength for a short time. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,0,NULL,104,NULL,0),(2259,202,'ECCM - Gravimetric II','A secondary electronic array that provides a significant boost to sensor strength for a short time. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,0,NULL,104,NULL,0),(2260,202,'ECCM - Ladar II','A secondary electronic array that provides a significant boost to sensor strength for a short time. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,0,NULL,104,NULL,0),(2261,202,'ECCM - Magnetometric II','A secondary electronic array that provides a significant boost to sensor strength for a short time. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,0,NULL,104,NULL,0),(2262,202,'ECCM - Radar II','A secondary electronic array that provides a significant boost to sensor strength for a short time. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,0,NULL,104,NULL,0),(2263,12,'Planetary Launch Container','This container has been launched from the planet surface into low orbit for collection by starships.  These containers will burn up within a few days if not collected.',10000,27500,1000,1,NULL,NULL,0,NULL,NULL,NULL,4578),(2267,1032,'Base Metals','Iron and nickel are two widespread, easily recognized examples of base metals, or those metals that oxidize relatively easily. Their tremendous usefulness in numerous applications ensures that base metals are always in high demand. Thankfully, so is their abundance on most planetary surfaces.',0,0.01,0,1,NULL,NULL,1,1333,10024,NULL,0),(2268,1033,'Aqueous Liquids','The abundance of water on terrestrial planets is often a misconception: What many refer to offhandedly as \"water\" is often an amalgamation of many liquids, microscopic particles, and saturated compounds combined with water and other liquids. Aqueous liquids represent those liquids from which pure water can be separated easily from waste or hazardous particles, but only using the proper equipment.',0,0.01,0,1,NULL,NULL,1,1333,10012,NULL,0),(2270,1032,'Noble Metals','Highly resistant to corrosion and oxidation, noble metals are somewhat rarer than base metals, yet they are just as sought after for their different electrical, material, and chemical attributes. When painstakingly refined and purified, some noble metal ores can produce \"precious metals.\"',0,0.01,0,1,NULL,NULL,1,1333,10025,NULL,0),(2272,1032,'Heavy Metals','In small quantities, heavy metals are vital to life, providing essential minerals for biological processes. In bulk, they are commonly found in most construction materials, forming the most basic components of computer electronics and reinforced structures.',0,0.01,0,1,NULL,NULL,1,1333,10026,NULL,0),(2280,1036,'Link','',0,0,1000,1,NULL,NULL,1,NULL,NULL,NULL,0),(2281,77,'Adaptive Invulnerability Field II','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,NULL,362408.0000,1,1696,81,NULL,0),(2282,157,'Adaptive Invulnerability Field II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,81,NULL,0),(2284,226,'Megathron (Roden)','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,3809),(2285,226,'Dominix (Roden)','The Dominix is one of the old warhorses dating back to the Gallente-Caldari War. While no longer regarded as the king of the hill, it is by no means obsolete. Its formidable hulk and powerful drone arsenal means that anyone not in the largest and latest battleships will regret ever locking horns with it.',0,0,0,1,8,NULL,0,NULL,NULL,NULL,3808),(2286,1035,'Planktic Colonies','Harvested in mass quantities, planktic colonies are used for much more than just a bulk food source that flourishes in water-rich environments. Their cumulative biomass has advanced properties that contribute to some of the most advanced material and medical sciences in New Eden.',0,0.01,0,1,NULL,NULL,1,1333,10035,NULL,0),(2287,1035,'Complex Organisms','Organic flora and fauna growing on worlds across the cluster technically qualify as alien life, though none of it has registered as sentient. However, their usefulness as comestibles or building materials in other areas of industry is invaluable.',0,0.01,0,1,NULL,NULL,1,1333,10036,NULL,0),(2288,1035,'Carbon Compounds','Often referred to as the building blocks of life, carbon compounds form the basis of most organic material; hence, they are ideally suited for use in the early development of advanced, reactive molecules, such as those used in biofuel and supertensile structures.',0,0.01,0,1,NULL,NULL,1,1333,10037,NULL,0),(2289,77,'Explos