8,157,'Explosive Deflection Field II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,81,NULL,0),(2299,77,'Kinetic Deflection Field II','Boosts shield resistance against kinetic damage.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance',10000,5,0,1,NULL,269248.0000,1,1693,20949,NULL,0),(2300,157,'Kinetic Deflection Field II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,81,NULL,0),(2301,77,'EM Ward Field II','Boosts shield resistance against EM damage.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,NULL,261376.0000,1,1695,20948,NULL,0),(2302,157,'EM Ward Field II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,81,NULL,0),(2303,77,'Thermal Dissipation Field II','Boosts shield resistance against thermal damage.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,NULL,273696.0000,1,1692,20950,NULL,0),(2304,157,'Thermal Dissipation Field II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,81,NULL,0),(2305,1035,'Autotrophs','At the very bottom of the food chain are autotrophs, those organisms that produce carbohydrates, proteins, and fats for higher life forms to consume. When properly gathered and ordered, they can be plied into industrial fibers, which then go on to contribute to advanced material technologies.',0,0.01,0,1,NULL,NULL,1,1333,10038,NULL,0),(2306,1032,'Non-CS Crystals','The orderly, compact nature of crystals makes them well suited for a staggering array of manufacturing processes, in which they are just as often the product of the factory as they are incorporated into many of the tools and machinery used therein.',0,0.01,0,1,NULL,NULL,1,1333,10027,NULL,0),(2307,1032,'Felsic Magma','The churning core of lava planets is rife with felsic magma, or silicate material that is infused with lighter elements, from which basic silicon and other atomic matter may be extracted. Silicon is abundant on many terrestrial planets, but the fastest and easiest way to obtain it, given advances in planetary mining processes, is from felsic magma.',0,0.01,0,1,NULL,NULL,1,1333,10028,NULL,0),(2308,1033,'Suspended Plasma','When found in harvestable quantities beyond the unapproachable heat of an active star, plasma is said to be in a suspended state. Specialized electronic equipment is used to attract the ionized particles into collection tubes, after which it can be stored, transported, or applied to a variety of technologies.',0,0.01,0,1,NULL,NULL,1,1333,10013,NULL,0),(2309,1033,'Ionic Solutions','An electrolyte found in a raw, natural form is called an ionic solution, especially in terms of planetary astronomy. Only after a lengthy process of extraction and refining can the resulting fluid go on to be used for medical, industrial, or nutritive applications. ',0,0.01,0,1,NULL,NULL,1,1333,10014,NULL,0),(2310,1033,'Noble Gas','This colorless, odorless, and usually nonflammable substance is one of seven known monoatomic gases, or those that do not easily combine with other atoms. They are thus well suited for a variety of manufacturing implementations.',0,0.01,0,1,NULL,NULL,1,1333,10015,NULL,0),(2311,1033,'Reactive Gas','Consisting of any number of volatile atomic structures, reactive gases are the most useful when applied to the fields of explosives, molecular restructuring, and electrical conduction. Great care must be taken when storing or transporting any sizeable quantity. ',0,0.01,0,1,NULL,NULL,1,1333,10016,NULL,0),(2312,1034,'Supertensile Plastics','Hyperoxidation was the term given to the process of rapidly fossilizing the carbon structures, readily available in the form of biomass, which forms the basic framework of supertensile plastics. The only amorphous solid known to retain the resilience of other such materials while also adopting conductive properties, supertensile plastic is highly sought after for a wide range of industrial applications.',0,1.5,0,1,NULL,1.0000,1,1335,10057,NULL,0),(2317,1034,'Oxides','Technically, any chemical compound that contains at least one oxygen atom is an oxide, though some are far more valuable than others. Once broken down and separated from waste material, many oxides can be applied to various industrial processes.',0,1.5,0,1,NULL,1.0000,1,1335,10051,NULL,0),(2319,1034,'Test Cultures','When bacteria are allowed to thrive in a water-based environment, they undergo generational transformations that can be monitored and documented, providing research data invaluable to numerous scientific fields.',0,1.5,0,1,NULL,1.0000,1,1335,10056,NULL,0),(2321,1034,'Polyaramids','Polyaramid textiles are produced when industrial fibers are harvested from autotrophic life forms and subjected to intense pressure using reactive gas pistons. Able to absorb a startling amount of kinetic energy, sheets of this miraculous material can be form-fitted to just about any structure, protecting it from anything but weapons-grade impact forces.',0,1.5,0,1,NULL,1.0000,1,1335,10058,NULL,0),(2327,1034,'Microfiber Shielding','Using advanced residual substrate isolation technology, silicon weave is threaded through layers of tough organic fibers. The resulting microfiber shielding is incredibly resilient and retains the microscopic profile required to shield miniaturized electronics.',0,1.5,0,1,NULL,1.0000,1,1335,10055,NULL,0),(2328,1034,'Water-Cooled CPU','Despite how ancient the technology is, there is still no method more cost-effective for cooling computer processing units than ordinary water, which can be heated and cooled rapidly via any number of proven methods. Most often, thermally conductive tubing makes its way through all of the vital components and over heat sinks, helping to regulate operating temperatures.',0,1.5,0,1,NULL,1.0000,1,1335,10052,NULL,0),(2329,1034,'Biocells','Similar to an ancient battery, a biocell instead uses biofuels distilled from organic material and precious metals to produce an electrical current in a self-contained, modular unit. However, modern biocells dwarf the capabilities of ancient batteries by several orders of magnitude.',0,1.5,0,1,NULL,1.0000,1,1335,10054,NULL,0),(2331,57,'Shield Power Relay I','Diverts power from the capacitors to the shields, thereby increasing the shield recharge rate.',20,5,0,1,NULL,NULL,1,688,83,NULL,0),(2332,137,'Shield Power Relay I Blueprint','',0,0.01,0,1,NULL,97440.0000,1,1550,83,NULL,0),(2333,49,'Survey Scanner II','Scans the composition of asteroids, ice and gas clouds.',0,5,0,1,NULL,NULL,1,714,2732,NULL,0),(2334,129,'Survey Scanner II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,107,NULL,0),(2335,226,'Mysterious Probe','Despite its familiar construction, this ancient probe is made from materials and electronics unlike anything you\'ve ever seen in New Eden. It floats silently through space, seemingly dormant.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,1211),(2341,82,'Passive Targeter II','Uses advanced gravitational and visual targeting to identify threats. Allows target lock without alerting the ship to a possible threat.',2000,5,0,1,NULL,NULL,1,672,104,NULL,0),(2342,161,'Passive Targeter II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,104,NULL,0),(2344,1040,'Condensates','Oxidized coolant is required to produce the temperatures needed to force rare particles to condense out of ordinary matter, which is the most economic way to produce valuable base elements in bulk.',0,6,0,1,NULL,1.0000,1,1336,10039,NULL,0),(2345,1040,'Camera Drones','Most visibly used in starship development, especially on capsuleer craft, other types of camera drones are also employed in the fields of nano-medicine, surveillance, and entertainment.',0,6,0,1,NULL,1.0000,1,1336,10040,NULL,0),(2346,1040,'Synthetic Synapses','The wide range of uses for synthetic synapses is largely due to the fact that they are able to serve double duty as electrical conduits and as replacements or additions to biological nervous systems. This allows them to be used in computers, cybernetics, and artificial intelligence equipment.',0,6,0,1,NULL,1.0000,1,1336,10041,NULL,0),(2348,1040,'Gel-Matrix Biopaste','Gel-matrix biopaste is a highly unstable substance that must be formed from elements that don\'t combine under normal circumstances. Forcing them to do so requires enormous amounts of energy, but the end product is invaluable to high-end electronics and cybernetic medicine.',0,6,0,1,NULL,1.0000,1,1336,10042,NULL,0),(2349,1040,'Supercomputers','When an individual computer system incorporates a wide range of networked utilities, layered processors, and redundant memory cores, it is said to have evolved into a supercomputer. Such systems can be put to use managing spaceships, starbases, or even entire planetary administrations.',0,6,0,1,NULL,1.0000,1,1336,10043,NULL,0),(2351,1040,'Smartfab Units','These tiny cubes form the building blocks of many simple structures, from basic walls and doors to entire homes and even industrial office spaces. Whenever a sufficient number of smartfab units are placed together and have been programmed with the same instructions, they will automatically combine to form some portion of that object and then become inert in their new form. With adequately detailed blueprints, there is theoretically no limit to the complexity of object or structure these clever devices can create. ',0,6,0,1,NULL,1.0000,1,1336,10044,NULL,0),(2352,1040,'Nuclear Reactors','This power core is able to convert heavy elements into electricity by way of nuclear fission, splitting atoms to produce thermal energy on a massive scale. If they are properly shielded and cooled, there are few safer, cleaner ways to power buildings or large vehicles. ',0,6,0,1,NULL,1.0000,1,1336,10045,NULL,0),(2354,1040,'Neocoms','As an essential component of the navigational and tactical interface of spaceships, Neocoms are a small but essential cornerstone of the interstellar economy.',0,6,0,1,NULL,1.0000,1,1336,10046,NULL,0),(2355,63,'Small Hull Repairer II','Makes use of nano-assembler technology in order to repair damage done to the structure.',1000,5,0,1,NULL,NULL,1,1053,21378,NULL,0),(2356,143,'Small Hull Repairer II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,21,NULL,0),(2358,1040,'Biotech Research Reports','As the core fundamentals of organic life constantly evolve and develop on micro and macro levels, the constant production and distribution of biotech research is a mandatory part of ongoing advances in countless scientific disciplines.',0,6,0,1,NULL,1.0000,1,1336,10132,NULL,0),(2360,1040,'Industrial Explosives','The primary difference between military and industrial explosives is that the latter are effective only when used in bulk, and they are never sold or transported with ready to use detonators. As such, they must be carefully installed, primed, and triggered from remote locations before their full destructive force can be applied.',0,6,0,1,NULL,1.0000,1,1336,10047,NULL,0),(2361,1040,'Hermetic Membranes','How do you make a sheet of material absolutely impermeable to specific particles? Simple: You make the material <i>want</i> to stop those particles. Such is the case with hermetic membranes, supertensile fabrics instilled with living genetic material that actively hunts down and absorbs or repels whatever they were bred to counteract.',0,6,0,1,NULL,1.0000,1,1336,10048,NULL,0),(2363,205,'Heat Sink I','Dissipates energy weapon damage efficiently, thus allowing them to be fired more rapidly. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1,5,0,1,NULL,NULL,1,647,1046,NULL,0),(2364,205,'Heat Sink II','Dissipates energy weapon damage efficiently, thus allowing them to be fired more rapidly. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1,5,0,1,NULL,NULL,1,647,1046,NULL,0),(2366,1040,'Hazmat Detection Systems','A critical component of space stations, starships, or any other isolated environment, these tiny devices are set to trigger alarms when the genetically engineered viruses inside mutate  which means that they\'ve encountered a significant dose of radiation, natural contaminant, or airborne pathogen, signifying that the surrounding crew is in danger.',0,6,0,1,NULL,1.0000,1,1336,10049,NULL,0),(2367,1040,'Cryoprotectant Solution','The base elements present in certain synthetic oils can, at extreme temperatures, produce habitable environments for genetically engineered extremophile. The byproduct of their rapid life-death cycle is a highly thermal resistant solution ideal for hybrid electronics.',0,6,0,1,NULL,1.0000,1,1336,10050,NULL,0),(2368,314,'Broken Organic Mortar Applicators','While nanites are ideal for many forms of construction, sealing joints between large structural bulkheads is a job best left to organic mortar, a thick gel that actively permeates every microscopic gap between two parts. Due to the aggressive nature of the genetically engineered bacteria that intelligently guides into place the hardening condensate material, this paste is extremely hazardous to humans and must be applied by robots.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2369,314,'Broken Sterile Conduits','Sustaining diverse populations of station inhabitants  many of whom come from different worlds with different ecologies  was a medical nightmare until the development of sterile conduits. Each length of flexible, self-repairing tube is powered by breaking down the chemical energy in the water they convey, which itself is laced with smart vaccines able to identify and destroy almost any known antigen.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2370,572,'Serpentis Initiate','This is a fighter for the Serpentis Corporation. It is protecting the assets of the Serpentis Corporation and may attack anyone it perceives as a threat or easy pickings. Threat level: Very low',2450000,24500,60,1,8,NULL,0,NULL,NULL,31,1816),(2371,314,'Broken Nano-Factory','Only the highly advanced Ukomi superconductor can be rendered small enough for use in nano-factories, microscopic devices programmed to absorb and recycle ambient material into useful matter. Each factory is built from reactive metals, ensuring that they interact properly  or not at all  with their environment, while a mote of industrial explosive automatically destroys them when they have completed their task.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2372,550,'Angel Rogue','This is a fighter for the Arch Angels. It is protecting the assets of Arch Angels and may attack anyone it perceives as a threat or easy pickings. Threat level: Low',2250000,22500,75,1,2,NULL,0,NULL,NULL,31,344),(2373,314,'Broken Self-Harmonizing Power Core','With camera drones diligently monitoring the temperature, radioactivity, and electrical output of these advanced nuclear reactors, instant adjustments can be made to a dynamic, adaptive layer of hermetic membranes, which keeps the power core functioning safely at maximum capacity, with no human attention required whatsoever.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2374,314,'Broken Recursive Computing Module','Not all automated functions are delicate or complicated enough to warrant advanced computer hardware; relatively mundane tasks are best when assigned to an RCM bank. These sturdy, reliable processing units are able to effectively handle most of the day-to-day operations of stations, starships, and stargates.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2375,314,'Broken Broadcast Node','By integrating transcranial microcontrollers into a circuit made from synthetic synapses, the broadcast node is able to communicate directly with various station functions and with negligible signal loss and latency. The addition of computerized guidance systems, each running independent navigation system software routines, allows a single node to coordinate starship docking procedures, drone operations, and even station defenses.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2376,314,'Broken Integrity Response Drones','Hull breaches are a constant, serious threat during space travel, as well as a dangerous reality to orbital stations, which are too massive to avoid incoming objects. Integrity response drones help mitigate that threat by providing the automated, immediate application of sealants to any detected impact or pressure fracture in the structure they patrol.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2377,314,'Broken Wetware Mainframe','So advanced and energy-demanding are wetware mainframes that they require vehicle-scale power cores and the constant attention of maintenance personnel. When operating at peak performance levels, nothing in New Eden can match the raw computing power of these machines, from calculating warp coordinates to administrating the core functions of an entire space station.',0,100,0,1,NULL,25000.0000,1,20,3250,NULL,0),(2378,675,'Mysterious Shuttle','The only thing sensors can make out about this ship is that it has some kind of receiver that interacts with the star\'s natural magnetic field. There is one faint life sign, similar to a human in cryogenic stasis.',1600000,5000,10,1,1,NULL,0,NULL,NULL,NULL,317),(2379,572,'Serpentis Spy','This is a fighter for the Serpentis Corporation. It is protecting the assets of the Serpentis Corporation and may attack anyone it perceives as a threat or easy pickings. Threat level: Moderate',2500000,25000,60,1,8,NULL,0,NULL,NULL,31,1817),(2381,571,'Serpentis Chief Spy','This is a fighter for the Serpentis Corporation. It is protecting the assets of the Serpentis Corporation and may attack anyone it perceives as a threat or easy pickings. Threat level: Extreme',11600000,116000,900,1,8,NULL,0,NULL,NULL,31,1812),(2382,562,'Guristas Arrogator','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Very low',1500100,15001,45,1,1,NULL,0,NULL,NULL,31,1968),(2383,562,'Guristas Invader','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Moderate',2025000,20250,65,1,1,NULL,0,NULL,NULL,31,1832),(2384,562,'Guristas Imputor','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Low',1612000,16120,80,1,1,NULL,0,NULL,NULL,31,1827),(2385,562,'Guristas Despoiler','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Significant',2040000,20400,100,1,1,NULL,0,NULL,NULL,31,1828),(2386,562,'Guristas Plunderer','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: High',1970000,19700,125,1,1,NULL,0,NULL,NULL,31,1830),(2387,561,'Guristas Silencer','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Extreme',10700000,107000,850,1,1,NULL,0,NULL,NULL,31,1823),(2389,1042,'Plasmoids','In the early days of humanity\'s return to space flight, scientists Planto and Ginch co-discovered a self-sustaining natural structure made entirely from plasma suspended in a planetary magnetic field. Since then, the term has been applied to any such construct, whether occurring under normal conditions or produced artificially using electrical currents.',0,0.38,0,1,NULL,1.0000,1,1334,10017,NULL,0),(2390,1042,'Electrolytes','This conductive liquid is able to carry an electrical current due to its unique ionic properties, making it ideal for use as a reactive coolant, a high-energy fuel, or a transference medium for power plants.',0,0.38,0,1,NULL,1.0000,1,1334,10019,NULL,0),(2392,1042,'Oxidizing Compound','Converting various matter from its basic state to an oxidized form requires an oxidizing compound, the most effective of which is a powerful agent made from pressurized reactive gas. Special containers are required to keep the compound from causing significant damage to common metals and organic life.',0,0.38,0,1,NULL,1.0000,1,1334,10018,NULL,0),(2393,1042,'Bacteria','The term bacteria covers a wide, diverse family of unicellular microorganisms, from those found in almost every climate in New Eden to those that thrive in the bodies of other living beings. Though some bacteria are known to convey diseases, others are more helpful than harmful to humans.',0,0.38,0,1,NULL,1.0000,1,1334,10029,NULL,0),(2395,1042,'Proteins','One of the most basic components of biological life, proteins form the core DNA structure and are involved in almost every process that sustains a living being. Harvested at the microscopic level, proteins can be put to use in everything from medical genetics to nanite technology.',0,0.38,0,1,NULL,1.0000,1,1334,10031,NULL,0),(2396,1042,'Biofuels','The most widely used, renewable solid fuel in the cluster, biofuel production is present in some fashion on almost every inhabited world. A steady fuel source can be maintained in a planetary economy by converting living material directly into energy instead of relying on fossil fuels. ',0,0.38,0,1,NULL,1.0000,1,1334,10032,NULL,0),(2397,1042,'Industrial Fibers','The main difference between fibers used in industry and those created for civilian use is the trade-off of comfort for tensile strength and durability. This allows industrial fibers to be used in more severe environments, from electronic component shielding on hostile worlds to solar sails in the frigid void of space. ',0,0.38,0,1,NULL,1.0000,1,1334,10033,NULL,0),(2398,1042,'Reactive Metals','Very dense metals are often called reactive metals, as their ability to conduct electrical currents and absorb heat is unparalleled. Rarely found in a natural solid state, they are instead usually assembled on an atomic level from particulate matter found in other forms.',0,0.38,0,1,NULL,1.0000,1,1334,10020,NULL,0),(2399,1042,'Precious Metals','A cousin of noble metals, precious metals are named as such because of how infrequently they appear on terrestrial worlds where they were first encountered.',0,0.38,0,1,NULL,1.0000,1,1334,10021,NULL,0),(2400,1042,'Toxic Metals','Derived from heavy metals, toxic metals are those that have no biological function and are in fact poisonous to most living creatures.',0,0.38,0,1,NULL,1.0000,1,1334,10022,NULL,0),(2401,1042,'Chiral Structures','A chiral structure is a crystal that is unsymmetrical, which makes it volatile in some situations but ideal for conductivity, especially in micro-circuitry. Using semi-rare chiral structures in electronics has allowed for an unprecedented advancement in the field of miniaturization.',0,0.38,0,1,NULL,1.0000,1,1334,10023,NULL,0),(2403,1241,'Advanced Planetology','The advanced understanding of planet evolution allowing you to interpret data from scans of planets for resources at much higher resolutions.\n\nBonus: The skill further increases the resolution of resource data when scanning a planet to allow for very precise surveying.',0,0.01,0,1,NULL,7500000.0000,1,1823,33,NULL,0),(2404,509,'Light Missile Launcher II','Favored by many for its average capacity and firing rate. Useful in both fast attack raids and longer battles.\r\n',0,5,0.795,1,NULL,72806.0000,1,640,168,NULL,20098),(2405,136,'Light Missile Launcher II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,168,NULL,0),(2406,1241,'Planetology','The understanding of planet evolution allowing you to better interpret data from scans of planets for resources.\n\nBonus: The skill increases the resolution of resource data when scanning a planet to allow for more accurate surveying.',0,0.01,0,1,NULL,1000000.0000,1,1823,33,NULL,0),(2407,226,'The Terminus Stream','The material being ejected from this wormhole consists of hydrogen, oxygen, silicon, iron, and other materials usually only found in those states and frequency on terrestrial planets.',1,0,0,1,NULL,NULL,0,NULL,NULL,NULL,2907),(2409,1026,'Barren Aqueous Liquid Extractor','Finding desired liquids on hostile worlds can be almost as challenging a task as extracting it from the unforgiving environment, which often entails drilling kilometers below the surface or condensing fluids from the upper atmosphere. Once the liquids are discovered, the facility itself begins the relatively simple task of separating it from the ambient plasma interference, scalding magma streams, or potentially infectious indigenous bacteria. A surprising amount of valuable liquids can be extracted from hostile worlds, but only if the equipment is properly calibrated and carefully maintained.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4544),(2410,510,'Heavy Missile Launcher II','Designed for long engagements between medium sized ships. Slow firing rate, but makes up for it with a large missile capacity.',0,10,1.2,1,NULL,167560.0000,1,642,169,NULL,20082),(2411,136,'Heavy Missile Launcher II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,169,NULL,20082),(2412,1026,'Temperate Aqueous Liquid Extractor','Finding desired liquids on hostile worlds can be almost as challenging a task as extracting it from the unforgiving environment, which often entails drilling kilometers below the surface or condensing fluids from the upper atmosphere. Once the liquids are discovered, the facility itself begins the relatively simple task of separating it from the ambient plasma interference, scalding magma streams, or potentially infectious indigenous bac