  ',100,0.005,0,100,NULL,260.0000,1,922,1351,NULL,20057),(2515,166,'Inferno Rocket Blueprint','',1,0.01,0,1,NULL,40000.0000,1,318,1351,NULL,0),(2516,387,'Nova Rocket','A small rocket with a nuclear warhead.',100,0.005,0,100,NULL,180.0000,1,922,1353,NULL,20059),(2517,166,'Nova Rocket Blueprint','',1,0.01,0,1,NULL,50000.0000,1,318,1353,NULL,0),(2524,1027,'Barren Command Center','The modular design of this administrative structure allows it to be deployed piecemeal from orbit, then manually assembled on the surface by MTACs and engineering personnel. Supported by self-regulating pylons that follow the contours of indigenous terrain, the facility can accommodate almost any severity of incline or other non-critical geological hazard. Once active, it serves as both a central command post to coordinate the activity of all other nodes and a basic transportation site for getting commodities off world using standard, vertically launched rockets.',5000,1000,500,1,NULL,90000.0000,1,1322,NULL,NULL,4566),(2525,1027,'Oceanic Command Center','Several interconnected underwater buildings comprise the oceanic command center, which serves as the nervous system for node structures built on water worlds. Built on the ocean floor, this facility includes a thick umbilical that connects it to a communications pod floating on the surface, through which all interplanetary transmissions are sent and received. It also houses a basic two-stage pressurized rocket tube for getting people and cargo to the surface and thence off world into orbit.',5000,1000,500,1,NULL,90000.0000,1,1322,NULL,NULL,4567),(2528,353,'SpaceAnchor','This module does not exist.',0,0.01,0,1,NULL,NULL,0,NULL,1041,NULL,0),(2529,295,'Explosive Deflection Amplifier I','Boosts the explosive resistance of the shield.<br><br>Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,1,1690,20941,NULL,0),(2530,296,'Explosive Deflection Amplifier I Blueprint','',0,0.01,0,1,NULL,187420.0000,1,1554,82,NULL,0),(2531,295,'Explosive Deflection Amplifier II','Boosts the explosive resistance of the shield.<br><br>Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,1,1690,20941,NULL,0),(2532,296,'Explosive Deflection Amplifier II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,82,NULL,0),(2533,1027,'Ice Command Center','This command structure is designed to survive in the harshest planetary environments the universe can offer. The superstructure uses a combination of titanium-steel reinforcement, increasing its overall resilience, and counter-harmonic stabilizers, which keep it level and secure regardless of geological conditions or activity. The entire facility is covered by a skin of adaptive plating originally designed for terraforming platforms, a protective barrier that insulates it from the surrounding environment. Visitors can expect a prolonged and immodest decontamination and pressurization process when first arriving at the command structure. Valuable materials are lifted off world by a bulk payload, reusable rocket, the scattered components of which are retrieved by cargo drones.',5000,1000,500,1,NULL,90000.0000,1,1322,NULL,NULL,4568),(2534,1027,'Gas Command Center','Maintaining control over a section of territory above a gas giant requires a very specific type of command facility, one that is able to maintain its own orbit, house administrative personnel, and easily communicate and interact with other nodes. Suspended with equilibrium technology, these nodes are able to maintain altitude with minimal upkeep. If there is one major advantage to colonizing gas giant planets, it is that these facilities can literally be dropped directly from orbit with almost no concern for their descent or deployment.',5000,1000,500,1,NULL,90000.0000,1,1322,NULL,NULL,4569),(2535,1029,'Oceanic Storage Facility','Goods and commodities are stored on ocean planets in a similar fashion as on more habitable terrestrial planets. Even though most underwater industrial processes conventionally take place inside residential dome habitats, underwater silos, due to their sheer size, must be stored outside these domes and be able to withstand the immense pressures and environmental stresses at the ocean floor.',0,0,12000,1,NULL,250000.0000,1,NULL,NULL,NULL,4571),(2536,1029,'Gas Storage Facility','The problem of how to safely store mass quantities of harvested materials and assembled commodities until they can be transported to higher orbital facilities was difficult to solve. The issue was alleviated by the invention of the equilibrium cargo silo system, an arrangement of empty canisters suspended in a hollow chamber, which is then carefully filled with a specific type of common material from different strata of the host planet. The result has an effective net mass of zero kilograms, causing the facility to hang eerily at the exact desired altitude.',0,0,12000,1,NULL,250000.0000,1,NULL,NULL,NULL,4573),(2537,295,'Thermal Dissipation Amplifier I','Boosts the thermal resistance of the shield.<br><br>Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,1,1688,20940,NULL,0),(2538,296,'Thermal Dissipation Amplifier I Blueprint','',0,0.01,0,1,NULL,187420.0000,1,1554,82,NULL,0),(2539,295,'Thermal Dissipation Amplifier II','Boosts the thermal resistance of the shield.<br><br>Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,1,1688,20940,NULL,0),(2540,296,'Thermal Dissipation Amplifier II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,82,NULL,0),(2541,1029,'Barren Storage Facility','Barren environment storage units require a great amount of technology to be reliable and effective. The super structure is made from adaptive materials designed to withstand a wide range of extreme weather conditions, as barren planets have little to no atmosphere and are therefore prone to extreme climates. Likewise, each module of the structure is designed to store different states of matter, further compounding preservation and containment concerns.',0,0,12000,1,NULL,250000.0000,1,NULL,NULL,NULL,4570),(2542,1030,'Oceanic Launchpad','Despite being anchored to the ocean floor, the underwater launch pad is able to deliver and receive payloads from orbit via two separate mechanisms. First, a compressed gyrostabilized gas containment system provides the required pressure to propel a solid fuel rocket to the surface of the water, where it can achieve escape velocity under its own power. Secondly, the structure houses an automated drone bay capable of retrieving splash-down canisters deposited on the surface as well as recovering booster stages of export rockets for reuse.',0,0,10000,1,NULL,900000.0000,1,NULL,NULL,NULL,4561),(2543,1030,'Gas Launchpad','In order to transport produced commodities from the lower orbit position of the node structure to the higher orbit of spaceports and trade hubs above gas giant planets, an old but reliable technology was revisited. The lack of a solid surface requires a very low recoil launch system, a situation that prohibits the use of solid fuel rockets, but the Hohmann Mass Driver uses a series of triggered electromagnets instead, producing minimal waste force. Essentially an enormous cargo railgun, the device propels a ferrous canister to a waiting deceleration receptacle aboard a high-orbit facility.',0,0,10000,1,NULL,900000.0000,1,NULL,NULL,NULL,4563),(2544,1030,'Barren Launchpad','The barren launchpad is able to send and receive payloads from orbit. Because of the relatively calm atmospheric conditions of most barren planets, the primary focus of this facility is on interfacing effectively with adjacent facilities, allowing for passengers and commodities to be easily organized, scanned, and transported to the appropriate areas. The obvious importance of a centralized spaceport often leads to its becoming a focal point of local culture, including trade, entertainment, and even illegal activities.',0,0,10000,1,NULL,900000.0000,1,NULL,NULL,NULL,4559),(2545,295,'Kinetic Deflection Amplifier I','Boosts the kinetic resistance of the shield.<br><br>Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,1,1689,20939,NULL,0),(2546,296,'Kinetic Deflection Amplifier I Blueprint','',0,0.01,0,1,NULL,187420.0000,1,1554,82,NULL,0),(2547,295,'Kinetic Deflection Amplifier II','Boosts the kinetic resistance of the shield.<br><br>Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,1,1689,20939,NULL,0),(2548,296,'Kinetic Deflection Amplifier II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,82,NULL,0),(2549,1027,'Lava Command Center','This command structure is designed to survive in the harshest planetary environments the universe can offer. The superstructure uses a combination of titanium-steel reinforcement, increasing its overall resilience, and counter-harmonic stabilizers, which keep it level and secure regardless of geological conditions or activity. The entire facility is covered by a skin of adaptive plating originally designed for terraforming platforms, a protective barrier that insulates it from the surrounding environment. Visitors can expect a prolonged and immodest decontamination and pressurization process when first arriving at the command structure. Valuable materials are lifted off world by a bulk payload, reusable rocket, the scattered components of which are retrieved by cargo drones.',5000,1000,500,1,NULL,90000.0000,1,1322,NULL,NULL,4568),(2550,1027,'Storm Command Center','This command structure is designed to survive in the hars