Angels and The Serpentis Corporation. Even for its size, it has no commercial station services or docking bays to receive guests.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,NULL,20651),(2832,226,'Blood Raider Fortress','This gigantic suprastructure is one of the military installations of the Blood Raiders pirate corporation. Even for its size, it has no commercial station services or docking bay to receive guests.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,20190,2359),(2833,943,'1000 Aurum Token','This item can be redeemed for 1000 Aurum (AUR).<br><br><font color=\"yellow\">To Redeem:</font> Right-click the Aurum Token and select \"Redeem for AUR\".<br><br><font color=\"yellow\">On the Aurum Token:</font> Originally designed for Noble Appliances in YC 113, the aurum token is a physical chit that can be redeemed for a predefined amount of AUR currency.<br><br>Though at first blush it appears to be a large coin, the aurum token shares more in common with high-security datacores. At the center of the token is digital ID paired with a series of suspended entangled electrons. When the token is redeemed, the entangled electrons are engaged, altering their partners located at an off-site bank. Not only does this ensure the exchange occurs instantly, but when combined with a proprietary security shell it renders attempts to tamper or counterfeit the token useless.<br><br>Though the gold and silver case is merely an aesthetic addition, the coin-like appearance has become synonymous with the device, leading to nicknames of \"gold aurum\", or \"golden token\".<br><i>Source: SCOPE fluff piece (unprinted)</i>',0,0.01,0,1,NULL,NULL,1,1427,10831,NULL,0),(2834,324,'Utu','The Utu is a highly advanced drone platform specially commissioned for the 8th Alliance Tournament. While based on the Ishkur\'s design, this ship features design elements that go above and beyond the original blueprint.\r\n\r\nIn addition to revolutionary heat dispersion field projectors, the Utu is equipped with cutting-edge hardwired drone protocols and upgraded warp scrambling capability. Combined with the sturdy armor plating, these qualities make the Utu a powerful ally in any combat encounter.',1216000,29500,165,1,8,NULL,1,1623,NULL,20074,10005),(2835,105,'Utu Blueprint','',0,0.01,0,1,NULL,NULL,0,NULL,NULL,NULL,10005),(2836,358,'Adrestia','The Adrestia is a high-powered blaster platform specially commissioned for the 8th Alliance Tournament. While similar to its sister vessel the Deimos (on which its design was based), this ship nonetheless differs in some very important ways. Utilizing lightweight alloys and a prototype form of ion thruster, the Adrestia is capable of reaching truly mind-boggling speeds for a heavy assault vessel. While this makes it less sturdy than its predecessor, the lack of defensive plating is compensated for by state-of-the-art targeting systems, thoroughly optimized weapon hardpoints and upgraded warp scrambling capability. Don\'t let the lack of defense fool you; very few vessels out there can stand against the Adrestia toe to toe.\r\n\r\n',11100000,112000,440,1,8,NULL,1,1621,NULL,20072,10006),(2837,106,'Adrestia Blueprint','',0,0.01,0,1,NULL,74000000.0000,0,NULL,NULL,NULL,63),(2838,303,'Standard Cerebral Accelerator','Cerebral accelerators are military-grade boosters that significantly increase a new pilot\'s skill development. This technology is usually available only to naval officers, but CONCORD has authorized the release of a small number to particularly promising freelance capsuleers.<br><br>This booster primes the brain\'s neural pathways and hippocampus, making it much more receptive to intensive remapping. This allows new capsuleers to more rapidly absorb information of all kinds, and as a bonus also enhanced spatial processing abilities that are critical for weapons handling.<br><br>The only drawback to this booster is that capsuleer training renders it ineffective after a while; as such, it will cease to function for pilots who have been registered for more than 35 days.<br><br>\r\nBonuses: +3 to all attributes; +20% Damage to Laser, Projectile and Hybrid weaponry; +20% Rate of Fire to Missile weaponry.',1,1,0,1,NULL,32768.0000,1,NULL,10144,NULL,0),(2839,718,'Cerebral Accelerator Blueprint','',0,0.01,0,1,NULL,NULL,0,NULL,21,NULL,0),(2840,517,'Hasaziras Assa\'s Scorpion','A Scorpion piloted by Hasaziras Assa.',115000000,1040000,550,1,1,NULL,0,NULL,NULL,NULL,50),(2841,306,'Angel Officer\'s Quarters','The highest ranking personnel within this deadspace pocket reside here.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2515),(2842,226,'Serpentis Station','This gigantic station is one of the Serpentis military installations and a black jewel of the alliance between The Guardian Angels and The Serpentis Corporation. Even for its size, it has no commercial station services or docking bays to receive guests.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,NULL,20651),(2845,1056,'Outuni Mesen','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Outuni Mesen)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Primary roles are capacitor warfare and interdiction. Moderate microwarp velocity. Long range energy neutralizers. Long range warp disruption capabilities. Extreme long-range stasis webification support.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 120,000 civilian abductions from Outuni III and VI. The Mesen identifier suggests an oversight role amongst the other battleship-class prototypes, or alternatively, that it was created during the first phase of development.<br>\r\n<i>Synopsis from ISHAEKA-0061. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(2846,820,'Domination Excavator','<font color=yellow>Subject:</font> Domination Excavator (ID: Modified Cyclone)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Houses both advanced scientific and military technologies. <br>\r\n<font color=yellow>Additional Intelligence:</font>  Cartel forays beyond Angel territories have escalated each year since the discovery of wormhole space in YC 111. The Domination Excavator was first seen in one of these operations in 113. The ship itself contains a wide array of hi-tech defensive and offensive capabilities, including redundant power systems and a range of Domination modules. Large sections of crew quarters are converted to specialized lab space, able to perform on-site analysis of found materials. Plasma igniters ensure the labs are burned at temperatures exceeding 45000 Kelvin, should the vessel be captured.\r\n <i>Agent Trereval, <a href=showinfo:2// 1000054>Republic Security Services</a>.</i><br><i>Authorized for capsuleer dissemination.</i>',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,2921),(2847,820,'True Sansha Foreman','<font color=yellow>Subject:</font> True Sansha Foreman (ID: Modified Phantasm)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Modified for increased mining efficiency of local Slaves. <br>\r\n<font color=yellow>Additional Intelligence:</font> Pre-YC 113, the True Sansha Foreman variant was once a rare sight outside of the Sansha home region of Stain. As an alternative to capsuleer-dependent strip mining, the Foreman is specially designed to coordinate large crews of Slaves in a local deadspace pocket. Exact figures are difficult to determine, but mining Slaves under the Foreman seem to operate at around 125% efficiency. This link is both fragile and experimental. If the link is violently severed (i.e. the Foreman is destroyed), the affected Slaves in the mining equipment are damaged and unable to continue their work. <br>\r\n<i>Analyst Fawlon, <a href=showinfo:2//1000081>Ministry of Assessment</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2848,1063,'Barren Extractor Control Unit','Finding desired liquids on hostile worlds can be almost as challenging a task as extracting it from the unforgiving environment, which often entails drilling kilometers below the surface or condensing fluids from the upper atmosphere. Once the liquids are discovered, the facility itself begins the relatively simple task of separating it from the ambient plasma interference, scalding magma streams, or potentially infectious indigenous bacteria. A surprising amount of valuable liquids can be extracted from hostile worlds, but only if the equipment is properly calibrated and carefully maintained.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4544),(2850,306,'Suspicious Ship Wreck','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3115),(2851,314,'Incriminating Evidence','This evidence proves beyond the shadow of a doubt that foul play was involved.',5,1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(2852,226,'Sansha Cynosural Field','A cynosural field, also known colloquially as a \"cyno\", is a cosmic anomaly that acts as a pseudo-gravity well. With the correct calibration information, interstellar jump drives can lock onto the field and create a portal into the destination system.',1,0,0,1,NULL,NULL,0,NULL,NULL,NULL,2742),(2853,314,'Salvaged Electronics','These ship parts are old but functional.',10,20,0,1,NULL,NULL,1,NULL,3265,NULL,0),(2854,306,'Cloaked Cache','Rigged with a localized cloaking field, this small container is hidden from sensors while activated.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2431),(2855,1056,'Intaki Colliculus','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Intaki Colliculus)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Primary role is remote logistics support. Medium range shield transfer capabilities. Low microwarp velocity. Defensive systems have been significantly enhanced.<br>\r\n<font color=yellow>Additional Intelligence:</font> There were no reported civilian abductions from the invasion of Intaki  IV. The Intaki identifier is yet further evidence supporting the theory that not all abductees were accounted for.  The Colliculus identifier suggests the vessel plays a central role in the integration of various data throughout the Nation\'s greater network.<br>\r\n<i>Synopsis from ISHAEKA-0067. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(2856,226,'Forlorn Hope','This massive laboratory complex was once home to over 10,000 scientists, their staff and security personnel, working day and night to unravel the mysteries of Vitoc. Since the return of the Minmatar Elders and Otro Gariushi\'s bequest of Insorum to the Republic, the facility has largely fallen into disuse, but some few scientists cling on, pushing to finish what they started before they too seek more commercial roles.<br><br>For the most part, research continues inside the newer biodome nearby, but a few smaller laboratories and their staff still insist on basing out of the aging titan. ',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3114),(2858,226,'Osnirdottir Memorial','A small and humble memorial to the work of the late scientist Dr. Mishkala Osnirdottir, whose life was most likely lost when an experiment with the Tachyon Bombardment Array went horribly wrong. Others, however, theorize that she was not killed, but relocated, or in some way altered on a quantum level by the barrage of antimatter. <br>\r\nThe memorial gardens features great trees contorted into elegant shapes with tungsten scaffolds and the doctor\'s favourite bloom, Ulfurtar - a small parasitic plant with delicate silvery flowers, noted for the soft, almost furred quality of its petals. In many Sebiestor clans, the blossom is believed to symbolise both dreams and memories and the atmosphere of the gardens is rich with both for those that tend it still.',0,0,0,1,NULL,NULL,0,NULL,NULL,20,2782),(2859,1054,'Romi Thalamus','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Romi Thalamus)<br>\r\n<font color=yellow>Military Specifications:</font>  Cruiser-class vessel. Primary role is damage dealing. Moderate microwarp velocity.<br>\r\n<font color=yellow>Additional Intelligence:</font> There were no reported civilian abductions from the invasion of Romi III. The Romi identifier is yet further evidence that unreported abductees may have been incorporated into these new vessel prototypes, and into the Nation as a whole. The Thalamus identifier suggests a unifying role between the cruiser-class prototypes and other hull classes, similar to the Arnon Epithalmus. Notable is the higher number of known cruiser-class vessels, and that the identifiers of each belong to the forebrain. This pattern highlights a structural shift away from battleship-led squadrons, or at the least, an equality of function and responsibility between battleship and cruiser variants.<br>\r\n<i>Synopsis from ISHAEKA-0051. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2860,306,'The Seven Holding Cells','This temporary structure is made to house The Seven\'s hostages until they are ready to be transported to a more secure location.',10000,1200,1000,1,NULL,NULL,0,NULL,NULL,NULL,2518),(2861,314,'Crate of Manportable Electromagnetic Pulse Weapons','These EM beam weapons have been custom fitted to detect and eradicate specific nanotechnologies. Normally, these EMP devices are used by special operations personnel during covert operations. They are placed in proximity to the enemy\'s defense grid and used to short out any nearby electronics, thus creating a hole in the defense grid such that conventional forces can then move through unimpeded by sentry grids, security bots, and other lethal defensive systems. The devices themselves are approximately the size of a large rucksack and can be both emplaced and operated by a single trained individual. ',250,250,0,1,NULL,NULL,1,NULL,1362,NULL,0),(2862,314,'Special Forces Weapons and Equipment ','The weapons and equipment containers hold a wide variety of small arms and other equipment currently in use by the Caldari Navy Special Forces, much of it designed specifically for use in maritime environments. Some of the items that can be found in a typical container are long range sniper rifles, target designation lasers, silenced pistols, high tech diving equipment, limpet mines, covert communications gear, and individual diver propulsion devices. This equipment, as you might guess, is extremely valuable and cannot be found outside the armories of the Caldari Navy, with the exception of the very small quantities that have found their way onto the black market. ',25,25,0,1,NULL,NULL,1,NULL,1366,NULL,0),(2863,28,'Primae','The Primae is a repurposed ORE design intended to ease the task of extracting resources from planetbound environments. Initially devised as a deep space salvage vessel for large-scale ore retrieval from destroyed ORE fleets in pirate-occupied areas, its previous incarnation was made all but obsolete by the arrival of capsuleers on the interstellar scene. Realizing that the ship could, with a few minor modifications, be made into an efficient resource harvesting aid, ORE wasted no time in revamping the design.<br><br>A low signature radius (a holdover from its earlier manifestation) adds a layer of defense to the Primae\'s already decent plating. In addition, the ship\'s two large bays have been re-engineered to hold equipment for planetside resource extraction and processed materials, making it an especially useful complement to any planetside harvesting endeavor.',15000000,270000,100,1,128,1000.0000,1,1614,NULL,20066,10013),(2864,108,'Primae Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,NULL,NULL,0),(2865,55,'1200mm Artillery Cannon II','One of the most powerful projectile cannons a battleship can equip. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Quake, Tremor.',2000,20,1,1,NULL,1987540.0000,1,579,379,NULL,11277),(2866,135,'1200mm Artillery Cannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,379,NULL,0),(2867,1041,'Broadcast Node','By integrating transcranial microcontrollers into a circuit made from synthetic synapses, the broadcast node is able to communicate directly with various station functions and with negligible signal loss and latency. The addition of computerized guidance systems, each running independent navigation system software routines, allows a single node to coordinate starship docking procedures, drone operations, and even station defenses.',0,100,0,1,NULL,NULL,1,1337,10073,NULL,0),(2868,1041,'Integrity Response Drones','Hull breaches are a constant, serious threat during space travel, as well as a dangerous reality to orbital stations, which are too massive to avoid incoming objects. Integrity response drones help mitigate that threat by providing the automated, immediate application of sealants to any detected impact or pressure fracture in the structure they patrol.',0,100,0,1,NULL,NULL,1,1337,10074,NULL,0),(2869,1041,'Nano-Factory','Only the highly advanced Ukomi superconductor can be rendered small enough for use in nano-factories, microscopic devices programmed to absorb and recycle ambient material into useful matter. Each factory is built from reactive metals, ensuring that they interact properly  or not at all  with their environment, while a mote of industrial explosive automatically destroys them when they have completed their task.',0,100,0,1,NULL,NULL,1,1337,10075,NULL,0),(2870,1041,'Organic Mortar Applicators','While nanites are ideal for many forms of construction, sealing joints between large structural bulkheads is a job best left to organic mortar, a thick gel that actively permeates every microscopic gap between two parts. Due to the aggressive nature of the genetically engineered bacteria that intelligently guides into place the hardening condensate material, this paste is extremely hazardous to humans and must be applied by robots.',0,100,0,1,NULL,NULL,1,1337,10076,NULL,0),(2871,1041,'Recursive Computing Module','Not all automated functions are delicate or complicated enough to warrant advanced computer hardware; relatively mundane tasks are best when assigned to an RCM bank. These sturdy, reliable processing units are able to effectively handle most of the day-to-day operations of stations, starships, and stargates.',0,100,0,1,NULL,NULL,1,1337,10071,NULL,0),(2872,1041,'Self-Harmonizing Power Core','Camera drones diligently monitor temperature, radioactivity and electrical output of these advanced nuclear reactions. This allows instant adjustments that result in maximum efficiency. With such advanced automation, no human attention is required whatsoever.',0,100,0,1,NULL,NULL,1,1337,10078,NULL,0),(2873,55,'125mm Gatling AutoCannon II','This multi-barrel autocannon is designed for skirmish warfare. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',500,5,0.5,1,NULL,35400.0000,1,574,387,NULL,11303),(2874,135,'125mm Gatling AutoCannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,387,NULL,0),(2875,1041,'Sterile Conduits','Sustaining diverse populations of station inhabitants  many of whom come from different worlds with different ecologies  was a medical nightmare until the development of sterile conduits. Each length of flexible, self-repairing tube is powered by breaking down the chemical energy in the water they convey, which itself is laced with smart vaccines able to identify and destroy almost any known antigen.',0,100,0,1,NULL,NULL,1,1337,10079,NULL,0),(2876,1041,'Wetware Mainframe','So advanced and energy-demanding are wetware mainframes that they require vehicle-scale power cores and the constant attention of maintenance personnel. When operating at peak performance levels, nothing in New Eden can match the raw computing power of these machines, from calculating warp coordinates to administrating the core functions of an entire space station.',0,100,0,1,NULL,NULL,1,1337,10077,NULL,0),(2877,875,'Federation Freighter Vessel','The large navy forces of the Empires regularly use freighters to transport a wide variety of military items and personnel en masse.  Such vulnerable ships are usually heavily guarded as they traverse the space lanes.',1175000000,17550000,750000,1,8,NULL,0,NULL,NULL,NULL,2739),(2878,927,'Federation Industrial Vessel','Industrials are a common sight in the universe of EVE, connecting supply points to each other. Convoys usually have armed escorts, so attacking them is risky.',11750000,275000,6000,1,8,NULL,0,NULL,NULL,NULL,328),(2879,875,'Imperial Freighter Vessel','The large navy forces of the Empires regularly use freighters to transport a wide variety of military items and personnel en masse.  Such vulnerable ships are usually heavily guarded as they traverse the space lanes.',1125000000,18500000,735000,1,4,NULL,0,NULL,NULL,NULL,2738),(2880,314,'Unknown Dead','This contingent of Federation pilots and soldier went missing during the first Caldari Gallente war. They\'ve been preserved by the cold but they are still in a delicate state, and must be handled with care.',80,1,0,1,NULL,NULL,1,NULL,2855,NULL,0),(2881,55,'150mm Light AutoCannon II','A simple but effective close combat autocannon. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',500,5,0.4,1,NULL,74212.0000,1,574,387,NULL,11305),(