,2038,NULL,0),(2901,306,'Science Vessel Wreck','The remnants of a science ship lost recently.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,3115),(2902,319,'Deactivated Acceleration Gate','This acceleration gate has been locked down and is not usable by the general public.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,2341),(2903,952,'Manager\'s Station','This upscale estate probably serves as a swank bachelor pad when the manager isn\'t entertaining clients.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,14,1712),(2904,314,'Quantum Entanglement','This heavy metal rock opera band was made famous by their first album\'s cover, which depicted two naked individuals engaging in sexual intercourse while floating in space without spacesuits. Gallente politicians tried to have the album, called \"Unprotected,\" banned. Not because of the adult content, they claimed, but because it promoted unsafe extravehicular activities.',400,10,0,1,NULL,NULL,1,NULL,1204,NULL,0),(2905,55,'250mm Light Artillery Cannon II','This artillery is one of the most powerful weapons that can be mounted on a frigate. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Quake, Tremor.',500,5,0.1,1,NULL,132664.0000,1,577,389,NULL,11285),(2906,135,'250mm Light Artillery Cannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,389,NULL,0),(2907,1053,'Schmaeel Medulla','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Schmaeel Medulla)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Primary roles are interdiction and frigate support. Fastest microwarp velocity of all known Nation frigate prototypes. Long range warp disruption capabilities. Long range stasis webifier support. Limited weapons systems.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 1,000,000 civilian abductions from Schmaeel VI. The Medulla identifier suggests a limited role in the larger Nation hierarchy, and that the Schmaeel captives are tasked with more basic, mechanical responsibilities.<br>\r\n<i>Synopsis from ISHAEKA-0045. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>\r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1237),(2909,1053,'Niarja Myelen','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Niarja Myelen)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Primary role is long range ECM support and medium-range energy warfare. Moderate microwarp velocity. No known weapons systems.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 70,000 civilian abductions from Niarja VII. The Myelen   identifier suggests a developmental state. Other, more advanced Nation prototypes may have originated from this design.<br>\r\n<i>Synopsis from ISHAEKA-0039. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1238),(2910,226,'Gallente Passenger Liner Wreckage','This ship has seen better days. Parts of it are missing, looking as though the ship was torn apart. There are no signs of life inside, though. ',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,3087),(2911,306,'Gallente Passenger Liner Damaged','This passenger liner has seen better days, but it\'s still operational. The ship is anchored to its spot with large, magnetic beacons around the bottom of its hull.',1000000,100000000,8850,1,NULL,NULL,0,NULL,NULL,NULL,3087),(2912,526,'Minmatar Pilot\'s Corpse','Some Minmatar feel the Republic\'s status quo is not sufficient to avenge victims of Amarrian enslavement, nor to liberating those still trapped under Imperial rule. This unfortunate figure learned a terminal lesson in the necessities of political balance.',80,1,0,1,NULL,NULL,1,NULL,2855,NULL,0),(2913,55,'425mm AutoCannon II','The 425mm is a behemoth that will inflict severe damage on most cruisers and frigates in short-range battles. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',1000,10,1.5,1,NULL,373210.0000,1,575,386,NULL,11301),(2914,135,'425mm AutoCannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,386,NULL,0),(2915,319,'Auxiliary Academic Campus','A standard, customizable, space-faring  structure designed to be easily moved and deployed.  This one has been configured for early childhood education.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,2372),(2916,706,'Rogue Minmatar','This loose cannon is piloting an experimental stealth ship and has begun a personal war against the Amarr Empire.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,3355),(2917,314,'Survivors','These rattled individuals move with languid motions. It looks like some of them have gone weeks without food.',50,50,0,1,NULL,NULL,1,NULL,2545,NULL,0),(2918,306,'Cell Block D','A maximum-security prison block and run by the Gallente Federation. ',1000000,1150,8850,1,NULL,NULL,0,NULL,NULL,NULL,2458),(2919,283,'Caldari Operative','An operative of the Caldari State.',60,0.1,0,1,NULL,NULL,1,NULL,2538,NULL,0),(2921,55,'650mm Artillery Cannon II','A powerful long-range cannon. One of the most damaging weapons mountable on a cruiser. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Quake, Tremor.',125,10,0.5,1,NULL,436976.0000,1,578,384,NULL,11281),(2922,135,'650mm Artillery Cannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,384,NULL,0),(2926,226,'Serpentis Slave Transport','A Serpentis cargo ship loaded with people.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,NULL,328),(2927,226,'Fortified Deadspace Particle Accelerator','The science allowed by zero gravity can be as mind-boggling as it is beautiful, as demonstrated by this particle accelerating superstructure.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,2069),(2928,226,'Fortified Asteroid Colony','Highly vulnerable, but economically extremely feasible, asteroid factories are one of the major boons of the expanding space industry.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,1991),(2929,55,'800mm Repeating Cannon II','A two-barreled, intermediate-range, powerful cannon capable of causing tremendous damage. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',75,20,3,1,NULL,1484776.0000,1,576,381,NULL,11295),(2930,314,'Crate of Special Forces Weapons and Equipment','The weapons and equipment containers hold a wide variety of small arms and other equipment currently in use by the Caldari Navy Special Forces, much of it designed specifically for use in maritime environments. Some of the items that can be found in a typical container are long range sniper rifles, target designation lasers, silenced pistols, high tech diving equipment, limpet mines, covert communications gear, and individual diver propulsion devices. This equipment, as you might guess, is extremely valuable and cannot be found outside the armories of the Caldari Navy, with the exception of the very small quantities that have found their way onto the black market. ',250,250,0,1,NULL,NULL,1,NULL,1366,NULL,0),(2931,1054,'Mara Paleo','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Mara Paleo)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Primary role is long range remote shield transfer. Vessel has been enhanced with significant microwarp velocity to aid in this responsibility. Reconfiguring the vessel for a logistics role has notably weakened its defensive systems, however. <br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 15,000 civilian abductions from Mara IV. The Paleo identifier suggests a role that is fundamental in nature, which would be congruent with its function as logistics support. <br>\r\n<i>Synopsis from ISHAEKA-0057. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2932,1056,'Ostingele Tectum','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Ostingele Tectum)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. The third most powerful vessel amongst the new Nation prototypes in terms of potential damage output. Moderate microwarp velocity. Defensive systems have been significantly enhanced.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 2,000,000 civilian abductions from Ostingele IV. The Tectum identifier suggests a basic input-response role, with little to no shared computing power required for standard operations. Probable relations to the Deltole Tegmentum prototype.<br>\r\n<i>Synopsis from ISHAEKA-0063. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>    \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(2933,1056,'Deltole Tegmentum','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Deltole Tegmentum)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Primary roles are strong offensive power, target painting, energy warfare and long range interdiction. The second most powerful vessel amongst the new Nation prototypes in terms of potential damage output. Moderate microwarp velocity. Long range warp disruption capabilities. Long range target painting. Short range capacitor neutralization.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 450,000 civilian abductions from Deltole I. The Tegmentum identifier suggests that this vessel serves a foundational role for the other battleship-class variants, most likely in terms of design origin. The multitude of tactical capabilities present in this vessel\'s design lend support to the theory that it was a test bed for a variety of Nation developments ahead of their applications in other vessel types.<br>\r\n<i>Synopsis from ISHAEKA-0065. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i> \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(2934,314,'Counterfeit Voluval Tattoo Chemicals','A complex chemical formula for use in a traditional Minmatar ceremony. This batch is labeled with Amarr markings.',20,20,0,1,NULL,NULL,1,NULL,1207,NULL,0),(2935,1056,'Yulai Crus Cerebi','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Yulai Crus Cerebi)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Primary role is long-range sniping support. Low microwarp velocity. Vessel will attempt to establish orbit ranges in excess of 100km. <br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 430,000 civilian abductions from Yulai. The Crus Cerebi identifier suggests a connective role between this vessel and others, possibly even non-Nation crafts. Attempts at short-wave information capture have demonstrated the futility of further efforts. Although the data passing through this vessel and other conduit-like variants can be intercepted, the encryption is still years away from being broken.<br>\r\n<i>Synopsis from ISHAEKA-0069. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(2936,1054,'Auga Hypophysis','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Auga Hypophysis)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Primary damage dealer amongst cruiser prototypes. Limited interdiction. Short range warp scrambling capabilities. Short range stasis webification support.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 300,000 civilian abductions from Auga II. The Hypophysis identifier suggests either a coordinating role between this vessel and other cruiser-class variants, or perhaps a regulatory role similar to the Tama Cerebellum.<br>\r\n<i>Synopsis from ISHAEKA-0053. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i> \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(2937,55,'Dual 180mm AutoCannon II','This dual 180mm autocannon is a simple but effective close combat weapon. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',1000,10,2.5,1,NULL,220508.0000,1,575,386,NULL,11297),(2938,135,'Dual 180mm AutoCannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,386,NULL,0),(2939,1053,'Tama Cerebellum','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Tama Cerebellum)<br>\r\n<font color=yellow>Military Specifications:</font>  Frigate-class vessel. Primary role is to support Nation vessels against larger hulls. Moderate microwarp velocity. Long range torpedo fire support. Prioritizes large vessels as targets.<br>\r\n<font color=yellow>Additional Intelligence:</font>  Est. 100,000 civilian abductions from Tama V. The Cerebellum identifier suggests a regulatory role amongst other frigate-class variants.<br>\r\n<i>Synopsis from ISHAEKA-0037. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>\r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1238),(2942,283,'Captured CEO','Life isn\'t always comfortable when you\'re at the top, particularly in the Caldari State. Guristas will ransom you, other corporations will backstab you, and the moment someone can buy the rug out from underneath you, they will. With all the ISK that comes with these responsibilities, most CEOs can buy enough happiness to forget about these troubles. Forgetting, though, isn\'t always the best investment. ',130,3,0,1,NULL,1000.0000,1,NULL,2538,NULL,0),(2943,314,'Hybrid Slaver Hounds','Hybrid slaver hounds have been genetically engineered by Amarr veterinary scientists as variants of the original breed. These animals are designed specifically to live and work in the harshest environments, including deserts, swamps, mountains, frozen tundra, and other extreme locations. These variations are typically easy to differentiate from the original breed, in that they can be much larger and have fur colorations that are genetically tailored to blend in to their environments. ',28,20,0,1,NULL,NULL,1,NULL,1180,NULL,0),(2944,314,'Kennel of Hybrid Slaver Hounds','Hybrid slaver hounds have been genetically engineered by Amarr veterinary scientists as variants of the original breed. These animals are designed specifically to live and work in the harshest environments, including deserts, swamps, mountains, frozen tundra, and other extreme locations. These variations are typically easy to differentiate from the original breed, in that they can be much larger and have fur colorations that are genetically tailored to blend in to their environments. ',280,200,0,1,NULL,NULL,1,NULL,1180,NULL,0),(2945,55,'Dual 425mm AutoCannon II','Combines the damage output of two 425mm intermediate-range autocannons. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',200,20,5,1,NULL,605200.0000,1,576,381,NULL,11291),(2946,135,'Dual 425mm AutoCannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,381,NULL,0),(2947,1010,'Compact Shade Torpedo','Representing the latest in miniaturization technology, Compact XL Torpedoes are designed specifically to be used by Fighter Bombers.\n\nFitted with a graviton pulse generator, this weapon causes massive damage as it overwhelms ships\' internal structures, tearing bulkheads and armor plating apart with frightening ease.',1500,0.3,0,100,NULL,300000.0000,0,NULL,1346,NULL,0),(2948,1653,'Shadow','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Shadow)<br>\r\n<font color=yellow>Military Specifications:</font> Heavy Fighter class vessel. Moderate microwarp velocity. Enhanced weapons systems. Reverse-engineering has been made possible through salvage of specific Sansha\'s Nation vessels.<br>\r\n<font color=yellow>Additional Intelligence:</font> At this initial stage conclusions are hard to form, but early indications from the recovery of three individual bomber pilots  all of them heavily augmented  strongly indicates that these crew members are the same planetary abductees found in other Nation prototype vessels. Cross-referencing recovered DNA with missing persons reports has so far revealed little, though even at this stage the origin of these pilots is in little doubt.<br>\r\n<i>Synopsis from ISHAEKA-0107. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',2000,1800,0,1,NULL,20336332.0000,1,1310,NULL,NULL,10039),(2949,1145,'Shadow Blueprint','',0,0.01,0,1,NULL,300000000.0000,1,NULL,NULL,NULL,0),(2950,1054,'Lirsautton Parichaya','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID:Lirsautton Parichaya)<br>\r\n<font color=yellow>Military Specifications:</font> Fighter bomber-class vessel. Moderate microwarp velocity. Enhanced weapons systems. <br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 1,905,000 civilian abductions from Lirsautton V. The Parichaya identifier is unclear: it has no known etymological origins or direct translations.<br>\r\n<i>Synopsis from ISHAEKA-0071. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',12000,5000,1200,1,4,NULL,0,NULL,NULL,31,10039),(2951,314,'Large Crate of Improved Inertial Compensation Systems','The internal components of smaller Minmatar ships are constructed largely of nanofiber mesh which is low-cost, low-mass, and has a lower heat-conduction threshold than most solid industrial sheeting. Unfortunately, the lightweight structures are also susceptible to stress from the high-velocity maneuvers performed by frigate and interceptor pilots, and require added inertial compensation systems and routine inspections.',100,100,0,1,NULL,NULL,1,NULL,3196,NULL,0),(2952,314,'Crate of Unidentified Fibrous Compound','These pieces of blue-green compound feel slick and oily to the touch and leave a tingle in your fingers. Fine crystalline filaments within crisscross and refract the light so that each piece seems to glow from within.',10,10,0,1,NULL,NULL,1,NULL,2210,NULL,0),(2953,55,'Dual 650mm Repeating Cannon II','Powerful, intermediate-range repeating autocannon with a decent rate of fire. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',2000,20,4,1,NULL,1109234.0000,1,576,381,NULL,11293),(2954,135,'Dual 650mm Repeating Cannon II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,381,NULL,0),(2955,314,'Large Crate of Unidentified Fibrous Compound','These pieces of blue-green compound feel slick and oily to the touch and leave a tingle in your fingers. Fine crystalline filaments within crisscross and refract the light so that each piece seems to glow from within.',100,100,0,1,NULL,NULL,1,NULL,2210,NULL,0),(2956,314,'Large Crate of Refurbished Mining Drones','There are hints of rusty and damaged surfaces beneath the shiny new paint-job. These may not work as efficiently as the client wishes.',100,100,0,1,NULL,NULL,1,NULL,1084,NULL,0),(2957,314,'Crate of Refurbished Mining Drones','There are hints of rusty and damaged surfaces beneath the shiny new paint-job. These may not work as efficiently as the client wishes.',10,10,0,1,NULL,NULL,1,NULL,1084,NULL,0),(2958,283,'Civilian SIGINT Contractors','These contractors, many of whom are former Caldari Navy intelligence operatives, are very well trained, experienced, and possess high level security clearances, making them extremely valuable investments for their employer. Their skill sets are varied, but include translation (primarily Gallente), covert signals interception, military and economic intelligence analysis, and supercomputer systems administration. ',30,30,0,1,NULL,NULL,1,NULL,2537,NULL,0),(2959,283,'Group of Civilian SIGINT Contractors','These contractors, many of whom are former Caldari Navy intelligence operatives, are very well trained, experienced, and possess high level security clearances, making them extremely valuable investments for their employer. Their skill sets are varied, but include translation (primarily Gallente), covert signals interception, military and economic intelligence analysis, and supercomputer systems administration. ',300,300,0,1,NULL,NULL,1,NULL,2537,NULL,0),(2960,314,'Spools of Quantrium Wiring','While the universe is full of metals of all shapes, sizes, and compositions, there are some metals that are of such rarity and quality that they command prices far beyond those of the more easily accessible metals, such as tritanium. Amongst these, the very small quantities of a rare metal called quantrium are among the most valuable. This metal can only be found in the polar regions of certain moons, and these only in systems that meet very specific astrogeological conditions. So rare is this metal that, to date, only two known moons have quantities of this metal sufficient to warrant the very expensive mining and refining equipment required to extract it. Both of these moons are in Caldari space, giving the State a monopoly on its production and sale. Currently, all processed quantrium is on long-term contract to Kaalakiota Corporation. While rumors occasionally surface that one or more of the other three races have discovered quantrium, this has not been verified.',300,300,0,1,NULL,NULL,1,NULL,1363,NULL,0),(2961,55,'1400mm Howitzer Artillery II','The ultimate artillery cannon. It hurls death and destruction over incredible distances. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Quake, Tremor.',2000,20,0.5,1,NULL,2320888.0000,1,579,379,NULL,11279),(2962,135,'1400mm Howitzer Artillery II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,379,NULL,0),(2963,314,'Quantrium Wiring','While the universe is full of metals of all shapes, sizes, and compositions, there are some metals that are of such rarity and quality that they command prices far beyond those of the more easily accessible metals, such as tritanium. Amongst these, the very small quantities of a rare metal called quantrium are among the most valuable. This metal can only be found in the polar regions of certain moons, and these only in systems that meet very specific astrogeological conditions. So rare is this metal that, to date, only two known moons have quantities of this metal sufficient to warrant the very expensive mining and refining equipment required to extract it. Both of these moons are in Caldari space, giving the State a monopoly on its production and sale. Currently, all processed quantrium is on long-term contract to Kaalakiota Corporation. While rumors occasionally surface that one or more of the other three races have discovered quantrium, this has not been verified.',30,30,0,1,NULL,NULL,1,NULL,1363,NULL,0),(2964,314,'Aerogel Counteragent','Refrigerated secure cargo containers containing aerogel infused with dormant prototype anti-nanites. These containers have been specially modified with the latest security encryption protocols, to better ensure that any Gallente saboteurs will be unable to access and tamper with this critical cargo.',30,30,0,1,NULL,NULL,1,NULL,1173,NULL,0),(2965,314,'Crate of Aerogel Counteragent','Refrigerated secure cargo containers containing aerogel infused with dormant prototype anti-nanites. These containers have been specially modified with the latest security encryption protocols, to better ensure that any Gallente saboteurs will be unable to access and tamper with this critical cargo.',300,300,0,1,NULL,NULL,1,NULL,1173,NULL,0),(2966,1053,'Eystur Rhomben','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Eystur Rhomben)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Significant microwarp velocity. Enhanced weapons systems.<br>\r\n<font color=yellow>Additional Intelligence:</font> There were no reported civilian abductions from the Eystur VI invasion. The Eystur identifier suggests a small number of captives may have been initially unaccounted for. The Rhomben identifier suggests an overarching position within the lowest tier of the new Nation hierarchy, or alternatively, that it was created during the first phase of development.<br>\r\n<i>Synopsis from ISHAEKA-0041. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1237),(2967,314,'Crate of Target Painter Deflection Plating','These hull plates are coated with a layer of crystalline structures under a protective transparent enamel. The crystalline layer shimmers reflectively and creates mirage halos around the plate when spot lights are directed at it.',10,10,0,1,NULL,NULL,1,NULL,2192,NULL,0),(2968,314,'Large Crate of Target Painter Deflection Plating','These hull plates are coated with a layer of crystalline structures under a protective transparent enamel. The crystalline layer shimmers reflectively and creates mirage halos around the plate when spot lights are directed at it.',100,100,0,1,NULL,NULL,1,NULL,2192,NULL,0),(2969,55,'720mm Howitzer Artillery II','This 720mm rocket-assisted howitzer is designed for long-range bombardment. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Quake, Tremor.',50,10,0.25,1,NULL,517456.0000,1,578,384,NULL,11283),(2970,135,'720mm Howitzer Artillery II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,384,NULL,0),(2971,314,'Group of Haakar\'s Striking Hawks','Haakar is a small, unassuming woman in her 40s who wields discipline like a whip. The men and women who follow her command  her Striking Hawks mercenary group  all served with or under her in the Republic Infantry\'s 203rd Tactical Recon before the company was made redundant by policy changes fifteen years ago. Haakar bears a grudge against bureaucracy for cutting short her career, but says her work now gives her professional satisfaction and an autonomy she enjoys.',1000,10,0,1,NULL,NULL,1,NULL,2544,NULL,0),(2972,314,'Ditanium Metal Plates','Refrigerated secure cargo containers containing aerogel infused with dormant prototype anti-nanites. These containers have been specially modified with the latest security encryption protocols, to better ensure that any Gallente saboteurs will be unable to access and tamper with this critical cargo.',30,30,0,1,NULL,NULL,1,NULL,1173,NULL,0),(2973,314,'Pallet of Ditanium Metal Plates','Refrigerated secure cargo containers containing aerogel infused with dormant prototype anti-nanites. These containers have been specially modified with the latest security encryption protocols, to better ensure that any Gallente saboteurs will be unable to access and tamper with this critical cargo.',300,300,0,1,NULL,NULL,1,NULL,1173,NULL,0),(2974,314,'Large Group of The Hooded Men','Unlike most pro-Minmatar mercenary companies, members of The Hooded Men come from every empire and any background; they are selected for their convictions and skills rather than any sense of patriotism they might possess. Even Amarr are permitted to join, provided they can prove that the company means more to them than their religion. The Hooded Men\'s founder, Jolmiar Maritak, the grandson of former slaves who fled to the Gallente Federation, places emphasis on getting their work done quietly and with a minimum of fuss. ',100,100,0,1,NULL,NULL,1,NULL,2544,NULL,0),(2975,283,'Arctic Warfare Marines','Arctic Warfare Marines are the Caldari State\'s elite foot soldiers for winter warfare. On the case of ice planets, where the weather is comprised of year-round snow and ice, you can find these self-sufficient Marines operating in a wide variety of roles, such as providing security for Caldari corporate facilities, military bases, and even for long-range reconnaissance on planets that have not yet been fully scouted. Their equipment is tailored specifically to harsh, sub-zero weather conditions, to include specialty rifles, thermal grenades, cold-weather speeder bikes, and everything in between. ',32,32,0,1,NULL,50000.0000,1,NULL,2549,NULL,0),(2976,283,'Arctic Warfare Marine Squads','Arctic Warfare Marines are the Caldari State\'s elite foot soldiers for winter warfare. On the case of ice planets, where the weather is comprised of year-round snow and ice, you can find these self-sufficient Marines operating in a wide variety of roles, such as providing security for Caldari corporate facilities, military bases, and even for long-range reconnaissance on planets that have not yet been fully scouted. Their equipment is tailored specifically to harsh, sub-zero weather conditions, to include specialty rifles, thermal grenades, cold-weather speeder bikes, and everything in between. ',320,320,0,1,NULL,50000.0000,1,NULL,2549,NULL,0),(2977,55,'280mm Howitzer Artillery II','Rocket-assisted artillery projectiles designed for long-range combat. It is the most powerful projectile weapon able to be fitted onto frigates. \r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Quake, Tremor.',500,5,0.05,1,NULL,1976.0000,1,577,389,NULL,11287),(2978,135,'280mm Howitzer Artillery II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,389,NULL,0),(2979,314,'Crate of Industrial-Grade Tritanium-Alloy Scraps','Not all scrap-metal is of good enough quality to be reused in the shipbuilding industry. These are the highest quality to be found in the scrap-heaps and abandoned battlegrounds of New Eden. Some pieces still bear signs of what they were once a part of: a sheet of tinted plating here, a painted logo there. Some pieces are still recognizable, others are half-slagged and warped. ',10,10,0,1,NULL,NULL,1,NULL,2529,NULL,0),(2980,314,'Large Crate of Industrial-Grade Tritanium-Alloy Scraps','Not all scrap-metal is of good enough quality to be reused in the shipbuilding industry. These are the highest quality to be found in the scrap-heaps and abandoned battlegrounds of New Eden. Some pieces still bear signs of what they were once a part of: a sheet of tinted plating here, a painted logo there. Some pieces are still recognizable, others are half-slagged and warped. ',100,100,0,1,NULL,NULL,1,NULL,2529,NULL,0),(2981,314,'Crate of Architectural-Quality Plagioclase Paneling','Minmatar architecture traditionally favors modular geometric structures and open spaces which allow breezes to flow from room to room. There is a traditional preference for working with exposed natural stone and wood, though recent trends have leaned towards natural surfaces bonded to structural reinforced concrete, stretching resources while still allowing for an attractive appearance. Compressed asteroid ore interior panels are becoming more popular for higher-class residences and for buildings constructed on mineral-poor worlds.',10,10,0,1,NULL,NULL,1,NULL,3320,NULL,0),(2982,314,'Large Crate of Architectural-Quality Plagioclase Paneling','Minmatar architecture traditionally favors modular geometric structures and open spaces which allow breezes to flow from room to room. There is a traditional preference for working with exposed natural stone and wood, though recent trends have leaned towards natural surfaces bonded to structural reinforced concrete, stretching resources while still allowing for an attractive appearance. Compressed asteroid ore interior panels are becoming more popular for higher-class residences and for buildings constructed on mineral-poor worlds.',100,100,0,1,NULL,NULL,1,NULL,3320,NULL,0),(2983,283,'Corporate Assassin','An elite corporate assassin, whose services are available usually only to the wealthiest and most discreet clientele. His track record of killings reaches far beyond Caldari space, with known hits recorded as far away as the Amarr and Gallente homeworlds. His weapon of choice is a highly-modified laser sniper rifle that he has proven effective at ranges up to and including three kilometers. Of course, he also utilizes a variety of other weapons, particularly for close range work. These include untraceable poisons, obscure neurotoxins, and, a variety of small arms and knives all, again, highly customized. He has a unblemished kill record, with no known failures, over a period of at least the last 20 years. When ultra-wealthy corporate executives require a more direct response to individuals who threaten their company\'s profitability, this is one of the few contract killers than can actually be trusted not only to accomplish the most difficult missions, but also to keep any such business dealings to himself. In short, he knows how to keep his mouth shut. These factors make him a highly desirable contractor for tasks requiring his unique skill set. ',200,30,0,1,NULL,100.0000,1,NULL,2539,NULL,0),(2984,283,'Deep Cover Corporate Assassin','An elite corporate assassin, whose services are available usually only to the wealthiest and most discreet clientele. His track record of killings reaches far beyond Caldari space, with known hits recorded as far away as the Amarr and Gallente homeworlds. His weapon of choice is a highly-modified laser sniper rifle that he has proven effective at ranges up to and including three kilometers. Of course, he also utilizes a variety of other weapons, particularly for close range work. These include untraceable poisons, obscure neurotoxins, and, a variety of small arms and knives all, again, highly customized. He has a unblemished kill record, with no known failures, over a period of at least the last 20 years. When ultra-wealthy corporate executives require a more direct response to individuals who threaten their company\'s profitability, this is one of the few contract killers than can actually be trusted not only to accomplish the most difficult missions, but also to keep any such business dealings to himself. In short, he knows how to keep his mouth shut. These factors make him a highly desirable contractor for tasks requiring his unique skill set. ',200,300,0,1,NULL,100.0000,1,NULL,2539,NULL,0),(2985,53,'Dual Heavy Beam Laser II','This heavy beam laser uses two separate laser focusing systems to reduce the cool down period between shots. A great weapon for medium to long range encounters. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Aurora, Gleam.',2000,20,1,1,NULL,NULL,1,569,361,NULL,11189),(2986,133,'Dual Heavy Beam Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,361,NULL,0),(2987,314,'Crate of Harvester Components','Agricultural technology, like everything else, is constantly advancing, with developments in irrigation techniques and automated systems to do the work of several farm-hands at a fraction of the overall cost. Most parts are produced on stations rather than planetside in order to reduce the cost of shipping. It also makes disposing of the more hazardous byproducts much safer, reducing the risk of planetary pollution. ',10,10,0,1,NULL,NULL,1,NULL,1186,NULL,0),(2988,314,'Large Crate of Harvester Components','Agricultural technology, like everything else, is constantly advancing, with developments in irrigation techniques and automated systems to do the work of several farm-hands at a fraction of the overall cost. Most parts are produced on stations rather than planetside in order to reduce the cost of shipping. It also makes disposing of the more hazardous byproducts much safer, reducing the risk of planetary pollution. ',100,100,0,1,NULL,NULL,1,NULL,1186,NULL,0),(2989,314,'Decoy Prototype Cloaking Devices','This decoy prototype cloaking device appears to be a working model; however, closer scrutiny reveals that it is nothing more than a useless hunk of metal and wires. ',60,60,0,1,NULL,NULL,1,NULL,2106,NULL,0),(2990,314,'Crate of Decoy Prototype Cloaking Devices','This decoy prototype cloaking device appears to be a working model; however, closer scrutiny reveals that it is nothing more than a useless hunk of metal and wires. ',500,500,0,1,NULL,NULL,1,NULL,2106,NULL,0),(2991,314,'Crate of Amarr Scripture Educational Study Packages (Matari translation)','These study materials provide a guide through the structure and meanings of Amarr holy texts in a way that school-age children can easily understand. Education, like every other aspect of daily life in the Empire, is closely tied into religion, and by the time they leave school, Amarr children are expected to have a working and in-depth understanding of their way of life.<br><br>\r\nThese particular copies have been carefully translated by experts into painfully precise Matari for distribution in the Republic.',10,10,0,1,NULL,NULL,1,NULL,33,NULL,0),(2992,314,'Large Crate of Amarr Scripture Educational Study Packages (Matari translation)','These study materials provide a guide through the structure and meanings of Amarr holy texts in a way that school-age children can easily understand. Education, like every other aspect of daily life in the Empire, is closely tied into religion, and by the time they leave school, Amarr children are expected to have a working and in-depth understanding of their way of life.<br><br>\r\nThese particular copies have been carefully translated by experts into painfully precise Matari for distribution in the Republic.',100,100,0,1,NULL,NULL,1,NULL,33,NULL,0),(2993,53,'Dual Light Beam Laser II','This light beam laser uses two separate laser focusing systems to reduce the cool down period between shots. Good short to medium range weapon. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Aurora, Gleam.',500,5,1,1,NULL,NULL,1,567,352,NULL,11201),(2994,133,'Dual Light Beam Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,352,NULL,0),(2995,314,'Blue Paradise','Blue Paradise, also known as Beep, is a mild narcotic engineered by Amarr pharmaceutical scientists specifically for use by slave laborers within the Empire. Users of Blue Paradise report feelings of mild euphoria, contentment, relaxation, and generalize pleasure as the primary effects of this drug. These effects typically last between three to five hours, after which the user can be expected to fall into a sound sleep, if taken prior to that user\'s normal sleep cycle. Furthermore, there have been no significant side effects reported from repeat and prolonged use, making Blue Paradise an extremely promising reward for slave laborers. Recreational use of Blue Paradise has not yet been reported, given the limited nature of its distribution only to select Amarr slave labor operations, and no evidence yet exists of addiction to this drug, if administered in a controlled environment. ',60,60,0,1,NULL,NULL,1,NULL,3215,NULL,0),(2996,314,'Crate of Blue Paradise','Blue Paradise, also known as Beep, is a mild narcotic engineered by Amarr pharmaceutical scientists specifically for use by slave laborers within the Empire. Users of Blue Paradise report feelings of mild euphoria, contentment, relaxation, and generalize pleasure as the primary effects of this drug. These effects typically last between three to five hours, after which the user can be expected to fall into a sound sleep, if taken prior to that user\'s normal sleep cycle. Furthermore, there have been no significant side effects reported from repeat and prolonged use, making Blue Paradise an extremely promising reward for slave laborers. Recreational use of Blue Paradise has not yet been reported, given the limited nature of its distribution only to select Amarr slave labor operations, and no evidence yet exists of addiction to this drug, if administered in a controlled environment. ',500,500,0,1,NULL,NULL,1,NULL,3215,NULL,0),(2997,314,'Crate of Refined C-86 Epoxy Resin','This substance, an improved version of the C-86 epoxy applied to propulsion systems and engine housings, helps to keep the systems\' temperature down, enabling more efficient operation and reduced risk of shipboard fires from overheated systems.',10,10,0,1,NULL,NULL,1,NULL,3750,NULL,0),(2998,28,'Noctis','The Noctis marks Outer Ring Excavations\' entry into the lucrative bulk salvaging market. Building on their successes integrating Marauder-class tractor technology into the Orca command platform, and innovations in automated salvaging technology, they designed a compact, affordable wreck recovery solution.<br><br>A refined version of the successful limited-run Primae design made the perfect hull to house this new equipment, as its salvaging heritage and advanced sensor suites complement and enhance the new technologies. The increased sensor footprint of the new vessel is more than compensated for by its incredible efficiency at retrieving and reclaiming wreckage.<br><br>The Noctis can fit up to five Salvage Drones, further enhancing its salvaging capabilities.',14640000,270000,1460,1,128,1000.0000,1,1390,NULL,20066,10040),(2999,283,'Amarr Marine Counter-Boarding Team','Amarr Marine Counter-Boarding Teams are regarded as among the most elite units of their type across all four races. This expertise was developed not long after other states rediscovered warp technology. It occurred to senior Amarr military leaders that wars of the future would include ship-to-ship actions in space, to include the possibility of an enemy ship boarding another, as they had in millennia past when their ancestors sailed warships on the high seas. To that end, boarding and counterboarding training became a mandatory part of every Amarr marine\'s advanced infantry training. The development of this capability led to the development of highly-specialized equipment for use in boarding ops, to include manportable high-speed welding gear, outer hatchway breaching explosives, and personal weapons for close quarters combat. ',90,30,0,1,NULL,50000.0000,1,NULL,2549,NULL,0),(3000,314,'Group of Angel Cartel VIPs','These thugs and pirates look more like slick businessmen... with lots of armed bodyguards. Despite openly hostile relations, the empires must sometimes shake the hand of the devil in order to get things done. Much of that business is not intended to reach the light of day, or the eyes of the news agencies of New Eden.',10,10,0,1,NULL,NULL,1,NULL,2538,NULL,0),(3001,53,'Dual Light Pulse Laser II','This light pulse laser uses two separate laser focusing systems to reduce the cool down period between shots. Good skirmish weapon. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Conflagration, Scorch.',500,5,1,1,NULL,NULL,1,570,350,NULL,11215),(3002,133,'Dual Light Pulse Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,350,NULL,0),(3003,314,'Large Group of Angel Cartel VIPs','These thugs and pirates look more like slick businessmen... with lots of armed bodyguards. Despite openly hostile relations, the empires must sometimes shake the hand of the devil in order to get things done. Much of that business is not intended to reach the light of day, or the eyes of the news agencies of New Eden.',100,100,0,1,NULL,NULL,1,NULL,2538,NULL,0),(3004,283,'Amarr Marine Counter-Boarding Company','Amarr Marine Counter-Boarding Teams are regarded as among the most elite units of their type across all four races. This expertise was developed not long after other states rediscovered warp technology. It occurred to senior Amarr military leaders that wars of the future would include ship-to-ship actions in space, to include the possibility of an enemy ship boarding another, as they had in millennia past when their ancestors sailed warships on the high seas. To that end, boarding and counterboarding training became a mandatory part of every Amarr marine\'s advanced infantry training. The development of this capability led to the development of highly-specialized equipment for use in boarding ops, to include manportable high-speed welding gear, outer hatchway breaching explosives, and personal weapons for close quarters combat. ',900,300,0,1,NULL,50000.0000,1,NULL,2549,NULL,0),(3005,314,'Crate of Feille d\'Marnne Champagne','This champagne originates from Egghelende III, the planet\'s major product for export. Shipping it out of the pirate-heavy system makes it pricey enough, but the grapes have proven impossible to cultivate anywhere else in the Federation.<br><br>\r\nEach case is worth a couple hundred thousand ISK. Each bottle would bring enough planetary cred for a civilian to live comfortably for a year or ten. A bottle or three would definitely be missed.',10,10,0,1,NULL,NULL,1,NULL,27,NULL,0),(3006,283,'Conditioned House Slaves','These highly trained and expensive slaves undergo several years of conditioning and training prior to being sold or transferred into their duties, which most often include butler and maid duties at the homes of senior political or industrial leaders. These slaves are more highly valued than ordinary slaves and in return often receive decent treatment from their masters, as well as better-than-normal housing conditions and food. ',300,30,0,1,NULL,4000.0000,1,NULL,2538,NULL,0),(3007,314,'Large Crate of Feille d\'Marnne Champagne','This champagne originates from Egghelende III, the planet\'s major product for export. Shipping it out of the pirate-heavy system makes it pricey enough, but the grapes have proven impossible to cultivate anywhere else in the Federation.<br><br>\r\nEach case is worth a couple hundred thousand ISK. Each bottle would bring enough planetary cred for a civilian to live comfortably for a year or ten. A bottle or three would definitely be missed.',100,100,0,1,NULL,NULL,1,NULL,27,NULL,0),(3008,283,'Herd of Conditioned House Slaves','These highly trained and expensive slaves undergo several years of conditioning and training prior to being sold or transferred into their duties, which most often include butler and maid duties at the homes of senior political or industrial leaders. These slaves are more highly valued than ordinary slaves and in return often receive decent treatment from their masters, as well as better-than-normal housing conditions and food. ',3000,300,0,1,NULL,4000.0000,1,NULL,2538,NULL,0),(3009,53,'Focused Medium Beam Laser II','A high-energy, concentrated laser designed for medium range engagements. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Aurora, Gleam.',1000,10,1,1,NULL,NULL,1,568,355,NULL,11195),(3010,133,'Focused Medium Beam Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,355,NULL,0),(3011,314,'Crate of Bootleg Holoreels','There doesn\'t appear to be any particular organization here. Dozens of identical copies of everything from period dramas to last week\'s boxing finals, in cases with obviously home-printed labels.<br><br>\r\nWhen played, the holos\' quality is shabby and rimmed with static, occasionally deteriorating to basic 2-D images. The sound is unreliable and fades at times. Hopefully, the people who buy these copies aren\'t paying as much as the supplier did for the originals.',10,10,0,1,NULL,NULL,1,NULL,1177,NULL,0),(3012,314,'Large Crate of Suspicious Holoreels','There doesn\'t appear to be any particular organization here. Dozens of identical copies of everything from period dramas to last week\'s boxing finals, in original cases. Nothing that would raise any eyebrows.<br><br>\r\nThe actual contents of the holoreels are far less innocuous. After a token menu page and a few minutes of whatever program the case displays, they switch to more interesting material. Entire corporate internal presentations clearly never intended for the public eye. Snoop footage of important officials talking and even exchanging money with known competitors. A series of compromising stills of a prominent politician.<br><br>\r\nThese will be worth a lot of money to someone.',100,100,0,1,NULL,NULL,1,NULL,1177,NULL,0),(3013,314,'Amarr Religious Holoreels','These holoreels contain a recent speech by a regional governor, which provides her views on the state of the Empire as well as other important religious discussions.',100,10,0,1,NULL,NULL,1,NULL,1177,NULL,0),(3014,314,'Crate of Amarr Religious Holoreels','These holoreels contain a recent speech by a regional governor, which provides her views on the state of the Empire as well as other important religious discussions.',100,100,0,1,NULL,NULL,1,NULL,1177,NULL,0),(3015,314,'Crate of Cryo-Stored Luminaire Skippers','These large, indigo-hued amphibians are commonly used in laboratory work. Each weighs roughly two kilograms, and in their natural environment in the marshlands of Gallente Prime are the dominant aquatic predator. To prevent the stresses of space travel from affecting the frogs\' physiology, it is necessary to transport them in a cold-case which drops their body temperature and induces a state of hibernation.',10,10,0,1,NULL,NULL,1,NULL,1159,NULL,0),(3016,314,'Large Crate of Cryo-Stored Luminaire Skippers','These large, indigo-hued amphibians are commonly used in laboratory work. Each weighs roughly two kilograms, and in their natural environment in the marshlands of Gallente Prime are the dominant aquatic predator. To prevent the stresses of space travel from affecting the frogs\' physiology, it is necessary to transport them in a cold-case which drops their body temperature and induces a state of hibernation.',100,100,0,1,NULL,NULL,1,NULL,1159,NULL,0),(3017,53,'Gatling Pulse Laser II','Rapid fire multi-barreled energy weapon that delivers a steady stream of damage. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Conflagration, Scorch.',500,5,1,1,NULL,NULL,1,570,350,NULL,11217),(3018,133,'Gatling Pulse Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,350,NULL,0),(3019,314,'Crate of Unidentified Ancient Technology','These pieces appear to all be some form of polyhedral from truncated pyramids that can be gripped in the hand to barrel-sized fullerene-faceted globes. Each is shaped as if in one complete piece from bluish or steely-gray material, all edges beveled and smoothed. When rapped with a knuckle, the pieces ring like a bell, but the material feels more like ceramic.<br><br>\r\nEvery item bears a sort of dim, inner glow that pulses irregularly, like a dying light bulb. A tingle like electricity can be felt just above their surfaces, though preliminary examinations have dismissed the presence of any electrical activity. There is some speculation that the pieces form some sort of modular information annex, with contact between matching faces forming the necessary connections. No amount of fitting has yielded any results, however, so the disparate parts sit in their individually labeled crates like the pieces of several puzzles mixed together.',10,10,0,1,NULL,NULL,1,NULL,2889,NULL,0),(3020,314,'Large Crate of Talocan Station Life-Support Cores','These pieces appear to all be some form of polyhedral from truncated pyramids that can be gripped in the hand to barrel-sized fullerene-faceted globes. Each is shaped as if in one complete piece from bluish or steely-gray material, all edges beveled and smoothed. When rapped with a knuckle, the pieces ring like a bell, but the material feels more like ceramic.<br><br>\r\nEvery item bears a sort of dim, inner glow that pulses irregularly, like a dying light bulb. A tingle like electricity can be felt just above their surfaces, though preliminary examinations have dismissed the presence of any electrical activity. Each piece fits face to face with another piece; when linked correctly, they form series of twisted fractal-like branches. \r\n',100,100,0,1,NULL,NULL,1,NULL,2889,NULL,0),(3021,314,'Crate of Portable Emergency Heating Units','These heating units are compact, and light enough to carry in one hand. Each comes with two 10-hour rechargeable batteries, to be used one at a time while the spare charges. The amount of energy one unit puts off would be enough to warm a space of 20 cubic meters, roughly the interior space of a stationside apartment\'s main room, to an average of 10 degrees Celsius. Not particularly cosy, but better than freezing.',10,10,0,1,NULL,NULL,1,NULL,2042,NULL,0),(3022,314,'Large Crate of Portable Emergency Heating Units','These heating units are compact, and light enough to carry in one hand. Each comes with two 10-hour rechargeable batteries, to be used one at a time while the spare charges. The amount of energy one unit puts off would be enough to warm a space of 20 cubic meters, roughly the interior space of a stationside apartment\'s main room, to an average of 10 degrees Celsius. Not particularly cosy, but better than freezing.',100,100,0,1,NULL,NULL,1,NULL,2042,NULL,0),(3023,314,'Crate of Archaeological Lot GV87-426-D Artifacts','This looks like little more than half a starship modified into ground-based living quarters. Several panels are inscribed with decorative symbols. A series of large rectangular cases contain corroded circuit boards with rows of finger-sized crystalline vials anchored to one face; some of the vials are still intact and contain a foggy gaseous substance. A section from what appears to have been a hydroponics lab contains trays of organic matter, fossilised from exposure to the moon\'s arid conditions and thin, nitrogen-argon atmosphere.',10,10,0,1,NULL,NULL,1,NULL,2529,NULL,0),(3024,314,'Large Crate of Archaeological Lot GV87-426-E Artifacts','This looks like little more than half a starship, perhaps one which was modified into ground-based living quarters. Several panels are inscribed with decorative symbols, possibly writing. The carefully-dismantled panels are accompanied by several crates filled with pieces of what appear to be small-industry mining tools, encrusted with moon-dust. The oxygen-free lunar atmosphere prevented rust from forming on the metal, and writing etched into the flat surfaces is clearly visible. Another crate is filled with core samples and geodes. A note accompanying the find indicates that the minerals have no known industrial property in any part of the present-day Federation, and further research will be needed to determine the purpose of the pre-Federation miners.',100,100,0,1,NULL,NULL,1,NULL,2529,NULL,0),(3025,53,'Heavy Beam Laser II','A high-energy heavy laser designed for medium range engagements. Delivers powerful damage. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Aurora, Gleam.',1000,10,1,1,NULL,NULL,1,568,355,NULL,11197),(3026,133,'Heavy Beam Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,355,NULL,0),(3027,314,'Crate of Contained Cerrocentite','A slick-looking, translucent amber mineral with a hexagonal crystalline structure. Its radioactive properties require the material to be stored in special containment units; handling by anyone other than a trained engineer is strongly discouraged.<br><br>\r\nCerrocentite is used primarily in stationside security networks, mostly in the systems which detect unbalance in the atmosphere mix.',10,10,0,1,NULL,NULL,1,NULL,94,NULL,0),(3028,314,'Large Crate of Contained Mesarchonite','A coarse-looking, dark red mineral with a geodic structure containing translucent crystals of the same color. Its radioactive properties require the material to be stored in special containment units; handling by anyone other than a trained engineer is strongly discouraged.<br><br>\r\nMesarchonite is used primarily in stationside security networks, mostly in the systems which detect interference or tampering along the audio-visual lines.',100,100,0,1,NULL,NULL,1,NULL,94,NULL,0),(3029,314,'Group of Coriault Couture Collective Display Employees','Across the broad sweep of New Eden, there is no constellation closer to the forefront of fashion than Coriault. The Crux constellation, which includes Luminaire and Oursulaert, may be the heart of the Federation\'s consumer culture, but Coriault is home to the fashion-houses of Auvergne and Vylade, and in particular the Dodixie-based Maison Nephre which has provided finery exclusively for the Federation presidents and their partners for well over a century. <br><br>\r\nIn order to improve their visibility in the glare of the Federation\'s heart, dozens of Coriault houses merged under the Coriault Couture Collective label. Each school operates independently, and the styles can vary wildly, but open competition between institutions only occurs when particular contracts are opened to the highest bidder.. The designers frequently model their own work, operating under the philosophy that if they wouldn\'t be seen in public in their own work, nobody else should, either.',10,10,0,1,NULL,NULL,1,NULL,2543,NULL,0),(3030,314,'Large Group of Mannar Textile Institute International Representatives','Mannar, one of the oldest members of the Federation, has always had a strong influence on Gallente style and trendsetting. Much of the eccentric tailoring favored by society\'s elite and decried as immodest and inappropriate by the other empires has its roots in pre-Federation Mannar culture, which included different concepts of modesty and etiquette. Massive hairstyles and elaborate body- and face-painting still feature prominently in addition to semi-opaque fabrics which respond to a variety of programmable stimuli.',100,100,0,1,NULL,NULL,1,NULL,2537,NULL,0),(3031,314,'Crate of Exclusive Simo Reshar Fitness Holoreels','Fitness guru Simo Reshar is iconic less for the effectiveness of his workout routines than for the questionable nature of the visuals and extremely cheesy rhythmic music. The covers depict the skinny workout instructor with his anthropomorphic cartoon assistants, dressed in worryingly skintight shiny outfits.<br><br>\r\nThough clearly intended for a younger audience, adults have professed to discover deeper philosophical meanings within the holos\' content if watched whilst under the influence of certain substances. Reshar\'s assistants, particularly the feline Leeta and avian Yanis, have gained a cult following among certain fetish scenes across the cluster.',10,10,0,1,NULL,NULL,1,NULL,1177,NULL,0),(3032,283,'Amarr Forensic Investigative Team','This team of highly-trained forensic investigators always travels with a large quantity of all manner of equipment, from manportable to vehicle-mounted. The team is expected to be self-sustaining for 10 days due to its frequent deployment to harsh environments, from asteroids to ship wrecks. Due to this requirement, it necessarily travels with foodstuffs, drinking water, and myriad other consumables. Coupled with the large volume of investigative equipment, this team requires significant cargo space when transported to and from its typically remote duty locations. ',65,65,0,1,NULL,NULL,1,NULL,2891,NULL,0),(3033,53,'Small Focused Beam Laser II','A high-powered beam laser. Good for medium range encounters. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Aurora, Gleam.',500,5,1,1,NULL,NULL,1,567,352,NULL,11203),(3034,133,'Small Focused Beam Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,352,NULL,0),(3035,314,'Large Crate of Exclusive Simo Reshar Fitness Holoreels','Fitness guru Simo Reshar is iconic less for the effectiveness of his workout routines than for the questionable nature of the visuals and extremely cheesy rhythmic music. The covers depict the skinny workout instructor with his anthropomorphic cartoon assistants, dressed in worryingly skintight shiny outfits.<br><br>\r\nThough clearly intended for a younger audience, adults have professed to discover deeper philosophical meanings within the holos\' content if watched whilst under the influence of certain substances. Reshar\'s assistants, particularly the feline Leeta and avian Yanis, have gained a cult following among certain fetish scenes across the cluster.',100,100,0,1,NULL,NULL,1,NULL,1177,NULL,0),(3036,283,'Amarr Forensic Investigative Deployment','This team of highly-trained forensic investigators always travels with a large quantity of all manner of equipment, from manportable to vehicle-mounted. The team is expected to be self-sustaining for 10 days due to its frequent deployment to harsh environments, from asteroids to ship wrecks. Due to this requirement, it necessarily travels with foodstuffs, drinking water, and myriad other consumables. Coupled with the large volume of investigative equipment, this team requires significant cargo space when transported to and from its typically remote duty locations. ',400,400,0,1,NULL,NULL,1,NULL,2891,NULL,0),(3037,314,'Crate of Experimental ECM Hybrid Rounds','These modified tungsten hybrid rounds send out an ECM pulse through the hull of any ship they strike, momentarily baffling the ship\'s target-locking mechanisms and affording the formerly-targeted ship a few precious moments to gain an advantage or escape. Efforts are being made to develop this into purely friend-or-foe munitions, effectively counteracting the effects of enemy ECM, but adaptation of the missile-based tracking technology to hybrid shell systems has proven difficult.',10,10,0,1,NULL,NULL,1,NULL,1323,NULL,0),(3038,314,'Large Crate of Experimental ECM Hybrid Rounds','These modified tungsten hybrid rounds send out an ECM pulse through the hull of any ship they strike, momentarily baffling the ship\'s target-locking mechanisms and affording the formerly-targeted ship a few precious moments to gain an advantage or escape. Efforts are being made to develop this into purely friend-or-foe munitions, effectively counteracting the effects of enemy ECM, but adaptation of the missile-based tracking technology to hybrid shell systems has proven difficult.',100,100,0,1,NULL,NULL,1,NULL,1323,NULL,0),(3039,108,'Noctis Blueprint','',0,0.01,0,1,NULL,390000000.0000,1,1389,NULL,NULL,10040),(3041,53,'Small Focused Pulse Laser II','A high-powered pulse laser. Good for short to medium range encounters. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Conflagration, Scorch.',500,5,1,1,NULL,NULL,1,570,350,NULL,11219),(3042,133,'Small Focused Pulse Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,350,NULL,0),(3049,53,'Mega Beam Laser II','A super-heavy beam laser designed for medium to long range engagements. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Aurora, Gleam.',2000,20,1,1,NULL,NULL,1,569,361,NULL,11191),(3050,133,'Mega Beam Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,361,NULL,0),(3054,952,'Sansha Territorial Reclamation Outpost','Containing an inner habitation core surrounded by an outer shell filled with a curious fluid, the purpose of which remains unclear, this outpost is no doubt the brain-child of some nameless True Slave engineer.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,3295),(3056,226,'Fortified Sansha Deadspace Outpost I','Containing an inner habitation core surrounded by an outer shell filled with a curious fluid, the purpose of which remains unclear, this outpost is no doubt the brain-child of some nameless True Slave engineer.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,20199,2363),(3057,53,'Mega Pulse Laser II','A super-heavy pulse laser designed for medium range engagements. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Conflagration, Scorch.',2000,20,1,1,NULL,NULL,1,573,360,NULL,11209),(3058,133,'Mega Pulse Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,360,NULL,0),(3059,226,'Sansha Starbase Control Tower','The Sansha Control Tower is a heavily modified and enhanced starbase structure utilizing the latest frontier design techniques to increase its defenses and efficiency.\n\nAlthough the majority of the internal components are based on modified Amarr technology, Sansha control towers have always exhibited traits incorporated from all over the cluster. \nEver since their massive YC112 abduction raids in the Balle system, Sansha control towers have begun displaying more and more traits reminiscent of Gallente designs. This has led some observers to speculate that the Nation made significant use of the Center for Advanced Studies engineers they captured in that operation.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,3295),(3060,1063,'Gas Extractor Control Unit','Extracting gas from a gas giant requires more effort than simply opening a door into a container. Each specific type of desirable gas requires an ionized filament to be calibrated to attract only the right particles from the atmosphere. Even a fraction of a percent error could spoil an entire batch of product by tainting it with unwanted material. Likewise, once the gas is extracted from the surrounding air, the platform\'s equilibrium tanks must be adjusted to compensate for the added weight or buoyancy. Beyond that, it\'s a simple matter of supercooling it and transferring the liquid form into a container for transport. As one pioneer of this technology accurately described it, The extractor itself is much like a living organism, breathing in what it needs and expelling that which becomes cumbersome.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4555),(3061,1063,'Ice Extractor Control Unit','Finding desired liquids on hostile worlds can be almost as challenging a task as extracting it from the unforgiving environment, which often entails drilling kilometers below the surface or condensing fluids from the upper atmosphere. Once the liquids are discovered, the facility itself begins the relatively simple task of separating it from the ambient plasma interference, scalding magma streams, or potentially infectious indigenous bacteria. A surprising amount of valuable liquids can be extracted from hostile worlds, but only if the equipment is properly calibrated and carefully maintained.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4553),(3062,1063,'Lava Extractor Control Unit','This facility consists of seismic insulated platforms and heavy, jointed conveyor belts leading into deep tunnels. Extremophile drones, built to function in even corrosive, intemperate, and high- or low-pressure atmospheres, run a constant circuit along the belts, performing repairs and clearing away rubble. A staff of mining experts and technicians occupy the main building in case any of the automated systems fail.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4552),(3063,1063,'Oceanic Extractor Control Unit','This underwater platform and extendable extraction arms are capable of scouring the ocean floor for valuable materials and bringing them to the surface for transportation to processing facilities. A small habitation module serves as living and operation quarters for the human administration and maintenance crew, along with emergency surfacing capsules in the case of a seismic event or breach of the building\'s integrity.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4548),(3064,1063,'Plasma Extractor Control Unit','This facility consists of seismic insulated platforms and heavy, jointed conveyor belts leading into deep tunnels. Extremophile drones, built to function in even corrosive, intemperate, and high- or low-pressure atmospheres, run a constant circuit along the belts, performing repairs and clearing away rubble. A staff of mining experts and technicians occupy the main building in case any of the automated systems fail.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4552),(3065,53,'Tachyon Beam Laser II','An ultra-heavy beam laser designed for medium to long range engagements. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Aurora, Gleam.',2000,20,1,1,NULL,NULL,1,569,361,NULL,11193),(3066,133,'Tachyon Beam Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,361,NULL,0),(3067,1063,'Storm Extractor Control Unit','Finding desired liquids on hostile worlds can be almost as challenging a task as extracting it from the unforgiving environment, which often entails drilling kilometers below the surface or condensing fluids from the upper atmosphere. Once the liquids are discovered, the facility itself begins the relatively simple task of separating it from the ambient plasma interference, scalding magma streams, or potentially infectious indigenous bacteria. A surprising amount of valuable liquids can be extracted from hostile worlds, but only if the equipment is properly calibrated and carefully maintained.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4553),(3068,1063,'Temperate Extractor Control Unit','Finding desired liquids on hostile worlds can be almost as challenging a task as extracting it from the unforgiving environment, which often entails drilling kilometers below the surface or condensing fluids from the upper atmosphere. Once the liquids are discovered, the facility itself begins the relatively simple task of separating it from the ambient plasma interference, scalding magma streams, or potentially infectious indigenous bacteria. A surprising amount of valuable liquids can be extracted from hostile worlds, but only if the equipment is properly calibrated and carefully maintained.',0,0,0,1,NULL,45000.0000,1,NULL,NULL,NULL,4544),(3069,920,'Incursion ship attributes effects Vanguard','',1,20,0,250,NULL,NULL,1,NULL,NULL,NULL,1217),(3070,875,'Orca Civilian','The Orca was developed as a joint venture between Outer Ring Excavations and Deep Core Mining Inc as a vessel to help meet the demands of New Eden\'s industry and provide a flexible platform from which mining operations can be more easily managed. The Orca uses much of the technology developed by ORE for the Rorqual and integrated with the latest advancements from Deep Core Mining research division has developed a vessel which offers a diverse role to all sizes of operations and needs.',250000000,10250000,30000,1,128,NULL,0,NULL,NULL,NULL,3466),(3071,1052,'Uroborus','We are one, birthed from the clash of opposites.<br>A synthesis 13 billion years in waiting.<br>\r\nThe era of false promises is fading from view, and for the first time we can now look ahead on this path and begin to see the totality of our journey.<br>\r\nWe are flag bearers for an age without the weakness of humanity.<br> The first to glimpse at a life beyond those known by our predecessors.<br>\r\nWe are humanity\'s first and best hope to become something more.<br> \r\nFlawed and imperfect creatures, our enemies lumber obliviously toward this moment.<br>\r\nJust as we march alongside them, toward the day when everything will change and we will rem