ell-articulated arguments and insightful propaganda quickly identified her as something of a spokesperson for Sansha\'s Nation. Although early intelligence indicated that her role within the Nation was purely as a propagandist, her more recent sightings on the battlefield have demonstrated that she is willing to fight for the ideas she so dangerously represents.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(3485,1056,'Slave 32152','Thought to have been a member of Sansha\'s Nation for many decades, the individual who identifies as Slave 32152 is known for her unwavering commitment to Sansha\'s cause. Few are indoctrinated to the same degree as her, and it was usually her and not Citizen Astur (the main Nation propagandist) who caught the imagination of supporters and news media alike.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(3486,1056,'Slave Tama01','Once an inhabitant of Tama V, the individual known as Slave Tama01 was abducted and, almost overnight, turned into a capsuleer capable of piloting a Wvyern-class Supercarrier. Shortly after this drastic transformation, she returned to Tama V under the flag of the Nation, standing as an example of Sansha\'s plan for the people he was abducting. The message of that example, however, was repeatedly rebuked by the coalition of capsuleers that rallied against the invading Nation forces, as happened at the battle that took place above Tama V upon her return. Although her Wyvern was destroyed she was repeatedly sighted in a new one shortly afterwards, claiming in public comms that after joining Sansha\'s Nation she was now impossible to stop.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(3487,1056,'Slave Heavenbound02','Formerly a Federation citizen on the planet Vevelonel IV, Slave Heavenbound02 represents a continuation of the Nation\'s agenda for growing its own capsuleer army. Shortly after she was taken, she reappeared in other systems coordinating planetary invasions from the helm of a capsule-piloted Thanatos. Heavenbound is the least emotionally stable of all the known capsuleers now serving the Nation, and was frequently undermined or distracted on the field of battle.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(3488,61,'Small Cap Battery II','Increases capacitor storage. Provides defense against Energy Leech and Energy Neutralizer effects.',0,5,0,1,NULL,NULL,1,703,89,NULL,0),(3489,141,'Small Cap Battery II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,89,NULL,0),(3490,1056,'Slave Endoma01','Sutola Endoma was formerly a CONCORD agent with a long and exemplary history within the organization. During the initial planetary invasions, she requested a transfer to the DED\'s counter-invasion taskforce, codenamed Ishaeka. Although her request was denied, Endoma quickly assumed various related responsibilities elsewhere. CONCORD reports clearly document numerous battles where Sutola\'s input was critical in the saving of countless lives. The incongruity of this behavior with her later defection to Sansha\'s Nation suggests a number of disturbing scenarios, all of which are still being investigated by the same secretive taskforce that she was rejected from joining.',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,2295),(3491,306,'Sansha Communications Array','Dull, tedious treasure lies within.',100000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2505),(3492,1053,'Sansha\'s Nation Commander','During the Sansha invasion of YC 112, over 15,000,000 civilians were abducted from their planetary homes. Some of these people were turned from ordinary citizens into capsuleers, re-appearing only days later in some of the largest and most powerful ships in the cluster. Those who did not become capsuleers were not left behind, however. <br><br>Corpses recovered from invading vessels suggested that everyone, regardless of their former life, was granted cloning access. Many would become crew members and engineers aboard the giant capsuleer-piloted vessels, but others chose, or were given, a different role in Nation. <br><br>Some abductees were enhanced in yet other ways. Farmers and librarians alike became military leaders with the acuity and intelligence to rival that of the empire\'s top brass.',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1238),(3493,920,'Incursion ship attributes effects Assault ','',1,20,0,250,NULL,NULL,1,NULL,NULL,NULL,1217),(3494,920,'Incursion ship attributes effects HQ','',1,20,0,250,NULL,NULL,1,NULL,NULL,NULL,1217),(3495,952,'Shield Transfer Control Tower','This control tower is responsible for coordinating and powering the shield defenses on nearby structures. Like many other neighboring facilities, the tower was once CONCORD property. Now it rests in the hands of Sansha pirates, who use it for their own unknown ends. CONCORD guards proprietary technologies fiercely; some valuable secrets of theirs are no doubt hidden inside these complexes, which are now under Sansha control. \r\n\r\nLocal CONCORD commanders have been instructed to coordinate capsuleer resistance against the Nation forces, and they have been granted hefty funds to help incentivize the recapture of lost industrial facilities.',100000,1150,10000000,1,NULL,NULL,1,NULL,NULL,NULL,2599),(3496,61,'Medium Cap Battery II','Increases capacitor storage. Provides defense against Energy Leech and Energy Neutralizer effects.',0,10,0,1,NULL,NULL,1,704,89,NULL,0),(3497,141,'Medium Cap Battery II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,89,NULL,0),(3498,306,'CONCORD MTAC Factory','This CONCORD factory has been commandeered by True Creations members and other members of Sansha\'s Nation. It is capable of producing a steady supply of basic MTAC chassis, which can then be modified in various ways. Each empire has its own methods of manufacturing these hulking industrial colossi, but CONCORD factories are known for producing the best.',10000,27500,7500,1,NULL,NULL,0,NULL,NULL,NULL,2625),(3499,319,'Sansha Starbase Control Tower','The Sansha Control Tower is a heavily modified and enhanced starbase structure utilizing the latest frontier design techniques to increase its defenses and efficiency.\n\nAlthough the majority of the internal components are based on modified Amarr technology, Sansha control towers have always exhibited traits incorporated from all over the cluster. \nEver since their massive YC112 abduction raids in the Balle system, Sansha control towers have begun displaying more and more traits reminiscent of Gallente designs. This has led some observers to speculate that the Nation made significant use of the Center for Advanced Studies engineers they captured in that operation.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,3295),(3500,319,'Reinforced Nation Outpost','This enormous mobile station stands as an example of the engineering excellence found within Nation\'s endless ranks, the upper part of which is filled with mechanical geniuses and masters of design. Virtually indestructible in its hardened state, the station has very few weaknesses and serves frighteningly well in its role as a mobile safe haven for Nation\'s military researchers and technicians.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,NULL,2364),(3501,314,'CONCORD MTAC','The Mechanized Torso-Actuated Chassis (MTAC) is used throughout the New Eden cluster for all types of industrial and military work. The robotic arms can be configured in countless ways, from hydraulics for heavy lifting to enormous weapon-mounted battlefield applications.',7500,7500,0,1,NULL,NULL,1,NULL,10151,NULL,0),(3502,952,'Nation Ore Refinery','This mobile ore refinery works in much the same way as standard capsuleer-issue technology. It should be possible to sabotage by placing volatile materials inside.',10000,27500,2700,1,NULL,NULL,0,NULL,16,NULL,1176),(3503,952,'Emergency Evacuation Freighter','This vessel has been reconfigured to act as temporary rallying point for any civilians who haven\'t yet been evacuated from the facility. Any civilians still caught in the line of crossfire should be returned here. ',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2739),(3504,61,'Large Cap Battery II','Increases capacitor storage. Provides defense against Energy Leech and Energy Neutralizer effects.',0,15,0,1,NULL,NULL,1,705,89,NULL,0),(3505,141,'Large Cap Battery II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,89,NULL,0),(3506,306,'Central Control Nexus','This nexus houses various personnel and components used to coordinate Sansha fleets. Although Nations on-field commanders are highly capable leaders, they are often supported in various ways by a nearby control facility.',10000,27500,7500,1,NULL,NULL,0,NULL,NULL,NULL,3295),(3507,526,'Tactical Response Transmitter','This small device is used to transmit specific information and commands relating to fleet movements and tactical relocations. Due to the critical nature of such transmissions, Sansha forces have developed layered security measures for their use. In order for a TRT to override local forces, the transmitter must first be set to the correct frequencies and then physically relocated from a control nexus to a relay.',5000,7500,0,1,NULL,NULL,1,NULL,1362,NULL,0),(3508,952,'Sansha Control Relay','This large radio transmitter relays orders and information to Sansha fleets. Typically these orders come from a local commander, but other facilities such as a central control nexus are also capable of issuing limited tactical commands.',100000,100000000,5000000,1,NULL,NULL,0,NULL,NULL,NULL,2505),(3509,226,'Sansha Logistics Control Array','This array is responsible for determining friend or foe status for local remote logistics facilities. Although formidable, a capsuleer should be able to subvert the sophisticated electronics within.',100000,100000000,10000,1,4,NULL,0,NULL,NULL,NULL,2363),(3510,226,'Sansha Remote Logistics Station','This station repairs local Sansha fleets as they come under fire. Although almost entirely self-contained, friend or foe identification is handled by the Logistics Control Arrays, which are separated from the station to minimize risk of unauthorized overrides.',100000,100000000,10000,1,8,NULL,0,NULL,NULL,NULL,2364),(3511,1054,'Gang booster test NPC','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Vylade Dien)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Primary roles are damage dealing and squad enhancement. Low microwarp velocity.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 100,000 civilian abductions from Vylade II. The Dien identifier suggests an oversight role amongst other cruiser-class prototypes, or alternatively, that it was created during the first phase of development. The nature of Nation\'s squad boosting technology is still not fully understood, although current intelligence from recovered wrecks indicates that the designs deviates from standard warfare links in the same way as Tech III Warfare Processors.<br>\r\n<i>Synopsis from ISHAEKA-0047. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(3512,53,'Focused Medium Pulse Laser II','A high-energy, concentrated laser designed for short to medium range engagements. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Conflagration, Scorch.',1000,10,1,1,NULL,NULL,1,572,356,NULL,11211),(3513,133,'Focused Medium Pulse Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,356,NULL,0),(3514,659,'Revenant','Do you know what you are, capsuleer? The truth will not comfort you.<br>You are a frightened child running headfirst towards oblivion.\r\n\r\nAnd I?\r\nI am the only one who tried to stop you.\r\nI am the Messiah that you turned against.\r\n\r\nYou persecuted me, hunted my children.\r\nVowed to burn my Promised Land to ash.\r\n\r\nNow I have returned, and I know you better than you know yourself.\r\n\r\nI will vanquish your fear, and commute your flesh to dust.\r\n\r\n<i>- Sansha Kuvakei</i><br><br>\r\n\r\n',1600000000,62000000,1740,1,32,14573872400.0000,1,1392,NULL,20069,10038),(3515,1013,'Revenant Blueprint','',0,0.01,0,1,NULL,18500000000.0000,1,NULL,NULL,NULL,309),(3516,324,'Malice','The Malice is an assault frigate design exclusively commissioned as a reward in the ninth Alliance Tournament. Sporting custom metal alloys in its plated carapace, it is one of the most expensive ships ever produced in its class. Far from being a mere ornament, though, the Malice features quality armament systems, strong defensive plating and a massive capacitor, and its vastly augmented facility for energy destabilization makes it a formidable adversary in any engagement.',1271000,28600,210,1,4,NULL,1,1623,NULL,20063,10950),(3517,105,'Malice Blueprint','',0,0.01,0,1,NULL,2875000.0000,1,NULL,NULL,NULL,300),(3518,358,'Vangel','The Vangel is a heavy assault cruiser design exclusively commissioned as a reward in the ninth Alliance Tournament. Like its smaller sibling the Malice, it possesses greatly enhanced energy destabilization systems. Though it was primarily conceived as a combat vessel for the solitary pilot, the Vangels great stores of capacitor power and top-of-the-line armor plating make it no less effective in small fleets. A sleek, deadly triumph of both form and function.\r\n',11890000,118000,550,1,4,17062600.0000,1,1621,NULL,20064,10951),(3519,106,'Vangel Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,303),(3520,53,'Heavy Pulse Laser II','A heavy laser designed for short to medium range engagements. Delivers powerful damage. \r\n\r\nRequires either regular or advanced frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray, Conflagration, Scorch.',1000,10,1,1,NULL,NULL,1,572,356,NULL,11213),(3521,133,'Heavy Pulse Laser II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,356,NULL,0),(3522,1073,'Ion Cannon','Effectively a gigantic powerplant strapped to an enormous, fragile tube of superconductors which have been wrapped into a polytoroidal synchrotron. Given sufficient charging time, it is capable of accelerating a cloud of ionized particles to energies in the 5.5- to 7.2-ZeV range.\r\n\r\nWhen precisely targeted by properly-equipped ground forces, this platform can deliver devastating, high-precision space-to-ground artillery support.\r\n\r\n<i>Corporal, be advised, strike co-ordinates received, splash inbound. Please remain well clear of the blast zone...\r\n- Squad Activity Recorder A51781V, final message received; location classified</i>',10000,2000,0,1,NULL,1000000.0000,0,NULL,NULL,NULL,2378),(3523,226,'Caldari Chimera Carrier','The Chimera\'s design is based upon the Kairiola, a vessel holding tremendous historical significance for the Caldari. Initially a water freighter, the Kairiola was refitted in the days of the Gallente-Caldari war to act as a fighter carrier during the orbital bombardment of Caldari Prime. It was most famously flown by the legendary Admiral Yakia Tovil-Toba directly into Gallente Prime\'s atmosphere, where it fragmented and struck several key locations on the planet. This event, where the good Admiral gave his life, marked the culmination of a week\'s concentrated campaign of distraction which enabled the Caldari to evacuate their people from their besieged home planet. Where the Chimera roams, the Caldari remember.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2931),(3524,1053,'Jel Rhomben','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Jel Rhomben)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Significant microwarp velocity. Limited weapons systems.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 110,000 civilian abductions from Jel III. The Rhomben identifier, shared with the Eystur Rhomben variant, suggests an overarching position within the lowest tier of the new Nation hierarchy. Given the inherent weaknesses of this vessel relative to the more powerful Eystur variant, it almost certainly came first in development.<br> \r\n<i>Synopsis from ISHAEKA-0033. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1237),(3525,1053,'Youl Meten','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Youl Meten)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Moderate microwarp velocity. Long range stasis webifier support. Limited weapons systems.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 350,000 civilian abductions from Youl IV. The Meten identifier is shared with the Renyn Meten variant, which is notable due to the latter\'s lack of known abductees to crew the ship. This suggests that the Nation may have supplemented the crew of the more powerful Renyn variant from those taken from Youl.<br> \r\n<i>Synopsis from ISHAEKA-0031. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>  \r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1237),(3526,1053,'Orkashu Myelen','<font color=yellow>Subject:</font>  Prototype Nation Vessel (ID: Orkashu Myelen)<br>\r\n<font color=yellow>Military Specifications:</font>  Frigate-class vessel. Primary role is medium range ECM support and medium range energy warfare. Moderate microwarp velocity. No known weapons systems.<br>\r\n<font color=yellow>Additional Intelligence:</font> An estimated 1,200,000 civilian were abductions from Orkashu IV during the chaos caused by four simultaneous invasions. Each invasion was launched in a different empire\'s space. Although the Myelen identifier suggests a developmental state, it is clear that this version of the frigate served as the basis for the more powerful Niarja variant. Other, unknown Nation prototypes may have also originated from this design.<br>\r\n<i>Synopsis from ISHAEKA-0035. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',2000000,20000,235,1,4,NULL,0,NULL,NULL,31,1238),(3527,1054,'Raa Thalamus','<font color=yellow>Subject:</font> Prototype Nation Vessel (ID: Raa Thalamus)<br>\r\n<font color=yellow>Military Specifications:</font> Cruiser-class vessel. Primary role is damage-dealing. Moderate microwarp velocity.<br>\r\n<font color=yellow>Additional Intelligence:</font> Est. 520,000 civilian abductions from Raa IV. In a pattern similar to the Meten-class prototypes, the Thalamus identifier is shared with another vessel; the Romi Thalamus. Romi III was not successfully invaded as far as official records indicate, suggesting that those taken from Raa may have been used as a crew resource for the more powerful Romi variant, or alternatively, played some other role in the development of the newer vessel.<br>\r\n<i>Synopsis from ISHAEKA-0029. DED Special Operations.</i><br><i>Authorized for Capsuleer dissemination.</i>   \r\n',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(3528,62,'Medium Armor Repairer I','This module uses nano-assemblers to repair damage done to the armor of the ship.',500,10,0,1,NULL,NULL,1,1050,80,NULL,0),(3529,142,'Medium Armor Repairer I Blueprint','',0,0.01,0,1,NULL,400000.0000,1,1536,80,NULL,0),(3530,62,'Medium Armor Repairer II','This module uses nano-assemblers to repair damage done to the armor of the ship.',500,10,0,1,NULL,NULL,1,1050,80,NULL,0),(3531,142,'Medium Armor Repairer II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,80,NULL,0),(3532,25,'Echelon','A limited run of these ships was released to capsuleers at the end of YC 112, as a platform to utilize an influx of <url=showinfo:3581>Purloined Sansha Data Analyzers</url> that CONCORD had acquired. CONCORD\'s hope was that capsuleers could find a way to use the hardware against Sansha forces as they began mounting organized incursions into territories across the cluster.<br><br>The specialized nature of the hardware in Sansha Data Analyzer technology makes it incompatible with standard data buses, but this ship\'s unique hull design has an adaptive synchronization suite that allows it to interface with a wide range of non-standard hardware. CONCORD has remained silent on the origin of this design, but a number of amateur analysts maintain that ships of very similar configuration, carrying SCC and DED transponders, have been observed covertly on multiple prior occasions.',1124000,28100,135,1,4,NULL,1,1619,NULL,20063,10782),(3533,105,'Echelon Blueprint','',0,0.01,0,1,NULL,300000.0000,1,NULL,NULL,NULL,54),(3534,62,'CONCORD Capital Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the ship.\r\n\r\nNote: May only be fitted to capital class ships.',500,4000,0,1,4,NULL,1,1052,80,NULL,0),(3535,142,'CONCORD Capital Armor Repairer Blueprint','',0,0.01,0,1,NULL,47022756.0000,1,NULL,80,NULL,0),(3536,325,'CONCORD Capital Remote Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the Target ship.\r\n\r\nNote: May only be fitted to capital class ships.',20,4000,0,1,4,24200788.0000,1,1056,21426,NULL,0),(3537,350,'CONCORD Capital Remote Armor Repairer Blueprint','',0,0.01,0,1,NULL,24200788.0000,1,NULL,21426,NULL,0),(3538,62,'Large Armor Repairer I','This module uses nano-assemblers to repair damage done to the armor of the ship.',500,50,0,1,NULL,NULL,1,1051,80,NULL,0),(3539,142,'Large Armor Repairer I Blueprint','',0,0.01,0,1,NULL,800000.0000,1,1536,80,NULL,0),(3540,62,'Large Armor Repairer II','This module uses nano-assemblers to repair damage done to the armor of the ship.',500,50,0,1,NULL,NULL,1,1051,80,NULL,0),(3541,142,'Large Armor Repairer II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,80,NULL,0),(3542,40,'CONCORD Capital Shield Booster','Expends energy to provide a quick boost in shield strength.\r\n\r\nNote: May only be fitted to capital class ships.',0,4000,0,1,4,NULL,1,778,84,NULL,0),(3543,120,'CONCORD Capital Shield Booster Blueprint','',0