ets.\r\nNote: May only be fitted to capital class ships.\r\n\r\nMust be loaded with any of the following regular and advanced projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, Titanium Sabot, Barrage, Hail.',75,4000,10,1,NULL,32694870.0000,1,776,2838,NULL,11308),(3574,135,'CONCORD Hexa 2500mm Repeating Cannon Blueprint','',0,0.01,0,1,NULL,32694870.0000,1,NULL,381,NULL,0),(3575,67,'CONCORD Capital Remote Capacitor Transmitter','Transfers capacitor energy to another ship.\r\n\r\nNote: May only be fitted to capital class ships.',1000,4000,0,1,4,26773840.0000,1,910,1035,NULL,0),(3576,76,'Heavy Capacitor Booster I','Provides a quick injection of power into the capacitor.',0,20,128,1,NULL,70258.0000,1,701,1031,NULL,0),(3577,156,'Heavy Capacitor Booster I Blueprint','',0,0.01,0,1,NULL,702580.0000,1,1563,1031,NULL,0),(3578,76,'Heavy Capacitor Booster II','Provides a quick injection of power into the capacitor.',0,20,160,1,NULL,230876.0000,1,701,1031,NULL,0),(3579,156,'Heavy Capacitor Booster II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,1031,NULL,0),(3580,147,'CONCORD Capital Remote Capacitor Transmitter Blueprint','',0,0.01,0,1,NULL,26773840.0000,1,NULL,1035,NULL,0),(3581,538,'Purloined Sansha Data Analyzer','CONCORD has acquired untold numbers of these devices from destroyed Sansha vessels during recent raids. The modules have the appearance of standard data analyzers, but when connected to the systems of a suitably modified ship, they exhibit significantly enhanced capabilities.<br><br>Official DED reports on the devices\' internal workings cite \"inconclusive results\", but CONCORD has nevertheless opted to distribute these modules to capsuleers in the hope that they might be useful in the fight against Kuvakei\'s minions.',1800,5,0,1,NULL,33264.0000,1,1718,2856,NULL,0),(3582,917,'Purloined Sansha Data Analyzer Blueprint','',0,0.01,0,1,NULL,332640.0000,1,NULL,84,NULL,0),(3583,314,'Badly Mangled Components','This rather large pile of obviously-broken components stands testament to the follies of reprocessing an item without <i>really</i> understanding how it fits together.',700,4,0,1,NULL,NULL,1,NULL,1365,NULL,0),(3584,314,'True Slave Decryption Node','Functionally, this piece of hardware - obviously of Sansha origin - is an extremely sophisticated parallel processing unit. Connecting it to a standard interface bus and running a few diagnostics reveals that it has been configured to act as the master node for a quasi-distributed decryption system, and its response rate suggests that it\'s exceptionally efficient at this task.<br><br>It is, however, difficult to ignore the fact that it\'s also a head in a jar - particularly when it opens its eyes briefly, looks around, and frowns.',700,4,0,1,NULL,NULL,1,NULL,2553,NULL,0),(3585,314,'Mangled Sansha Data Analyzer ','This is still nearly recognizable as a Purloined Sansha Data Analyzer, but attempting to reprocess it has left it broken yet still more-or-less intact. It\'s possible that running it through the reprocessor a second time will yield better results.',1650,5,0,1,NULL,33264.0000,1,NULL,2856,NULL,0),(3586,41,'Small Remote Shield Booster I','Transfers shield power over to the target ship, aiding in its defense.',0,5,0,1,NULL,4996.0000,1,603,86,NULL,0),(3587,121,'Small Remote Shield Booster I Blueprint','',0,0.01,0,1,NULL,49960.0000,1,1553,86,NULL,0),(3588,41,'Small Remote Shield Booster II','Transfers shield power over to the target ship, aiding in its defense.',0,5,0,1,NULL,38726.0000,1,603,86,NULL,0),(3589,121,'Small Remote Shield Booster II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,86,NULL,0),(3590,917,'Mangled Sansha Data Analyzer Blueprint','',0,0.01,0,1,NULL,332640.0000,1,NULL,84,NULL,0),(3591,319,'Angel Control Tower','The Angel Control Tower is an enhanced version of the Matari control tower utilizing the latest frontier design techniques to increase its defenses and efficiency.',100000,1150,8850,1,2,NULL,0,NULL,NULL,NULL,3290),(3592,226,'Caldari Wyvern Carrier ','The Wyvern is based on documents detailing the design of the ancient Raata empire\'s seafaring flagship, the Oryioni-Haru. According to historical sources the ship was traditionally taken on parade runs between the continent of Tikiona and the Muriyuke archipelago, seat of the Emperor, and represented the pride and joy of what would one day become the Caldari State. Today\'s starfaring version gives no ground to its legendary predecessor; with its varied applications in the vast arena of deep space, the Wyvern is likely to stand as a symbol of Caldari greatness for untold years to come.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2928),(3593,226,'Caldari Phoenix Dreadnought','In terms of Caldari design philosophy, the Phoenix is a chip off the old block. With a heavily tweaked missile interface, targeting arrays of surpassing quality and the most advanced shield systems to be found anywhere, it is considered the strongest long-range installation attacker out there. While its shield boosting actuators allow the Phoenix, when properly equipped, to withstand tremendous punishment over a short duration, its defenses are not likely to hold up against sustained attack over longer periods. With a strong supplementary force, however, few things in existence rival this vessel\'s pure annihilative force.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2786),(3594,226,'Caldari Leviathan Titan','Citizens of the State, rejoice! Today, a great milestone has been achieved by our glorious leaders. A stepping stone in the grand story of our empire has been traversed. Our individual fears may be quietened; the safety of our great nation has been secured. Today, unyielding, we have walked the way of the warrior. In our hands have our fates been molded. On the Leviathan\'s back will our civilization be carried home and the taint of the Enemy purged from our souls. Rejoice, citizens! Victory is at hand. -Caldari State Information Bureau Pamphlet, 23248 AD',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2930),(3595,226,'Caldari Badger Industrial Ship','The Badger-class freighter is the main cargo-carrier for the Caldari State, particularly in long, arduous trade-runs. Its huge size and comfortable armament makes it perfectly equipped for those tasks, although the Caldari seldom let it roam alone.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,51),(3596,41,'Medium Remote Shield Booster I','Transfers shield power over to the target ship, aiding in its defense.',0,10,0,1,NULL,12470.0000,1,602,86,NULL,0),(3597,121,'Medium Remote Shield Booster I Blueprint','',0,0.01,0,1,NULL,124700.0000,1,1553,86,NULL,0),(3598,41,'Medium Remote Shield Booster II','Transfers shield power over to the target ship, aiding in its defense.',0,10,0,1,NULL,79936.0000,1,602,86,NULL,0),(3599,121,'Medium Remote Shield Booster II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,86,NULL,0),(3600,226,'Caldari Tayra Industrial Ship','The Tayra is an alternative version of the famous Badger, it\'s mostly used by the military or the mega corps for transports of goods of great value. The Tayra has a much larger cargo capacity, making it ideal for high volume hauling.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,52),(3601,226,'Caldari Charon Freighter','As the makers of the Charon, the Caldari State are generally credited with pioneering the freighter class. Recognizing the need for a massive transport vehicle as deep space installations constantly increase in number, they set about making the ultimate in efficient mass transport - and were soon followed by the other empires. Regardless, the Charon still stands out as the benchmark by which the other freighters were measured. Its massive size and titanic cargo hold are rivalled by none.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2740),(3602,226,'Gallente Atron Frigate','The Atron is a hard nugget with an advanced power conduit system, but little space for cargo. Although it is a good harvester when it comes to mining, its main ability is as a combat vessel.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,323),(3603,226,'Gallente Imicus Frigate','The Imicus is a slow but hard-shelled frigate, ideal for any type of scouting activity. Used by merchant, miner and combat groups, the Imicus is usually relied upon as the operation\'s eyes and ears when traversing low security sectors.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,322),(3604,226,'Gallente Incursus Frigate','The Incursus is commonly found spearheading Gallentean military operations. Its speed and surprising strength make it excellent for skirmishing duties. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,61),(3605,226,'Gallente Maulus Frigate','ThThe Maulus is a high-tech vessel, specialized for electronic warfare. It is particularly valued in fleet warfare due to its optimization for sensor dampening technology.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,324),(3606,41,'Large Remote Shield Booster I','Transfers shield power over to the target ship, aiding in its defense.',0,25,0,1,NULL,31244.0000,1,601,86,NULL,0),(3607,121,'Large Remote Shield Booster I Blueprint','',0,0.01,0,1,NULL,312440.0000,1,1553,86,NULL,0),(3608,41,'Large Remote Shield Booster II','Transfers shield power over to the target ship, aiding in its defense.',0,25,0,1,NULL,139968.0000,1,601,86,NULL,0),(3609,121,'Large Remote Shield Booster II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,86,NULL,0),(3610,226,'Gallente Navitas Frigate',' In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Gallente Federation, this led to the redesign and redeployment of the Navitas. The Navitas had been a solid mining vessel that had seen wide use by independent excavators, along with being one of the best ships available for budding traders and even for much-maligned scavengers. After its redesign, its long-range scanners and sturdy outer shell gave way entirely for remote repairing capabilities, moving the Navitas away from the calming buzz of mining lasers and into the roar of battle.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,59),(3611,226,'Gallente Tristan Frigate','Often nicknamed The Fat Man this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,60),(3612,226,'Gallente Catalyst Destroyer','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2389),(3613,226,'Gallente Celestis Cruiser','The Celestis cruiser is a versatile ship which can be employed in a myriad of roles, making it handy for small corporations with a limited number of ships. True to Gallente style the Celestis is especially deadly in close quarters combat due to its advanced targeting systems.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,319),(3614,226,'Gallente Exequror Cruiser','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Gallente Federation the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Exequoror. The Exequror was a heavy cargo cruiser originally strong enough to defend itself against raiding frigates, though it lacked prowess in heavier combat situations. After its redesign, it had some of that bulk - and, necessarily, some of that strength - yanked out and replaced with the capability to help others in heavy combat situations, in particular those who needed armor repairs.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,320),(3615,226,'Gallente Thorax Cruiser','The Thorax-class cruiser is the latest combat ship commissioned by the Federation. While the Thorax is a very effective ship at any range, typical of modern Gallente design philosophy it is most effective when working at extreme close range where its blasters and hordes of combat drones tear through even the toughest of enemies.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,63),(3616,41,'Capital Remote Shield Booster I','Transfers shield power over to the target ship, aiding in its defense.\r\n\r\nNote: May only be fitted to capital class ships.',0,4000,0,1,4,24659510.0000,1,600,86,NULL,0),(3617,121,'Capital Remote Shield Booster I Blueprint','',0,0.01,0,1,1,24659510.0000,1,1553,86,NULL,0),(3618,41,'Capital Remote Shield Booster II','Transfers shield power over to the target ship, aiding in its defense.\r\n\r\nNote: May only be fitted to capital class ships.',0,4000,0,1,NULL,155242.0000,1,600,86,NULL,0),(3619,121,'Capital Remote Shield Booster II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,86,NULL,0),(3620,226,'Fortified Starbase Shield Generator','Smaller confined shield generators with their own access restrictions can be deployed outside the Control Tower\'s defense perimeter. This allows for lesser security areas around the Starbase, for purposes of storage or pickup. ',1,1,0,1,4,NULL,0,NULL,NULL,NULL,2380),(3624,306,'Holding Cell','If you have the right equipment you might be able to hack into the databank and get some valuable information.',10000,27500,2700,1,NULL,NULL,0,NULL,NULL,NULL,2431),(3625,517,'Rohan Shadrak\'s Bellicose','Rohan Shadrak is a Vherokior Shaman of somewhat eccentric repute - he was once described by Isardsund Urbrald, CEO of Vherokior tribe to be \"Mad as a biscuit\". A staunch traditionalist, he is a vocal - and occasionally physical - opponent of CONCORD laws against drug transportation.',0,0,0,1,2,NULL,0,NULL,NULL,NULL,303),(3626,226,'Sansha Station Ruins','Ruins.',0,0,0,1,NULL,NULL,0,NULL,NULL,20174,10670),(3627,314,'Construction Materials','Metal girders, plasteel concrete and fiber blocks are all very common construction material used around the universe.',1000000,70,0,1,NULL,500.0000,1,NULL,26,NULL,0),(3628,659,'Nation','',1550000000,62000000,1405,1,32,14573872400.0000,0,NULL,NULL,20062,10038),(3629,306,'Amarr Academy Office','The Pilot Certification Documents can be retrieved from inside this office. ',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2404),(3630,226,'Amarr Crucifier Frigate','The Crucifier was first designed as an explorer/scout, but the current version employs the electronic equipment originally intended for scientific studies for more offensive purposes. The Crucifier\'s electronic and computer systems take up a large portion of the internal space leaving limited room for cargo or traditional weaponry.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,1066),(3631,226,'Amarr Executioner Frigate','The Executioner is another newly commissioned ship of the Amarr Imperial Navy. The Executioner was designed specially to counter the small, fast raider frigates of the Minmatar Republic; thus it is different from most Amarr ships in favoring speed over defenses. With the Executioner, the Amarrians have expanded their tactical capabilities on the battlefield.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,54),(3632,226,'Amarr Inquisitor Frigate','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Amarr Empire, this led to the redesign and redeployment of the Inquisitor. The Inquisitor was originally an example of how the Amarr Imperial Navy modeled their design to counter specific tactics employed by the other empires. After its redesign, it was exclusively devoted to the role of a support frigate, and its formerly renowned missile capabilities gave way to a focus on remote armor repair.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,55),(3633,226,'Amarr Magnate Frigate','This Magnate-class frigate is one of the most decoratively designed ship classes in the Amarr Empire, considered to be a pet project for a small, elite group of royal ship engineers for over a decade. The frigate\'s design has gone through several stages over the past decade, and new models of the Magnate appear every few years. The most recent versions of this ship  the Silver Magnate and the Gold Magnate  debuted as rewards in the Amarr Championships in YC105, though the original Magnate design is still a popular choice among Amarr pilots.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,3367),(3634,53,'Civilian Gatling Pulse Laser','Low powered, rapid fire multi-barreled energy weapon that delivers a steady stream of damage. Comes with a pre-fitted irreplaceable standard frequency crystal.',500,5,0,1,NULL,NULL,0,NULL,350,NULL,11118),(3635,226,'Amarr Punisher Frigate','The Amarr Imperial Navy has been upgrading many of its ships in recent years and adding new ones. The Punisher is one of the most recent ones and considered by many to be the best Amarr frigate in existence. As witnessed by its heavy armaments, the Punisher is mainly intended for large-scale military operations, acting in coordination with larger military vessels, but it is more than powerful enough for solo operations.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,300),(3636,53,'Civilian Gatling Autocannon','Low powered, rapid fire multi-barreled projectile weapon that delivers a steady stream of damage. Generates Its own ammo from space particles. Cannot use standard projectile ammo.',500,5,0,1,NULL,NULL,0,NULL,387,NULL,11161),(3637,226,'Amarr Tormentor Frigate','The Tormentor has been in service for many decades, mainly as a mining ship. It is not big enough to cut it as a battle frigate, but as with most Amarr ships its strong defenses make it a tough opponent to crack. Exactly for this and the way it seems to be curling up on itself has given the Tormentor-class the nickname \'Armadillo\'.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,56),(3638,53,'Civilian Gatling Railgun','Low powered, rapid fire multi-barreled hybrid weapon that delivers a steady stream of damage. Generates Its own ammunition from space particles. Cannot use standard hybrid charges.',500,5,0,1,NULL,NULL,0,NULL,349,NULL,11140),(3639,226,'Amarr Coercer Destroyer','Noticing the alarming increase in Minmatar frigate fleets, the Imperial Navy made its plans for the Coercer, a vessel designed specifically to seek and destroy the droves of fast-moving frigate rebels.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2387),(3640,53,'Civilian Light Electron Blaster','Low powered, rapid fire multi-barreled hybrid weapon that delivers a steady stream of damage. Generates Its own ammo from space particles. Cannot use standard hybrid ammo.',500,5,0,1,NULL,NULL,0,NULL,376,NULL,11127),(3641,226,'Amarr Arbitrator Cruiser','The Arbitrator is unusual for Amarr ships in that it\'s primarily a drone carrier. While it is not the best carrier around, it has superior armor that gives it greater durability than most ships in its class.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,298),(3642,226,'Amarr Augoror Cruiser','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Amarr Empire the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Augoror. The Augoror-class cruiser is one of the old warhorses of the Amarr Empire, having seen action in both the Jovian War and the Minmatar Rebellion. Like most Amarr vessels, the Augoror depended first and foremost on its resilience and heavy armor to escape unscathed from unfriendly encounters. After its overhaul, it had some of the armor stripped off to make room for equipment allowing it to focus on the armor of other vessels, along with energy transfers.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,58),(3643,280,'Soil','Fertile soil rich with nutrients is very sought after by agricultural corporations and colonists on worlds with short biological history.',3000,1.5,0,1,NULL,80.0000,1,20,1181,NULL,0),(3644,226,'Amarr Omen Cruiser','The Omen is a stereotypical example of the Amarrian School of thinking when it comes to ship design: thick armor and hard hitting lasers. Advancements in heat dissipation allow the Omen to fire its lasers faster than other ships without this technology.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,1065),(3645,1042,'Water','Water is one of the basic conditional elements of human survival. Most worlds have this compound in relative short supply and hence must rely on starship freight.',0,0.38,0,1,NULL,35.0000,1,1334,1178,NULL,0),(3646,226,'Amarr Harbinger Battlecruiser','Right from its very appearance on a battlefield, the Harbinger proclaims its status as a massive weapon, a laser burning through the heart of the ungodly. Everything about it exhibits this focused intent, from the lights on its nose and wings that root out the infidels, to the large number of turreted high slots that serve to destroy them. Should any heathens be left alive after the Harbinger\'s initial assault, its drones will take care of them.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,3133),(3647,280,'Holoreels','Holographic video reels (also called \"holoreels\") are the most common type of personal entertainment there is. From interactive gaming to erotic motion pictures, these reels can contain hundreds of titles each. ',100,0.5,0,1,NULL,250.0000,1,492,1177,NULL,0),(3648,226,'Amarr Prophecy Battlecruiser','The Prophecy is built on an ancient Amarrian warship design dating back to the earliest days of starship combat. Originally intended as a full-fledged battleship, it was determined after mixed fleet engagements with early prototypes that the Prophecy would be more effective as a slightly smaller, more mobile form of artillery support.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2385),(3649,226,'Amarr Abaddon Battleship','The Abaddon class ship is a celestial tool of destruction. It is designed to enter combat from the outset, targeting enemies at range and firing salvo after salvo at them, and to remain intact on the battlefield until every heretic in sight has been torn to shreds.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,3132),(3650,226,'Amarr Apocalypse Battleship','In days past, only those in high favor with the Emperor could hope to earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. In latter years, even though now in full market circulation, these golden, metallic monstrosities are still feared and respected as enduring symbols of Amarrian might.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,296),(3651,54,'Civilian Miner','Common, low technology mining laser adapted for use with capsuleer technology. Works well for extracting common ore, but has great difficulty with higher end ores.\r\n\r\nWithout suitable skills and the use of specialized ships and modules, this mining laser will not be able to extract ore from Dark Ochre, Spodumain, Crokite, Bistot or Arkonor asteroids.',0,5,0,1,NULL,NULL,1,1039,1061,NULL,11146),(3652,226,'Amarr Bestower Industrial Ship','The Bestower has for decades been used by the Empire as a slave transport, shipping human labor between cultivated planets in Imperial space. As a proof to how reliable this class has been through the years, the Emperor himself has used an upgraded version of this very same class as transports for the Imperial Treasury. The Bestower has very thick armor and large cargo space.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,1064),(3653,63,'Medium Hull Repairer I','Makes use of nano-assembler technology in order to repair damage done to the structure.',1000,25,0,1,NULL,NULL,1,1054,21378,NULL,0),(3654,143,'Medium Hull Repairer I Blueprint','',0,0.01,0,1,NULL,1250000.0000,1,1537,21,NULL,0),(3655,63,'Medium Hull Repairer II','Makes use of nano-assembler technology in order to repair damage done to the structure.',1000,10,0,1,NULL,NULL,1,1054,21378,NULL,0),(3656,143,'Medium Hull Repairer II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,21,NULL,0),(3657,226,'Amarr Sigil Industrial Ship','A recent ship from Viziam. Based on a old slave transport design.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2715),(3658,226,'Amarr Maller Cruiser','Quite possibly the toughest cruiser in the galaxy, the Maller is a common sight in Amarrian Imperial Navy operations. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,57),(3659,226,'Amarr Aeon Carrier','Ships like the Aeon have been with the Empire for a long time. They have remained a mainstay of Amarr expansion as, hopeful for a new beginning beyond the blasted horizon, whole cities of settlers sojourn from their time-worn homesteads to try their luck on infant worlds. The Aeon represents the largest ship of its kind in the history of the Empire, capable of functioning as a mobile citadel in addition to fielding powerful wings of fighter bombers.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2911),(3660,226,'Amarr Archon Carrier','The Archon was commissioned by the Imperial Navy to act as a personnel and fighter carrier. The order to create the ship came as part of a unilateral initative issued by Navy Command in the wake of Emperor Kor-Azor\'s assassination. Sporting the latest in fighter command interfacing technology and possessing characteristically strong defenses, the Archon is a powerful aid in any engagement.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2905),(3661,226,'Amarr Revelation Dreadnought','The Revelation represents the pinnacle of Amarrian military technology. Maintaining their proud tradition of producing the strongest armor plating to be found anywhere, the Empire\'s engineers outdid themselves in creating what is arguably the most resilient dreadnought in existence. Added to that, the Revelation\'s ability to fire capital beams makes its position on the battlefield a unique one. When extended sieges are the order of the day, this is the ship you call in.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2743),(3662,226,'Amarr Avatar Titan','Casting his sight on his realm, the Lord witnessed The cascade of evil, the torrents of war. Burning with wrath, He stepped down from the Heavens To judge the unworthy, To redeem the pure. -The Scriptures, Revelation Verses 2:12',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2910),(3663,63,'Large Hull Repairer I','Makes use of nano-assembler technology in order to repair damage done to the structure.',1000,50,0,1,NULL,NULL,1,1055,21378,NULL,0),(3664,143,'Large Hull Repairer I Blueprint','',0,0.01,0,1,NULL,3125000.0000,1,1537,21,NULL,0),(3665,63,'Large Hull Repairer II','Makes use of nano-assembler technology in order to repair damage done to the structure.',1000,50,0,1,NULL,NULL,1,1055,21378,NULL,0),(3666,143,'Large Hull Repairer II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,21,NULL,0),(3667,226,'Amarr Providence Freighter','Even though characteristically last in the race to create a working prototype of new technology, the Empire\'s engineers spared no effort in bringing the Providence into the world. While the massive potential for profit from the capsuleer market is said to have been what eventually made the stolid Empire decide to involve themselves in the freighter business, their brainchild is by no means the runt of the litter; the Providence is one of the sturdiest freighters out there.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,2738),(3668,226,'Gallente Brutix Battlecruiser','One of the most ferocious war vessels to ever spring from Gallente starship design, the Brutix is a behemoth in every sense of the word. When this hard-hitting monster appears, the battlefield takes notice.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2383),(3669,226,'Gallente Myrmidon Battlecruiser','Worried that their hot-shot pilots would burn brightly in their eagerness to engage the enemy, the Federation Navy created a ship that encourages caution over foolhardiness. A hardier version of its counterpart, the Myrmidon is a ship designed to persist in battle. Its numerous medium and high slots allow it to slowly bulldoze its way through the opposition, while its massive drone space ensures that no enemy is left unscathed.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3168),(3670,226,'Caldari Bantam Frigate','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Caldari State, this led to the redesign and redeployment of the Bantam. The Bantam, a strong and sturdy craft, was originally an extremely effective mining frigate. After its redesign, the Bantam\'s large structure had to give way for logistics systems that ate up some of its interior room but allowed it to focus extensively on shield support for fellow vessels.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,38),(3671,226,'Caldari Condor Frigate','The Condor is fast and agile. It has limited cargo space so it\'s not very suitable for trading or mining. It is best used as an assault vessel in a hit-and-run type of operations.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,39),(3672,226,'Caldari Griffin Frigate','The Griffin is much used by the Caldari Navy as a support vessel in combat squadrons, using its impressive array of electronic gadgetry to disrupt the operation of target ships, making them easy prey for traditional combat vessels.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,40),(3673,280,'Wheat','Cereal grasses have been localized on hundreds of worlds. The grains of the wheat plant make a solid foundation for the production of foodstuffs within empire space.',1000,1.15,0,1,NULL,100.0000,1,492,1182,NULL,0),(3674,226,'Caldari Heron Frigate','The Heron has good computer and electronic systems, giving it the option of participating in electronic warfare. But it has relatively poor defenses and limited weaponry, so it\'s more commonly used for scouting and exploration.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,316),(3675,226,'Caldari Kestrel Frigate','The Kestrel is a heavy missile boat with a fairly large cargo space and one of the most sophisticated sensor arrays around. Interestingly enough, it has been used by both the Caldari Navy and several wealthy trade corporations as a cargo-hauling vessel. It is one of few trading vessels with good punching power, making it ideal for solo trade-runs in dangerous areas. The Kestrel was designed so that it could take up to four missile launchers but instead it can not be equipped with turret weapons nor mining lasers. ',0,0,0,1,1,NULL,0,NULL,NULL,NULL,313),(3676,226,'Caldari Merlin Frigate','The Merlin is the most powerful all-out combat frigate of the Caldari. It is highly valued for its versatility in using both missiles and turrets, while its defenses are exceptionally strong for a Caldari vessel.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,314),(3677,226,'Caldari Cormorant Destroyer','The Cormorant is the only State-produced space vessel whose design has come from a third party. Rumors abound, of course, but the designer\'s identity has remained a tightly-kept secret in the State\'s inner circle.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2388),(3678,226,'Caldari Blackbird Cruiser','The Blackbird is a small high-tech cruiser newly employed by the Caldari Navy. Commonly seen in fleet battles or acting as wingman, it is not intended for head-on slugfests, but rather delicate tactical situations.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,311),(3679,226,'Caldari Caracal Cruiser','The Caracal is a powerful vessel that specializes in missile deployment. It has excellent shield defenses, but poor armor plating. Its missile arsenal, when fully stocked, is capable of making mincemeat of almost anyone.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,42),(3680,226,'Caldari Moa Cruiser','The Moa was designed as an all-out combat ship, and its heavy armament allows the Moa to tackle almost anything that floats in space. In contrast to its nemesis the Thorax, the Moa is most effective at long range where its railguns and missile batteries can rain death upon foes.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,49),(3681,226,'Caldari Osprey Cruiser','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Caldari State the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Osprey. The Osprey originally offered excellent versatility and power for what was considered a comparably low price. After its redesign, its inbuilt mining technology - now a little creaky and long in the tooth - was gutted from the Osprey and replaced in its entirety with tech of a different type, capable of high energy and shield transfers.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,41),(3682,226,'Caldari Drake Battlecruiser','Of the meticulous craftsmanship the Caldari are renowned for, the Drake was born. It was found beneath such a ship to rely on anything other than the time-honored combat tradition of missile fire, while the inclusion of sufficient CPU capabilities for decent electronic warfare goes without saying.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3169),(3683,1042,'Oxygen','Oxygen is a commodity in constant demand. While most stations have their own supply units, smaller depots and space crafts rely on imports.',0,0.38,0,1,NULL,95.0000,1,1334,1183,NULL,0),(3684,226,'Caldari Ferox Battlecruiser','Designed as much to look like a killing machine as to be one, the Ferox will strike fear into the heart of anyone unlucky enough to get caught in its crosshairs. With the potential for sizable armament as well as tremendous electronic warfare capability, this versatile gunboat is at home in a great number of scenarios. ',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2382),(3685,280,'Hydrogen Batteries','The use of hydrogen batteries has become an international standard both in industry and in the public domain; they are a particularly common power supply in off-world habitats such as space stations. ',1500,1,0,1,NULL,500.0000,1,20,1184,NULL,0),(3686,226,'Caldari Raven Battleship','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,43),(3687,280,'Electronic Parts','These basic elements of all electronic hardware are sought out by those who require spare parts in their hardware. Factories and manufacturers take these parts and assemble them into finished products, which are then sold on the market.',1000,1,0,1,NULL,750.0000,1,20,1185,NULL,0),(3688,226,'Caldari Rokh Battleship','Having long suffered the lack of an adequate hybrid platform, the Caldari State\'s capsule pilots found themselves rejoicing as the Rokh\'s design specs were released. A fleet vessel if ever there was one, this far-reaching and durable beast is expected to see a great deal of service on battlefields near and far.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3170),(3689,1034,'Mechanical Parts','These basic elements of all mechanical hardware can come in virtually any shape and size, although composite or modular functionality is highly advantageous in today\'s competitive market. Factories and manufacturers take these parts and assemble them into finished products, which are then sold on the market. ',0,1.5,0,1,4,600.0000,1,1335,1186,NULL,0),(3690,226,'Caldari Scorpion Battleship ','The first Scorpion-class battleship was launched only a couple of years ago, and those that have been built are considered to be prototypes. Little is known of its capabilities, but what has been garnered suggests that the Scorpion is crammed to the brink with sophisticated hi-tech equipment that few can match.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,50),(3691,1034,'Synthetic Oil','Since original oil can be harvested only from a world with a long biological history, synthetic oil has become frequently produced in laboratories all over known space.',0,1.5,0,1,NULL,320.0000,1,1335,1187,NULL,0),(3693,1034,'Fertilizer','Fertilizer is particularly valued on agricultural worlds, where there is a constant demand for all commodities that boost export value.',0,1.5,0,1,NULL,200.0000,1,1335,1188,NULL,0),(3695,1034,'Polytextiles','Composite materials, both synthetic and natural, are used in the creation of polytextiles, durable fabrics that see widespread use in the clothing industry, solar sail manufacture, and even classic art.',200,1.5,0,1,NULL,400.0000,1,1335,1189,NULL,0),(3697,1034,'Silicate Glass','Silicate glass is a common construction material, in constant demand throughout New Eden, whether in planetary structures or reinforced for use in space vessels.',0,1.5,0,1,NULL,185.0000,1,1335,1190,NULL,0),(3699,280,'Quafe','Quafe is the name of the most popular soft drink in the universe, manufactured by a Gallentean company bearing the same name. Like so many soft drinks, it was initially intended as a medicine for indigestion and tender stomachs, but the refreshing effects of the drink appealed to everyone and the drink quickly became tremendously popular. Quafe is one of the best recognized brands in the whole EVE universe and can be found in every corner of it. ',500,0.1,0,1,NULL,50.0000,1,492,1191,NULL,0),(3701,314,'Certification Results','These complicated certification results may mean little to the layman\'s eye, but can prove valuable in the right hands.',1,0.1,0,1,NULL,NULL,1,NULL,1192,NULL,0),(3703,313,'Nerve Sticks','This booster is used as a stress-reliever and is ingested with a sip of water.',10,0.2,0,1,NULL,2500.0000,1,491,1193,NULL,0),(3704,226,'Gallente Dominix Battleship','The Dominix is one of the old warhorses dating back to the Gallente-Caldari War. While no longer regarded as the king of the hill, it is by no means obsolete. Its formidable hulk and powerful drone arsenal means that anyone not in the largest and latest battleships will regret ever locking horns with it.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,318),(3705,313,'Crash','This expensive booster is highly addictive and has been known to cause heart attacks and seizures.',5,0.2,0,1,NULL,1100.0000,1,491,1194,NULL,0),(3706,226,'Gallente Hyperion Battleship','Recognizing the necessity for a blaster platform to round out their high-end arsenal, the Federation Navy brought in top-level talent to work on the Hyperion. The result: one of the most lethal and versatile gunboats ever to take to the dark skies.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3207),(3707,313,'Blue Pill','This booster causes forgetfulness and bliss, and may cause light hallucinations.',10,0.2,0,1,NULL,2200.0000,1,491,1195,NULL,0),(3708,226,'Gallente Megathron Battleship','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,64),(3709,313,'Drop','This highly hallucinogenic booster can easily cause temporary dementia. It is commonly poured into a wet rag, which is then laid over, or bound across, sensitive parts of the skin.',5,0.2,0,1,NULL,1000.0000,1,491,1196,NULL,0),(3710,226,'Gallente Nyx Carrier','The Nyx is a gigantic homage to a figure much loved in Gallente society. The ship\'s design is based on the scepter of Doule dos Rouvenor III, the king who, during his peaceful 36-year reign, was credited with laying the foundation for the technologically and socially progressive ideologies which have pervaded Gallente thought in the millennia since. Indeed, the Nyx itself is emblematic of the Gallenteans\' love for progress; packed to the ergonomic brim with the latest in cutting-edge advancements, it is a proud reminder of the things that make the Federation what it is.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2909),(3711,313,'X-Instinct','Abusers of this booster have reported surreal visions and altered perceptions of the world around them. The subject becomes blissful and content, but highly analytical of the surroundings.',800,1,0,1,NULL,13500.0000,1,491,1206,NULL,0),(3712,226,'Gallente Thanatos Carrier','Sensing the need for a more moderately-priced version of the Nyx, Federation Navy authorities commissioned the design of the Thanatos. Designed to act primarily as a fighter carrier for small- to mid-scale engagements, its significant defensive capabilities and specially-fitted fighter bays make it ideal for its intended purpose.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2932),(3713,313,'Vitoc','The Vitoc booster has become more than a simple strategy by the Amarrians in controling their slaves. With the Vitoc method, slaves are injected with a toxic chemical substance that is fatal unless the recipient receives a constant supply of an antidote. The method first appeared a few centuries ago when the Amarrians started manning some of their space ships with slaves. As space crew the slaves had to be cajoled into doing complex, often independent work, making older methods of slave control undesirable. Although the more conventional ways of subduing slaves with force (actual or threat of) are still widely used in other forced labor areas, the Vitoc method has proven itself admirably for the fleet.',800,0.5,0,1,NULL,9300.0000,1,491,1207,NULL,0),(3714,226,'Gallente Moros Dreadnought','Of all the dreadnoughts currently in existence, the versatile Moros possesses perhaps the greatest capacity to fend off smaller hostiles by itself while concentrating on its primary capital target. By virtue of its protean array of point defense capabilities - including a drone bay capable of fielding vast amounts of drones to safeguard the behemoth - the Moros is single-handedly capable of turning the tide in a fleet battle.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2744),(3715,281,'Frozen Food','Frozen food is in high demand in many regions, especially on stations orbiting a non-habitable planet and a long way from an agricultural world.',400,0.5,0,1,NULL,98.0000,1,492,30,NULL,0),(3716,226,'Gallente Erebus Titan','From the formless void\'s gaping maw, there springs an entity. Not an entity such as any you can conceive of, nor I; an entity more primordial than the elements themselves, yet constantly coming into existence even as it is destroyed. It is the Child of Chaos, the Pathway to the Next. The darkness shall swallow the land, and in its wake there will follow a storm, as the appetite of nothing expands over the world. From the formless void\'s gaping maw, there springs an entity. Dr. Damella Macaper The Seven Events of the Apocalypse',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2942),(3717,281,'Dairy Products','These products, extracted from livestock, are one of the biggest cogs in the food production cycle. Dairy products are rich with calcium and help make sure the inhabitants of the EVE universe all have shiny teeth.',400,0.5,0,1,NULL,160.0000,1,492,1198,NULL,0),(3718,226,'Gallente Iteron Mark I Industrial Ship','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,65),(3719,283,'Tourists','The need for tasting other cultures and seeing new worlds is unquenchable among the well-off citizens of the universe.',200,1,0,1,NULL,100.0000,1,23,2539,NULL,0),(3720,226,'Gallente Iteron Mark II Industrial Ship','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,325),(3721,283,'Slaves','Slavery has always been a questionable industry, favored by the Amarr Empire and detested by the Gallente Federation.',450,5,0,1,NULL,750.0000,1,23,2541,NULL,0),(3722,226,'Gallente Iteron Mark III Industrial Ship','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,326),(3723,283,'Slaver Hound','The slaver hound is a native animal of Syrikos V and has been bred by the Amarrians from the time they first settled the planet more than a millennium ago. The favorable experience of employing the slaver hound as a guard animal has led to it being exported from Syrikos V to most other Amarrian agricultural planets and even some industrial and mining ones as well. In recent years, the slaver hound has become fashionable among Amarrians as a pet for those willing to risk its often murderous nature; slaver hounds can become extremely loyal and devoted to their owners if handled with care. ',30,1,0,1,NULL,3000.0000,1,23,1180,NULL,0),(3724,226,'Gallente Iteron Mark IV Industrial Ship','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,327),(3725,1034,'Livestock','Livestock are domestic animals raised for home use or for profit, whether it be for their meat or dairy products.',900,1.5,0,1,NULL,850.0000,1,1335,1205,NULL,0),(3726,226,'Gallente Iteron Mark V Industrial Ship','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,328),(3727,282,'Plutonium','Plutonium is used in arms manufacturing, among other things, making it a steady trade commodity.',2000,1,0,1,NULL,12000.0000,1,22,29,NULL,0),(3728,226,'Gallente Obelisk Freighter','The Obelisk was designed by the Federation in response to the Caldari State\'s Charon freighter. Possessing similar characteristics but placing a greater emphasis on resilience, this massive juggernaut represents the latest, and arguably finest, step in Gallente transport technology. ',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2739),(3729,282,'Toxic Waste','Waste from various production industries and arms manufacturers can be hazardous to the environment, but instead of dumping it to the void, it can be sold to those who see value in the material.',2000,1,0,1,NULL,150.0000,1,22,29,NULL,0),(3730,226,'Minmatar Breacher Frigate','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,305),(3731,266,'Megacorp Management','Advanced corporation operation. +100 members per level.\r\n\r\nNote: The CEO must update his corporation through the corporation user interface before the skill takes effect.',0,0.01,0,1,NULL,400000.0000,1,365,33,NULL,0),(3732,266,'Empire Control','Advanced corporation operation. +400 corporation members allowed per level. \r\n\r\nNote: The CEO must update his corporation through the corporation user interface before the skill takes effect.',0,0.01,0,1,NULL,8000000.0000,1,365,33,NULL,0),(3733,92,'Cobra Mine','Standard mine with nuclear payload.',1,0.15,0,10,NULL,NULL,0,NULL,1007,NULL,0),(3734,174,'Cobra Mine Blueprint','',0,0.01,0,1,NULL,136400.0000,0,NULL,1007,NULL,0),(3735,92,'Anaconda Mine','Standard mine with nuclear payload.',1,0.15,0,10,NULL,NULL,0,NULL,1007,NULL,0),(3736,174,'Anaconda Mine Blueprint','',0,0.01,0,1,NULL,136400.0000,0,NULL,1007,NULL,0),(3737,92,'Asp Mine','Standard mine with nuclear payload.',1,0.15,0,10,NULL,NULL,0,NULL,1007,NULL,0),(3738,174,'Asp Mine Blueprint','',0,0.01,0,1,NULL,136400.0000,0,NULL,1007,NULL,0),(3739,99,'Caldari Sentry Gun III','Sentry guns are placed around important space facilities and will attack anyone threatening the place they\'ve been assigned to defend. Sentry guns are very powerful compared to their ease 