tivities. It is even better prepared, however, to guard such tasks from interruption and sabotage.\r\n\r\nAlthough The Society generally frowns upon violent behavior, extreme (and often, extremely violent) methods are taken to protect its own vessels and the secrets they may carry.\r\n\r\nThis mission of acquiring, deepening and sharing knowledge is key to the philosophy of the SoCT, and one well-served by the capable and fearsome Gnosis.',10000000,101000,900,1,16,NULL,1,1698,NULL,20125,1231),(3757,226,'Minmatar Burst Frigate','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. In the Minmatar Republic, this led to the redesign and redeployment of the Burst. The Burst had been a small and fast cargo vessel. This all changed after the redesign, when the Burst found its small-time mining capabilities curtailed in lieu of logistics systems that moved its focus to shield support for friendly vessels.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,306),(3758,257,'Jove Cruiser','',0,0.01,0,1,16,1500000.0000,0,NULL,33,NULL,0),(3759,226,'Minmatar Probe Frigate','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,45),(3760,226,'Minmatar Rifter Frigate','The Rifter is a very powerful combat frigate and can easily tackle the best frigates out there. It has gone through many radical design phases since its inauguration during the Minmatar Rebellion. The Rifter has a wide variety of offensive capabilities, making it an unpredictable and deadly adversary.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,46),(3761,226,'Minmatar Slasher Frigate','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,44),(3762,226,'Minmatar Vigil  Frigate','The Vigil is an unusual Minmatar ship, serving both as a long range scout as well as an electronic warfare platform. It is fast and agile, allowing it to keep the distance needed to avoid enemy fire while making use of jammers or other electronic gadgets.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,1240),(3763,226,'Minmatar Thrasher Destroyer','Engineered as a supplement to its big brother the Cyclone, the Thrasher\'s tremendous turret capabilities and advanced tracking computers allow it to protect its larger counterpart from smaller, faster menaces.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2390),(3764,30,'Leviathan','Citizens of the State, rejoice!<br>\r\nToday, a great milestone has been achieved by our glorious leaders. A stepping stone in the grand story of our empire has been traversed. Our individual fears may be quietened; the safety of our great nation has been secured.<br>\r\nToday, unyielding, we have walked the way of the warrior. In our hands have our fates been molded. On the Leviathan\'s back will our civilization be carried home and the taint of the Enemy purged from our souls.<br>\r\nRejoice, citizens! Victory is at hand.<br>\r\n<i>-Caldari State Information Bureau Pamphlet, YC 12</i>',2300000000,132500000,13750,1,1,49100550200.0000,1,814,NULL,20071,2930),(3765,110,'Leviathan Blueprint','',0,0.01,0,1,NULL,70000000000.0000,1,885,NULL,NULL,0),(3766,25,'Vigil','The Vigil is an unusual Minmatar ship, serving both as a long range scout as well as an electronic warfare platform. It is fast and agile, allowing it to keep the distance needed to avoid enemy fire while making use of jammers or other electronic gadgets.',1080000,17400,250,1,2,NULL,1,64,NULL,20078,1240),(3767,105,'Vigil Blueprint','',0,0.01,0,1,NULL,2300000.0000,1,264,NULL,NULL,0),(3768,25,'Amarr Police Frigate','Amarr Police Frigate ',1265000,18100,235,1,4,NULL,0,NULL,NULL,20063,1067),(3769,105,'Amarr Police Frigate Blueprint','',0,0.01,0,1,NULL,9999999.0000,0,NULL,NULL,NULL,0),(3770,226,'Minmatar Bellicose Cruiser','Being a highly versatile class of Minmatar ships, the Bellicose has been used as a combat juggernaut as well as a support ship for wings of frigates. While not quite in the league of newer navy cruisers, the Bellicose is still a very solid ship for most purposes, especially in terms of long range combat.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,303),(3771,284,'Ectoplasm','Used for the making of the liquid inside starship pilot pods, this thick goo is made primarily out of used cell membranes.',100,0.5,0,1,NULL,900.0000,1,20,1199,NULL,0),(3772,226,'Minmatar Rupture Cruiser','The Rupture is slow for a Minmatar ship, but it more than makes up for it in power. The Rupture has superior firepower and is used by the Minmatar Republic both to defend space stations and other stationary objects and as part of massive attack formations.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,302),(3773,284,'Hydrochloric Acid','A clear, colorless, fuming, poisonous, highly acidic aqueous solution of hydrogen chloride, used as a chemical intermediate and in petroleum production, ore reduction, and food processing.',100,0.5,0,1,NULL,630.0000,1,20,1199,NULL,0),(3774,226,'Minmatar Scythe Cruiser','In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Minmatar Republic the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Scythe. The Scythe-class cruiser remains the oldest Minmatar ship still in use. It has seen many battles and is an integrated part in Minmatar tales and heritage. With its redesign, past firmware upgrades for mining output were tossed out entirely in favor of two new separate systems that focused on shield transporting and logistics drones respectively.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,304),(3775,1034,'Viral Agent','The causative agent of an infectious disease, the viral agent is a parasite with a noncellular structure composed mainly of nucleic acid within a protein coat.',0,1.5,0,1,NULL,850.0000,1,1335,1199,NULL,0),(3776,226,'Minmatar Stabber Cruiser','The Stabber is the mainstay of the Minmatar fleet. It is light and extremely fast, yet surprisingly powerful, with a wide variety of weapons. It is one of few Minmatar vessels that have reached popularity outside Minmatar space. ',0,0,0,1,1,NULL,0,NULL,NULL,NULL,47),(3777,281,'Long-limb Roes','The eggs of the hanging long-limb are among the most sought after delicacies in fancy restaurants. The roe is quite rare because no one has succeeded in breeding the species outside its natural planetary habitat.',400,1,0,1,NULL,2400.0000,1,492,1406,NULL,0),(3778,226,'Minmatar Cyclone Battlecruiser','The Cyclone was created in order to meet the increasing demand for a vessel capable of providing muscle for frigate detachments while remaining more mobile than a battleship. To this end, the Cyclone\'s seven high-power slots and powerful thrusters have proved ideal.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2384),(3779,1042,'Biomass','A catch-all term for composite material obtained from living things, biomass has several unique properties that make it ideal for various industrial, commercial, and personal uses. Its most important attribute is that it retains many of its nutrients even after being harvested, transported, and processed.',0,0.38,0,1,NULL,1.0000,1,1334,10030,NULL,0),(3780,226,'Minmatar Hurricane Battlecruiser','The force with which this ship hits is more than sufficient to leave a trail of shattered enemies, floating around like so much lifeless debris. An adaptable vessel, it has enough turret hardpoints for a full-scale assault while remaining versatile enough to allow for plenty of missile fire, and has both sufficient speed to outrun its enemies and sufficient capacitor charge to outlast them.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3135),(3781,226,'Minmatar Maelstrom Battleship','With the Maelstrom, versatility is the name of the game. Its defensive capabilities make it ideally suited for small raid groups or solo work, while its 8 turret hardpoints present opportunities for untold carnage on the fleet battlefield. ',0,0,0,1,1,NULL,0,NULL,NULL,NULL,3134),(3782,226,'Minmatar Tempest Battleship','The Tempest is one of the Republic Fleet\'s key vessels; a versatile gunship proficient at long-range bombardment and capable of dishing out specialized types of damage with great effectiveness. A well-rounded squadron of Tempests has been proven time and time again to be an invaluable wild card in a fleet battle, one which opponents should ignore at their own peril.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,48),(3783,226,'Minmatar Typhoon Battleship','Much praised by its proponents and much maligned by its detractors, the Typhoon-class battleship has always been one of the most hotly debated spacefaring vessels around. Its distinguishing aspect - and the source of most of the controversy - is its sheer versatility, variously seen as either a lack of design focus or a deliberate freedom for pilot modification.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,301),(3784,226,'Minmatar Hel Carrier','Inspired by a vicious scissor-toothed shark indigenous to old-world Matar, the Hel is widely viewed as a sign of a Republic out for blood. Since the beginning of its development it has remained a project cloaked in secrecy, with precious few people aware of its progress and its capabilities, and its formal unveiling has come as a defiant slap in the face to many who formerly believed the Matari incapable of working at this scale of starship design. Whatever comprises the soil of its roots, though, one thing is clear: from no-frills living quarters to grim, unadorned aesthetic, this ferocious behemoth has been designed for one purpose and one purpose only. Imagine a swarm of deadly hornets pouring from the devil\'s mouth. Now imagine they have autocannons. -Unknown Hel designer',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2894),(3785,226,'Minmatar Nidhoggur Carrier','Essentially a pared-down version of its big brother the Hel, the Nidhoggur nonetheless displays the same austerity of vision evident in its sibling. Quite purposefully created for nothing less than all-out warfare, and quite comfortable with that fact, the Nidhoggur will no doubt find itself a mainstay on many a battlefield.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2929),(3786,226,'Minmatar Naglfar Dreadnought','The Naglfar is based on a Matari design believed to date back to the earliest annals of antiquity. While the exact evolution of memes informing its figure is unclear, the same distinctive vertical monolith form has shown up time and time again in the wind-scattered remnants of Matari legend. Boasting an impressive versatility in firepower options, the Naglfar is capable of holding its own against opponents of all sizes and shapes. While its defenses don\'t go to extremes as herculean as those of its counterparts, the uniformity of resilience - coupled with the sheer amount of devastation it can dish out - make this beast an invaluable addition to any fleet.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2755),(3787,226,'Minmatar Ragnarok Titan','The liberty of our people is solely our responsibility. Tempting as it is to foist this burden upon our well-wishers, we must never forget that the onus of our emancipation rests with us and us alone. For too long, our proud people have been subjugated to the whims of enslavers, forced to endure relentless suffering and humiliation at the hands of people whose motivations, masked though they may be by florid religious claptrap, remain as base and despicable as those of the playground bully. If ever there was a time to rise  if ever there was a time to join hands with our brothers  that time is now. At this exact junction in history we have within our grasp the means to loosen our tormentors\' hold and win freedom for our kin. Opportunities are there to be taken. Brothers, we must rise. -Malaetu Shakor, Republic Parliament Head Speaking before the Tribal Council November 27th, YC 107',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2906),(3788,226,'Minmatar Hoarder Industrial Ship','The Hoarder is the second in line of the Minmatar industrial ships, it\'s not as strong as the Mammoth but its cargo space is very large for its price. It\'s perfect for operation in peaceful areas or when it has strong escort.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,308),(3789,226,'Minmatar Mammoth Industrial Ship','The Mammoth is the biggest and the strongest industrial ship of the Minmatar Republic. It was designed with aid from the Gallente Federation, making the Mammoth both large and powerful yet also nimble and technologically advanced. A very good buy.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,309),(3790,226,'Minmatar Wreathe Industrial Ship','The Wreathe is an old ship of the Minmatar Republic and one of the oldest ships still in usage. The design of the Wreathe is very plain, which is the main reason for its longevity, but it also makes the ship incapable of handling anything but the most mundane tasks.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,310),(3791,226,'Minmatar Fenrir Freighter','Third in line to jump on the freighter bandwagon, the Republic decided early in the design process to focus on a balance between all ship systems. True to form, their creation is comparatively lightweight - though lightweight is certainly not a term easily applicable to this giant.',0,0,0,1,1,NULL,0,NULL,NULL,NULL,2737),(3792,306,'Caldari Academy Office  ','The Pilot Certification Documents can be retrieved from inside this office. ',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2372),(3793,538,'Data Subverter I','A specialized computer and communications suite designed to assist attempts to subvert the control routines of orbital structures.\r\n\r\n<i>\"You fail to understand. This is our time now. Since prehistory, we have fought each other, first with clubs, then with guns and with beams of energy. Now we shall fight with our minds amidst the beautiful spinning streams of data interconnecting all life on all worlds.<br>\r\nResist, if you like. Your efforts will only hasten the time when we wrest control from you and all the rest of the old order.\"<br>\r\n- Note left in Federal Intelligence Office mainframe by anonymous hacker</i>',0,5,0,1,NULL,33264.0000,1,NULL,2856,NULL,0),(3794,917,'Data Subverter I Blueprint','',0,0.01,0,1,NULL,332640.0000,1,NULL,84,NULL,0),(3795,495,'Blood Raider Central Bastion','This massive structure sends signals to its neighbors and the rest of the complex constantly, processing and coordinating all functions. An armament of XL torpedo batteries, stasis webifiers and advanced repair functions reinforce the already formidable structure. ',1000,1000,1000,1,4,NULL,0,NULL,NULL,20190,2359),(3796,6,'Sun O1 (Blue Bright)','A hot, luminous and blue stellar body belonging to a relatively rare class of main-sequence stars. Often large and massive, these stars very quickly burn through their core hydrogen fuel supply and therefore have short lifetimes on the main sequence.\r\n\r\nThese stars emit a tremendous amount of ultraviolet radiation and the largest among them will typically go nova after only a few million years. Smaller stars of this type can cool sufficiently that they will turn into rapidly-rotating stars dominated by carbon-nitrogen-oxygen (CNO) cycle nuclear fusion.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20094,21468),(3797,6,'Sun G5 (Pink)','Main-sequence stars of this kind can have a slight red-white tint and are generally bright and in the process of fusing vast quantities of hydrogen every second.\r\n\r\nVarious numbers of planets of the terrestrial and gas giant types are found around these stars and the habitable zones often contain one or more planets.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20096,21469),(3798,6,'Sun K5 (Orange Bright)','A bright orange star that is relatively cool but stable, being of a class that typically runs a fusion process on the main-sequence for as long as 30 billion years. Planetary systems containing an abundance of heavier metals and relatively complex molecular products have been noted as present around such stars.\r\n\r\nThese stable stars, emitting relatively gentle levels of ultraviolet radiation, are common targets for scientific expeditions looking for life or colonization survey teams seeking viable planets within their comfortable habitable zones.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20095,21471),(3799,6,'Sun G3 (Pink Small)','Small, red-white stars of this kind are relatively old and may be on the verge of exhausting their hydrogen fusion fuel before becoming red giants.\r\n\r\nPlanetary systems can often be found around these stars and an abundance of heavier metals is not uncommon.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20096,21473),(3800,6,'Sun M0 (Orange radiant)','Orange and red-orange stars in this class are very abundant, making up by far the largest number of main-sequence stars in the locale of the New Eden cluster. However, many such stars are dim and in the dwarf category with the more radiant members of the class being the better known.\r\n\r\nRather cool and experiencing constant remixing of their hydrogen fuel by convection, it is believed that stars of this kind could potentially remain stable, at constant luminosity, for trillions of years. By this scale, all stars of this kind are young in terms of their potential lifetime due to the relatively short age of the universe.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20095,21475),(3801,6,'Sun A0 (Blue Small)','A small blue sun belonging to a class of relatively common dwarf stars that are often planet-bearing or accompanied by planetary dust clouds.\r\n\r\nMany stars of this kind rotate quickly and the class is known for strong hydrogen and ionized metal lines in stellar spectroscopy.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20094,21478),(3802,6,'Sun K3 (Yellow Small)','Rather small but on the main-sequence, these yellow or yellow-orange stars are very stable, remaining on the main-sequence for tens of billions of years. Abundant compared to other classes that tend to support habitable planetary systems, these stars are common targets for colonization efforts.\r\n\r\nThe stability of these stars, combined with the relatively low ultraviolet radiation flux they emit, is thought to enhance the viability of their planetary systems for the development of life.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20099,21479),(3803,6,'Sun B5 (White Dwarf)','This small white star is largely made up of degenerate matter and is slowly cooling, having ceased thermonuclear fusion after exhausting its fuel. The temperature of these stars is generally uniform through the body due to the excellent thermal conduction of degenerate electrons making up the bulk of their mass.\r\n\r\nHigh surface gravity leads to separation and purification of elements in these stars such that, while generally composed mostly of carbon and oxygen, the atmosphere is rich in lighter elements.',1e18,1,0,1,NULL,NULL,0,NULL,NULL,20098,21481),(3804,283,'VIPs','Very important people. Business executives, politicians, diplomats and game designers.',130,3,0,1,NULL,1000.0000,1,NULL,2538,NULL,0),(3805,495,'Sansha\'s Nation Central Bastion','Brimming with electronics and defensive batteries, the Sansha central bastion coordinates and collates hundreds of petabytes of Nation neural traffic daily. Frequently found at the heart of a Sansha local network, the bastion also serves as a common storage point for advanced Sansha starship modules.',1000,1000,1000,1,4,NULL,0,NULL,NULL,20199,2364),(3806,283,'Refugees','When wars and epidemics break out, people flee from their homes, forming massive temporary migrations.',400,1,0,1,NULL,NULL,1,23,2542,NULL,0),(3807,226,'Miniball hax','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,10026),(3808,283,'Prisoners','Transporting prisoners is a task that requires trust and loyalty to the empire\'s legislative arm, but it is one of the least sought-after jobs in the known universe.',560,7.5,0,1,NULL,100.0000,1,NULL,2545,NULL,0),(3809,495,'Serpentis Administration Facility','This structure houses a full staff of research techs, engineers, and pencil pushers. It is also heavily armored and upgraded with the latest in military grade anti-spacecraft batteries.',1000,1000,1000,1,8,NULL,0,NULL,NULL,20193,20651),(3810,283,'Marines','When war breaks out, the demand for transporting military personnel on site can exceed the grasp of the military organization. In these cases, the aid from non-military spacecrafts is often needed.',1000,2,0,1,NULL,1000.0000,1,23,2540,NULL,0),(3811,306,'Minmatar Academy Office','The Pilot Certification Documents can be retrieved from inside this office. ',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2366),(3812,280,'Data Sheets','These complicated data sheets may mean little to the layman\'s eye, but can prove valuable in the right hands.',1,1,0,1,NULL,150.0000,1,20,1192,NULL,0),(3814,280,'Reports','These encoded reports may mean little to the untrained eye, but can prove valuable to the relevant institution.',1,0.1,0,1,NULL,30.0000,1,20,1192,NULL,0),(3818,313,'Exile','This booster is highly addictive and has been known to cause aggressive behavior.',800,1,0,1,NULL,15500.0000,1,491,1194,NULL,0),(3820,313,'Sooth Sayer','This booster causes the subject to fall into a blissful sleep. Reports tell of abusers falling into a deep coma, never to regain consciousness.',800,1,0,1,NULL,8900.0000,1,491,1195,NULL,0),(3821,821,'Dread Guristas Commanding Officer','<font color=yellow>Subject:</font> Dread Guristas Commanding Officer (ID: Modified Caldari Raven)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Heavily modified for increased shield and weapon system performance. <br>\r\n<font color=yellow>Additional Intelligence:</font> Like the majority of Gurista craft, this ship is a variant on Caldari design, in this case the infamous Raven. Analyses of salvaged wrecks have found numerous aftermarket modifications. Common alterations include custom torpedo tubes capable of handling over-packed payloads and the removal of output governing systems on shield emitters. These systems result in a perceived increase of performance, but put crews at increased risk of burns, radiation poisoning, and, in the case of catastrophic failure, immolation in fires exceeding 10,000 Kelvin.<br>\r\n<i>Analyst Boselena, CDIA.</i><br><i>Authorized for capsuleer dissemination.</i>  ',19000000,19000000,120,1,1,NULL,0,NULL,NULL,31,2158),(3822,313,'Frentix','The Frentix fluid is used as a relaxative drug on subjects in heavy pain. Abuse of this booster is common in underground communities around the universe.',5,0.2,0,1,NULL,1400.0000,1,491,1193,NULL,0),(3823,821,'True Sansha Archduke','<font color=yellow>Subject:</font> True Sansha Archduke (ID: Modified Nightmare)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Heavily modified for increased armor and weapon system performance. <br>\r\n<font color=yellow>Additional Intelligence:</font> The Archduke Nightmare variant is favored by Sansha military outpost commanders. While perhaps not as advanced as the ships flown by Sansha incursion forces, the Archduke is clearly built with the lessons from capsuleer battles in mind: Molten salt coolant systems allow for overcharged energy turrets. Physical link cables connect key True Slave crew members directly to their ship commander, preventing any electronic interference from affecting the crew. Supplemental adaptive armor plates line the hull. <br><br>This is all in addition to several proprietary Nation modules and other experimental tech found exclusively, if inconsistently, among models of the Archduke variant.\r\n<i>Analyst Atros, CDIA.</i><br><i>Authorized for capsuleer dissemination.</i>  ',19000000,19000000,120,1,4,NULL,0,NULL,NULL,31,2295),(3824,313,'Crystal Egg','Crystal is a common feel-good booster, used and abused around the universe in abundance.',500,0.5,0,1,NULL,5000.0000,1,491,1195,NULL,0),(3825,821,'Dark Blood Hunter','<font color=yellow>Subject:</font> Dark Blood Hunter (ID: Modified Bhaalgorn)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Heavily modified for increased armor and enhanced laser penetration. <br>\r\n<font color=yellow>Additional Intelligence:</font> The Bhaalgorn variant used exclusively by Dark Blood Hunters betrays the ship\'s design goal: direct engagement with capsuleer ships. The outer hull is reinforced with a further 18 inches of armor plating. Energy turrets are fitted with a molten salt cooling system, allowing a hotter discharge. To accommodate the obscene power needs, a full two-thirds of the crew space is replaced with additional power generators. Ironically, the ship\'s advanced composition also makes it a tempting target for many capsuleers, as Dark Blood Hunter wreckage often contains advanced modules exclusive to the Blood Raider Covenant.<br>\r\n<i>Analyst Rurkanid, CDIA.</i><br><i>Authorized for capsuleer dissemination.</i>  \r\n',19000000,19000000,120,1,4,NULL,0,NULL,NULL,31,2122),(3826,313,'Mindflood','Highly addictive fluid of which the toxic fumes are inhaled through the nostrils of the user. Mindflood kills braincells quicker than submerging one\'s brain in battery acid.',5,0.2,0,1,NULL,1500.0000,1,491,1196,NULL,0),(3827,821,'Shadow Serpentis Big Boss','<font color=yellow>Subject:</font> Shadow Serpentis Big Boss (ID: Modified Vindicator)<br>\r\n<font color=yellow>Military Specifications:</font> Battleship-class vessel. Heavily modified for increased shield and weapon system performance. <br>\r\n<font color=yellow>Additional Intelligence:</font> This variant of the familiar Serpentis Vindicator was first encountered at the conclusion of a prolonged but failed SARO sweep operation. SARO ships had a sizable Serpentis fleet on the run, until a commander in this Vindicator variant entered the scene. The resilience and coordination abilities of the vessel led several SARO agents on scene to name it the Big Boss, a name which has come to be attached to the entire variant line.<br>\r\nIn addition to a second power tram to the shield emitters and redundant targeting systems, the Big Boss features the latest in Serpentis-engineered modular equipment and weaponry.<br>\r\n<i>Analyst Crarch, CDIA.</i><br>\r\n<i>Authorized for capsuleer dissemination.</i>  \r\n',19000000,19000000,120,1,8,NULL,0,NULL,NULL,31,2157),(3828,1034,'Construction Blocks','Metal girders, plasteel concrete, and fiber blocks are all common construction materials used in almost every large-scale building or manufacturing project throughout New Eden.',0,1.5,0,1,NULL,500.0000,1,1335,26,NULL,0),(3829,38,'Medium Shield Extender I','Increases the maximum strength of the shield.',0,10,0,1,NULL,NULL,1,606,1044,NULL,0),(3830,118,'Medium Shield Extender I Blueprint','',0,0.01,0,1,NULL,124740.0000,1,1549,1044,NULL,0),(3831,38,'Medium Shield Extender II','Increases the maximum strength of the shield.',0,10,0,1,NULL,NULL,1,606,1044,NULL,0),(3832,118,'Medium Shield Extender II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,1044,NULL,0),(3835,306,'Gallente Academy Office','The Pilot Certification Documents can be retrieved from inside this office. ',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,1712),(3836,526,'Pilot Certification Documents','This document, specifically designed for capsuleers, certifies that the holder has passed basic training and is cleared for further instruction, as well as general employment throughout the cluster. A basic level of piloting proficiency is required before being awarded the certification, and the capsuleers must demonstrate competency in a range of fundamental navigation and combat tasks.\r\n\r\nAlthough the document is not required by CONCORD police or empire law, it significantly adds to the employment prospects of a newly-graduated capsuleer. Throughout repeated surveys and tests one common pattern emerges; those capsuleers who complete this basic training and other more advanced courses have a much higher chance of employment with other capsuleer corporations, and generally finds themselves more confident and knowledgeable in the often turbulent and confusing first few days of becoming a full-fledged capsuleer.\r\n\r\nNot only that, but graduates get a swanky new outfit to show off to the dropouts and plebeians who couldn\'t cut it.\r\n',1,0.1,0,1,NULL,NULL,1,NULL,2908,NULL,0),(3837,314,'Token of Submission','A document representing submission to the authority of the Amarrian Empress, Jamyl Sarum.\r\n\r\nNotably, the language surrounding capsuleer fealty has been significantly watered down, revealing that even the Amarr Empire is willing to acknowledge the reality of capsuleer freedom and autonomy. ',1,0.1,0,1,NULL,NULL,1,NULL,2095,NULL,0),(3838,314,'Clearance Documents','These documents clear the holder from numerous by-laws and responsibilities within the Caldari State and abroad. \r\n\r\nThey are issued to capsuleers, who typically operate above the law and are accountable to few people. All this document does is formalize that reality, and as such, is entirely redundant and pointless. \r\n\r\nThe hypercapitalist corporate state of the Caldari is awash with these sorts of documents, however, and the tendency towards needless bureaucracy is simply a part of corporate life. ',1,0.1,0,1,NULL,NULL,1,NULL,2853,NULL,0),(3839,38,'Large Shield Extender I','Increases the maximum strength of the shield.',0,20,0,1,NULL,NULL,1,608,1044,NULL,0),(3840,118,'Large Shield Extender I Blueprint','',0,0.01,0,1,NULL,312420.0000,1,1549,1044,NULL,0),(3841,38,'Large Shield Extender II','Increases the maximum strength of the shield.',0,20,0,1,NULL,NULL,1,608,1044,NULL,0),(3842,118,'Large Shield Extender II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,1044,NULL,0),(3843,314,'Tribal Sponsorship','Tribal sponsorship is a longstanding tradition within the Minmatar Republic. Typically sponsorship is sought by an individual before embarking on a journey away from their tribe, or as part of a corporation\'s employment process. After a sometimes lengthy approval process, a Minmatar is then able to proceed with the full support of their tribal peers. \n\nTypically, a citizen of the Republic will seek sponsorship from only their family tribe, and this is usually sufficient to last their lifetime, barring any dramatic changes. In some rare circumstances, sponsorship is granted from all of the seven tribes to particularly promising individuals. \n\nIn the unique case of the capsuleers, the seven tribes of the Republic have agreed to blanket-issue sponsorships as an attempt to encourage loyalty and cooperation.',1,0.1,0,1,NULL,NULL,1,NULL,2886,NULL,0),(3844,314,'Freedom of Operation License','This document is issued to all graduate capsuleers, regardless of their ethnicity or background. \r\n\r\nIn the document, various fundamental human rights are outlined and defended, including the freedom to travel, freedom to work for a corporation of one\'s choosing, and freedom of speech within Gallente Federation borders. \r\n\r\nThe document is somewhat redundant for capsuleers, who enjoy these freedoms and others even greater. Despite this obvious fact, the Federation authorities have chosen to issue the license all the same, viewing it as a symbolic gesture, and a reminder of the Federation\'s core values. ',1,0.1,0,1,NULL,NULL,1,NULL,2853,NULL,0),(3845,306,'Amarr Cargo Rig','This industrial structure serves as a platform for warehouses and the sorting of cargo containers.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2403),(3846,306,'Caldari Cargo Rig','This industrial structure serves as a platform for warehouses and the sorting of cargo containers.',10000,27500,2700,1,4,NULL,0,NULL,NULL,NULL,2403),(3847,306,'Gallente Cargo Rig','This industrial structure serves as a platform for warehouses and the sorting of cargo containers.',10000,27500,2700,1,8,NULL,0,NULL,NULL,NULL,2403),(3848,306,'Minmatar Cargo Rig','This industrial structure serves as a platform for warehouses and the sorting of cargo containers.',10000,27500,2700,1,2,NULL,0,NULL,NULL,NULL,2403),(3849,38,'Micro Shield Extender I','Increases the maximum strength of the shield.',0,2.5,0,1,4,NULL,0,NULL,1044,NULL,0),(3851,38,'Micro Shield Extender II','Increases the maximum strength of the shield.',0,2.5,0,1,4,NULL,0,NULL,1044,NULL,0),(3858,319,'Tutorial Fuel Depot','This depot contains fuel for the surrounding structures.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2007),(3859,1109,'genericAudioEmitter','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(3863,301,'CONCORD Police Officer','This is a security vessel of CONCORD. It is patrolling this sector and will respond to any combat it detects. It can call in reinforcements from nearby sectors if the need arises.',2040000,20400,100,1,NULL,NULL,0,NULL,NULL,30,1049),(3864,15,'Amarr Citadel','',0,0,0,1,4,600000.0000,0,NULL,NULL,20158,1249),(3865,15,'Gallente Research Station','',0,1,0,1,8,600000.0000,0,NULL,NULL,20164,2308),(3866,15,'Gallente Trading Hub','',0,1,0,1,8,600000.0000,0,NULL,NULL,20165,1253),(3867,15,'Gallente Industrial Station','',0,1,0,1,8,600000.0000,0,NULL,NULL,20164,1254),(3868,15,'Gallente Administrative Station','',0,1,0,1,8,600000.0000,0,NULL,NULL,20164,1255),(3869,15,'Gallente Logistics Station','',0,1,0,1,8,600000.0000,0,NULL,NULL,20164,1256),(