,NULL,30,1055),(3884,820,'Guristas Distributor','<font color=yellow>Subject:</font> Distributor (ID: Modified Ferox) <br>\r\n<font color=yellow>Military Specifications: </font> Battlecruiser-class vessel. Heavily modified for increased shield and weapon system performance. <br>\r\n<font color=yellow>Additional Intelligence:</font> Little remains of what was once an off-the-rack Ferox cruiser. The Guristas take their security very seriously, as is evident by numerous missile launchers and support hardware to ensure they function at peak performance. Initial readouts indicate a high yield of kinetic and thermal ballistics. <br>\r\n<i>Analyst Nadiri, CDIA. </i><br>\r\n<i>Authorized for capsuleer dissemination. </i>\r\n',10100000,101000,235,1,1,NULL,0,NULL,NULL,31,2919),(3885,301,'CONCORD Police Captain','This is a security vessel of CONCORD. It is patrolling this sector and will respond to any combat it detects. It can call in reinforcements from nearby sectors if the need arises.',10100000,101000,1000,1,NULL,NULL,0,NULL,NULL,30,1051),(3886,288,'DED Army Captain','This is a security vessel of CONCORD. It is patrolling this sector and will respond to any combat it detects. It can call in reinforcements from nearby sectors if the need arises.',10100000,101000,1800,1,NULL,NULL,0,NULL,NULL,30,1052),(3887,285,'Co-Processor I','Increases CPU output.',0,5,0,1,NULL,NULL,1,676,1405,NULL,0),(3888,285,'Co-Processor II','Increases CPU output.',0,5,0,1,NULL,NULL,1,676,1405,NULL,0),(3889,820,'Slave Ation09','<font color=yellow>Subject:</font> Slave Ation09 (ID: Modified Phantasm) <br>\r\n<font color=yellow>Military Specifications:</font> Enhanced variant of Sansha\'s Nation cruiser model. Extreme caution recommended. <br>\r\n<font color=yellow>Additional Intelligence:</font> Taken during the incursion at Ation, this high-ranking officer of True Creations has been tasked with maintaining Nation\'s supply of neural paralytics, an essential component of their harvesting tactic. Naturally, he has also been commanded by Kuvakei himself to attack and destroy any threats to Nation assets. <br>\r\n<i>Senior Analyst Epo, CDIA. </i><br>\r\n<i>Authorized for capsuleer dissemination. </i>',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(3890,820,'Sarpati Family Enforcer','<font color=yellow>Subject:</font> Sarpati Family Enforcer (ID: Modified Brutix) <br>\r\n<font color=yellow>Military Specifications:</font> Battlecruiser-class vessel. Do not engage without assistance. <br>\r\n<font color=yellow>Additional Intelligence:</font> Representatives of the Sarpati family often tour Serpentis Corporation facilities to ensure that their operations are efficient and secure. They have been known to execute their own employees as examples to others and are too well paid to ever think of resigning, so they have absolutely no qualms about engaging interlopers. <br>\r\n<i>Associate Analyst Kepeck, CDIA. </i><br>\r\n<i>Authorized for capsuleer dissemination. </i>',11200000,112000,480,1,8,NULL,0,NULL,NULL,31,2917),(3891,820,'5/10 DED Angel Big Boss','This is a fighter for the Arch Angels. It is protecting the assets of Arch Angels and may attack anyone it perceives as a threat or easy pickings. Threat level: Deadly',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,2921),(3893,278,'Mining Connections','Understanding of corporate culture on the industrial level and the plight of the worker.\n\nImproves loyalty point gain by 10% per level when working for agents in the Mining corporation division.',0,0.01,0,1,NULL,20000000.0000,1,376,33,NULL,0),(3894,278,'Distribution Connections','Understanding of the way trade is conducted at the corporate level.\n\nImproves loyalty point gain by 10% per level when working for agents in the Distribution corporation division.',0,0.01,0,1,NULL,20000000.0000,1,376,33,NULL,0),(3895,278,'Security Connections','Understanding of military culture.\r\n\r\nImproves loyalty point gain by 10% per level when working for agents in the Security corporation division.',0,0.01,0,1,NULL,20000000.0000,1,376,33,NULL,0),(3897,72,'Micro Proton Smartbomb I','Radiates an omnidirectional pulse from the ship that causes explosive damage to surrounding vessels.',100,2.5,0,1,NULL,NULL,1,380,112,NULL,2034),(3898,303,'Quafe Zero','Congratulations, capsuleer! You have acquired a batch of Quafe Zero, the performance drink with the powers of a booster! Enjoy the benefits of increased reflexes with none of the drawbacks!\r\n\r\n<font color=\"yellow\">Benefits:</font>\r\n+5% Speed, +5% Scan Resolution. Duration: 1 hour.\r\n\r\n<i>Attached Ad Copy</i>\r\nAs a capsuleer, you are immortal. You have all eternity to seize your destiny. Shouldnt you have a soft drink that can perform as well as you? Quafe thinks so. Thats why weve developed Quafe Zero.\r\n\r\nUsing the latest in cutting edge biotechnology, our industry-leading scientists have reverse-engineered Quafe Zero from compounds found only in Sleeper vessels. Quafe Zero is fortified with a proprietary mix of performance enhancers, oxidizers, and natural fruit juices designed to push your abilities to the limit.\r\n\r\nThe secret is in our patented fulleroferrocene nanite delivery system, which attaches our exclusive pro-capsuleer formula directly to the neurons you want, not the ones you dont. The result is an immediate and direct boost to your performance, with Zero drawbacks!\r\n\r\n<font size=\"2\">Quafe Zero is a product of the Quafe Company. Quafe does not condone the use of boosters or other illicit substances. The Quafe Company disavows responsibility for any side effects caused by consuming Sleeper technology.\r\n\r\nWarning: Quafe Zero is designed for capsuleer use only. Side effects experienced by non-capsuleers include but are not limited to dizziness, blindness, nausea, internal hemorrhaging, IBS, sleepwalking, amnesia, sexual deviancy, vision changes, acute epidermal sloughing, partial or total loss of motor control, and minor skin rash.\r\n\r\nQuafe Zero is manufactured 