,2450000,24500,60,1,4,NULL,0,NULL,NULL,NULL,46),(3962,1106,'Customs Office Gantry','A rigid scaffold equipped with stabilizing thrusters and microgravity fabrication facilities, this gantry is designed for the erection of large, stationary structures in the orbit of planetary bodies. This model provides the skeleton for an orbital Customs Office.\r\n\r\nNote: In an effort to reduce waste, <b>the gantry will be consumed during construction</b> and its materials will be incorporated into the new structure.\r\n',1000000,7600,19500001,1,NULL,NULL,1,1410,NULL,NULL,2625),(3963,1048,'Customs Office Gantry Blueprint','',0,0.01,0,1,NULL,25000001.0000,1,NULL,0,NULL,0),(3964,1025,'Orbital Command Center','Orbital Command Centers provide the basic communication, command & control facilities necessary to integrate a planetary society and economy into an interstellar community. They serve as bases from which power can be projected into the local area, as well as hubs of economic activity.\r\n\r\nHowever, they lack the power plants, drydocks and other facilities necessary to qualify as full, starship-capable Outposts.\r\n\r\n<i>Elyse: Wait, are you the kid from Oursulaert who steals drones and sets holders\' robes on fire? (pause) I\'m on a crew with Gallente\'s Most Wanted?\r\n\r\nThaddeus: Is there going to be a problem?\r\n\r\nElyse: Hell no, this is going to be the best shift ever!\r\n\r\n- Excerpt from S1E3 of the smash hit holoseries, \"The OCC\"</i>',5000000000,100000000,25000,1,NULL,NULL,0,NULL,NULL,10031,1692),(3966,1091,'Men\'s \'Precision\' Boots','Designer: Vallou\r\n\r\nEven the strongest commander needs support. Our \"Precision\" collection introduces the latest in military style with these perfect pitch black uniform boots. Polished leather outer-soles conceal a rugged grip and metal heel-caps; Veproco-treated leather uppers maintain a sleek shine no matter the environment. Our patented shock-resistant inner cushioning reduces leg strain when you need to stay on your feet, and the dual-zip front improves fit and comfort without sacrificing style. Command in confidence.',0.5,0.1,0,1,NULL,NULL,1,1400,10254,NULL,0),(3967,226,'Fortified Gallente Station 7','Docking has been prohibited into this station without proper authorization.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,1256),(3970,226,'Federation Administrative Outpost','A standard outpost of Gallentean design.',0,0,0,1,8,NULL,0,NULL,NULL,14,2783),(3974,226,'Minmatar Service Outpost Structure','A service outpost for Minmatar traders and travelers. ',0,0,0,1,2,NULL,0,NULL,NULL,14,2758),(3975,1088,'Women\'s \'Structure\' Dress (navy)','Designer: Vallou\r\n\r\nLook sharp and competent in any situation. Our \"Structure\" dress wraps you in soft silk-blend twill with angled silver piping to remind people who\'s in charge. Our latest workforce design combines our classic \"V-Line\" shirt with a utilitarian pencil skirt for the ultimate in everyday comfort and style. Make a statement without saying a word.\r\n',0.5,0.1,0,1,NULL,NULL,1,1405,10249,NULL,0),(3977,72,'Large Proton Smartbomb I','Radiates an omnidirectional pulse from the ship that causes explosive damage to surrounding vessels.',100,50,0,1,NULL,NULL,1,381,112,NULL,2034),(3978,152,'Large Proton Smartbomb I Blueprint','',0,0.01,0,1,NULL,3000000.0000,1,341,112,NULL,0),(3979,72,'Large Proton Smartbomb II','Radiates an omnidirectional pulse from the ship that causes explosive damage to surrounding vessels.',100,50,0,1,NULL,NULL,1,381,112,NULL,2034),(3980,152,'Large Proton Smartbomb II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,112,NULL,0),(3981,72,'Large Graviton Smartbomb I','Radiates an omnidirectional pulse from the ship that causes kinetic damage to surrounding vessels.',100,50,0,1,NULL,NULL,1,381,112,NULL,2033),(3982,152,'Large Graviton Smartbomb I Blueprint','',0,0.01,0,1,NULL,3200000.0000,1,341,112,NULL,0),(3983,72,'Large Graviton Smartbomb II','Radiates an omnidirectional pulse from the ship that causes kinetic damage to 