tbomb II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,112,NULL,0),(3997,1090,'Women\'s \'Excursion\' Pants (black/gray)','Designer: Vallou\r\n\r\nVallou\'s \"Excursion\" pants in a cool interplay of black and gray are designed for the style-conscious woman who still demands combat-rated performance from her clothes. A poly wool blend covers our proprietary thermal layer designed to keep you comfortable in extreme temperatures. The Excursion also features a dynamic g-force adaptive system, constricting or loosening against your legs so you have optimal bloodflow in any adverse situation.\r\n',0.5,0.1,0,1,NULL,NULL,1,1403,10572,NULL,0),(3998,1090,'Women\'s \'Impress\' Skirt (gray)','Designer: House of Ranai\r\n\r\nMove with confidence in our two-toned Resothane and spider-silk blend \"Impress\" skirt. Subtle detailing flatters the figure in contrasting tones of professional blacks and greys, while unobtrusive back pockets preserve the slim-line silhouette.\r\n',0.5,0.1,0,1,NULL,NULL,1,1403,10584,NULL,0),(3999,1090,'Women\'s \'Impress\' Skirt (black wax)','Designer: House of Ranai\r\n\r\nMove with confidence in our two-toned Resothane and spider-silk blend \"Impress\" skirt. Subtle detailing flatters the figure in contrasting tones of professional blacks and greys, complete with a waxy sheen that catches any light, while unobtrusive back pockets preserve the slim-line silhouette.\r\n',0.5,0.1,0,1,NULL,NULL,1,1403,10581,NULL,0),(4001,1091,'Men\'s \'Trench\' Boots','Designer: Sennda of Emrayur \r\n\r\nClassic military style and boardroom chic come together in the perfect pitch black of our latest footwear. Crafted of genuine calfskins, reinforced around the foot and supple at the ankle, our classic military boot features Resothane inserts for breathability. Shok-Lite lining and a subtly stacked heel provide essential support, so you never have to worry when you\'re thinking on your feet.',0.5,0.1,0,1,NULL,NULL,1,1400,10255,NULL,0),(4002,1091,'Women\'s \'Minima\' Heels','Designer: Vallou\r\n\r\nFor a traditional look with easy sex appeal, look no further than our \"Minima\" heels. Understated elegance meets modern sensibilities with slick patent leather; our trademark \"V\" clasp securing the ankle assures the highest Vallou quality.\r\n',0.5,0.1,0,1,NULL,NULL,1,1404,10250,NULL,0),(4003,1091,'Women\'s \'Greave\' Knee-Boots','Designer: House of Ranai\r\n\r\nWho says military dress has to be unflattering? Step out in style in our \"Greave\" high-heeled boots, inspired by the gaiters of yesteryear\'s foot-soldier. Slick leather wraps up to your knee, while the structured flexible ribbing at the back provides for easy on-and-off.\r\n',0.5,0.1,0,1,NULL,NULL,1,1404,10251,NULL,0),(4004,1091,'Women\'s \'Mystrioso\' Boots','Designer: Sennda of Emrayur\r\n\r\nIn a complicated world, relax in simplicity in our \"Mystrioso\" boots. In a symphony of darkest black, leather uppers flatter any ensemble, while the toe platform provides height without strain. The transparent prismatic resin heel adds a touch of intrigue to the understated design.',0.5,0.1,0,1,NULL,NULL,1,1404,10252,NULL,0),(4005,27,'Scorpion Ishukone Watch','With its focus on electronic warfare, few ships can resist the direct onslaught of the Ishukone Watch Scorpion-class battleship\'s jamming capabilities.\r\n \r\n<font color=white><u>Details</u></font>\r\nThis variant of the Scorpion represents the pinnacle of the Ishukone paramilitary force\'s electronic warfare capabilities.\r\n \r\n<font color=white><u>Development</u></font>\r\nWhen Ishukone Watch was commissioned to produce a run of Scorpion-class battleships for its parent company, it was decided that a number of extra units would be offered to the capsuleer community to help fund the effort. Interestingly, the entire project took less than one year from start to finish, suggesting at some degree of urgency in the fleet\'s production.\r\n\r\nThe first of these vessels was awarded to Gallente pilot Jack DuVal on June 4th YC115 as a gesture of good will, after it was stolen from an Ishukone Watch shipyard in orbit of Caldari Prime by the Guristas Pirates, before being abandoned in his hangar in Korama after a lengthy pursuit across the Caldari Border Zone.\r\n \r\n<font color=white><u>Technology</u></font>\r\nThough the typical Scorpion-class battleship includes a highly advanced sensor package, Ishukone Watch modifies their ships for policing duty around their worlds. Custom multispectral radiation scanners designed to catch all forms of planetary and extra-planetary communications replace the standard comms suite. Special Ladar and thermal imaging equipment allow Ishukone Watch ships to serve as a distant eye-in-the-sky for planetary security forces. Although these features are stripped out before decommissioned hulls are placed on the open market, the infamy of the Ishukone Watch still makes ships popular with independent ship buyers.\r\n\r\n<font color=white><u>Notes</u></font>\r\nMany wonder why Ishukone Watch would produce a massive run of electronic warfare battleships, especially with sensor suites fine-tuned to detect planetside signals. Some have speculated that these ships were intended to support a larger, multinational fleet. Regarding the mass production of these ships, Ishukone Watch CEO Eborimi Shiskala praised her parent corporation with an \"incredible dedication to the Ishukone doctrine of technological superiority.\"',103600000,468000,550,1,1,71250000.0000,0,1620,NULL,20068,11536),(4006,107,'Scorpion Ishukone Watch Blueprint','',0,0.01,0,1,NULL,712500000.0000,1,NULL,NULL,NULL,50),(4007,226,'Fortified Minmatar Station','Docking has been prohibited into this station without proper authorization.',0,0,0,1,4,NULL,0,NULL,NULL,NULL,1138),(4008,1091,'Men\'s \'Lockstep\' Boots','Designer: House of Ranai\r\n\r\nLife on the cutting edge doesn\'t have to be harsh. Our \"Lockstep\" military gentleman\'s boots enfold your feet in the dark, muted colors of soft genuine leather, with reinforced toes and metal heel caps for protection. Pressure-sensitive gel insoles provide comfort and regulate temperature, while our patented limited-magnetic closure ensures a comfortable, custom fit.',0.5,0.1,0,1,NULL,NULL,1,1400,10253,NULL,0),(4009,1083,'Looking Glass Monocle Interface (right/gold)','An extremely rare and sought-after implant available only to the wealthy and powerful of New Eden, the Looking Glass monocle interface offers advanced vision augmentation beyond the capabilities of all comparable prosthetics or upgrades. Full-spectrum optic weave filters, nanofiber refraction lenses, an enhanced NeoCom uplink, and a blackbox holovid recorder linked directly to the memory centers in the temporal lobe are just some of its groundbreaking options. When combined with the specialized training and equipment unique to capsuleers, the Looking Glass is an efficient interfacing tool, not to mention a dramatic fashion statement.',0.5,0.1,0,1,NULL,NULL,1,1408,10838,NULL,0),(4010,819,'Domination Grigori','<font color=yellow>Subject:</font> Domination Grigori (ID: Modified Daredevil)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Veteran-level crew. <br>\r\n<font color=yellow>Additional Intelligence:</font> Designed specifically for lightning raids in enemy space, the Grigori variant of the daunted Daredevil can catch the inexperience ship captain unaware. What is most impressive is that, beyond a handful of experimental Angel technologies, the Grigori\'s advantage comes almost exclusively from employing an all-veteran crew.  The efficiency and skill a Grigori crew brings to battle can rival those of a capsuleer. Luckily, the loss of a Grigori crew can be extremely demoralizing for local Cartel forces, leading them to eventually abandon complexes where a Grigori was destroyed.<br>\r\n<i>Analyst Kental, <a href=showinfo:2//1000137>DED</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  ',1910000,19100,80,1,2,NULL,0,NULL,NULL,31,339),(4011,319,'Reinforced Drone Bunker','<font color=yellow>Subject:</font> Reinforced Drone Bunker<br>\r\n<font color=yellow>Summary:</font> This structure appears similar to classic drone bunkers, but is heavily  modified to withstand direct attack. <br>\r\n<font color=yellow>Additional Intelligence:</font> First appearing in YC 113, the reinforced drone bunker is an incredibly sturdy variant of the classic rogue drone bunker design. The outer hull itself is bolstered by a honeycombed mesh of tritanium-tungsten alloy, preventing breaches from tears or blunt impact. Internal systems are supplemented with multiple redundancies. <br>\r\nThe nature of rogue drones makes it difficult to determine if these improvements are the result of conscious effort or, as some engineers theorize, a sort of natural selection after years of losing traditional bunkers to capsuleer raids.<br>\r\n<i>Senior Defense Analyst Jervei, FIO.</i><br><i>Authorized for capsuleer dissemination.</i>',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2583),(4012,819,'Dread Guristas Irregular','<font color=yellow>Subject:</font> Dread Guristas Irregular (ID: Modified <a href=showinfo:17930>Worm</a>)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Veteran-level crew. <br>\r\n<font color=yellow>Additional Intelligence:</font> First encountered in YC112, the Irregular is an attack frigate modified for fast assault and first response action. A <a href=showinfo:34>tritanium</a>-reinforced hull improves survivability, as does an experimental Guristas Production Atlas capacitor. Each Irregular is, ironically, crewed by seasoned combat veterans. The average total experience of an Irregular crew is 90 years. This experience gap gives the Irregular an 83% higher survivability rating than the average Guristas frigate crew.<br>\r\n<i>Comparative Intelligence Specialist Ahelen, <a href=showinfo:2//1000042> Wiyrkomi Peace Corps</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  ',1650000,16500,235,1,1,NULL,0,NULL,NULL,31,1831),(4013,203,'RADAR Backup Array I','A backup system which operates in conjunction with the main array. Reduces the ship\'s vulnerability to jamming.\r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,0,NULL,104,NULL,0),(4014,203,'RADAR Backup Array II','A backup system which operates in conjunction with the main array. Reduces the ship\'s vulnerability to jamming.\r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,0,NULL,104,NULL,0),(4015,819,'Dark Blood Alpha','<font color=yellow>Subject:</font> Dark Blood Alpha (ID: Modified Inquisitor)<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Veteran-level crew. <br>\r\n<font color=yellow>Additional Intelligence:</font> The Dark Blood Alpha is an Inquisitor variant designed for a single purpose: lead blitzkrieg raids through empire space. Taking after capsuleer tactics, the Dark Blood Alpha coordinates groups of fast-attack frigates known as wolf packs. Wolf packs swarm larger targets, providing too many fast moving targets for the enemy weapons to track. The Dark Blood Alpha is crewed almost exclusively by veterans of past raids, making this ship the most dangerous opponent on the field. <br>\r\n<i>Analyst Fawlon, <a href=showinfo:2//1000081>Ministry of Assessment</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  \r\n',2870000,28700,135,1,4,NULL,0,NULL,NULL,31,1766),(4016,1090,'Women\'s \'Excursion\' Pants (black)','Designer: Vallou\r\n\r\nVallou\'s \"Excursion\" pants in pure midnight black are designed for the style-conscious woman who still demands combat-rated performance from her clothes. A poly wool blend covers our proprietary thermal layer designed to keep you comfortable in extreme temperatures. The 