ocle Interface (right/gray)','An extremely rare and sought-after implant available only to the wealthy and powerful of New Eden, the Looking Glass monocle interface offers advanced vision augmentation beyond the capabilities of all comparable prosthetics or upgrades. Full-spectrum optic weave filters, nanofiber refraction lenses, an enhanced NeoCom uplink, and a blackbox holovid recorder linked directly to the memory centers in the temporal lobe are just some of its groundbreaking options. When combined with the specialized training and equipment unique to capsuleers, the Looking Glass is an efficient interfacing tool, not to mention a dramatic fashion statement.',0.5,0.1,0,1,NULL,NULL,1,1408,10219,NULL,0),(4043,1083,'Odin Synthetic Eye (left/dark)','The Odin synthetic eye is a favorite of space jockeys who still need to wine and dine with the best. Nanite-constructed filament-lenses and cutting-edge optics are suspended in a sterile gel, all housed in a membrane of transparent polyethylene terephthalate. The result is a fully functional human optic replacement subtle enough for any occasion.',0.5,0.1,0,1,NULL,NULL,1,1408,10220,NULL,0),(4044,53,'Sleeper Turret Small','Small Sleeper Turret',500,5,1,1,NULL,NULL,0,NULL,350,NULL,11550),(4045,53,'Sleeper Turret Medium','Medium Sleeper Turret',2500,25,1,1,NULL,NULL,0,NULL,356,NULL,11549),(4046,1083,'Odin Synthetic Eye (left/gold)','The Odin synthetic eye is a favorite of space jockeys who still need to wine and dine with the best. Nanite-constructed filament-lenses and cutting-edge optics are suspended in a sterile gel, all housed in a membrane of transparent polyethylene terephthalate. The result is a fully functional human optic replacement subtle enough for any occasion.',0.5,0.1,0,1,NULL,NULL,1,1408,10221,NULL,0),(4048,1083,'Odin Synthetic Eye (left/gray)','The Odin synthetic eye is a favorite of space jockeys who still need to wine and dine with the best. Nanite-constructed filament-lenses and cutting-edge optics are