 fuel block types, for maximum convenience.',0,5,0,40,NULL,95.0000,1,1870,10834,NULL,0),(4052,1083,'Looking Glass Monocle Interface (left/gray)','An extremely rare and sought-after implant available only to the wealthy and powerful of New Eden, the Looking Glass monocle interface offers advanced vision augmentation beyond the capabilities of all comparable prosthetics or upgrades. Full-spectrum optic weave filters, nanofiber refraction lenses, an enhanced NeoCom uplink, and a blackbox holovid recorder linked directly to the memory centers in the temporal lobe are just some of its groundbreaking options. When combined with the specialized training and equipment unique to capsuleers, the Looking Glass is an efficient interfacing tool, not to mention a dramatic fashion statement.',0.5,0.1,0,1,NULL,NULL,1,1408,10224,NULL,0),(4054,1088,'Women\'s \'Executor\' Coat','Designer: House of Ranai\r\n\r\nIn today\'s cutthroat political environment, maintaining a commanding presence is essential. Lead from the front in our high-collared Resothane and spider-silk \"Executor\" coat. The bold, clean lines of our latest design offer you that sleek, tailored, and uncompromising impression. The contrasting yoke and black silk detailing build a military-sharp appearance that will guarantee their undivided attention.\r\n',0.5,0.1,0,1,NULL,NULL,1,1405,10234,NULL,0),(4057,1089,'Men\'s \'Sterling\' Dress Shirt (black)','Designer: Sennda of Emrayur\r\n\r\nModeled after the Class B military blouses found in several modern navies, the pitch-black \"Sterling\" dress shirt is designed to cope with the realities of daily service while maintaining the image of an orderly fighting force. Our dark wool blends are specially treated to resist staining, even tough grease and oil stains common on modern starships. Silver thread highlights and sterling silver chevrons finish the high-contrast look.\r\n',0.5,0.1,0,1,NULL,NULL,1,1398,10239,NULL,0),(4058,1089,'Men\'s \'Sterling\' Dress Shirt (navy)','Design