089,'Men\'s \'Sterling\' Dress Shirt (red/black leather)','Designer: Sennda of Emrayur\r\n\r\nModeled after the Class B military blouses found in several modern navies, the detailed, rugged leather \"Sterling\" dress shirt is designed to cope with the realities of daily service while maintaining the image of an orderly fighting force. Our dark wool blends are specially treated to resist staining, even tough grease and oil stains common on modern starships. Red thread highlights and red chevrons - reportedly treated with traces of Morphite - finish the high-contrast look.\r\n',0.5,0.1,0,1,NULL,NULL,1,1398,10810,NULL,0),(4243,1089,'Men\'s \'Sterling\' Dress Shirt (white/blue)','Designer: Sennda of Emrayur\r\n\r\nModeled after the Class B military blouses found in several modern navies, the crisply contrasted bone white and navy blue \"Sterling\" dress shirt is designed to cope with the realities of daily service while maintaining the image of an orderly fighting force. Our dark wool blends are specially treated to resist staining, even tough grease and oil stains common on modern starships. Silver thread highlights and sterling silver chevrons finish the high-contrast look.\r\n',0.5,0.1,0,1,NULL,NULL,1,1398,10811,NULL,0),(4244,1088,'Men\'s \'Field Marshal\' Coat (green)','Designer: Vallou Outerwear \r\n\r\nFor the discerning gentleman officer, our august green \"Field Marshal\" coat is an essential part of any commandant\'s wardrobe. Whether commanding troops in the field or inspecting facilities, command respect while remaining comfortable and secure. Our patented polycel and silk mix offers durability and softness, and we\'ve gone the extra length with a weather-fast Kruna-wool lining for added warmth.\r\n',0.5,0.1,0,1,NULL,NULL,1,1399,10771,NULL,0),(4245,1088,'\'Silvershore\' Greatcoat','Designer: Vallou (Limited Collection)\r\n\r\nThe distinctive design of Vallou\'s officer coats is inspired by historical images of high-ranking military members from the heyday of the Garoun Empire, ancestors of the Gallente Federation. The most prestigious of these was the silver-lined leather coat worn by the Admiral of the Fleet, arguably the most important official in a kingdom so heavily reliant on maritime dominance.\r\n\r\nOne of the rarest and most sought-after items in Vallou\'s renowned Limited Collection, the Silvershore greatcoat is also one of the most expensive articles of clothing ever created. From the top-quality Caillian leather to the burnished platinum clasps, every aspect of this stately raiment has been carefully shaped to evoke the mystery, grandeur and peril of the unexplored.\r\n\r\n',0.5,0.1,0,1,NULL,NULL,1,1399,10772,NULL,0),(4246,1136,'Hydrogen Fuel Block','Frustrated with the inefficiencies involved in tracking multiple fuel types, Thukker logisticians pioneered the development of prepackaged fuel. In YC 111, after a successful trial period, they converted the Tribe\'s entire starbase network to use fuel blocks. Capsuleers were forced to wait for this innovation while CONCORD dithered over how to handle the transition period, but were finally granted clearance in YC 113.\n\nThis is a block of fuel designed for Minmatar control towers and Standup service modules. Forty blocks are sufficient to run a standard large tower for one hour, while medium and small towers require twenty and ten blocks respectively over the same period.\nStandup service modules are designed to be fit to Upwell structures such as the advanced Citadel structure line. These service modules consume fuel blocks while running and are capable of using any of the four fuel block types, for maximum convenience.',0,5,0,40,NULL,95.0000,1,1870,10836,NULL,0),(4247,1136,'Helium Fuel Block','Frustrated with the inefficiencies involved in tracking multiple fuel types, Thukker logisticians pioneered the development of prepackaged fuel. In YC 111, after a successful trial period, they converted the Tribe\'s entire starbase network to use fuel blocks. Capsuleers were forced to wait for this innovation while CONCORD dithered over how to handle the transition period, but were finally granted clearance in YC 113.\n\nThis is a block of fuel designed for Amarr control towers and Standup service modules. Forty blocks are sufficient to run a standard large tower for one hour, while medium and small towers require twenty and ten blocks respectively over the same period.\nStandup service modules are designed to be fit to Upwell structures such as the advanced Citadel structure line. These service modules consume fuel blocks while running and are capable of using any of the four fuel block types, for maximum convenience.',0,5,0,40,NULL,95.0000,1,1870,10835,NULL,0),(4248,899,'Warp Disruption Field Generator II','The field generator projects a warp disruption sphere centered upon the ship for its entire duration. The field prevents any warping or jump drive activation within its area of effect.\r\n\r\nThe generator has several effects upon the parent ship whilst active. It increases its signature radius and agility whilst penalizing the velocity bonus of any afterburner or microwarpdrive modules. It also prevents any friendly remote effects from being rendered to the parent ship.\r\n\r\nThis module\'s effect can be modified with scripts. When scripted it prevents capital class ships from using stargates (excluding Jump Freighters, Freighters and the Orca). \r\n\r\nNote: Can only be fitted on the Heavy Interdiction Cruisers.',0,50,1,1,NULL,3964874.0000,1,1085,21489,NULL,20396),(4249,132,'Warp Disruption Field Generator II Blueprint','',0,0.01,0,1,NULL,50000000.0000,1,NULL,111,NULL,0),(4250,650,'Small Tractor Beam II','By manipulating gravity fields, this module can pull cargo containers towards the ship.',50,50,0.8,1,NULL,1308176.0000,1,872,2986,NULL,11867),(4251,723,'Small Tractor Beam II Blueprint','',0,0.01,0,1,NULL,90000.0000,1,NULL,349,NULL,0),(4252,650,'Capital Tractor Beam II','By manipulating gravity fields, this module can pull cargo containers towards the ship.\r\n\r\nNote: This tractor beam can only be fitted on the Rorqual ORE Capital Ship.',50,4000,0.8,1,NULL,1555840.0000,1,872,2986,NULL,11868),(4253,723,'Capital Tractor Beam II Blueprint','',0,0.01,0,1,NULL,400000000.0000,1,NULL,349,NULL,0),(4254,339,'Micro Auxiliary Power Core II','Supplements the main Power core providing more power.',0,20,0,1,NULL,NULL,1,660,2105,NULL,0),(4255,352,'Micro Auxiliary Power Core II Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,NULL,84,NULL,0),(4256,862,'Bomb Launcher II','A missile launcher bay module facilitating bomb preparation, and deployment.\r\n\r\nNote: Bomb Launchers can only be equipped by Stealth Bombers and each bomber can only equip one bomb launcher. Your ship must be at the minimum velocity before you can activate this module.',0,50,300,1,4,80118.0000,1,1014,2677,NULL,20066),(4257,136,'Bomb Launcher II Blueprint','',0,0.01,0,1,NULL,19000000.0000,1,NULL,170,NULL,170),(4258,481,'Core Probe Launcher II','Launcher for <a href=showinfo:30013>Core Scanner Probes</a>, which are used to scan down Cosmic Signatures in space.\r\n\r\nNote: Only one probe launcher can be fitted per ship.\r\n\r\n5% bonus to strength of scan probes.',0,5,0.8,1,NULL,6000.0000,1,712,2677,NULL,0),(4259,918,'Core Probe Launcher II Blueprint','',0,0.01,0,1,NULL,60000.0000,1,NULL,168,NULL,0),(4260,481,'Expanded Probe Launcher II','Launcher for <a href=showinfo:30013>Core Scanner Probes</a> and <a href=showinfo:30028>Combat Scanner Probes</a>.\r\n\r\n<a href=showinfo:30013>Core Scanner Probes</a> are used to scan down Cosmic Signatures in space.\r\n<a href=showinfo:30028>Combat Scanner Probes</a> are used to scan down Cosmic Signatures, starships, structures and drones.\r\n\r\nNote: Only one scan probe launcher can be fitted per ship.\r\n\r\n5% bonus to strength of scan probes.',0,5,8,1,NULL,6000.0000,1,712,2677,NULL,0),(4261,918,'Expanded Probe Launcher II Blueprint','',0,0.01,0,1,NULL,60000.0000,1,NULL,168,NULL,0),(4262,