dvanced units allow the use of multiple systems.\r\n\r\nNote: The Fleet bonus only works if you are the assigned fleet booster.',0,60,0,1,NULL,NULL,1,NULL,2858,NULL,0),(4279,532,'Mining Foreman Link - Mining Laser Field Enhancement II Blueprint','',0,0.01,0,1,NULL,1732280.0000,1,NULL,21,NULL,0),(4280,316,'Siege Warfare Link - Active Shielding II','Increases the speed of the fleet\'s shield boosters and decreases the duration of shield transporters. Will not affect Capital-sized personal shield boosters.\r\n\r\nWarfare links are dedicated fleet command systems designed for use on battlecruisers and advanced command class ships.\r\n\r\nWhile only one of these units can normally be operated at any given time, certain advanced units allow the use of multiple systems.\r\n\r\nNotes: The Fleet bonus only works if you are the assigned fleet booster. This module cannot activate inside a starbase forcefield.',0,60,0,1,NULL,NULL,0,NULL,2858,NULL,0),(4281,532,'Siege Warfare Link - Active Shielding II Blueprint','',0,0.01,0,1,NULL,1732280.0000,0,NULL,21,NULL,0),(4282,316,'Siege Warfare Link - Shield Efficiency II','Reduces the capacitor need of the fleet\'s shield boosters and shield transporters.\r\n\r\nWarfare links are dedicated fleet command systems designed for use on battlecruisers and advanced command class ships.\r\n\r\nWhile only one of these units can normally be operated at any given time, certain advanced units allow the use of multiple systems.\r\n\r\nNotes: The Fleet bonus only works if you are the assigned fleet booster. This module cannot activate inside a starbase forcefield. The Fleet bonus provided by this module does not apply to Capital sized local booster modules.',0,60,0,1,NULL,NULL,0,NULL,2858,NULL,0),(4283,532,'Siege Warfare Link - Shield Efficiency II Blueprint','',0,0.01,0,1,NULL,1732280.0000,0,NULL,21,NULL,0),(4284,316,'Siege Warfare Link - Shield Harmonizing II','Boosts all shield resistances for the fleet\'s ships.\r\n\r\nWarfare links are dedicated fleet command systems designed for use on battlecruisers and advanced command class ships.\r\n\r\nWhile only one of these units can normally be operated at any given time, certain advanced units allow the use of multiple systems.\r\n\r\nNotes: The Fleet bonus only works if you are the assigned fleet booster. This module cannot activate inside a starbase forcefield.',0,60,0,1,NULL,NULL,0,NULL,2858,NULL,0),(4285,532,'Siege Warfare Link - Shield Harmonizing II Blueprint','',0,0.01,0,1,NULL,1732280.0000,0,NULL,21,NULL,0),(4286,316,'Skirmish Warfare Link - Evasive Maneuvers II','Lowers the signature radius of ships in the fleet.\r\n\r\nWarfare links are dedicated fleet command systems designed for use on battlecruisers and advanced command class ships.\r\n\r\nWhile only one of these units can normally be operated at any given time, certain advanced units allow the use of multiple systems.\r\n\r\nNotes: The Fleet bonus only works if you are the assigned fleet booster. This module cannot activate inside a starbase forcefield.',0,60,0,1,NULL,NULL,0,NULL,2858,NULL,0),(4287,532,'Skirmish Warfare Link - Evasive Maneuvers II Blueprint','',0,0.01,0,1,NULL,1732280.0000,0,NULL,21,NULL,0),(4288,316,'Skirmish Warfare Link - Interdiction Maneuvers II','Boosts the range of the fleet\'s propulsion jamming modules, except for Warp Disruption Field Generators.\r\n\r\nWarfare links are dedicated fleet command systems designed for use on battlecruisers and advanced command class ships.\r\n\r\nWhile only one of these units can normally be operated at any given time, certain advanced units allow the use of multiple systems.\r\n\r\nNotes: The Fleet bonus only works if you are the assigned fleet booster. This module cannot activate inside a starbase forcefield.',0,60,0,1,NULL,NULL,0,NULL,2858,NULL,0),(4289,532,'Skirmish Warfare Link - Interdiction Maneuvers II Blueprint','',0,0.01,0,1,NULL,1476280.0000,0,NULL,21,NULL,0),(4290,316,'Skirmish Warfare Link - Rapid Deployment II','Increases the speed of the fleet\'s afterburner and microwarpdrive modules.\r\n\r\nWarfare links are dedicated fleet command systems designed for use on battlecruisers and advanced command class ships.\r\n\r\nWhile only one of these units can normally be operated at any given time, certain advanced units allow the use of multiple systems.\r\n\r\nNotes: The Fleet bonus only works if you are the assigned fleet booster. This module cannot activate inside a starbase forcefield.',0,60,0,1,NULL,NULL,0,NULL,2858,NULL,0),(4291,532,'Skirmish Warfare Link - Rapid Deployment II Blueprint','',0,0.01,0,1,NULL,1732280.0000,0,NULL,21,NULL,0),(4292,515,'Siege Module II','An electronic interface designed to augment and enhance a dreadnought\'s siege warfare abilities. Through a series of electromagnetic polarity field shifts, the siege module diverts energy from the ship\'s propulsion and warp systems to lend additional power to its offensive and defensive capabilities.\r\n\r\nThis results in a tremendous increase in damage, as well as a greatly increased rate of defensive self-sustenance. Defensive benefits include improved self-repair and shield boosting effectiveness, as well as increased resistance to most forms of  electronic warfare. As a side effect of the ionic field created by the siege module, beneficial remote repair and capacitor transfer effects are ineffective against the fitted ship while the module is active.\r\nIn addition, the lack of power to locomotion systems means that neither standard propulsion nor warp travel are available to the ship nor are you allowed to dock until out of siege mode.\r\n\r\nNote: A siege module requires Strontium clathrates to run and operate effectively. Only one siege module can be fitted to a dreadnought class ship. The increased shield boosting and armor repairing gained from the Siege Module is subject to a stacking penalty when used with other similar modules that affect the same attribute on the ship.',1,4000,0,1,NULL,47022756.0000,1,801,2851,NULL,0),(4293,516,'Siege Module II Blueprint','',0,0.01,0,1,NULL,522349680.0000,1,NULL,21,NULL,0),(4294,515,'Triage Module II','An electronic interface designed to augment and enhance a Force Auxiliary Ship\'s defenses and logistical abilities. Through a series of electromagnetic polarity field shifts, the triage module diverts energy from the ship\'s propulsion and warp systems to lend additional power to its defensive and logistical capabilities.\r\n\r\nThis results in a great increase in the Force Auxiliary\'s ability to provide aid to members of its fleet, as well as a greatly increased rate of defensive self-sustenance. Defensive benefits include improved self-repair and shield boosting effectiveness, as well as increased resistance to most forms of  electronic warfare. As a side effect of the ionic flux created by the triage module, beneficial remote repair and capacitor transfer effects are ineffective against the fitted ship while the module is active.\r\n\r\nThe flux only disrupts incoming effects, however, meaning the Force Auxiliary can still provide aid to its cohorts. Sensor strength and targeting capabilities are also significantly boosted. In addition, the lack of power to locomotion systems means that neither standard propulsion nor warp travel are available to the ship, nor is the Force Auxiliary able to dock until out of triage mode. Finally, any drones currently in space will be unable to deal damage when the module is activated.\r\n\r\nNote: A triage module requires Strontium Clathrates to run and operate effectively. Only one triage module can be run at any given time, so fitting more than one has no practical use. The remote repair module bonuses are only applied to capital sized modules. The increased shield boosting and armor repairing gained from the Triage Module is subject to a stacking penalty when used with other similar modules that affect the same attribute on the ship.\r\n\r\nThis module can only be fit on Force Auxiliary Ships.',1,4000,0,1,NULL,47022756.0000,1,801,3300,NULL,0),(4295,516,'Triage Module II Blueprint','',0,0.01,0,1,NULL,522349680.0000,1,NULL,21,NULL,0),(4296,585,'Medium Remote Hull Repairer II','This module uses nano-assemblers to repair damage done to the hull of the Target ship.',20,10,0,1,NULL,31244.0000,1,1061,21428,NULL,0),(4298,870,'Medium Remote Hull Repairer II Blueprint','',0,0.01,0,1,NULL,2000000.0000,1,NULL,80,NULL,0),(4299,585,'Small Remote Hull Repairer II','This module uses nano-assemblers to repair damage done to the hull of the Target ship.',20,5,0,1,NULL,31244.0000,1,1060,21428,NULL,0),(4300,870,'Small Remote Hull Repairer II Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,NULL,80,NULL,0),(4301,474,'Outgrowth Rogue Drone Hive Pass Key','This is a pass key handed out by Jeremy Tacs.',1,0.1,0,1,NULL,NULL,1,NULL,2038,NULL,0),(4302,1201,'Oracle','In YC 113 Empress Jamyl Sarum I challenged <a href=showinfo:30//500003>Amarr</a> ship manufacturers to build a new battlecruiser that would break the stalemate of the Empyrean War. Deviating from the doctrine of brute-force and heavy armor, the engineers at <a href=showinfo:2//1000066>Viziam</a> took inspiration from <a href=showinfo:30//500001>Caldari</a> history.\r\n<br>During the Gallente-Caldari War, the Caldari developed light, maneuverable ships to counter the slow ships of the <a href=showinfo:30//500004>Gallente Federation</a>. This philosophy, along with a cutting-edge powertrain and ultra-light alloy armor plating, led to the Oracle.\r\n<br>The Empire immediately ordered the ship into production. The Empress personally congratulated Viziam Chief Researcher <a href=showinfo:1383//3014474>Parud Vakirokiki</a>, calling the ship \"a work of Divine Grace for the Empire, and retribution to our enemies.\"',14760000,234000,500,1,4,62500000.0000,1,470,NULL,20061,11775),(4303,1141,'Research Abstract: Project Tesseract','<b>Paper:</b> Project Tesseract - An Investigation into the Causes of the Seyllin Incident and the properties of A0 Blue stars and Isogen-5.<br>\r\n<b>Lead Researcher:</b> Rhavas<br>\r\n<b>Contributors:</b> Mark726, Dr Amira, Julianus Soter, Morwen Lagann, Darth Skorpius, The Antiquarian<br>\r\n<b>Summary:</b> In YC 111, one of the deadliest events in recent memory, the March Seyllin Incident, extinguished nearly 500 million souls as the system\'s A0-class blue sun poured radioactive energy along a magnetic field anomaly and directly into the depths of the first planet in the system, <a href=showinfo:30889//40318018>Seyllin I</a>. \r\n\r\nThe energy released by this event was so great that it may have triggered the opening of the wormhole network in addition to simultaneously decimating eight other planets which orbited similar A0 Blue stars. A chief aim of this project is to understand the causes and mechanics driving such incredible destruction. \r\n\r\nThis project has compiled all the known data on the subject, including multiple expeditions to shattered planet systems (located across both New Eden and wormhole space). We expect to uncover significant details about the mechanics of wormhole initiation as well as the role and power of Isogen-5, which is implicated in the events of that day.\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system (beacon designation - <b>AJS1: Antiquus</b>).<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4304,1141,'Research Abstract: Project Theseus','<b>Paper:</b> Project Theseus<br>\r\n<b>Lead Researcher:</b> Valerie Valate<br>\r\n<b>Contributors:</b> Aedeal, Horatius Caul, Calen Davrissus, Kathryn Dougans, Myyona, Katy Moore, Gosakumori Noh<br>\r\n<b>Summary:</b> The Labyrinth deadspace complex in <a href=showinfo:5//30004124>Aphi</a> is one of the major Takmahl relic sites found in the <a href=showinfo:4//20000603>Araz constellation</a>. Project Theseus set out to map the Labyrinth, perform a survey of the site, identify any Takmahl artifacts present, and to aid in future projects investigating Takmahl culture in Araz. \r\n\r\nTeams of ships entered the Labyrinth to combat the Minotaur guardians within and explore the site. The result of those efforts was a three-dimensional map which reveals much about the shape of the Labyrinth, in addition to containing useful information about the types and quantities of Takmahl artifacts to be found there.  \r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4305,489,'Oracle Blueprint','',0,0.01,0,1,NULL,625000000.0000,1,589,NULL,NULL,1748),(4306,1201,'Naga','The Naga was designed in YC 109 by <a href=showinfo:2//1000043>Corporate Police Force</a> as an anti-<a href=showinfo:30//500010>Guristas</a> ship, sacrificing the usual robust <a href=showinfo:2//1000035>Caldari Navy</a> standards in favor of supporting battleship-class weaponry. It was rejected by <a href=showinfo:2//1000005>Hyasyoda</a> management for being overspecialized.\r\n<br>The Naga design remained in the Hyasyoda archives, forgotten (save for a cameo in the Gallente holo-series <i>CPF Blue</i>). In YC 113 the Caldari Navy entertained contracts for a new tier of gunboat battlecruiser. Hyasyoda quickly submitted and won with the Naga, underbidding both <a href=showinfo:2//1000010>Kaalakiota</a> and <a href=showinfo:2//1000019>Ishukone</a>.\r\n<br>The Naga is effective in any campaign where fast, mobile firepower is required.',15000000,252000,575,1,1,61500000.0000,1,471,NULL,20068,11776),(4307,489,'Naga Blueprint','',0,0.01,0,1,NULL,615000000.0000,1,590,NULL,NULL,1748),(4308,1201,'Talos','The Talos began in YC 110 as a R&D concept by <a href=showinfo:30//500014>ORE</a>. Conceived as a patrol craft for mining operations in lawless space, the Talos would have been abandoned completely were it not adopted by the Black Eagles, a black-ops branch of the <a href=showinfo:30//500004>Gallente</a> government. The Black Eagles stripped the Talos of non-essential systems and bolted on battleship-class weapons, creating a quick-strike craft ideal for guerilla action. \r\n<br>The Talos remained a military secret until YC 113, when it was introduced into wider circulation as a third tier battlecruiser. Today the Talos is manufactured by <a href=showinfo:2//1000109>Duvolle Labs</a>, who modified the original ORE designs to bring it in line with Gallente standards.',15552000,270000,600,1,8,65000000.0000,1,472,NULL,20072,11777),(4309,489,'Talos Blueprint','',0,0.01,0,1,NULL,650000000.0000,1,591,NULL,NULL,1748),(4310,1201,'Tornado','In YC 113 <a href=showinfo:2//1000054>Republic Security Services</a> learned the <a href=showinfo:30//500003>Amarr Empire</a> was building a new battlecruiser capable of supporting battleship-class weapons. Determined to not lose their technological edge to their adversaries, <a href=showinfo:2//1000051>Republic Fleet</a> commissioned <a href=showinfo:2//1000057>Boundless Creation</a> to construct a gunboat to match.<br><br>What they designed was the Tornado. Developed in record time and total secrecy, the Tornado is a testament to Minmatar engineering. Modeled loosely off of flying-wing designs of ancient planetary bombers, the Tornado supports multiple large projectile turrets, dealing massive damage while maintaining a small signature radius.',15228000,216000,535,1,2,59200000.0000,1,473,NULL,20076,11778),(4311,489,'Tornado Blueprint','',0,0.01,0,1,NULL,592000000.0000,1,592,NULL,NULL,1748),(4312,1136,'Oxygen Fuel Block','Frustrated with the inefficiencies involved in tracking multiple fuel types, Thukker logisticians pioneered the development of prepackaged fuel. In YC 111, after a successful trial period, they converted the Tribe\'s entire starbase network to use fuel blocks. Capsuleers were forced to wait for this innovation while CONCORD dithered over how to handle the transition period, but were finally granted clearance in YC 113.\n\nThis is a block of fuel designed for Gallente control towers  and Standup service modules. Forty blocks are sufficient to run a standard large tower for one hour, while medium and small towers require twenty and ten blocks respectively over the same period.\nStandup service modules are designed to be fit to Upwell structures such as the advanced Citadel structure line. These service modules consume fuel blocks while running and are capable of using any of the four fuel block types, for maximum convenience.',0,5,0,40,NULL,95.0000,1,1870,10833,NULL,0),(4313,1137,'Oxygen Fuel Block Blueprint','',0,0.01,0,1,8,10000000.0000,1,1920,10833,NULL,0),(4314,1137,'Nitrogen Fuel Block Blueprint','',0,0.01,0,1,1,10000000.0000,1,1920,10834,NULL,0),(4315,1137,'Helium Fuel Block Blueprint','',0,0.01,0,1,4,10000000.0000,1,1920,10835,NULL,0),(4316,1137,'Hydrogen Fuel Block Blueprint','',0,0.01,0,1,2,10000000.0000,1,1920,10836,NULL,0),(4318,1025,'InterBus Customs Office','Orbital Customs Offices are the primary points of contact between planetary and interplanetary economies. These facilities, resembling massive hangars in space, provide high-volume, high-frequency cargo transport services between a planet\'s surface and orbit.\r\n\r\n<i>Excerpt from the Amarr Prime Customs Agency regulations, section 17, subsection 4, paragraph 8:\r\n\r\nThe following items may only be imported or exported with the express prior approval of the Imperial Underscrivener for Commercial Affairs:\r\n\r\nNarcotic substances; handheld firearms; slaver hounds (except as personal property); Mindflood; live insects; ungulates; Class 1 refrigerants and aerosols; forced laborers/personal slaves (or other sapient livestock); animal germ-plasm; biomass of human origin; xenobiotics; walnuts.</i>',5000000000,100000000,35000,1,4,NULL,0,NULL,NULL,10030,4579),(4319,226,'Protest Monument','This was once a memorial to the winners of a riddle contest sponsored by late entrepreneur Ruevo Aram. After standing proud for half a decade, it was destroyed in late YC113 by capsuleers who were staging a mass uprising against an intolerable status quo of intergalactic affairs. Today, the ruins of this once-great work of art stand as a testament to the fact that change is the universe\'s only constant.',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,11854),(4320,1141,'Research Abstract: Project Theta','<b>Paper:</b> Project Theta<br>\r\n<b>Lead Researcher:</b> Norman Vales<br>\r\n<b>Contributors:</b> Authochthonian, Chevalleis<br>\r\n<b>Summary:</b> The present goal of Project Theta is to produce laboratory equipment for use in attempting safe communications with rogue drones. Project Theta aims to achieve this goal by repurposing and reverse engineering available rogue drone technology to create a communications subnet intended to interface with the more advanced rogue drone networks.\r\n\r\nThe three-unit communications system includes an override of the present comms systems, designed as a protective measure. It has also been designed to provide on-the-fly encoding and decoding. Future testing will be necessary to determine if the system will work as required.\r\n\r\nBased on the <a href=showinfo:23678>Aether Hive Link</a> the network remains experimental, and will be part of an isolated communications system. Recent lab tests have indicated a bandwidth of at least ten times that which is available to typical businesses.\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4321,1141,'Research Abstract: Project Blueprint','<b>Paper:</b> Project Blueprint<br>\r\n<b>Lead Researchers:</b> Adainy Gwanwyn, Emily Dallocort<br>\r\n<b>Contributors:</b> Mark726<br>\r\n<b>Summary:</b> The premise of Project Blueprint is to acquire photographic samples (along with standard documentation) of Sleeper constructs to determine their similarity, if any, to those produced in known space. Currently, researchers are in the initial phases of gathering samples of New Eden\'s structures to compare to the Sleeper constructs once wormhole excursions begin.\r\n\r\nThe purpose behind gathering this information is manifold:<br>\r\n   1. To investigate if Sleeper constructs hold any sort of cultural significance to the Sleepers themselves;<br>\r\n   2. To investigate if Sleepers build their constructs to establish permanent homes or temporary sites<br>\r\n   3. To assist in determining the relationship between Sleepers and the Talocan.\r\n\r\nUltimately, information gathered from Project Blueprint could be used to assist other Project teams (ideally, those under the <a href=evebrowser:http://wiki.eveonline.com/en/wiki/Arek%27Jaalan:_Sleeper_History>Sleeper History division</a>), and to help further the efforts of those in the Arek\'Jaalan initiative.\r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>\r\n',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4322,1141,'Research Abstract: Project Catapult','<b>Paper:</b> Project Catapult, A Study of the Sansha Wormhole Generator Method<br>\r\n<b>Lead Researcher:</b> Rhavas<br>\r\n<b>Contributors:</b> Grideris, Mark726, Morwen Lagann, Razz Skyshatter, Tuoro<br>\r\n<b>Summary:</b> New Eden is under siege by Sansha Kuvakei and his Nation. Entire systems are attacked and disabled, but he reserves his most massive, propagandist attacks for the Slaves and Citizens, who come in <a href=showinfo:3628>Nation</a>-class supercapitals to destroy the capsuleer fleets. The hallmarks of these invasions are multiple wormholes under the direct control of Sansha\'s Nation. While the battle between the capsuleer community and Kuvakei lies outside the scope of the Arek\'Jaalan project, wormhole generation and stabilization technology represents a potentially critical link to understanding both current wormholes and the transportation capabilities and technologies of the ancient races.\r\n\r\nBy analyzing information captured by our sensors, probes and contacts, we hope to gather sufficient information to reverse engineer and recreate this technology. Three goals are indicated for this purpose: \r\n\r\n   1. Create new methods of point-to-point interstellar travel, either by enabling greater distances or a broader range of jump-capable vessels.<br>\r\n   2. Provide deeper insights to the basic functional physics of wormholes to help drive the efforts of <a href=showinfo:4333>Project Slipstream</a><br>\r\n   3. Provide potential insights into whether Sansha\'s Nation wormhole generators were created by the Nation, captured from the Jove, or adapted from the technology of ancient races (if so, those findings will be used to further inform <a href=evebrowser:http://wiki.eveonline.com/en/wiki/Project_Gateway>Project Gateway</a> and <a href=evebrowser:http://wiki.eveonline.com/en/wiki/Project_Rift>Project Rift</a>).\r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4323,1141,'Research Abstract: Project Common Ground','<b>Paper</b>: Project Common Ground<br>\r\n<b>Lead Researcher</b>: Unit XS365BT<br>\r\n<b>Contributors</b>: None.<br>  \r\n<b>Summary:</b> This paper is a theoretical study on a possible history of the Talocan and Sleeper species, and their potential links to the rogue drone and capsuleer communities.\r\n\r\nIt theorizes that the Sleeper species was originally the Talocan equivalent of the capsuleer and that a war occurred between the Talocan and their creations, culminating in the release of an AI virus by the Talocan in an attempt to survive the conflict. This AI virus ravaged the Sleeper species, but not before they transmitted a large quantity of data to a secure storage device they had sent far from their own region of space. This data, when uncovered, gave rise to the rogue drone species.\r\n\r\nThis paper was created to serve as a theoretical basis for future projects.\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>\r\n',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4324,1141,'Research Abstract: Project Huntress Green (1 of 3)','<b>Paper:</b> Project Huntress Green - The Nature of Life in Anoikis<br>\r\n<b>Lead Researcher:</b> Gaia Ma\'chello<br>\r\n<b>Contributors:</b> James Arget, Tas Caern and Vincent Athena<br>\r\n<b>Summary:</b> Examination of biological samples obtained from planets in Anoikis has shown that life there is closely related to that found in known sectors of space. Both use DNA as the genetic material, and both use the same 26 amino acids for building proteins. In addition, the genetic code (that is, which combinations of three nucleotides code for which amino acid) is the same for both humans and life in Anoikis. As the genetic code is arbitrary, the chance of this happening by accident is one in ten to the 26th power. We are forced to conclude that life in Anoikis and human life sprang from the same source.\r\n\r\nFurther investigation into how this could have come to be is the topic of another paper: <a href=showinfo:4336>The Origin of Life in Anoikis.</a>\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4325,1141,'Research Abstract: Project Algintal','<b>Paper</b>: Project Algintal - Investigation of the Algintal Rogue Drone Hive<br>\r\n<b>Lead Researcher</b>: Myyona<br>\r\n<b>Contributors</b>: Natelia<br>\r\n<b>Summary</b>: Rogue drones have been spreading all over New Eden for the last 80 years or so and represent a constant threat to space travel across the cluster. The rogue drone hive found at the Skeleton Comet complex within the <a href=showinfo:5//30002681>Deltole</a> system appears to have assimilated ancient technologies left behind by the Yan Jung nation, resulting in the development of a new strain of drones, potentially more powerful than their standard counterparts. \r\n\r\nTwo reports on these events were gathered to determine the extent to which the drones were affected by assimilating the Yan Jung technology, and to establish what level of threat this could pose. The findings showed that the new strain of drones possess significantly enhanced communication systems and cognitive abilities as compared with their predecessors. However, through the examination process it was also discovered that apparently, nearly all of the new drone strains had been destroyed by the original rogue drone hive, likely due to self-regulatory mechanisms within the hive. Consequently, we conclude that any remaining drones pose little to no threat. \r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4326,1141,'Research Abstract: Project Enigma','<b>Paper:</b> Project Enigma - The Jovian Empires<br>\r\n<b>Lead Researcher:</b> Myyona<br>\r\n<b>Contributors:</b> None<br>\r\n<b>Summary:</b> The Jovian society was the first to recover after the closure of the EVE Gate, an event that caused a near-complete extinction of all human settlements in New Eden. Having existed for thousands of years since then, the Jovian Empire experienced peaks and falls long before any of the other currently existing empires even managed to establish themselves as spacefaring nations. \r\n\r\nBeing keen seekers of knowledge, the Jovians possess great insight on past events, though they do not share it freely and easily with outsiders. This paper looks into the documentation available on the history of the Jovian Empires in an attempt to better understand the Jove mentality and the current state of the Jovian society. Evidence gathered for the paper suggests that the recent lack of communication from Jovian officials, as well as their seeming inability to stop the fatal Jovian Disease, may signal that the current Jovian Empire is in decline.\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4327,1141,'Research Abstract: Project Trinity','<b>Paper:</b> Project Trinity<br>\r\n<b>Lead Researcher:</b> Julianus Soter<br>\r\n<b>Contributors:</b> General Stargazer, Moira. Corporation<br>\r\n<b>Summary:</b> Operation Trinity was the in-field reconnaissance operation to gather experimental evidence to prove or deny the Trinity Hypothesis, part of Project Trinity. Conducted inside Class 4 space, the operation utilized military and scientific vessels to investigate Trinary Hub facilities in order to determine whether they held any similarity to the <a href=showinfo:11066>Trinary Data</a> discovered on an abandoned Helios in Class 6 space, suspected to have once belonged to missing astrophysicist Lianda Burreau, the first capsuleer to discover the unknown regions. \r\n\r\nA trinary hub was investigated and the Sleeper databanks located at the structure were hacked. Data analyzers were applied to all artifacts and signals captured from the facility were compared with a Jovian Trinary Data fragment acquired from Admiral Ouria\'s Eidolon battleship. Correlations were collected and indicate possible relationships between Jovian and Sleeper data structures. Additional conclusions may be possible with assistance from Eifyr & Co.\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4328,1141,'Research Abstract: Project Infernal Spade','<b>Paper:</b> Project Infernal Spade - Analysis of the Ancient Talocan Temple and Sun Reader<br>\r\n<b>Lead Researcher:</b> Myyona<br>\r\n<b>Contributors:</b> None<br>\r\n<b>Summary:</b> The appearance of Talocan ruins in w-space has put a renewed focus on this civilization. Very little was known about the Talocan before their ruins appeared in w-space besides that they once had a presence in the <a href=showinfo:4//20000024>Okkelen constellation</a>, an area now claimed by the Caldari State. Despite being overrun by rogue drones, the Devil\'s Dig Site deadspace complex in the <a href=showinfo:5//30000171>Otitoh</a> system held archaeologists\' interest for some time, mostly due to its housing some of the only Talocan relic remnants still available.  \r\n\r\nThis paper is aimed at investigating the Devil\'s Dig Site and finding out what secrets it holds. It has become clear that the rogue drones inhabiting this site are formidable foes and, clearly surpassing most other rogue drone hives in power. Two ancient Talocan structures have also been discovered; an ancient temple and a mysterious black monolith identified as a Sun Reader.\' Due to the hostility of the drones, a thorough investigation of these structures has not been possible yet and is still in the planning phase. \r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4329,1141,'Research Abstract: Project Astrosurvey','<b>Paper:</b> Astrosurvey<br>\r\n<b>Lead Researcher:</b> Pr. Gehen Sealbreaker<br>\r\n<b>Contributors:</b> Sealbreaker Labs, Vincent Athena<br>\r\n<b>Summary:</b> The homogeneity of the asteroids located in Anoikis is improbable, and ores extracted there have been thrown in refineries using old refining processes with no proper study. Considering current survey scanners only compare asteroid properties to a known ores database, their current classification may be wrong and not reflect their full potential.\r\n\r\nThree possibilities other than an improbable homogeneity can explain this:<br>\r\n   1. Ores in Anoikis are plain. Specific conditions in New Eden contributed to variants\' formation.<br>\r\n   2. Specific ores existed in Anoikis. Their supply was depleted by intensive exploitation from previous occupants.<br>\r\n   3. There are specific ore variants in Anoikis. Tolerance of survey scanners made us unaware of this. (Hypothesis studied)\r\n\r\nWhen it comes to crystal formation, stellar macroscopic effects are a main factor. Cosmic phenomenon must be considered, and samples from their systems studied.\r\n\r\nThe operation had 3 steps so far:<br>\r\n   1. Establishment of a scientific base camp in Anoikis.<br>\r\n   2. Harvesting and initial study of resources.<br>\r\n   3. Study of the collected samples using laboratories in Empire stations. (Ongoing)<br>\r\n\r\nCurrent results are inconclusive, but there is still much to do. So far, no collected ore matches the molecular structure of any known ore variant, common or rare (Luminous Kernite, Banidine, Polygypsum, etc).\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4330,1141,'Research Abstract: Project Omicron','<b>Paper:</b> Project Omicron<br>\r\n<b>Lead Researcher:</b> Authochthonian<br>\r\n<b>Contributors:</b> Authochthonian, Chevalleis, Grideris<br>\r\n<b>Summary:</b> Project Omicron is an attempt to establish two-way communications with the rogue drones. The purpose of this attempt is to find common ground as a prelude to full diplomatic negotiations and to find out as much information as possible on their origins, purpose and needs. Additionally, Omicron aims to investigate possible connections between rogue drones and sleeper drones by communicating directly with rogue drone hives where possible. Much of this project relates to others, such as <a href=showinfo:4320>Project Theta</a>, which seeks to provide the hardware to make such communication possible. \r\n\r\nTwo-way communications with rogue drones have been proven possible (see the Algintal Incident) and we are constantly refining our communication protocols and encryption/decryption techniques to improve our communication abilities. We predict, based on current evidence, that full communication with rogue drones may be possible around late YC 113 to early YC 114. \r\n\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4331,1141,'Research Abstract: Project Omega','<b>Paper:</b> Project Omega<br>\r\n<b>Lead Researcher:</b> Chevalleis<br>\r\n<b>Contributors:</b> Authochthonian, Chevalleis<br>\r\n<b>Summary:</b> Project Omega is an attempt to investigate the nature of rogue drone hives and their structures. Omega seeks to uncover anything that can be learned about their hierarchy and society by recording how the various rogue drone types interact with one another and other hives. Omega also studies the software of the rogue drones, analyzing their intelligence and their psychology in an effort to identify the programming code responsible for their behavior. \r\n\r\nResearch into existing types of hives found naturally occurring has been carried out and a comparative psychology study is also underway. These examinations should provide deeper insights into the nature of rogue drones and their hives.\r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4332,1141,'Research Abstract: Project Rho','<b>Paper:</b> Project Rho<br>\r\n<b>Lead Researcher:</b> Authochthonian<br>\r\n<b>Contributors:</b> Authochthonian, Chevalleis<br>\r\n<b>Summary:</b> Project Rho is an attempt to gather information on all types of rogue drone hardware, from the smallest to the largest drone types known to exist, and to compile this information into a comprehensive database for ease of access when comparing rogue drone technology to sleeper drone technology by other divisions of Arek\'Jaalan.  Detailed analysis of every rogue drone will be carried out and compared to empire equivalents.\r\n\r\nWhen completed, this project should enable us to identify any technological links between rogue drones and sleeper drones.\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4333,1141,'Research Abstract: Project Slipstream','<b>Paper:</b> Project Slipstream - Wormhole Physics for Capsuleers<br>\r\n<b>Lead Researcher:</b> Helen Ohmiras<br>\r\n<b>Contributors:</b> Rhavas, Pat Irvam<br>\r\n<b>Summary:</b> Artificial wormhole induction processes are used in warp drives and jump drives across New Eden. Despite the prevalence of this technology, natural wormholes are still a mystery to many. A pilot with a firm grasp of wormhole mechanics can make more effective decisions when unforeseen and unpredicted events occur in the future.\r\n\r\nProject Slipstream is an attempt to educate the wider capsuleer community on basic wormhole physics. We will focus on clearing up misconceptions regarding the difference between natural wormholes and artificial wormholes. The nature of wormholes present in the uncharted regions will also be determined. These findings will then be used as a starting point for further clarification of the physics behind the technology used to create artificial wormholes, as well as other wormhole induction drive technologies.\r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4334,1141,'Arek\'Jaalan: Site One Contributions Listing','<b>Special Acknowledgement:</b> This site is named after the capsuleer known as \"The Antiquarian\" whose generous contributions played a large part in making this base in Eram a reality. \r\n\r\n</b>Dedication:</b> Arek\'Jaalan Site One is dedicated to the capsuleers who helped found the project, and ensure its continued stability and success. \r\n\r\nA full listing of donations is available <a href=evebrowser:http://wiki.eveonline.com/en/wiki/Arek%27Jaalan:_Site_One>here</a>. \r\n\r\nThe following individuals and corporations contributed to the construction of this site. Without their donations, Arek\'Jaalan Site One would not have been possible. \r\n\r\n</b>Corporations:</b>\r\nApplied Industrial Technologies\r\nFedMart\r\nKitzless\r\nNepenthe Inc.\r\nRed Rock Mining Company\r\nUnit Commune\r\nYahoo Inc\r\n\r\n</b>Individuals:</b>\r\nAdainy Gwanwyn\r\nAeb Raven\r\nAidan Brooder\r\nAkrasjel Lanate\r\nAlexa Wilkot\r\nAlextrasa Zurman\r\nAlpac T\'Zarri\r\nAngrypunch\r\nAquila Shadow\r\nArklan1\r\nBorascus\r\nBrick Royl\r\nCargo2000\r\nCold Vodka\r\nCunane Jeran\r\nDarkcoro Matari\r\nDravidshky\r\nDutchGunner\r\nEkserevnitis\r\nEri Vin\'Taur\r\nFaith Comet\r\nFaulx\r\nfLitSer\r\nGeneral Stargazer\r\nGouzu Kho\r\nGran Man\r\nHannah Viktor\r\nHector Von Hammerstorm\r\nHordi LaGeorge\r\nIwata Accuspray\r\nJack bubu\r\nJacques DuVey\r\nJames Gheris\r\nJara Blackwind\r\nJikane Ronuken\r\nJulianus Soter\r\nKais Malleus\r\nLancashirian\r\nLeopold Caine\r\nMai Satiri\r\nMark726\r\nMorwen Lagann\r\nMyrhial Arkenath\r\nMyyona\r\nNaraish Adarn\r\nNormal Vales\r\nPhaedra Aurilen\r\nPlanetary Genocide\r\nQansh\r\nRazz Skyshatter\r\nRees Noturana\r\nRhavas\r\nScatter Gun\r\nShin\'rohtak\r\nSteve Ronuken\r\nStone Cold Assassin\r\nTan Tau\r\nTaqai\r\nTarryn Nightstorm\r\nTerra Dedlow\r\nThe Antiquarian\r\nThomas Ownz\r\nTumbles Goodness\r\nTundradog\r\nUtremi Fasolasi\r\nVariden\r\n\r\n<b>ISK Donations:</b>\r\n\r\nThe following indviduals donated ISK towards the construction of Site One. Excess ISK left over after construction, will be used to fund archivist work. \r\n\r\n1,100,000,000 - Adhocracy Incorporated\r\n1,000,000,000 - House of Sebtin\r\n500,000,000 - Alpac T\'Zarri\r\n500,000,000 - skaunk (on behalf of Caustic Confluence corporation)\r\n300,000,000 - Salpun\r\n200,000,000 - Gauss Jannon\r\n100,000,000 - Gallente Independent Progressive Alternative\r\n50,000,000 - Ethan Revenant\r\n40,000,000 - Molocath Vynneve\r\n25,000,000 - Rae Seddon\r\n15,000,000 - Invader Squee\r\n10,000,000 - Windsong Woodhaven\r\n10,000,000 - Iwata Accuspray\r\n5,000,000 - Jethra Daystar\r\n1,000,000 - ElQuirko\r\n1,000,000 - Squid Tentacle\r\n1,000,000 - Lady mifa\r\n2,000,000 - jimmy 15',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4335,1141,'Research Abstract: Project Compass','<b>Paper:</b> Project Compass<br>\r\n<b>Lead Researcher:</b> Mark726<br>\r\n<b>Contributors:</b> Rhavas<br>\r\n<b>Summary:</b> Project Compass represents an attempt to experimentally verify the spatial relationship between wormhole space and New Eden. The project is primarily aimed at identifying stellar objects  both in New Eden and in wormhole space  through spectroscopic analysis, and by using the properties of parallax and triangulation to determine the location of wormhole space in relation to New Eden. The Lead Researcher surveyed a random sample of wormhole systems and was able to identify a star cluster identifiable in both New Eden and wormhole space. Through mathematical extrapolation and analysis, the location of wormhole space was determined.\r\n\r\nProject Compass draws no final conclusions at this stage, as researchers are awaiting potential changes to capsule sensor technology that may yield new data.\r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4336,1141,'Research Abstract: Project Huntress Green (2 of 3)','<b>Paper:</b> Huntress Green - The Origin of Life in Anoikis<br>\r\n<b>Lead Researcher:</b> Gaia Ma\'chello <br>\r\n<b>Contributors:</b> James Arget, Tas Caern and Vincent Athena<br>\r\n<b>Summary:</b> Previous work has indicated that life in Anoikis and human life had the same origin. This brings up the question of how life originally came to planets in Anoikis.\r\n\r\nThe molecular clock method was used to estimate how long ago life in Anoikis and life in known space had a common ancestor. In the molecular clock method random changes to segments of junk DNA are examined and compared between organisms. Changes in these segments occur randomly, accumulate over time, and are not selected for by evolution. By seeing how different a given segment of junk DNA is between two organisms, an estimate can be made as to how long ago they had a common ancestor. \r\n\r\nFor this case, microorganisms that live in known space and those that live in Anoikis were compared. \r\n\r\nIt was found that life in Anoikis split from life in known space during the dark ages, the time period between the closure of the eve gate and the rebirth of civilization. Apparently, during this time, some space-faring civilization survived, or arose much faster than has been assumed. This civilization appears to have moved to Anoikis and made use of the planets.\r\n\r\nSome organisms were found that had a common ancestor with life in known space about a year ago. This is likely contamination from recent capsuleer activity in Anoikis.\r\n\r\n<i>This abstract relates to research undertaken by the Arek\'Jaalan Project.</i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4337,1141,'Research Abstract: Project Huntress Green (3 of 3)','<b>Paper:</b> Huntress Green - Possible disease organisms in Anoikis<br>\r\n<b>Lead Researcher:</b> Gaia Ma\'chello<br>\r\n<b>Contributors:</b> James Arget, Tas Caern and Vincent Athena<br>\r\n<b>Summary:</b> Examination of multiple biological samples obtained from planets in the unknown regions has found several organisms that could cause diseases in humans. The most interesting one is a certain fungus found on several temperate worlds.\r\n\r\nThis fungus appears able to colonize almost any surface or other organism. As it digests another organism, some proteins from that organism are displayed on the surface of the fungal strands. This allows the fungus to evade the immune system of many infected hosts.\r\n\r\nSome bacteria were also found that appear to be somewhat infectious. They do not appear to be too virulent, but some of the chemicals they produce are of particular interest. These chemicals have neurological effects that alter the behavior of the host, helping spread the bacteria.\r\n\r\n<i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek\'Jaalan Project.</a></i>\r\n\r\n<i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>\r\n\r\n<i>Further copies of this document can be obtained through the Arek\'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4338,1141,'Arek\'Jaalan: Mission Statement','The Arek\'Jaalan Project was founded to act as a cross-organizational research body and common ground for capsuleers to share information about the Sleeper civilization and related matters. The goals of the project are, relative to similar bodies, both simple to understand and quite humble. Put simply, our aim is to research, document and educate.\r\n\r\n<b>Research:</b> We aim to posit and debate theories, study known facts and uncover new ones, and use every other method available to deepen our understanding of the Sleepers and related subjects.\r\n\r\n<b>Document:</b> Through extensive use of open networks, and with the help of key staff, we aim to document all of the information shared between project members, from everyday communication to large-scale research projects.\r\n\r\n<b>Educate:</b> Using our body of contributors and their documented research as a foundation, we aim to educate other capsuleers about our work, and to encourage wider capsuleer interest in scientific matters by presenting information openly and accessibly.\r\n\r\nIn its initial phase, the project aims to build a foundational body of documented research, at which point a larger focus will begin to be placed on the goal of education.\r\n\r\nIt should be emphasized that Arek\'Jaalan does not aim to produce new technologies, and in particular that we take an active stance against any further weaponization of Sleeper or other technologies. We aim for something more benign and progressive.\r\n\r\nIt should be similarly noted that much of our work lies in centralizing and documenting scattered, yet publicly available, information. In the absence of these hard facts, we turn to educated theory. Although there is always the risk of information being used for immoral ends, it should be remembered what the majority of our work at the Arek\'Jaalan project actually amounts to, and that our own stance is to be firmly against such actions.\r\n\r\nOverwhelmingly, the current focus of interest in capsuleer research is applied science, particularly weaponization. The work we do is intended to help humanity, and science as a whole, not just the capsuleer military-industrial cycle. Arek\'Jaalan stands apart from the destructive mainstream; as an alternative way for capsuleers to use their unique capabilities. ',1,0.1,0,1,4,NULL,1,NULL,33,NULL,0),(4345,77,'Gistum B-Type Adaptive Invulnerability Field','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,1,63062.0000,1,1696,81,NULL,0),(4346,77,'Gistum A-Type Adaptive Invulnerability Field','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,1,63062.0000,1,1696,81,NULL,0),(4347,77,'Pithum A-Type Adaptive Invulnerability Field','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,1,63062.0000,1,1696,81,NULL,0),(4348,77,'Pithum B-Type Adaptive Invulnerability Field','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,1,63062.0000,1,1696,81,NULL,0),(4349,77,'Pithum C-Type Adaptive Invulnerability Field','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,1,63062.0000,1,1696,81,NULL,0),(4354,819,'Sansha Tenebrus','<font color=yellow>Subject:</font> Sansha Tenebrus<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Veteran-level crew. <br>\r\n<font color=yellow>Additional Intelligence:</font> The Tenebrus is a specialized defensive vessel intended for swift and vicious first response action. Employing only those True Slaves most receptive to the hive-mind and therefore best able to coordinate amongst themselves, these ships are considered among the most valuable members of the Nation\'s military force.<br>\r\n<i>Analyst Kamal Shan, <a href=showinfo:2//1000081>Ministry of Assessment</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  ',2112000,21120,235,1,4,NULL,0,NULL,NULL,31,1237),(4355,819,'Dark Blood Keeper','<font color=yellow>Subject:</font> Dark Blood Keeper<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Veteran-level crew. <br>\r\n<font color=yellow>Additional Intelligence:</font> The Dark Blood Keeper is a defensive vessel designed to protect the human farm\'s living produce. Crewed by a hand-picked selection of expert technicians who are also zealous believers in the Blood Raider cause, this ship is without a doubt the most dangerous opponent in the vicinity. <br>\r\n<i>Analyst Kepur, <a href=showinfo:2//1000081>Ministry of Assessment</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  \r\n',2860000,28600,235,1,4,NULL,0,NULL,NULL,31,1764),(4356,819,'Shadow Serpentis Warden','<font color=yellow>Subject:</font> Dark Blood Alpha<br>\r\n<font color=yellow>Military Specifications:</font> Frigate-class vessel. Veteran-level crew. <br>\r\n<font color=yellow>Additional Intelligence:</font> The Shadow Serpentis Warden is one of the most versatile frigate designs ever to be iterated on by any independent organization. Triple-reinforced armor, an augmented plasma ventilation system and extremely strict crew specifications have been identified as three primary reasons for why no Serpentis live cargo facility can ever be found without one.<br>\r\n<i>Analyst Batuan, <a href=showinfo:2//1000137>DED</a>.</i><br><i>Authorized for capsuleer dissemination.</i>  ',2650000,26500,235,1,8,NULL,0,NULL,NULL,31,1818),(4357,319,'Amarr Drone Mine','This is an Amarr drone mine.',100000,100000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2425),(4358,283,'Exotic Dancers, Male','Exotic dancing is considered an art form, even though not everyone might agree. Exposing the flesh in public places may be perfectly acceptable within the Federation, but in the Amarr Empire it\'s considered a grave sin and a sign of serious deviancy.',50,1,0,1,NULL,NULL,1,23,10153,NULL,0),(4359,707,'QA Jump Bridge','This structure does not exist.',250000,1,30000,1,NULL,100000000.0000,0,NULL,NULL,NULL,2374),(4360,353,'QA ECCM','This module does not exist.',0,1,0,1,NULL,NULL,0,NULL,104,NULL,0),(4361,365,'QA Fuel Control Tower','This structure does not exist.',200000000,1,1000000,1,1,400000000.0000,0,NULL,NULL,NULL,2599),(4363,28,'Miasmos Quafe Ultra Edition','The Miasmos Quafe Ultra Edition was commissioned by the Quafe Corporation as a specialized vessel for the distribution of Quafe throughout the New Eden cluster.\r\n\r\nTo this end, the ship has been made more agile, given a faster warp engine and fitted with an upgraded cargohold that can carry vast amounts of sweet, sweet Quafe. Additionally, the controls have been simplified so that new pilots can be trained quickly and efficiently, allowing for optimal transport labor wages.\r\n\r\nA later addition under the new \"Miasmos\" moniker included a small number of sealed vats, but Quafe has demanded that those be accessed solely by corporate representatives, and not by crew nor capsuleer.',11250000,265000,5250,1,8,NULL,1,1614,NULL,20074,11876),(4364,108,'Miasmos Quafe Ultra Edition Blueprint','',0,0.01,0,1,NULL,4287500.0000,1,NULL,NULL,NULL,327),(4365,1089,'Men\'s \'Quafe\' T-shirt YC 114','Stand out in a crowd with your comfortable new 