loped by Duvolle Laboratories Advanced Manifold Theory Unit. The drive was conceived by the late Avagher Xarasier, the genius behind several ground-breaking innovations of that era.\r\n',0,10,0,1,NULL,1340852.0000,1,1650,20971,NULL,0),(4384,1191,'Large Micro Jump Drive Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,96,NULL,0),(4385,275,'Micro Jump Drive Operation','Skill at using Micro Jump Drives. 5% reduction in activation time per skill level.',0,0.01,0,1,NULL,4500000.0000,1,374,33,NULL,0),(4386,1149,'Mobile Large Jump Disruptor I','A Large deployable self powered unit that prevents micro jumping into its area of effect.',0,585,0,1,NULL,NULL,0,405,2309,NULL,2309),(4387,371,'Mobile Large Jump Disruptor I Blueprint','',0,0.01,0,1,NULL,119764480.0000,1,NULL,21,NULL,0),(4388,28,'Miasmos Quafe Ultramarine Edition','The Miasmos (originally Iteron Mark IV) Quafe Ultramarine Edition was commissioned by the Quafe Corporation as a vessel for highly focused distribution of Quafe to a demanding clientele in the New Eden cluster.\r\n\r\nTo this end, the ship has been made more agile, given a faster warp engine and fitted with an upgraded cargohold that can carry vast amounts of Quafe. In addition, its controls have been simplified so that new pilots can more easily meet the strict delivery conditions of prospective buyers.  A number of sealed vats were added after the ship was rebranded as the Miasmos, but Quafe has demanded that those be accessed solely by corporate representatives, and not by crew nor capsuleer.\r\n\r\nWhile the Quafe Corporation has firmly denied making any alterations to its lucrative formula, and insists that the Miasmos Quafe Ultramarine Edition does not have special dispensation to carry a supercaffeinated version of the famous drink, it is notable that this model has been fitted with extra security mechanisms to prevent any and all crew from sampling its cargo. \r\n\r\nWhile there are persistent rumors of storage crew personnel tasting the cargo and subsequently staying awake for days on end, grinding their teeth and yelling at each other, these have never been conclusively proven, although the Quafe Corporation does reportedly undertake all medical costs for any crewmember serving more than 72 consecutive hours onboard the Miasmos Quafe Ultramarine Edition. ',11250000,265000,5250,1,8,NULL,1,1614,NULL,20074,11875),(4389,108,'Miasmos Quafe Ultramarine Edition Blueprint','',0,0.01,0,1,NULL,4287500.0000,1,NULL,NULL,NULL,327),(4390,314,'Pax Ammaria','This book has a history.',1,0.1,0,1,NULL,3328.0000,1,NULL,2176,NULL,0),(4391,1156,'Large Ancillary Shield Booster','Provides a quick boost in shield strength. The module takes Cap Booster charges and will start consuming the ship\'s capacitor upon the charges running out. Deactivating the module while it has no cap boosters loaded starts reloading, if there are cap boosters available in cargo hold.\r\n\r\nNote: Can use Cap Booster 150 and 200 as fuel. Reloading time is 60 seconds. Prototype Inferno Module.\r\n',0,25,42,1,NULL,NULL,1,611,10935,NULL,0),(4392,1157,'Large Ancillary Shield Booster Blueprint','',0,0.01,0,1,NULL,1458560.0000,1,NULL,84,NULL,0),(4393,645,'Drone Damage Amplifier I','The Drone Damage Amplifier projects a multi-node quantum entanglement onto the ship\'s drone or fighter communications net, creating a bridged processor link that allows for better real-time trajectory projections.\r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1,5,0,1,NULL,NULL,1,938,10934,NULL,0),(4394,1152,'Drone Damage Amplifier I Blueprint','',0,0.01,0,1,NULL,499200.0000,1,939,21,NULL,0),(4395,781,'Medium Processor Overclocking Unit I','This ship modification is designed to increase a ship\'s CPU.\r\n\r\nPenalty: - 5% Shield Recharge Rate Bonus.\r\n',200,5,0,1,NULL,NULL,1,1223,3199,NULL,0),(4396,787,'Medium Processor Overclocking Unit I Blueprint','',0,0.01,0,1,NULL,750000.0000,1,1253,76,NULL,0)