00000000,10000,1,NULL,NULL,0,NULL,NULL,NULL,2051),(11172,830,'Helios','Designed for commando and espionage operation, its main strength is the ability to travel unseen through enemy territory and to avoid unfavorable encounters.\r\n\r\nDeveloper: CreoDron \r\n\r\nThe Helios is CreoDron\'s answer to the Ishukone Buzzard. After the fall of Crielere, the once-cordial relations between the Gallente Federation and the Caldari state deteriorated rapidly and, for a while, it seemed as if war might be brewing. It was seen by certain high-ranking officers within the Gallente navy as being of vital importance to be able to match the Caldari\'s cloaking technology in an effort to maintain the balance of power.\r\n',1271000,23000,175,1,8,NULL,1,423,NULL,20072,1841),(11173,105,'Helios Blueprint','',0,0.01,0,1,NULL,1800000.0000,1,428,NULL,NULL,324),(11174,893,'Keres','Electronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleet\'s electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little vessels.\r\n\r\nDeveloper: Duvolle Labs \r\n\r\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Since the company is one of New Eden\'s foremost manufacturers of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.',1204500,23000,175,1,8,2428948.0000,1,1068,NULL,20072,1913),(11175,105,'Keres Blueprint','',0,0.01,0,1,NULL,1800000.0000,1,NULL,NULL,NULL,324),(11176,831,'Crow','Interceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius. This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets. \r\n\r\nDeveloper: Kaalakiota\r\n\r\nAs befits one of the largest weapons manufacturers in the known world, Kaalakiota\'s ships are very combat focused. Favoring the traditional Caldari combat strategy, they are designed around a substantial number of weapons systems, especially missile launchers. However, they have rather weak armor and structure, relying more on shields for protection.',1065000,18000,98,1,1,NULL,1,401,NULL,20070,1848),(11177,105,'Crow Blueprint','',0,0.01,0,1,NULL,287500.0000,1,411,NULL,NULL,39),(11178,831,'Raptor','Interceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius. This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets. \r\n\r\nDeveloper: Lai Dai\r\n\r\nLai Dai ships favor a balanced mix of ship systems, making them very versatile but also less powerful when it comes to specific tactics.',1050000,18000,92,1,1,NULL,1,401,NULL,20070,1878),(11179,105,'Raptor Blueprint','',0,0.01,0,1,NULL,287500.0000,1,411,NULL,NULL,39),(11182,830,'Cheetah','Designed for commando and espionage operation, its main strength is the ability to travel unseen through enemy territory and to avoid unfavorable encounters.\r\n\r\nDeveloper: Thukker Mix\r\n\r\nIt is unclear how Thukker Mix could master the intricacies of cloaking technology so quickly after the fall of Crielere. According to Professor Oggand Viftuin, head of R&D, the tribe managed to recruit some senior Caldari scientist that used to work on the Mirage Project at Crielere. Ishukone has denied this, claiming that the Thukkers aquired the technology from prototypes stolen by the Guristas.',1430000,17400,200,1,2,NULL,1,424,NULL,20076,1948),(11183,105,'Cheetah Blueprint','',0,0.01,0,1,NULL,1725000.0000,1,429,NULL,NULL,0),(11184,831,'Crusader','Interceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius. This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets. \r\n\r\nDeveloper: Carthum Conglomerate\r\n\r\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems, they provide a nice mix of offense and defense. On the other hand, their electronic and shield systems tend to be rather limited.',1050000,28100,90,1,4,NULL,1,400,NULL,20063,1921),(11185,105,'Crusader Blueprint','',0,0.01,0,1,NULL,300000.0000,1,410,NULL,NULL,54),(11186,831,'Malediction','Interceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius. This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets.\r\n\r\nDeveloper: Khanid Innovations \r\n\r\nIn addition to robust electronics systems, the Khanid Kingdom\'s ships possess advanced armor alloys capable of withstanding a great deal of punishment. Generally eschewing the use of turrets, they tend to gear their vessels more towards close-range missile combat.',1140000,28100,98,1,4,NULL,1,400,NULL,20063,1861),(11187,105,'Malediction Blueprint','',0,0.01,0,1,NULL,300000.0000,1,410,NULL,NULL,54),(11188,830,'Anathema','Designed for commando and espionage operation, its main strength is the ability to travel unseen through enemy territory and to avoid unfavorable encounters.\r\n\r\nDeveloper: Khanid Innovation\r\n\r\nKhanid Innovations was quick to take advantage of the disintegration of the Crielere Project. Through shrewd diplomatic and financial maneuvering they were able to acquire a working Buzzard prototype as well as several of the former top scientists of Project Mirage to work on adapting its innovations to Khanid ship technology.',1147000,28100,190,1,4,NULL,1,421,NULL,20061,3424),(11189,105,'Anathema Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,425,NULL,NULL,1066),(11190,893,'Sentinel','Electronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleet\'s electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little vessels.\r\n\r\nDeveloper: Viziam\r\n\r\nViziam ships are quite possibly the most durable ships money can buy. Their armor is second to none and that, combined with superior shields, makes them hard nuts to crack. Of course this does mean they are rather slow and possess somewhat more limited weapons and electronics options.',1223200,28100,165,1,4,2401508.0000,1,1066,NULL,20061,3365),(11191,105,'Sentinel Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,NULL,NULL,NULL,1066),(11192,830,'Buzzard','Designed for commando and espionage operation, its main strength is the ability to travel unseen through enemy territory and to avoid unfavorable encounters.\r\n\r\nDeveloper: Ishukone \r\n\r\nThe Buzzard was developed according to the exacting specifications of Admiral Okaseilen Fukashi, head of the Caldari Navy Recon Division, and was the first production level ship specifically built to take full advantage of the cloaking breakthroughs achieved by Project Mirage at Crielere.',1270000,19400,190,1,1,NULL,1,422,NULL,20070,1902),(11193,105,'Buzzard Blueprint','',0,0.01,0,1,NULL,1600000.0000,1,427,NULL,NULL,40),(11194,893,'Kitsune','Electronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleet\'s electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little 