Repairer I Blueprint','',0,0.01,0,1,NULL,124700.0000,1,1539,21426,NULL,0),(11359,325,'Large Remote Armor Repairer I','This module uses nano-assemblers to repair damage done to the armor of the Target ship.',20,25,0,1,NULL,31244.0000,1,1057,21426,NULL,0),(11360,350,'Large Remote Armor Repairer I Blueprint','',0,0.01,0,1,NULL,312440.0000,1,1539,21426,NULL,0),(11365,324,'Vengeance','The Vengeance represents the latest in the Kingdom\'s ongoing mission to wed Amarr and Caldari tech, molding the two into new and exciting forms. Sporting a Caldari ship\'s launcher hardpoints as well as an Amarr ship\'s armor systems, this relentless slugger is perfect for when you need to get up close and personal.\r\n\r\nDeveloper: Khanid Innovation\r\n\r\nConstantly striving to combine the best of two worlds, Khanid Innovation have utilized their Caldari connections to such an extent that the Kingdom\'s ships now possess the most advanced missile systems outside Caldari space, as well as fairly robust electronics systems.',1163000,28600,210,1,4,NULL,1,433,NULL,20063,1860),(11366,105,'Vengeance Blueprint','',0,0.01,0,1,NULL,2875000.0000,1,459,NULL,NULL,300),(11367,318,'map Landmark','',0,0,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(11369,226,'Particle Acceleration Superstructure','Whatever purpose this structure once served, it is utterly useless now. Only a few bits of the array\'s hull survived the explosion that tore it apart.',0,0,0,1,NULL,NULL,0,NULL,NULL,20172,2069),(11370,330,'Prototype Cloaking Device I','This prototype of an advanced cloaking mechanism was one of the last major technological breakthroughs to come out of Crielere Labs. Although it does work it is not really a finished product and has some serious drawbacks, most notably the fact that the module creates high sensor disruption while fitted and can not operate unless at minimum velocity.\r\n\r\nNote: Fitting two or more cloaking devices to a ship negates their use, as unsynchronized light deflection causes interference.',0,100,0,1,NULL,802680.0000,1,675,2106,NULL,0),(11371,324,'Wolf','Named after a mythical beast renowned for its voraciousness, the Wolf is one of the most potentially destructive frigates currently in existence. While hardier than its brother the Jaguar it has less in the way of shield systems, and the capabilities of its onboard computer leave something to be desired. Nevertheless, the mere sight of a locked and loaded Wolf should be enough to make most pilots turn tail and flee.\r\n\r\nDeveloper: Boundless Creation\r\n\r\nBoundless Creation\'s ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as possible. Defense systems and electronics arrays therefore take a back seat to sheer annihilative potential.',1309000,27289,165,1,2,NULL,1,436,NULL,20078,1931),(11372,105,'Wolf Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,463,NULL,NULL,1066),(11373,324,'Blade','Core Complexions ships are unusual in that they favor electronics and defense over the typical \"lots of guns\" approach traditionally favored by the Minmatar.',1200000,28600,130,1,2,NULL,0,NULL,NULL,20063,1782),(11374,105,'Blade Blueprint','',0,0.01,0,1,NULL,1500000.0000,0,NULL,NULL,NULL,1066),(11375,324,'Erinye','',2810000,28100,165,1,8,NULL,0,NULL,NULL,20074,1770),(11376,105,'Erinye Blueprint','',0,0.01,0,1,NULL,1500000.0000,0,NULL,NULL,NULL,1066),(11377,834,'Nemesis','Specifically engineered to fire torpedoes, stealth bombers represent the next generation in covert ops craft. The bombers are designed for sneak attacks on large vessels with powerful missile guidance technology enabling the torpedoes to strike faster and from a longer distance. \r\n\r\nDeveloper: Duvolle Laboratories\r\n\r\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Being the foremost manufacturer of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.\r\n\r\n',1410000,28100,270,1,8,NULL,1,423,NULL,20072,1909),(11378,105,'Nemesis Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,428,NULL,NULL,1066),(11379,324,'Hawk','Following in the footsteps of Caldari vessels since time immemorial, the Hawk relies on tremendously powerful shield systems to see it through combat, blending launchers and turrets to provide for a powerful, well-rounded combat vessel.\n\nDeveloper: Lai Dai\n\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships but providing very little in terms of tactical specialization.',1217000,16500,300,1,1,NULL,1,434,NULL,20070,1882),(11380,105,'Hawk Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,461,NULL,NULL,1066),(11381,324,'Harpy','Already possessing a reputation despite its limited initial circulation, the Harpy is a powerful railgun platform with long range capability and strong defensive systems. Formidable both one-on-one and as a support ship, it was referred to as the \"little Moa\" by the pilots who participated in its safety and performance testing.\r\n\r\nDeveloper: Ishukone\r\n\r\nIshukone created the Harpy as a long-range support frigate for defense of Ishukone holdings as well as increased muscle and visibility in the constantly shifting game of cold war the Caldari megacorps\' police forces play amongst themselves.',1155000,16500,165,1,1,NULL,1,434,NULL,20070,1901),(11382,105,'Harpy Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,461,NULL,NULL,1066),(11383,324,'Gatherer','',5250000,28100,400,1,4,NULL,0,NULL,NULL,20063,1868),(11384,105,'Gatherer Blueprint','',0,0.01,0,1,NULL,1500000.0000,0,NULL,NULL,NULL,1066),(11387,893,'Hyena','Electronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleet\'s electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little vessels.\r\n\r\nDeveloper: Core Complexion Inc.\r\n\r\nCore Complexion\'s ships are unusual in that they favor electronics and defense over the \"lots of guns\" approach traditionally favored by the Minmatar.',1191300,17400,150,1,2,2084040.0000,1,1069,NULL,20076,1973),(11388,105,'Hyena Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,NULL,NULL,NULL,1066),(11389,324,'Kishar','',5125000,28100,450,1,8,NULL,0,NULL,NULL,20074,1913),(11390,105,'Kishar Blueprint','',0,0.01,0,1,NULL,1500000.0000,0,NULL,NULL,NULL,1066),(11393,324,'Retribution','The Retribution is an homage to the glory days of the Empire, informed by classical Amarrian design philosophy: if it\'s strong, sturdy and packs a punch, it\'s ready for action. What this powerhouse lacks in speed and maneuverability it more than makes up for with its wide range of firepower possibilities and superb defensive ability.\r\n\r\nDeveloper: Carthum Conglomerate\r\n\r\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon system they provide a nice mix of offense and defense.',1171000,28600,135,1,4,NULL,1,433,NULL,20063,1920),(11394,105,'Retribution Blueprint','',0,0.01,0,1,NULL,2875000.0000,1,459,NULL,NULL,300),(11395,1218,'Deep Core Mining','Skill at operating mining lasers requiring Deep Core Mining. 20% reduction per skill level in the chance of a damage cloud forming while mining Mercoxit.',0,0.01,0,1,4,500000.0000,1,1323,33,NULL,0),(11396,468,'Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary morphite mineral but few other minerals of note.\r\n\r\nAvailable in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1e35,40,0,100,NULL,17367040.0000,1,530,2102,NULL,0),(11399,18,'Morphite','Morphite is a highly unorthodox mineral that can only be found in the hard-to-get Mercoxit ore. It is hard to use Morphite as a basic building material, but when it is joined with existing structures it can enhance the performance and durability manifold. This astounding quality makes this the material responsible for ushering in a new age in technology breakthroughs.\r\n\r\nMay be obtained by reprocessing the following ores:\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:11396>Mercoxit</a>, <a href=showinfo:17869>Magma Mercoxit</a>, <a href=showinfo:17870>Vitreous Mercoxit</a>',0,0.01,0,1,NULL,32768.0000,1,1857,2103,NULL,0),(11400,324,'Jaguar','The Jaguar is a versatile ship capable of reaching speeds unmatched by any other assault-class vessel. While comparatively weak on the defensive front it sports great flexibility, allowing pilots considerable latitude in configuring their loadouts for whatever circumstances they find themselves in.\r\n\r\nDeveloper: Thukker Mix\r\n\r\nBeing the brain-child of the nomadic Thukkers, it is no surprise the Jaguar is as fast as it is. Initially conceived as a way for the tribe to pack some added punch to their organized detachments, they\'ve found it to be equally useful as messenger, scout and escort, and it is likely to become one of the most commonly-seen ships in the Thukkers\' stomping grounds.',1366000,27289,130,1,2,NULL,1,436,NULL,20078,1950),(11401,105,'Jaguar Blueprint','',0,0.01,0,1,NULL,1500000.0000,1,463,NULL,NULL,1066),(11433,270,'High Energy Physics','Skill and knowledge of High Energy Physics and its use in the development of advanced technology. \r\n\r\nUsed primarily in the research of various energy system modules as well as smartbombs and laser based weaponry. \r\n\r\nAllows High Energy Physics research to be performed with the help of a research agent. 1% reduction in manufacturing time for all items requiring High Energy Physics per level.\r\n\r\nNeeded for all research and manufacturing operations on related blueprints.',0,0.0