lary way, it is considered a huge honor to command -- let alone own -- one of these majestic and powerful battleships.',99300000,495000,675,1,4,112500000.0000,1,1620,NULL,20061,4515),(11937,107,'Apocalypse Imperial Issue Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,0),(11938,27,'Armageddon Imperial Issue','Designed and constructed by the most skilled starship engineers and architects of the Empire, the imperial issue of the mighty Armageddon class is an upgraded version of the most-used warship of the Amarr. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor.',97100000,486000,600,1,4,66250000.0000,1,1620,NULL,20061,2240),(11939,107,'Armageddon Imperial Issue Blueprint','',0,0.01,0,1,NULL,NULL,0,NULL,NULL,NULL,297),(11940,25,'Gold Magnate','This ship is a masterly designed frigate as well as an exquisite piece of art. The Magnate class has been the pet project of a small, elite group of royal ship engineers for over a decade. When the Gold Magnate was offered as a prize in the Amarr Championships in YC105,  the long years of expensive research were paid off with the deployment of this beautiful ship.\r\nThe first Gold Magnate was awarded to <url=showinfo:1373//170181132>Ecliptical</url> to honor his success as Doriam Kor-Azor\'s champion in YC105. That famous vessel was eventually sold to <url=showinfo:1373//144870255>Tyrrax Thorrk</url>  and met its demise at the hands of <url=showinfo:1373//144604580>Lord Zap</url>, <url=showinfo:1373//145355201>DrStrangelove</url>, <url=showinfo:1373//149050919>Motaka</url> and <url=showinfo:1373//152755230>Omniwar</url>, four of the legendary pirates of the m0o corporation.\r\nThe news that four more Gold Magnates were being produced for the new Amarr Succession Championship taking place in YC117 and YC118 has recently brought this storied ship back into the spotlight, and has electrified the hopes and dreams of wealthy collectors and elite capsuleers across the cluster.',1500000,22100,300,1,4,NULL,1,1619,NULL,20063,2242),(11942,25,'Silver Magnate','This decoratively designed ship is a luxury in its own class. The Magnate frigate has been the pet project of a small, elite group of royal ship engineers for a decade. Over the long years of expensive research, the design process has gone through several stages, and each stage has set a new standard in frigate design. The Silver Magnate, offered as a reward in the Amarr Championships in YC105 and YC118, is one of the most impressive iterations in this line of masterworks.\r\n',1500000,22100,250,1,4,NULL,1,1619,NULL,20063,2241),(11944,314,'Synthetic Coffee','This stimulating aromatic drink, made out of dried, roasted and ground seeds, is a particular favorite among scientists and software engineers.',2500,0.2,0,1,NULL,NULL,1,492,2244,NULL,0),(11947,687,'Khanid Fighter','This is a fighter for the Khanid Kingdom. It is protecting the assets of the Khanid Kingdom and may attack anyone it perceives as a threat. Threat level: Moderate',1810000,18100,225,1,4,NULL,0,NULL,NULL,NULL,1861),(11948,689,'Khanid Officer','This is an officer for the Khanid Kingdom. He is protecting the assets of the Khanid Kingdom and may attack anyone he perceives as a threat or easy pickings. Threat level: Extreme',12250000,115000,465,1,4,NULL,0,NULL,NULL,NULL,1856),(11957,833,'Falcon','Force recon ships are the cruiser-class equivalent of covert ops frigates. While not as resilient as combat recon ships, they are nonetheless able to do their job as reconaissance vessels very effectively, due in no small part to their ability to interface with covert ops cloaking devices and set up cynosural fields for incoming capital ships.\r\n\r\nDeveloper: Ishukone\r\n\r\nMost of the recent designs off their assembly line have provided for a combination that the Ishukone name is becoming known for: great long-range capabilities and shield systems unmatched anywhere else.',12230000,96000,315,1,1,14871496.0000,1,830,NULL,20070,11863),(11958,106,'Falcon Blueprint','',0,0.01,0,1,NULL,NULL,1,901,NULL,NULL,303),(11959,906,'Rook','Built to represent the last word in electronic warfare, combat recon ships have onboard facilities designed to maximize the effectiveness of electronic countermeasure modules of all kinds. Filling a role next to their class counterpart, the heavy assault cruiser, combat recon ships are the state of the art when it comes to anti-support support. They are also devastating adversaries in smaller skirmishes, possessing strong defensive capabilities in addition to their electronic superiority.\r\n\r\nDeveloper: Kaalakiota\r\n\r\nAs befits one of the largest weapons manufacturers in the known world, Kaalakiota\'s ships are very combat focused. Favoring the traditional Caldari combat strategy, they are designed around a substantial number of weapons systems, especially missile launchers. However, they have rather weak armor and structure, relying more on shields for protection.',12730000,96000,305,1,1,15001492.0000,1,830,NULL,20070,1847),(11960,106,'Rook Blueprint','',0,0.01,0,1,NULL,NULL,1,901,NULL,NULL,303),(11961,906,'Huginn','Built to represent the last word in electronic warfare, combat recon ships have onboard facilities designed to maximize the effectiveness of electronic countermeasure modules of all kinds. Filling a role next to their class counterpart, the heavy assault cruiser, combat recon ships are the state of the art when it comes to anti-support support. They are also devastating adversaries in smaller skirmishes, possessing strong defensive capabilities in addition to their electronic superiority.\r\n\r\nDeveloper: Boundless Creation\r\n\r\nBoundless Creation\'s ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as possible. Defense systems and electronics arrays therefore tend to take a back seat to sheer annihilative potential.',11550000,85000,315,1,2,14988558.0000,1,836,NULL,20078,1945),(11962,106,'Huginn Blueprint','',0,0.01,0,1,NULL,NULL,1,903,NULL,NULL,303),(11963,833,'Rapier','Force recon ships are the cruiser-class equivalent of covert ops frigates. While not as resilient as combat recon ships, they are nonetheless able to do their job as reconaissance vessels very effectively, due in no small part to their ability to interface with covert ops cloaking devices and set up cynosural fields for incoming capital ships.\r\n\r\nDeveloper: Core Complexion Inc.\r\n\r\nCore Complexion\'s ships are unusual in that they favor electronics and defense over the \"lots of guns\" approach traditionally favored by the Minmatar.',11040000,85000,315,1,2,14990532.0000,1,836,NULL,20078,1777),(11964,106,'Rapier Blueprint','',0,0.01,0,1,NULL,NULL,1,903,NULL,NULL,303),(11965,833,'Pilgrim','Force recon ships are the cruiser-class equivalent of covert ops frigates. While not as resilient as combat recon ships, they are nonetheless able to do their job as reconaissance vessels very effectively, due in no small part to their ability to interface with covert ops cloaking devices and set up cynosural fields for incoming capital ships.\r\n\r\nDeveloper: Carthum Conglomerate\r\n\r\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems, they provide a nice mix of offense and defense. On the other hand, their electronic and shield systems tend to be rather limited.',11370000,120000,315,1,4,15013042.0000,1,827,NULL,20063,1914),(11966,106,'Pilgrim Blueprint','',0,0.01,0,1,NULL,NULL,1,900,NULL,NULL,303),(11969,833,'Arazu','Force recon ships are the cruiser-class equivalent of covert ops frigates. While not as resilient as combat recon ships, they are nonetheless able to do their job as reconaissance vessels very effectively, due in no small part to their ability to interface with covert ops cloaking devices and set up cynosural fields for incoming capital ships.\r\n\r\nDeveloper: Duvolle Labs\r\n\r\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Since the company is one of New Eden\'s foremost manufacturers of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.',11650000,116000,315,1,8,14962526.0000,1,833,NULL,20074,1903),(11970,106,'Arazu Blueprint','',0,0.01,0,1,NULL,NULL,1,902,NULL,NULL,303),(11971,906,'Lachesis','Built to represent the last word in electronic warfare, combat recon ships have onboard facilities designed to maximize the effectiveness of electronic countermeasure modules of all kinds. Filling a role next to their class counterpart, the heavy assault cruiser, combat recon ships are the state of the art when it comes to anti-support support. They are also devastating adversaries in smaller skirmishes, possessing strong defensive capabilities in addition to their electronic superiority.\n\nDeveloper: Roden Shipyards\n\nRoden Shipyards is the fastest growing ship manufacturer in the Federation, thanks to an extremely aggressive R&D division and extensive connections in government and military procurement communities. Roden ships are distinguished by strong armor defenses and excellent electronic capabilities. They also tend towards gunboats with exceptional range and tracking systems, and less reliance on drones than the average Federation warship.',12070000,116000,320,1,8,15072684.0000,1,833,NULL,20074,2140),(11972,106,'Lachesis Blueprint','',0,0.01,0,1,NULL,NULL,1,902,NULL,NULL,303),(11978,832,'Scimitar','Built with special tracking support arrays, the Scimitar was designed in large part to assist heavy combat vessels in tracking fast-moving targets. Relatively nimble for a support cruiser, it can often be found ducking between battleships, protecting its own back while lending the behemoths the support they need to take out their enemies.\n\nDeveloper: Core Complexion Inc.\n\nCore Complexions ships are unusual in that they favor electronics and defense over the \"lots of guns\" approach traditionally favored by the Minmatar. Being a support cruiser, the Scimitar therefore fits ideally into their design scheme.',12090000,89000,440,1,2,12450072.0000,1,441,NULL,20077,1778),(11979,106,'Scimitar Blueprint','',0,0.01,0,1,NULL,NULL,1,446,NULL,NULL,303),(11985,832,'Basilisk','Following in the time-honored Caldari spaceship design tradition, the Basilisk sports top-of-the-line on-board computer systems specially designed to facilitate shield transporting arrays, while sacrificing some of the structural strength commonly found in vessels of its class.\r\n\r\nDeveloper: Lai Dai\r\n\r\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships but providing very little in terms of tactical specialization. With the Basilisk, their aim was to continue pushing forward the development of cutting-edge defense optimization systems while providing powerful support capability.',13130000,107000,485,1,1,13340104.0000,1,439,NULL,20069,11865),(11986,106,'Basilisk Blueprint','',0,0.01,0,1,NULL,NULL,1,444,NULL,NULL,303),(11987,832,'Guardian','The Guardian is the first vessel to feature Carthum Conglomerate\'s brand new capacitor flow maximization system, allowing for greater amounts of energy to be stored in the capacitor as well as providing increased facilities for transporting that energy to other ships.\r\n\r\nDeveloper: Carthum Conglomerate\r\n\r\nWhile featuring Carthum\'s trademark armor and hull strength, the Guardian, being a support ship, has limited room for armaments. Its intended main function is to serve as an all-round support vessel, providing the raw energy for fleet compatriots to do what they need to do in order to achieve victory.',11980000,115000,465,1,4,12567518.0000,1,438,NULL,20062,1916),(11988,106,'Guardian Blueprint','',0,0.01,0,1,NULL,NULL,1,443,NULL,NULL,303),(11989,832,'Oneiros','Designed specifically as an armor augmenter, the Oneiros provides added defensive muscle to fighters on the front lines. Additionally, its own formidable defenses make it a tough nut to crack. Breaking through a formation supported by an Oneiros is no mean feat.\r\n\r\nDeveloper: Roden Shipyards\r\n\r\nDeciding that added defensive capabilities would serve to strengthen the overall effectiveness of Gallente ships, who traditionally have favored pure firepower over other aspects, Roden Shipyards came up with the Oneiros. Intrigued, Gallente Navy officials are reportedly considering incorporating this powerful defender into their fleet formations.',13160000,113000,600,1,8,12691246.0000,1,440,NULL,20073,2141),(11990,106,'Oneiros Blueprint','',0,0.01,0,1,NULL,NULL,1,445,NULL,NULL,303),(11993,358,'Cerberus','No cruiser currently in existence can match the superiority of the Cerberus\'s onboard missile system. With a well-trained pilot jacked in, this fanged horror is capable of unleashing a hail of missiles to send even the most seasoned armor tankers running for cover. \r\n\r\nDeveloper: Lai Dai \r\n\r\nMoving away from their traditionally balanced all-round designs, Lai Dai have created a very specialized - and dangerous - missile boat in the Cerberus. Many have speculated that due to recent friction between Caldari megacorporations, LD may be looking to beef up their own police force with these missile-spewing monstrosities.',12720000,92000,650,1,1,17950950.0000,1,450,NULL,20068,1825),(11994,106,'Cerberus Blueprint','',0,0.01,0,1,NULL,NULL,1,455,NULL,NULL,303),(11995,894,'Onyx','Effectively combining the trapping power of interdictors with the defensive capabilities of heavy assault cruisers, the heavy interdiction cruiser is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdiction cruisers are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \r\n\r\nDeveloper: Kaalakiota \r\n\r\nAs befits one of the largest weapons manufacturers in the known world, Kaalakiota\'s ships are very combat focused. Favoring the traditional Caldari combat strategy, they are designed around a substantial number of weapons systems, especially missile launchers. However, they have rather weak armor and structure, relying more on shields for protection.\r\n\r\n',15400000,92000,450,1,1,14494924.0000,1,1072,NULL,20071,3362),(11996,106,'Onyx Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,303),(11999,358,'Vagabond','The fastest cruiser invented to date, this vessel is ideal for hit-and-run ops where both speed and firepower are required. Its on-board power core may not be strong enough to handle some of the larger weapons out there, but when it comes to guerilla work, the Vagabond can\'t be beat. \n<br>Developer: Thukker Mix\n\nImproving on the original Stabber design, Thukker Mix created the Vagabond as a cruiser-sized skirmish vessel equally suited to defending mobile installations and executing lightning strikes at their enemies. Honoring their tradition of building the fastest vessels to ply the space lanes, they count the Vagabond as one of their crowning achievements.',11590000,80000,460,1,2,17944848.0000,1,452,NULL,20076,1943),(12000,106,'Vagabond Blueprint','',0,0.01,0,1,NULL,NULL,1,457,NULL,NULL,303),(12003,358,'Zealot','The Zealot is built almost exclusively as a laser platform, designed to wreak as much havoc as its energy beams can be made to. As a vanguard vessel, its thick armor and dazzling destructive power make it capable of cutting through enemy fleets with striking ease. Zealots are currently being mass-produced by Viziam for the Imperial Navy. \n<br>Developer: Viziam\n\nFor their first production-ready starship design, Viziam opted to focus on their core proficiencies - heavy armor and highly optimized weaponry. The result is an extremely focused design that, when used correctly, can go toe-to-toe with any contemporary cruiser design.',12580000,118000,440,1,4,17956216.0000,1,449,NULL,20061,1751),(12004,106,'Zealot Blueprint','',0,0.01,0,1,NULL,NULL,1,454,NULL,NULL,303),(12005,358,'Ishtar','While not endowed with as much pure firepower as other ships of its category, the Ishtar is more than able to hold its own by virtue of its tremendous capacity for drones and its unique hard-coded drone-control subroutines. \n<br>Developer: CreoDron\n\nTouted as \"the Ishkur\'s big brother,\" the Ishtar design is the furthest CreoDron have ever gone towards creating a completely dedicated drone carrier. At various stages in its development process plans were made to strengthen the vessel in other areas, but ultimately the CreoDron engineers\' fascination with pushing the drone carrier envelope overrode all other concerns.',10600000,115000,560,1,8,17949992.0000,1,451,NULL,20075,1835),(12006,106,'Ishtar Blueprint','',0,0.01,0,1,NULL,NULL,1,456,NULL,NULL,303),(12011,358,'Eagle','Built on the shoulders of the sturdy Moa and improving on its durability and range, the Eagle is the next generation in Caldari gunboats. Able to fire accurately and do tremendous damage at ranges considered extreme by any cruiser pilot, this powerhouse will be the bane of anyone careless enough to think himself out of its range. \r\n\r\nDeveloper: Ishukone \r\n\r\nCaldari starship design is showing a growing trend towards armaments effective at high ranges, and in this arena, as in others, Ishukone do not let themselves get left behind; the Eagle was intended by them as a counter to the fearsome long-range capabilities of Lai Dai\'s Cerberus ship.',11720000,101000,550,1,1,17062524.0000,1,450,NULL,20068,1894),(12012,106,'Eagle Blueprint','',0,0.01,0,1,NULL,NULL,1,455,NULL,NULL,303),(12013,894,'Broadsword','Effectively combining the trapping power of interdictors with the defensive capabilities of heavy assault cruisers, the heavy interdiction cruiser is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdiction cruisers are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \r\n\r\nDeveloper: Core Complexion Inc.\r\n\r\nCore Complexion\'s ships are unusual in that they favor electronics and defense over the lots of guns approach traditionally favored by the Minmatar.\r\n\r\n',15000000,96000,452,1,2,15858382.0000,1,1074,NULL,20076,1776),(12014,106,'Broadsword Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,303),(12015,358,'Muninn','Commissioned by the Republic Fleet to create a powerful assault vessel for the strengthening of the Matari tribes as well as a commercial platform for the Howitzers and other guns produced by the Fleet, Boundless Creation came up with the Muninn. Heavily armored, laden with turret hardpoints and sporting the latest in projectile optimization technology, this is the very definition of a gunboat. \n<br>Developer: Boundless Creation\n\nBoundless Creation\'s ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as is humanly possible. The Muninn is far from being an exception.',11750000,96000,515,1,2,17062768.0000,1,452,NULL,20076,1925),(12016,106,'Muninn Blueprint','',0,0.01,0,1,NULL,NULL,1,457,NULL,NULL,303),(12017,894,'Devoter','Effectively combining the trapping power of interdictors with the defensive capabilities of heavy assault cruisers, the heavy interdiction cruiser is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdiction cruisers are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \r\n\r\nDeveloper: Viziam\r\n\r\nViziam ships are quite possibly the most durable ships money can buy. Their armor is second to none and that, combined with superior shields, makes them hard nuts to crack. Of course this does mean they are rather slow and possess somewhat more limited weapons and electronics options.\r\n\r\n',16200000,118000,375,1,4,15918776.0000,1,1071,NULL,20064,3363),(12018,106,'Devoter Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,303),(12019,358,'Sacrilege','Khanid\'s engineers have spent months perfecting the Sacrilege\'s on-board missile launcher optimization systems, making it a very effective assault missile platform. In addition, its supremely advanced capacitor systems make it one of the most dangerous ships in its class. \n<br>Developer: Khanid Innovation\n\nIn an effort to maintain the fragile peace with the old empire through force of deterrence, Khanid Innovation have taken the Maller blueprint and morphed it into a monster. State-of-the-art armor alloys, along with missile systems developed from the most advanced Caldari designs, mean the Sacrilege may be well on its way to becoming the Royal Khanid Navy\'s flagship cruiser.',11750000,118000,615,1,4,17062600.0000,1,449,NULL,20061,1855),(12020,106,'Sacrilege Blueprint','',0,0.01,0,1,NULL,NULL,1,454,NULL,NULL,303),(12021,894,'Phobos','Effectively combining the trapping power of interdictors with the defensive capabilities of heavy assault cruisers, the heavy interdiction cruiser is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdiction cruisers are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \n\nDeveloper: Roden Shipyards \n\nRoden Shipyards is the fastest growing ship manufacturer in the Federation, thanks to an extremely aggressive R&D division and extensive connections in government and military procurement communities. Roden ships are distinguished by strong armor defenses and excellent electronic capabilities. They also tend towards gunboats with exceptional range and tracking systems, and less reliance on drones than the average Federation warship.',14000000,112000,400,1,8,15894674.0000,1,1073,NULL,20072,3361),(12022,106,'Phobos Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,NULL,NULL,303),(12023,358,'Deimos','Sharing more tactical elements with smaller vessels than with its size-class counterparts, the Deimos represents the final word in up-close-and-personal cruiser combat. Venture too close to this one, and swift death is your only guarantee. \n\nDeveloper: Duvolle Labs\n\nRumor has it Duvolle was contracted by parties unknown to create the ultimate close-range blaster cruiser. In this their engineers and designers haven\'t failed; but the identity of the company\'s client remains to be discovered.',11460000,112000,415,1,8,17062588.0000,1,451,NULL,20072,11859),(12024,106,'Deimos Blueprint','',0,0.01,0,1,NULL,NULL,1,456,NULL,NULL,303),(12028,306,'Storage Bin','The enclosed storage bin drifts quietly in space, waiting patiently to be pried open by a hungry looter.',10000,1200,1000,1,NULL,NULL,0,NULL,16,NULL,1176),(12029,687,'Khanid Elite Fighter','This is a fighter for the Khanid Kingdom. It is protecting the assets of the Khanid Kindgom and may attack anyone it perceives as a threat.  Threat level: High',2870000,28700,315,1,4,NULL,0,NULL,NULL,NULL,1862),(12031,105,'Manticore Blueprint','',0,0.01,0,1,NULL,NULL,1,427,NULL,NULL,1066),(12032,834,'Manticore','Specifically engineered to fire torpedoes, stealth bombers represent the next generation in covert ops craft. The bombers are designed for sneak attacks on large vessels with powerful missile guidance technology enabling the torpedoes to strike faster and from a longer distance. \r\n\r\nDeveloper: Lai Dai\r\n\r\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships. \r\n\r\n',1470000,28100,265,1,1,NULL,1,422,NULL,20068,1881),(12034,834,'Hound','Specifically engineered to fire torpedoes, stealth bombers represent the next generation in covert ops craft. The bombers are designed for sneak attacks on large vessels with powerful missile guidance technology enabling the torpedoes to strike faster and from a longer distance. \r\n\r\nDeveloper: Boundless Creation\r\n\r\nBoundless Creation ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as humanly possible. On the other hand, defense systems and \"cheap tricks\" like electronic warfare have never been a high priority.',1455000,28100,255,1,2,NULL,1,424,NULL,20077,1966),(12035,105,'Hound Blueprint','',0,0.01,0,1,NULL,NULL,1,429,NULL,NULL,1066),(12036,324,'Dagger','',2810000,28100,175,1,2,NULL,0,NULL,NULL,20078,1966),(12037,105,'Dagger Blueprint','',0,0.01,0,1,NULL,NULL,0,NULL,NULL,NULL,1066),(12038,834,'Purifier','Specifically engineered to fire torpedoes, stealth bombers represent the next generation in covert ops craft. The bombers are designed for sneak attacks on large vessels with powerful missile guidance technology enabling the torpedoes to strike faster and from a longer distance. \r\n\r\nDeveloper: Viziam\r\n\r\nViziam ships are quite possibly the most durable ships money can buy. Their armor is second to none and that, combined with superior shields, makes them hard nuts to crack. Of course this does mean they are rather slow and possess somewhat more limited weapons and electronics options.',1495000,28100,260,1,4,NULL,1,421,NULL,20061,1872),(12041,105,'Purifier Blueprint','',0,0.01,0,1,NULL,NULL,1,425,NULL,NULL,1066),(12042,324,'Ishkur','Specialized as a frigate-class drone carrier, the Ishkur carries less in the way of firepower than most other Gallente gunboats. With a fully stocked complement of drones and a skilled pilot, however, no one should make the mistake of thinking this vessel easy prey.\r\n\r\nDeveloper: CreoDron\r\n\r\nAs the largest drone developer and manufacturer in space, CreoDron has a vested interest in drone carriers. While sacrificing relatively little in the way of defensive capability, the Ishkur can chew its way through surprisingly s