 various high profile kidnappings throughout the galaxy.  Concord has placed a high bounty on their heads. Threat level: Deadly',10010000,100100,235,1,4,NULL,0,NULL,NULL,31,1236),(12256,816,'Zor','Little is known about \"Zor\", other than the fact he is part of an infamous pirate gang going by the nickname \"The Seven\".  Concord lists him as their second in command, and has placed a very high bounty on his head.  The Seven have allegedly taken part in numerous high profile kidnappings throughout the galaxy, as well as ambushing convoys and drug smuggling activity.  All of them go by aliases to hide their identity, and to date no knowledge exists about their origins. Threat level: Deadly',22000000,1080000,235,1,1,NULL,0,NULL,NULL,NULL,2158),(12257,68,'Medium Energy Nosferatu I','Drains energy from the target ship and adds it to your own. This is a more powerful version designed for cruiser class ships.\r\n\r\nNote: A Nosferatu module will not drain your target\'s capacitor below your own capacitor level.',1000,5,0,1,NULL,NULL,1,693,1029,NULL,0),(12258,148,'Medium Energy Nosferatu I Blueprint','',0,0.01,0,1,NULL,1975200.0000,1,1564,1029,NULL,0),(12259,68,'Medium Energy Nosferatu II','Drains energy from the target ship and adds it to your own. This is a more powerful version designed for cruiser class ships.\r\n\r\nNote: A Nosferatu module will not drain your target\'s capacitor below your own capacitor level.',1000,5,0,1,NULL,NULL,1,693,1029,NULL,0),(12260,148,'Medium Energy Nosferatu II Blueprint','',0,0.01,0,1,NULL,9999999.0000,1,NULL,1029,NULL,0),(12261,68,'Heavy Energy Nosferatu I','Drains energy from the target ship and adds it to your own. This huge unit is designed for battleship class ships.\r\n\r\nNote: A Nosferatu module will not drain your target\'s capacitor below your own capacitor level.',1000,5,0,1,NULL,NULL,1,694,1029,NULL,0),(12262,148,'Heavy Energy Nosferatu I Blueprint','',0,0.01,0,1,NULL,9876000.0000,1,1564,1029,NULL,0),(12263,68,'Heavy Energy Nos