137863054','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"I am continuing mission to raid the tradelines of the periphery. Seems like the gates have gone quiet for now, which should give me time to repair the damage the last conservative bleep did to my munitions hold. I only hope I\'ll get an order soon from commander Barnac to return home to our asteroid processing facility in Illinfrik. I miss the rusty crawlways despite their stink. Perhaps I\'ll have time to have some more fun with the slaves.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12339,369,'Angel Ship Log 165462566','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"We faced heavy onslaught from a group of mercenaries seemingly after our loot that we\'ve pillaged across the region. Rakner surprised one of them with a scrambler, allowing the rest of us to take them out after a few moments of intense fighting. According to our latest mission declaration, we are to get some reinforcements from our \'roid processing facility in Nedegulf. I hope they won\'t be as green as the last batch. That group of wannabe pirates ended up as floating stiffs at the first sign of trouble.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12340,369,'Angel Ship Log 109285473','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"My communication systems should be back online in a matter of days. The hit had disintegrated the sidejack powercables and shredded the delicate wiring inside the touplet. I\'ve managed to dig up some spare cables, but in the end I know I\'ll have to get new parts at our asteroid processing facility in Hardbako.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12341,369,'Angel Ship Log 174132231','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"I\'m jonesin\' for a juicy bottle of spiced wine. When I close my eyes to sleep, I see myriad frozen corpses drifting towards me. I think this job is getting to me. Just a friggin bottle of wine! That\'s all I ask. That\'s it, after this day\'s raiding duty, I\'ll head over to the Sin City complex in Lasleinur and get me some liquor. I\'ve heard they have a nice stash of juice there. They sure won\'t get to drink those heaps of barrels all on their own.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12342,369,'Angel Ship Log 141490454','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"Our plundering fleet is invincible! We\'ve taken down two convoys in the first hour of pillaging. I still have the explosion of their sundering ships burnt into my vision. Oh, how their burning corpses kindle my soul. We took a few of the survivors captive, including a saucy Brutor chick that I\'ll have to introduce to the boys at the \'roid processing facility in Altrinur. I hope I\'ll get my long overdue promotion at last.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12343,369,'Angel Ship Log 349584483','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"The explosive package that the boss told me to deliver to the Senate seems to have gone off in one of our cargo ships. The hold\'s contents are now drifting in the void, attracting scavengers of all sorts. To finish the mission, I will have to go to the installation in LN-56V and pick up a new device. The Senate\'s new order must be suppressed.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12344,74,'200mm Railgun I','The 200mm railgun works much the same as its big brother except that it is considerably faster but also less powerful. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',1000,10,1,1,NULL,100000.0000,1,565,370,NULL,11136),(12345,154,'200mm Railgun I Blueprint','',0,0.01,0,1,NULL,1000000.0000,1,290,349,NULL,0),(12346,74,'200mm Railgun II','The 200mm railgun works much the same as its big brother except that it is considerably faster but also less powerful. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires either regular or advanced hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium, Javelin, Spike.',1000,10,1,1,NULL,243088.0000,1,565,370,NULL,11253),(12347,154,'200mm Railgun II Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,349,NULL,0),(12354,74,'350mm Railgun I','The 350mm railgun works much the same as its big brother except that it is considerably faster but also less powerful. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,50,2,1,NULL,1000000.0000,1,566,366,NULL,11133),(12355,154,'350mm Railgun I Blueprint','',0,0.01,0,1,NULL,10000000.0000,1,289,349,NULL,0),(12356,74,'350mm Railgun II','The 350mm railgun works much the same as its big brother except that it is considerably faster but also less powerful. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires either regular or advanced hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium, Javelin, Spike.',2000,20,2,1,NULL,1172256.0000,1,566,366,NULL,11247),(12357,154,'350mm Railgun II Blueprint','',0,0.01,0,1,NULL,NULL,1,NULL,349,NULL,0),(12365,1209,'EM Shield Compensation','5% bonus to EM resistance per level for Shield Amplifiers.',0,0.01,0,1,NULL,120000.0000,1,1747,33,NULL,0),(12366,1209,'Kinetic Shield Compensation','5% bonus to kinetic resistance per level for Shield Amplifiers.',0,0.01,0,1,NULL,120000.0000,1,1747,33,NULL,0),(12367,1209,'Explosive Shield Compensation','5% bonus to explosive resistance per level for Shield Amplifiers.',0,0.01,0,1,NULL,120000.0000,1,1747,33,NULL,0),(12368,272,'Hypereuclidean Navigation','Skill at navigating while cloaked. 20% per level  bonus to cloaked velocity per skill level.',0,0.01,0,1,NULL,NULL,0,NULL,33,NULL,0),(12369,369,'Angel Ship Log 303445882','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"Cannons! We need big friggin cannons! Not those micro autocannons they use for target practice. If only the wing commander would wake up from his stupidity and get us some real weaponry. I want one of heavy metal howitzers they keep at our Sin City complex in Aeditide. He says it\'s more economic this way. Which is another way of saying that he\'s the only one with a clone contract and doesn\'t give a damn whether we make it out alive or not.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12370,369,'Angel Ship Log 343873495','This salvaged data from a destroyed Angel vessel reveals the following:\r\n\"Toilet duty is more exciting than this. I\'ve seen graveyards with more life than this raiding party. These guys are totally devout of the gene of humor-appreciation. So what if I podded my wingman!? He had a clone contract back at our installation in RD-FWY. Why did nobody find that funny? I mean, he had it coming in that goofy ship of his. He\'d even spilt some quafe in his goo pod the day before, making the explosion all the more colorful. C\'mon, I just had to do it.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12371,369,'Angel Ship Log 523366291','This salvaged data from a destroyed Angel vessel reveals the following coded message:\r\n\"O4: core omega at HG8 delta. Caution. O7: spin kappa to NZPK-G. O1: trail iota with epsilon on B15. Proceed beta delta O3 and rearm. O2: return.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12372,369,'Angel Ship Log 583225679','This salvaged data from a destroyed Angel vessel reveals the following partly coded message:\r\n\"Orders: Take m98 and raid convoy at I-0,32. Continue to echo 5 and group up with K6 and G3 at the rendezvous point 832 parsecs from region border. Take loot and surviving ships to shipyard at 77S8-E. Pick up some spiced wine and rock whiskey and meet my fleet 125 parsecs from the Golgothan Fields.\"',1,0.1,0,1,NULL,NULL,0,NULL,2335,NULL,0),(12373,369,'Blood Raider Log 137393941','This salvaged data from a destroyed Blood Raider vessel reveals the following:\r\n\"We\'ve experienced heavy casualties since the Empire fleet attacked our outpost in the Outer Ring. We\'ve collected the blood from the wounded and drained the salvaged corpses of the enemy. According to the orders from the cathedral, we are to deliver the barrels to the outpost in the Ainsan system.\"',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12374,369,'Blood Raider Log 118338758','This salvaged data from a destroyed Blood Raider vessel reveals the following communication log:\r\n\"Local > What more do you ask of me, Cardinal Sarikusa?\r\nOmir Sarikusa > I want you to meet up with three of my Blood Seekers at the outpost in Tegheon. Follow them on this blood quest to collect nine barrels of clone-blood, devoid of any impurities.\r\nLocal > Yes, Cardinal. What should I do with the blood from the Piri colony?\r\nOmir Sarikusa > Spill it! All I want is pure clone-blood. Anything else is contaminated. Is that clear?\r\nLocal > As you wish, Cardinal. I will do as you command.\r\nEnd of Transmission.\"',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12375,369,'Blood Raider Log 114019732','This salvaged data from a destroyed Blood Raider vessel reveals the following:\r\n\"The Sani Sabik ritual is soon coming up and I fear I haven\'t reached the quota. I\'ve already deposited 600 liters to my storeroom in the outpost at Gasavak. If our raiding party can drain 80 more pilots in the coming week, we should be able to make it.\"',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12376,267,'\'Logic\'','This is part of a set of debunked CONCORD self-help books that used to be very popular among capsuleers until independent researchers proved conclusively that they were largely rubbish.',0,0.01,0,1,NULL,5000000.0000,0,NULL,33,NULL,0),(12377,369,'Blood Raider Log 189897223','This salvaged data from a destroyed Blood Raider vessel reveals the following:\r\n\"My prayers have not been answered. Perhaps I have fallen from grace since the incident back at the outpost in Huola. I may have to make up for it in some way. It\'s hard to do anything now after a few of the brothers were taken into custody by those heretic Concord officials. May the curse of the Sani Sabik fall on those wretched souls.\"',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12378,369,'Blood Raider Log 167593883','This salvaged data from a destroyed Blood Raider vessel reveals the following:\r\n\"The directions that I was given were very vague. All I know is that I am supposed to go from our outpost in Jedandan, ferrying some drums of blood to another of our outposts in Miroona. I was told the location in Miroona was to be a very obvious one if I started to look from the sun, but it\'s hard to tell what they mean. I know they want the five liters in my own body. If this turns out to be another ambush, I have fitted my ship with a micro warpdrive fast enough to scoot out of range of their leeching lasers.\"\r\n',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12379,369,'Blood Raider Log 397001231','This salvaged data from a destroyed Blood Raider vessel reveals the following:\r\n\"These frequency crystals are all but burnt out. According to the raid bishop, there\'s plenty at the depot in the 8RQJ-2 system. If things slow down around here, I might find time to jet over there and pick up a few crystals and maybe get some real, warm sustenance in the way.\"\r\n ',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12380,369,'Blood Raider Log 335499422','This salvaged data from a destroyed Blood Raider vessel reveals the following:\r\n\"I snuck back in the cargo hold yesterday and ripped one of the canister lids off. I just had to taste it. According to the cardinal it\'s supposed to make you immortal. It tasted ok at first, but after  I swallowed a whole cupful my stomache rebelled and threw it all back up. I don\'t think anyone will notice my breakfast floating in there, and if they do, I\'ll be long gone to our Sota outpost.\"\r\n\r\n ',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12381,369,'Blood Raider Log 389314943','This salvaged data from a destroyed Blood Raider vessel reveals the following:\r\n\"The ship is breaking apart. I can hear the plating peeling away and the superstructure groans when I warp. I think somebody should do it a favor and just blast the damn thing, preferably without me inside it. A new ship would be waiting for me at the depot in Q-02UL, but I\'d have to buy some new modules since the old ones are way past their expiration date.\"',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12382,369,'Blood Raider Log 534970023','This salvaged data from a destroyed Blood Raider vessel reveals the following coded message:\r\n\"Sarasomi al tokune ra\'popune. Kente ba\'al rapontes al pheton de\'skran o malen Sani Sabik. Dorurem tokun o batine sat dori am Z-XX2J. Meronam taru.\"',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12383,267,'\'Presence\'','This is part of a set of debunked CONCORD self-help books that used to be very popular among capsuleers until independent researchers proved conclusively that they were largely rubbish.',0,0.01,0,1,NULL,5000000.0000,0,NULL,33,NULL,0),(12384,369,'Blood Raider Log 518719843','This salvaged data from a destroyed Blood Raider vessel reveals the following code:\r\n\"Secret Base Sys: 0-NTIS\"',1,0.1,0,1,NULL,NULL,0,NULL,2336,NULL,0),(12385,267,'\'Eidetic Memory\'','This is part of a set of debunked CONCORD self-help books that used to be very popular among capsuleers until independent researchers proved conclusively that they were largely rubbish.',0,0.01,0,1,NULL,5000000.0000,0,NULL,33,NULL,0),(12386,267,'\'Focus\'','This is part of a set of debunked CONCORD self-help books that used to be very popular among capsuleers until independent researchers proved conclusively that they were largely rubbish.',0,0.01,0,1,NULL,5000000.0000,0,NULL,33,NULL,0),(12387,267,'\'Clarity\'','This is part of a set of debunked CONCORD self-help books that used to be very popular among capsuleers until independent researchers proved conclusively that they were largely rubbish.',0,0.01,0,1,NULL,5000000.0000,0,NULL,33,NULL,0),(12388,667,'Imperial Navy Apocalypse','Only those in high favor with the Emperor can earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. These metallic monstrosities see to it that the word of the Emperor is carried out among the denizens of the Empire and beyond.  Threat level: Deadly',20500000,1150000,675,1,4,NULL,0,NULL,NULL,NULL,2239),(12389,706,'Republic Fleet Tempest','The Tempest battleship can become a real behemoth when fully equipped.\r\nThreat level: Deadly',19000000,850000,600,1,2,NULL,0,NULL,NULL,NULL,2642),(12390,680,'Federation Navy Megathron','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.\r\n  Threat level: Deadly',19000000,1140000,675,1,8,NULL,0,NULL,NULL,NULL,2139),(12391,674,'Caldari Navy Raven','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty.  Threat level: Deadly',21000000,1040000,665,1,1,NULL,0,NULL,NULL,NULL,43),(12392,691,'Khanid Mashtori','The Khanid Mashtori are an elite sect of bounty hunters which work exclusively for the Khanid royalty.  It is not uncommon for them to operate a battleship or lead a fleet of Khanid ships in times of war.   Threat level: Deadly',12000000,120000,550,1,4,NULL,0,NULL,NULL,NULL,20313),(12394,673,'Caldari Navy Blackbird','The Blackbird is a small high-tech cruiser newly employed by the Caldari Navy. What it lacks in armor strength it more than makes up with maneuverability and stealth. The Blackbird is not intended for head-on slugfests, but rather delicate tactical situations.  Threat level: Deadly',14000000,96000,305,1,1,NULL,0,NULL,NULL,NULL,1787),(12438,705,'Republic Fleet Stabber','The Stabber is the mainstay of the Minmatar fleet. It is light and extremely fast, yet surprisingly powerful, with a wide variety of weapons. It is one of few Minmatar vessels that have reached popularity outside Minmatar space.  Threat level: Deadly',10000000,80000,420,1,2,NULL,0,NULL,NULL,NULL,1884),(12439,668,'Imperial Navy Omen','The Omen is a good example of the sturdy and powerful cruisers of the Amarr, with super strong armor and defenses. It also mounts multiple turret hardpoints.  Threat level: Deadly',11950000,118000,450,1,4,NULL,0,NULL,NULL,NULL,1731),(12440,678,'Federation Navy Vexor','The Vexor is a strong combat ship that is also geared to operate in a variety of other roles. The Vexor is especially useful for surveying in potentially hostile sectors as it can stay on duty for a very long time before having to return to base. Furthermore, it is well capable of defending itself against even concentrated attacks.  Threat level: Deadly',13075000,115000,480,1,8,NULL,0,NULL,NULL,NULL,1803),(12441,256,'Missile Bombardment','Proficiency at long-range missile combat. 10% bonus to all missiles\' maximum flight time per level.',0,0.01,0,1,NULL,80000.0000,1,373,33,NULL,0),(12442,256,'Missile Projection','Skill at boosting missile bay trigger circuits and enhancing guided missiles\' ignition systems. 10% bonus to all missiles\' maximum velocity per level.',0,0.01,0,1,NULL,100000.0000,1,373,33,NULL,0),(12444,369,'Serpentis Ship Log 12682884','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"The two dealers that contacted me from Stacmon were both the regular low-life scum I\'m used to dealing with. They told me they\'d find me at outpost in Ainaille. These are no high-rollers and are dealing in a few hundreds of Nerve Sticks at most. I think I\'ve got some sticks on me, but joined with the stash I have in Slays, I should be able to facilitate their needs.\"',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12445,369,'Serpentis Ship Log 187076356','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"One of the blue-pill packages is leaking in the hold. I checked the boxes before I left the depot in the Torvi system, so they seem to have been fractured sometime on my route through the region. I\'m afraid I may have an intruder onboard.\"',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12446,369,'Serpentis Ship Log 144391348','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"This stuff is amazing. According to storage chief Plotola Auki, it only grows under very special circumstances. Every attempt to manufacture it in a lab has failed. It seems to grow well under the dim purple light on our outpost in Osmeden. It will be curious to know what effects this will have on the market.\"',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12447,369,'Serpentis Ship Log 103298223','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"The DED has been making some inquiries into our operations in the Erme system. We\'re making inquires into how much the agents value their families\' well-being, though, so soon they should give up and divert their attention to more pressing business.\"',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12448,369,'Serpentis Ship Log 166832001','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"I was told by the boss to pick up the delivery at the outpost in Laurvier. The region is clogged with cops as if the rival druglords aren\'t bad enough. I\'ll need at least a cruiser for a job like that.\"',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12449,369,'Serpentis Ship Log 381038422','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"I need money fast. This courier job isn\'t paying off. A few of us gangmates are gonna hold-up the supply station in Covryn. According to our sources it shouldn\'t be defended by any guardian angels. At least not until they get their next big shipment, but we\'ll be long gone by then. The sweet thing is that we can probably sell the loot right back to Salvador Sarpati himself.\"',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12450,369,'Serpentis Ship Log 303248612','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"The pleasant sound of credits loading into my account, what sweet symphony they make. So what if a few families die by the hand of my \'chemical remedies\'? This is a competitive world and I intend to win gold medal in the survival competition. Soon I\'ll make enough money, I can deposit all the isk from my account at the Serpentis supply depot in the Vaurent system, and start my own business in Foundation.\"',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12451,369,'Serpentis Ship Log 378922371','This salvaged data from a destroyed Serpentis vessel reveals the following:\r\n\"Report: We\'ve got supply runs darting from our depot in Toustain, both ways. Three guys are camping in the Syndicate region and four guys in Placid. I\'ve got a small cabal of brothers running the deals between Solitude and Verge, everyone knowing what to do if the heat will rise.\"\r\n',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12452,369,'Serpentis Ship Log 534643764','This salvaged data from a destroyed Serpentis vessel reveals the following coded message:\r\n\"2 slops thr. Uhorn and D25sg. 50mg test=success. Rprt2 DC UTKS-5. Durand & Bilski=10-4 over log2 Placid.\"\r\n\r\n',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12453,369,'Serpentis Ship Log 501163556','This salvaged data from a destroyed Serpentis vessel reveals the following coded message:\r\n\"Waypnt.3 advance on Syndicate spinw. Echo cont. gate at Fountain. Pick up deliv. Ouelletta; Test results: 810551=Awful, Caimn23=Quality stuff, 25thH=Good.\"\r\n\r\n',1,0.1,0,1,NULL,NULL,0,NULL,2337,NULL,0),(12454,369,'Guristas Ship Log 119373337','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"The cooling coils didn\'t make it to HQ in Venal. This means we have to switch over to blasters before we pillage the Lonetrek target. I\'ve already invested in some short range weaponry at the depot in Kakki.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12455,369,'Guristas Ship Log 108634544','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"Wow, I\'ve met Korako \'The Rabbit\' Kosakami himself! He was sailing his TL2+ Condor into the \'roid facility in Kusomonmon, with a small group of deserter sergeants from the Navy.  Man, wait \'til I tell the guys down at the fitting station.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12456,369,'Guristas Ship Log 125792289','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"Three days in base was all I had and I\'d better use the short time well. I was speaking with Chief Scout Kaikka Peunato about our outposts in Venal, when he mentioned a hideout of ours that I wasn\'t familiar with. He told me that if I got into trouble, I could always go back to the Aikoro depot for repairs and rearming. It surprised me that I hadn\'t heard about it before, and I\'ll be sure to check it out, if not only to check his credibility.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12457,369,'Guristas Ship Log 175568934','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"Our numbers rise as the number of navy pilots increases that discover the rewards of piracy versus the deprecatory pay of the state. New recruits are directed to the depot at Ekura, where they are put to the test.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12460,369,'Guristas Ship Log 180983465','This salvaged data from a destroyed Guristas vessel reveals the following part of a report:\r\n\"The last wave of intruders came as a surprise. They had three Merlins, a Kestrel missileboat and an osprey fitted with scramblers. Our forces had been weakened by the raid on the Hyasyoda compound, but we had the perimeter lined with backup ships that answered our call as the first two ships sundered. We took on the Merlins with our light crafts and let the reserves take out key targets; the Kestrel and the cruiser. Our three surviving ships headed over to the Mara outpost for repairs and rearming.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12461,369,'Guristas Ship Log 312887432','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"Orders from Arjidsi Yimishoo: Deliver any loot and salvageable debris to the Obe outpost. Local hands of Guristas Production will then ship it to our commercial stations in the region.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12462,369,'Guristas Ship Log 398560763','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"The missiles are on their way to the outpost in DT-TCD. Be sure to check their detonators and remove the wrappings so that the cruisers can have clear and hassle-free access when they arrive.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12463,369,'Guristas Ship Log 365764054','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"Construction parts for the battlestation are being ferried and stored at the outpost in Oijanen. Station personnel training is under way in Venal HQ, estimated to be completed a day after construction completion. The blueprints are to be destroyed in the station incinerator as soon as it has been verified to operate successfully.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12464,816,'Mercenary Overlord','This is a mercenary battleship, usually deployed at the head of a fleet of ships, and harboring their leader.  Only the major factions or biggest corporations in Eve can afford to hire Overlords.  Threat level: Deadly',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,335),(12465,369,'Guristas Ship Log 534987422','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"TOP SECRET - Destroy after processing\r\ntulip command XYZ:300312,321441,53131\r\nBOR <18966 au> under <839 au (w/o BOR)>\r\ndeadspace complex ZZZR-5.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12466,369,'Guristas Ship Log 573652885','This salvaged data from a destroyed Guristas vessel reveals the following:\r\n\"Report: The research plans have been delivered. Meet me at the prison facility in FHB-QA. Bring F&R.\"',1,0.1,0,1,NULL,NULL,0,NULL,2338,NULL,0),(12467,369,'Sansha Ship Log 104398459','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Must perform better. Must follow masterplan. Must pick up fellow workers at Boranai outpost. Thus was I told, such will I act.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12468,369,'Sansha Ship Log 187342874','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Sometimes my head hurts. Perhaps it\'s the Master\'s implants. I must be better at tolerating pain. Master wouldn\'t want me to feel pain. I must do what the Master wants. I feel compelled to go to the Hadonoo outpost. I am sure I\'m being directed there to increase my pain threshold. Then I could serve better.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12469,369,'Sansha Ship Log 148920447','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Orders from Master Sansha: Attack anyone who enters the territory without Concord signiature. After destroying ten ships, return to Dabrid outpost and rearm.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12474,369,'Sansha Ship Log 136423760','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Must follow the rules set by Master Sansha. Must find my fellow True Slaves at Agil outpost. We must work together to enforce Master\'s will.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12475,369,'Sansha Ship Log 112457832','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Long live great Sansha! We will fight the evil empires that invade our rightful territory so that our perfect nation shall rise again from the waves of time. Mental Note: Recalibrate master implants at Nidebora outpost.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12476,369,'Sansha Ship Log 363587633','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Blood Raiders invade our territory. Their pestilence is not welcome in the perfect eden of Sansha. The Power that Master Sansha has given us has enabled us great feats in the fight against the Raiders. An outpost has been built in X4-WLO, to ensure a firm foothold for the soldiers of Sansha in Blood Raider space.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12477,369,'Sansha Ship Log 309832812','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Rumors have been spreading amongst Sansha\'s nation that The Master is not gone. Those would surely be good news, although we would carry out his orders until the end of days whether he be among us or in heaven. I shall have to check on these rumors at the outpost in C-VZAK.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12478,314,'Khumaak','The Khumaak (literally \"Hand of Maak\") is a replica of an ancient Amarrian relic used 125 years ago by a Minmatar slave to kill his master, thereby sparking a revolt on Arzad II (also known as Starkman Prime). This revolt, while precipitating the almost total annihilation of the Starkmanir Minmatar tribe, has in historical retrospect come to be credited as one of the seminal events in the larger Minmatar uprising. The weapon itself is a three-foot rod with a spiked solar disc on the top, the design of the original relic believed to date back to the pre-Reclaiming era of Amarrian prophet Dano Geinok. It isn\'t believed to have been intended as a weapon originally, but as a rod of command for high-ranking members of the Amarrian Conformist clergy.',2,0.3,0,1,NULL,10000.0000,1,492,2206,NULL,0),(12479,369,'Sansha Ship Log 322301875','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"We shall rebuild. We shall serve. We shall carry out the word of the almighty Sansha. After the construction of the outpost in 9UY4-H, we shall go on. The world will be filled with wonders of construction, worthy of the kingdom of Master Sansha.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12480,369,'Sansha Ship Log 549327937','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Implant error: Failed to initiate navigation subroutines for calibrated system node ZDYA-G. Possible cause: Neural tissue damage.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12481,369,'Sansha Ship Log 566930267','This salvaged data from a destroyed Sansha vessel reveals the following:\r\n\"Sansha command I4-3G; Base E3-SDZ; reprocess biomass from old slave modules.\"',1,0.1,0,1,NULL,NULL,0,NULL,2339,NULL,0),(12484,273,'Amarr Drone Specialization','Specialization in the operation of advanced Amarr drones. 2% bonus per skill level to the damage of light, medium, heavy and sentry drones requiring Amarr Drone Specialization.',0,0.01,0,1,NULL,9000000.0000,1,366,33,NULL,0),(12485,273,'Minmatar Drone Specialization','Specialization in the operation of advanced Minmatar drones. 2% bonus per skill level to the damage of light, medium, heavy and sentry drones requiring Minmatar Drone Specialization.',0,0.01,0,1,NULL,9000