itary duty, although a few can be found in the private sector acting as escort ships for very important dispatches. In the Amarr Imperial Navy, the Maller is commonly used as the spearhead for large military operations. Threat level: Deadly',12750000,118000,280,1,4,NULL,0,NULL,NULL,NULL,1739),(15324,705,'Republic Fleet Rupture','The Rupture is slow for a Minmatar ship, but it more than makes up for it in power. The Rupture has superior firepower and is used by the Minmatar Republic both to defend space stations and other stationary objects and as part of massive attack formations. Threat level: Deadly',11500000,96000,300,1,2,NULL,0,NULL,NULL,NULL,1885),(15325,678,'Federation Navy Thorax','The Thorax-class cruisers are the latest combat ships commissioned by the Federation. In the few times it has seen action since its christening, it has performed admirably. The hordes of combat drones it carries allow it to strike against unwary opponents far away and to easily fight many opponents at the same time. Threat level: Deadly',12000000,112000,265,1,8,NULL,0,NULL,NULL,NULL,1804),(15326,674,'Caldari Navy Scorpion','The first Scorpion-class battleship was launched only a couple of years ago, and those that have been built are considered to be prototypes. Little is known of its capabilities, but what has been garnered suggests that the Scorpion is crammed to the brink with sophisticated hi-tech equipment that few can match.  Threat level: Deadly',20500000,1040000,550,1,1,NULL,0,NULL,NULL,NULL,50),(15327,706,'Republic Fleet Typhoon','The Typhoon class battleship has an unusually strong structural integrity for a Minmatar ship. Threat level: Deadly',19000000,920000,625,1,2,NULL,0,NULL,NULL,NULL,2160),(15328,667,'Imperial Navy Armageddon','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor. Threat level: Deadly',20500000,1100000,600,1,4,NULL,0,NULL,NULL,NULL,2240),(15329,667,'Ammatar Navy Armageddon','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor. Threat level: Deadly',20500000,1100000,600,1,4,NULL,0,NULL,NULL,NULL,297),(15330,680,'Federation Navy Dominix','The Dominix is one of the old warhorses that dates backs to the Gallente-Caldari War. The Dominix is no longer regarded as the top-of-the-line battleship, but this by no means makes it obsolete. Its formidable hulk and powerful weapon batteries means that anyone not in the largest and latest battleships will regret that they ever locked into combat with it. Threat level: Deadly',19000000,1010000,600,1,8,NULL,0,NULL,NULL,NULL,2138),(15331,526,'Metal Scraps','This mechanical hardware has obviously outlived its use, and is now ready to be recycled. Many station maintenance departments use the material gained from recycling these scraps to manufacture steel plates which replace worn out existing plates in the station hull. Most station managers consider this a cost-effective approach, rather than to send out a costly mining expedition for the ore, although these scraps rarely are enough to satisfy demand.\r\n\r\nThis commodity is not affected by the scrap metal processing skill any more than any other recyclable item.',10000,0.01,0,1,NULL,20.0000,1,20,2529,NULL,0),(15333,817,'Pirate Transport Ship','Convoys are a common sight in the universe of EVE, ferrying goods from one place to another. Convoys usually have armed escorts, so attacking them is risky.',96000000,960000,2300,1,1,NULL,0,NULL,NULL,31,51),(15334,817,'Smuggler Freight','Convoys are a common sight in the universe of EVE, ferrying goods from one place to another. Convoys usually have armed escorts, so attacking them is risky.',96000000,960000,2300,1,1,NULL,0,NULL,NULL,31,51),(15335,667,'Imperial Navy Fleet Commander','Designed by master starship engineers and constructed in the royal shipyards of the Emperor himself, the imperial issue of the dreaded Apocalypse battleship is held in awe throughout the Empire. Given only as an award to those who have demonstrated their fealty to the Emperor in a most exemplary way, it is considered a huge honor to command, let alone own, one of these majestic and powerful battleships. These metallic monstrosities see to it that the word of the Emperor is carried out among the denizens of the Empire and beyond. Threat level: Deadly.',20500000,1150000,675,1,4,NULL,0,NULL,NULL,NULL,2239),(15336,667,'Ammatar Navy Fleet Commander','Designed by master starship engineers and constructed in the royal shipyards of the Emperor himself, the imperial issue of the dreaded Apocalypse battleship is held in awe throughout the Empire. Given only as an award to those who have demonstrated their fealty to the Emperor in a most exemplary way, it is considered a huge honor to command, let alone own, one of these majestic and powerful battleships. These metallic monstrosities see to it that the word of the Emperor is carried out among the denizens of the Empire and beyond.  Threat Level:  Deadly',20500000,1150000,675,1,4,NULL,0,NULL,NULL,NULL,2239),(15337,680,'Federation Navy Fleet Commander','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.\r\n\r\nThe Federal Issue is a unique ship, commissioned by Gallentean president Foiritan as an honorary award for given to those individuals whose outstanding achivements benefit the entire Federation.  Threat level:  Deadly',19000000,1140000,675,1,8,NULL,0,NULL,NULL,NULL,2139),(15338,674,'Caldari Navy Fleet Commander','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty.  Threat level:  Deadly',20500000,1080000,665,1,1,NULL,0,NULL,NULL,NULL,43),(15341,706,'Republic Fleet Command Ship','The Tempest battleship can become a real behemoth when fully equipped.\r\nThreat level: Deadly',19000000,850000,600,1,2,NULL,0,NULL,NULL,NULL,2642),(15342,683,'Republic Fleet Squad Leader','A Squad Leader controls a small unit of ships during battle.  Seldom are they found without a few escorts with them.  Threat level: Deadly.',1100000,27289,130,1,2,NULL,0,NULL,NULL,NULL,1891),(15343,705,'Republic Fleet Raid Leader','Raid Leaders are high ranking commanding officers within the Fleet.',10250000,89000,440,1,2,NULL,0,NULL,NULL,NULL,1886),(15344,665,'Imperial Navy Squad Leader','A Squad Leader controls a small unit of ships during battle.  Seldom are they found without a few escorts with them. Threat level: Deadly.',1425000,28600,135,1,4,NULL,0,NULL,NULL,NULL,1734),(15345,677,'Federation Navy Squad Leader','A Squad Leader controls a small unit of ships during battle.  Seldom are they found without a few escorts with them. Threat level: Deadly.',1250000,26500,140,1,8,NULL,0,NULL,NULL,NULL,1807),(15346,671,'Caldari Navy Squad Leader','A Squad Leader controls a small unit of ships during battle.  Seldom are they found without a few escorts with them.  Threat level: Deadly.',1450000,16500,130,1,1,NULL,0,NULL,NULL,NULL,1793),(15347,665,'Ammatar Navy Squad Leader','A Squad Leader controls a small unit of ships during battle.  Seldom are they found without a few escorts with them. Threat level: Deadly.',1425000,28600,135,1,4,NULL,0,NULL,NULL,NULL,1744),(15349,673,'Caldari Navy Raid Leader','Raid Leaders are high ranking commanding officers within the Navy.',13000000,107000,485,1,1,NULL,0,NULL,NULL,NULL,1784),(15350,668,'Imperial Navy Raid Leader','Raid Leaders are high ranking commanding officers within the Navy.  ',12250000,115000,465,1,4,NUL