 from the dark life of the pirate which he had once led, mainly for the sake of his wife and children.  \r\n\r\nToday Pierre is best known as a bounty hunter who specializes in assassinating pirates.  He works only for trustworthy Gallenteans who have no obvious connections to the underworld, and prides himself with his current good relationship with the Gallentean authorities.  \r\n\r\n\r\n Threat level: Deadly',12000000,112000,265,1,8,NULL,0,NULL,NULL,31,63),(15392,818,'Zack Mead','Zack Mead is a small time criminal turned bounty hunter.  He used to work as an agent for the Serpentis but eventually switched to the job as a freelancer once he had the funds to purchase his own frigate.  Many wealthy Gallenteans turn to men such as Zack when they feel the law is not adequate in dealing with their problem.  Threat level: Very high',1680000,17400,90,1,1,NULL,0,NULL,NULL,NULL,315),(15393,816,'Jared Kalem','Jared is a former member of the Angel Cartel who turned freelance bounty hunter.  Today he is known to work for anyone, anywhere, if the price is right.  Concord advice utmost caution when approaching this outlaw.  Threat level: Deadly',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,335),(15394,816,'Taisu Magdesh','Taisu comes from a powerful family of mercenaries within the Mordus Legion.  Famous for their \"no questions asked\" approach, the Magdesh family is prized as first class fighter pilots, who normally lead a fleet of warships.  Only powerful leaders or extremely wealthy individuals can afford the likes of Taisu, who commands a deadly Raven battleship.  Threat level: Deadly',19000000,1080000,665,1,1,NULL,0,NULL,NULL,NULL,43),(15395,337,'Construction Freight','Convoys are a common sight in the universe of EVE, ferrying goods from one place to another. Convoys usually have armed escorts, so attacking them is risky.',110500000,1105000,4000,1,8,NULL,0,NULL,NULL,NULL,328),(15396,821,'General Luther Veron','This is General Luther Veron\'s personal battleship, fitted with the very finest modules available in the Gallente Federation.  ',21000000,1140000,675,1,8,NULL,0,NULL,NULL,31,2139),(15397,205,'Luther Veron\'s Modified Heat Sink','Dissipates energy weapon damage efficiently, thus allowing them to be fired more rapidly. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1,5,0,1,NULL,NULL,0,NULL,1046,NULL,0),(15399,53,'Luther Veron\'s Modified Dual Heavy Beam Laser','This heavy beam laser uses two separate laser focusing systems to reduce the cool down period between shots. A great weapon for medium to long range encounters. \r\n\r\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',2000,20,1,1,NULL,NULL,0,NULL,361,NULL,11188),(15401,53,'Luther Veron\'s Modified Mega Beam Laser','A super-heavy beam laser designed for medium to long range engagements. \r\n\r\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',2000,20,1,1,NULL,NULL,0,NULL,361,NULL,11190),(15403,53,'Luther Veron\'s Modified Tachyon Beam Laser','An ultra-heavy beam laser designed for medium to long range engagements. \r\n\r\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',2000,20,1,1,NULL,NULL,0,NULL,361,NULL,11192),(15405,72,'Luther Veron\'s Modified Large EMP Smartbomb','Radiates an omnidirectional pulse from the ship that causes EM damage to surrounding vessels.',100,50,0,1,NULL,NULL,0,NULL,112,NULL,2032),(15407,77,'Luther Veron\'s Modified Adaptive Invulnerability Field','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,1,63062.0000,0,NULL,81,NULL,0),(15408,38,'Luther Veron\'s Modified Shield Extender','Increases the maximum strength of the shield.',0,20,0,1,NULL,NULL,0,NULL,1044,NULL,0),(15410,314,'Neophite','This priceless mineral was discovered by a band of Gallente explorers during the Caldari-Gallente war over a century ago. Closely related to morphite, its composition is only slightly different yet enough so that it has not been able to serve the same function. Only a few samples of it are known to remain intact, in the possession of some of the most wealthy collectors in the known universe.  ',1,0.1,0,1,NULL,NULL,1,492,2103,NULL,0),(15411,667,'Amarr Luxury Yacht','The Opux Luxury Yacht cruisers are developed and produced by the Gallente, for the wealthy citizens and entertainment industry within the Federation.  Some Amarrian nobels have taken up buying these luxury yachts for their personal pleasure, and have given them slight modifications to bring an Amarrian \"feel\" to them.',13075000,115000,1750,1,8,NULL,0,NULL,NULL,NULL,330),(15412,818,'Andres Sikvatsen','Andres Sikvatsen is a small time criminal turned bounty hunter.  He used to work as an agent for the Angel Cartel but eventually switched to the job of a freelancer once he had the funds to purchase his own frigate.  Many wealthy individuals turn to men such as Andres when they feel the law is not adequate in dealing with their problem.  Threat level: Very high',1200000,19100,110,1,2,NULL,0,NULL,NULL,NULL,339),(15413,821,'Commander Terachi TashMurkon','Commander Terachi TashMurkon is one of the highest ranking officers within the Tash-Murkon militia.  He received this magnificent battleship as a personal gift from the Emperor himself, fitted with the very finest modules the Imperial Armaments had to offer.  Few pilots in the galaxy would ever dare face this monstrosity in combat.',17500000,1150000,675,1,4,NULL,0,NULL,NULL,31,20316),(15414,821,'Warlord Shaqil Dragat','Shaqil Dragat is one of the most prominent Warlords within the Brutor Tribe of the Minmatar Republic.  Known for his enormous size, even for a Brutor, Shaqil is feared not only for the fleet of warships he commands, but also in person.  He also commands one of the most devastating battleships in the entire Minmatar fleet.',21000000,850000,600,1,2,NULL,0,NULL,NULL,31,48),(15415,821,'Fleet Commander Naiyon Tai','Fleet Commander Naiyon Tai is one of the highest ranking officers within the Caldari Navy.  Operating one of the finest and most well equipped battleships the Caldari Navy has to offer, Naiyon is not to be taken lightly.  ',21000000,1080000,665,1,1,NULL,0,NULL,NULL,31,43),(15416,302,'Naiyon\'s Modified Magnetic Field Stabilizer','Grants a bonus to the firing rate and damage of hybrid turrets. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',0,5,0,1,NULL,NULL,1,648,1046,NULL,0),(15418,77,'Naiyon\'s Modified Adaptive Invulnerability Field','Boosts shield resistance against all damage types.<br><br>Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',10000,5,0,1,1,63062.0000,0,NULL,81,NULL,0),(15419,65,'Naiyon\'s Modified Stasis Webifier','Reduces the maximum speed of a ship by employing micro energy streams which effectively entangle the target temporarily, thereby slowing it down.',0,5,0,1,NULL,NULL,0,NULL,1284,NULL,0),(15421,74,'Naiyon\'s Modified 425mm Railgun','This large battleship-sized weapon packs quite a punch. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges. \r\n\r\nRequires hybrid charge types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2000,20,1,1,NULL,1500000.0000,0,NULL,366,NULL,11248),(15423,74