cenaries aiding them, but they usually work solo.  Normally, unless sent to kill you, they will leave you alone.   Threat level: Deadly',10250000,89000,420,1,2,NULL,0,NULL,NULL,31,304),(16200,816,'Jerek Shapuir','This is a bounty hunter.  These freelancers can be of any race and come from all walks of life, sometimes they have mercenaries aiding them, but they usually work solo.  Normally, unless sent to kill you, they will leave you alone. Threat level: Deadly',19000000,1100000,600,1,4,NULL,0,NULL,NULL,NULL,297),(16201,816,'Ioan Lafonte','This is a bounty hunter.  These freelancers can be of any race and come from all walks of life, sometimes they have mercenaries aiding them, but they usually work solo.  Normally, unless sent to kill you, they will leave you alone.',19000000,1140000,675,1,8,NULL,0,NULL,NULL,NULL,64),(16202,816,'Tauron','Tauron is of a rare breed of bounty hunters, who have been given the title of Master by the Universal League of Bounty Hunters (ULBH).  After his long and prosperous servitude for the Angel Cartel, Master Bounty Hunter Tauron recieved his first Battleship from that organization.  \r\n\r\nTauron was given the name \"Dwenehaven Darmetsoko\" by his foster parents, but quickly took up the name Tauron after he aquired his official Bounty Hunter status within the ULBH.\r\n\r\nAfter a brief dispute with a drug lord within the Angel Cartel, he left the organization to persue an independent mercenary career.  \r\n\r\nOnly the wealthiest corporations in Eve would even attempt to buy the services of this ancient bounty hunter.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,335),(16203,816,'Kyokan','Master Bounty Hunter Kyokan is a former special ops pilot of the Mordus Legion that turned freelance bounty hunter.  When his wealthy father died, he inherited a vast sum of credits, which he used to purchase a magnificent Tyrent battleship off the black market.  With his valuable experience from serving as a special ops pilot, and his well fitted battleship, Kyokan is a force to be reckoned with.\r\n\r\nThe Universal League of Bounty Hunters (ULBH) awarded Kyokan the title of Master Bounty Hunter not long ago, after over a decade of service to various factions throughout the Eve universe.\r\n\r\nKyokan is most famous for his use of the \'Doom\' torpedo, which is an enhanced version of the Inferno torpedo.  He has never revealed his supplier of the famous but extremely rare torpedo, which is mainly used to rip through large structures such as outposts or battleships, but some expect them to be of Jovian origin.  The claim has never been proven though.',19000000,19000000,120,1,2,NULL,0,NULL,NULL,NULL,335),(16206,100,'Hellhound I','Heavy Attack Drone',12000,25,0,1,8,70000.0000,0,NULL,NULL,NULL,20250),(16208,818,'Ex-Secret Agent','An ex-secret agent who has turned to blackmailing his former corporation for money.',2250000,22500,75,1,2,NULL,0,NULL,NULL,NULL,344),(16209,817,'Ex-Elite Secret Agent','This is a recently laid off elite secret agent.',10900000,109000,120,1,2,NULL,0,NULL,NULL,31,337),(16210,805,'Spider Drone I','A popular drone amongst bounty hunters, the rare Spider drone has been sold in the thousands on the black market since it began being manufactured by CreoDron corporation.  The conceptual design of it was created by the multi-awarded scientist, Yeeti Mourir.  Built on the old Wasp drone model, the Spider drone sacrifices its damaging capabilities for a more powerful force-shield and stasis webifying ability, as well as ultra fast speed.  \r\n\r\nUnfortunately it is not currently available on the public market.  CreoDron and Yeeti Mourir have waged a long and ugly battle in Gallente courtrooms to try and acquire the sole manufacturing rights on the Spider drone, which has kept it off of public markets for legal reasons.  Yet that did not keep the drone from being built for the Gallente military, nor has it kept the Serpentis from acquiring hundreds of batches of the drone and smuggling it out of Gallente space for the lucrative black market.',3500,250,235,1,NULL,NULL,0,NULL,NULL,11,1079),(16211,805,'Spider Drone II','A popular drone amongst bounty hunters, the rare Spider drone has been sold in the thousands on the black market since it began being manufactured by CreoDron corporation.  The conceptual design of it was created by the multi-awarded scientist, Yeeti Mourir.  Built on the old Wasp drone model, the Spider drone sacrifices its damaging capabilities for a more powerful force-shield and stasis webifying ability, as well as ultra fast speed.  \r\n\r\nUnfortunately it is not currently available on the public market.  CreoDron and Yeeti Mourir have waged a long and ugly battle in Gallente courtrooms to try and acquire the sole manufacturing rights on the Spider drone, which has kept it off of public markets for legal reasons.  Yet that did not keep the drone from being built for the Gallente military, nor has it kept the Serpentis from acquiring hundreds of batches of the drone and smuggling it out of Gallente space for the lucrative black market.',3500,250,235,1,NULL,NULL,0,NULL,NULL,11,1080),(16212,687,'Khanid Wingman','This is a support ship for the Khanid Navy.  Threat level: Very high',1425000,28600,120,1,4,NULL,0,NULL,NULL,NULL,1860),(16213,365,'Caldari Control Tower','At first the Caldari Control Towers were manufactured by Kaalakiota, but since they focused their efforts mostly on other, more profitable installations, they soon lost the contract and the Sukuuvestaa corporation took over the Control Towers\' development and production.\r\n\r\nRacial Bonuses:\r\n25% bonus to Missile Battery Rate of Fire\r\n50% bonus to Missile Velocity\r\n-75% bonus to ECM Jammer Battery Target Cycling Speed',200000000,8000,140000,1,1,400000000.0000,1,478,NULL,NULL,2599),(16214,365,'Minmatar Control Tower','The Matari aren\'t really that high-tech, preferring speed rather than firepower or involved technology. Unfortunately that doesn\'t apply very well to stationary objects, much to the liking of the Amarr Empire.  \r\n\r\nAmarrians call it a scrapheap of epic proportions. But don\'t underestimate these structures. Minmatar commanders usually have the last laugh when it comes to combat.\r\n\r\nRacial Bonuses:\r\n50% bonus to Projectile Sentry Optimal Range\r\n50% bonus to Projectile Sentry Fall Off Range\r\n25% bonus to Projectile Sentry RoF',200000000,8000,140000,1,2,400000000.0000,1,478,NULL,NULL,2600),(16215,319,'Small Armory','This small armory has a thick layer of reinforced tritanium and a customized shield module for deflecting incoming fire.',100000,100000000,10000,1,1,NULL,0,NULL,NULL,NULL,2372),(16216,413,'Research Laboratory','Portable laboratory facilities, anchorable within control tower fields. This structure has Material Efficiency research and Time Efficiency research activities.\r\n\r\nActivity bonuses:\r\n30% reduction in research ME required time\r\n30% reduction in research TE required time',100000000,3000,25000,1,NULL,100000000.0000,1,933,NULL,NULL,2373),(16217,414,'Small Auxiliary Power Array','',50000000,100,0,1,NULL,NULL,0,NULL,NULL,NULL,2374),(16219,364,'Small Storage Array','Mobile Storage',100000000,1150,8850,1,NULL,NULL,0,NULL,NULL,NULL,2601),(16220,397,'Rapid Equipment Assembly Array','A mobile assembly facility where modules, implants, deployables, structures, structure modules, starbases and containers can be manufactured quickly but at increased mineral cost due to waste.\r\n\r\nActivity modifiers:\r\n35% reduction in manufacturing required time\r\n5% increase in required manufacturing materials',100000000,6250,10000000,1,NULL,10000000.0000,1,932,NULL,NULL,2377),(16221,416,'Moon Harvesting Array','A deployable array designed to gather raw minerals from moons. Can harvest a good deal of material per cycle, after which it needs to be linked with either a silo (for storage) or a reactor (for chemically molding the materials into something else).',200000000,4000,1,1,NULL,5000000.0000,1,488,NU