00.0000,1,592,NULL,NULL,1748),(16233,419,'Prophecy','The Prophecy is built on an ancient Amarrian warship design dating back to the earliest days of starship combat. Originally intended as a full-fledged battleship, it was determined after mixed fleet engagements with early prototypes that the Prophecy would be more effective as a slightly smaller, more mobile form of artillery support.',15300000,234000,400,1,4,25500000.0000,1,470,NULL,20061,2385),(16234,489,'Prophecy Blueprint','',0,0.01,0,1,NULL,555000000.0000,1,589,NULL,NULL,1748),(16236,420,'Coercer','Noticing the alarming increase in Minmatar frigate fleets, the Imperial Navy made its plans for the Coercer, a vessel designed specifically to seek and destroy the droves of fast-moving frigate rebels. ',1650000,47000,375,1,4,NULL,1,465,NULL,20063,2387),(16237,487,'Coercer Blueprint','',0,0.01,0,1,NULL,8635240.0000,1,583,NULL,NULL,1748),(16238,420,'Cormorant','The Cormorant is the only State-produced space vessel whose design has come from a third party. Rumors abound, of course, but the designer\'s identity has remained a tightly-kept secret in the State\'s inner circle.',1700000,52000,425,1,1,NULL,1,466,NULL,20070,2388),(16239,487,'Cormorant Blueprint','',0,0.01,0,1,NULL,8416400.0000,1,584,NULL,NULL,1748),(16240,420,'Catalyst','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.',1550000,55000,450,1,8,NULL,1,467,NULL,20074,2389),(16241,487,'Catalyst Blueprint','',0,0.01,0,1,NULL,7887800.0000,1,585,NULL,NULL,1748),(16242,420,'Thrasher','Engineered as a supplement to its big brother the Cyclone, the Thrasher\'s tremendous turret capabilities and advanced tracking computers allow it to protect its larger counterpart from smaller, faster menaces.',1600000,43000,400,1,2,NULL,1,468,NULL,20074,2390),(16243,487,'Thrasher Blueprint','',0,0.01,0,1,NULL,7500000.0000,1,586