A colorless, odorless, tasteless noble gas, krypton occurs in trace amounts in the atmosphere, is isolated by fractionating liquefied air, and is often used with other rare gases in fluorescent lamps. Krypton is inert for most practical purposes but it is known to form compounds with fluorine. Krypton can also form clathrates with water when atoms of it are trapped in a lattice of the water molecules.',0,0.1,0,1,NULL,NULL,0,NULL,NULL,NULL,0),(16262,465,'Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field, and are known as the universe\'s primary source of helium isotopes.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',1000,1000,0,1,NULL,376000.0000,1,1855,2556,NULL,0),(16263,465,'Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, in addition to smatterings of heavy water and liquid ozone.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',1000,1000,0,1,NULL,76000.0000,1,1855,2555,NULL,0),(16264,465,'Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice contains more oxygen isotopes than any other ice asteroid.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',1000,1000,0,1,NULL,76000.0000,1,1855,2554,NULL,0),(16265,465,'White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. White Glaze is extremely high in nitrogen-14 and other stable nitrogen isotopes, and is thus a necessity for the sustained operation of certain kinds of control tower.\r\n\r\nAvailable in <color=\'0xFF33FFFF\'>1.0</color> security status solar systems or lower.',1000,1000,0,1,NULL,76000.0000,1,1855,2561,NULL,0),(16266,465,'Glare Crust','In areas with high concentrations of electromagnetic activity, ice formations such as this one, containing large amounts of heavy water and liquid ozone, are spontaneously formed during times of great electric flux. Glare crust also contains a small amount of strontium clathrates.\n\nAvailable in <color=\'0xFFFF6600\'>0.4</color> security status solar systems or lower.',1000,1000,0,1,NULL,1525000.0000,1,1855,2559,NULL,0),(16267,465,'Dark Glitter','Dark glitter is one of the rarest of the interstellar ices, formed only in areas with large amounts of residual electrical current. Little is known about the exact way in which it comes into being; the staggering amount of liquid ozone to be found inside one of these rocks makes it an intriguing mystery for stellar physicists and chemists alike. In addition, it contains large amounts of heavy water and a decent measure of strontium clathrates.\r\n\r\nAvailable in <color=\'0xFFE53300\'>0.1</color> security status solar systems or lower.',1000,1000,0,1,NULL,1550000.0000,1,1855,2557,NULL,0),(16268,465,'Gelidus','Fairly rare and very valuable, Gelidus-type ice formations are a large-scale source of strontium clathrates, one of the rarest ice solids found in the universe, in addition to which they contain unusually large concentrations of heavy water and liquid ozone.\r\n\r\nAvailable in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1000,1000,0,1,NULL,825000.0000,1,1855,2558,NULL,0),(16269,465,'Krystallos','The universe\'s richest known source of strontium clathrates, Krystallos ice formations are formed only in areas where a very particular combination of environmental factors are at play. Krystallos compounds also include quite a bit of liquid ozone.\r\n\r\nAvailable in <color=\'0xFFFF0000\'>0.0</color> security status solar systems or lower.',1000,1000,0,1,NULL,450000.0000,1,1855,2560,NULL,0),(16272,423,'Heavy Water','Dideuterium oxide. Water with significant nuclear properties which make it extremely effective as a neutron moderator in various types of power reactors. One of the materials required to keep Control Towers online.\r\n\r\nMay be obtained by reprocessing the following ice ores:\r\n\r\n<color=\'0xFF33FFFF\'>1.0</color> security status solar system or lower:\r\n<a href=showinfo:16264>Blue Ice</a>\r\n<a href=showinfo:16262>Clear Icicle</a>\r\n<a href=showinfo:16263>Glacial Mass</a>\r\n<a href=showinfo:16265>White Glaze</a>\r\n\r\n<color=\'0xFFFF6600\'>0.3</color> security status solar system or lower:\r\n<a href=showinfo:16266>Glare Crust</a>\r\n\r\n<color=\'0xFFE53300\'>0.1</color> security status solar system or lower:\r\n<a href=showinfo:16267>Dark Glitter</a>\r\n\r\n<color=\'0xFFFF0000\'>0.0</color> security status solar system or lower:\r\n<a href=showinfo:17978>Enriched Clear Icicle</a>\r\n<a href=showinfo:16268>Gelidus</a>\r\n<a href=showinfo:16269>Krystallos</a>\r\n<a href=showinfo:17976>Pristine White Glaze</a>\r\n<a href=showinfo:17977>Smooth Glacial Mass</a>\r\n<a href=showinfo:17975>Thick Blue Ice</a>',0,0.4,0,1,NULL,1000.0000,1,1033,2698,NULL,0),(16273,423,'Liquid Ozone','Liquid Ozone is used as a cleaning and disinfectant substance, and plays a vital role in ensuring the smooth day-to-day operation of a starbase. One of the materials required to keep Control Towers online.\r\n\r\nMay be obtained by reprocessing the following ice ores:\r\n\r\n<color=\'0xFF33FFFF\'>1.0</color> security status solar system or lower:\r\n<a href=showinfo:16264>Blue Ice</a>\r\n<a href=showinfo:16262>Clear Icicle</a>\r\n<a href=showinfo:16263>Glacial Mass</a>\r\n<a href=showinfo:16265>White Glaze</a>\r\n\r\n<color=\'0xFFFF6600\'>0.3</color> security status solar system or lower:\r\n<a href=showinfo:16266>Glare Crust</a>\r\n\r\n<color=\'0xFFE53300\'>0.1</color> security statu